INSERT INTO `faqs` (`id`, `faq_type`, `question_ar`, `question_nl`, `answer_ar`, `answer_nl`, `question_en`, `answer_en`, `enable`, `arrangment`, `created_at`, `updated_at`) VALUES
(11, 'faq', 'كيف اقوم بتغيير كلمة المرور', 'Hoe verander ik het wachtwoord', '<p>يمكنك ذلك من خلال &quot;حسابي&quot;</p>\r\n\r\n<p>بقسم كلمة المرور تغيير كلمة المرور</p>\r\n\r\n<p>أضافة كلمة المرور القديمة بالقسم الأول ( كلمة المرور الحالية)</p>\r\n\r\n<p>ومن ثم أضافة كلمة المرور الجديدة بالقسم الثاني ومن ثم تأكيدها بالقسم الثالث.</p>', '<p>Dat kan via &quot;Mijn Account&quot;</p>\r\n\r\n<p>Wijzig het wachtwoord in het wachtwoordgedeelte</p>\r\n\r\n<p>Voeg het oude wachtwoord toe in het eerste gedeelte (het huidige wachtwoord)</p>\r\n\r\n<p>Voeg vervolgens het nieuwe wachtwoord toe in het tweede gedeelte en bevestig het in het derde gedeelte.</p>', NULL, NULL, 1, 1, '2023-03-03 16:10:10', '2023-03-08 16:22:51'),
(12, 'faq', 'كيف اقوم بأعادة تعيين كلمة المرور', NULL, '<p style=\"direction:rtl\">في حال نسيان كلمة المرور الخاصة بالمستخدم&nbsp;</p>\r\n\r\n<p style=\"direction:rtl\">وعدم تمكنة من الدخول الى حسابة&nbsp;</p>\r\n\r\n<p style=\"direction:rtl\">يمكنة الضغط على كلمة أعادة تعيين كلمة المرور أسفل&nbsp;</p>\r\n\r\n<p style=\"direction:rtl\">المكان المخصص لكلمة السر ومن ثم كتابة الايميل الخاص بالمستخدم</p>\r\n\r\n<p style=\"direction:rtl\">ثم أرسال سوف يصل للمستخدم على البريد الالكتروني رابط أعادة تعيين كلمة المرور</p>\r\n\r\n<p style=\"direction:rtl\">يمكن من خلال الضغط على هذا الرابط التوجة الى صفحة خاصة تمكن المستخدم من أختيار</p>\r\n\r\n<p style=\"direction:rtl\">كلمة مرور جديدة بدل المفقودة&nbsp;</p>\r\n\r\n<p style=\"direction:rtl\">&nbsp;</p>', NULL, NULL, NULL, 1, 2, '2023-03-03 16:16:29', '2023-03-03 16:16:29'),
(13, 'faq', 'ماهو الافضل لتعلم القيادة القير العادي ام الاوتوماتيك؟ ', NULL, '<p>&nbsp;</p>\r\n\r\n<div style=\"direction:rtl\">الفرق بين كلاهما وهو فقط بالغيار والتنقل في القير العادي عند القيادة</div>\r\n\r\n<div style=\"direction:rtl\">اما الاتوماتيك فقط تحتاج الى تركيب D&nbsp;</div>\r\n\r\n<div style=\"direction:rtl\"><span style=\"font-size:14px\">اما بالنسبه للرجوع فكلاهما يحتاج الى تركيب R </span></div>\r\n\r\n<div style=\"direction:rtl\"><span style=\"font-size:14px\">الفرق بالتدريب&nbsp;هو فقط اربعة&nbsp;دروس </span></div>\r\n\r\n<div style=\"direction:rtl\"><span style=\"font-size:14px\">وكل مهارات القياده والتحكم بالسيارة متشابهة</span></div>', NULL, NULL, NULL, 1, 3, '2023-03-04 13:16:41', '2023-03-10 05:44:43'),
(18, 'faq', 'test1', 'test2', '<p>test1</p>', '<p>test2</p>', 'test3', '<p>test3</p>', 1, 1, '2023-08-03 08:49:56', '2023-08-03 08:49:56');
