eg de ontvangst van de aanvaarding van het aanbod.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 6: Aangeschafte pakketten</strong><br />\r\n<br />\r\n6.1 De klant kan een pakket aanschaffen voor individueel gebruik.<br />\r\n6.2 &nbsp;De klant kan via de website een theoriepakket bestellen. De prijs van het theoriepakker staat op de website vermeld. De genoemde prijzen zijn inclusief btw.<br />\r\n6.3 Betaling van de aangeschafte diensten geschiedt via iDeal of PayPal of Creditcard.<br />\r\n6.4 Tegoeden kunnen niet ingewisseld worden voor geld.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 7: Het theorie-examen oefenen</strong><br />\r\n<br />\r\n7.1 Indien de klant een aanvang maakt met een theorie-examen en dit theorie-examen niet direct afmaakt, dan heeft de klant de keuze om het theorie-examen alsnog af te maken of om het theorie-examen in zijn geheel opnieuw te doen.<br />\r\n7.2 Indien de klant het theorie-examen afmaakt, dan blijft het tegoed van de klant ongewijzigd.<br />\r\n7.3 Indien de klant het theorie-examen niet afmaakt en dit theorie-examen opnieuw doet, dan kost dat de klant weer 1 tegoed.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 8: Herroepingsrecht</strong><br />\r\n<br />\r\n8.1 Indien de klant een product aanschaft die toegang biedt tot digitale inhoud van deze website geldt het herroepingsrecht alleen als de klant nog geen gebruik heeft gemaakt van het product. Het recht op herroeping vervalt als de klant toegang heeft gehad tot het product door in te loggen op de website.<br />\r\n<br />\r\n8.2 De klant kan in geen enkel geval beroep doen op het herroepingsrecht zodra hij is ingelogd.<br />\r\n8.3 Om gebruik te maken van het herroepingsrecht dient de klant zich te richten aan AAtheorie.nl. Dit contact dient op korte termijn na de levering van het product te worden gelegd, via het online contactformulier met een duidelijke opmerking waarom de klant gebruik wil maken van het herroepingsrecht.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 9: klachten</strong><br />\r\n<br />\r\n9.1 Klachten over de diensten welke worden aangeboden op de website kunnen worden gemeld &nbsp;bij:<br />\r\n<br />\r\nRijschool LAT<br />\r\n<br />\r\nThomas a Kempisstraat 87<br />\r\n<br />\r\n8021BL te Zwolle<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n9.2 Klachten worden door AAtheorie.nl binnen 30 dagen afgehandeld. Indien afhandeling van een klacht binnen de termijn van 30 dagen onverhoopt niet mogelijk is, zal de klant op de hoogte worden gesteld van de vertragingsduur.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 10: Aansprakelijkheid</strong><br />\r\n<br />\r\n10.1 De inlichtingen en diensten die op de website voorkomen, kunnen technische onjuistheden en/of tikfouten bevatten.<br />\r\n<br />\r\n10.2 De theoriepakketten zijn zorgvuldig samengesteld. AAtheorie.nl garandeert echter niet dat er geen fouten en/of onvolkomenheden in de theoriepakketten zitten. AAtheorie.nl is voor dergelijke fouten en/of onvolkomenheden niet aansprakelijk.<br />\r\n<br />\r\n10.3 AAtheorie.nl garandeert niet dat de website en/of theoriepakketten te allen tijde en zonder onderbrekingen of storingen toegankelijk zijn. AAtheorie.nl streeft ernaar de diensten 7 dagen per week en 24 uur per dag toegankelijk te houden, maar kan de toegang onderbreken, onder meer voor onderhoudswerken, updating en/of om enig andere technische reden.<br />\r\n10.4 AAtheorie.nl is niet aansprakelijk voor de schade die de klant heeft geleden ten gevolge van de onderbrekingen verwoord in lid 3 van dit artikel, tenzij de onderbreking door toedoen van AAtheorie.nl onredelijk lang is. In dat geval is het schadebedrag dat AAtheorie.nl dient te vergoeden nimmer hoger dan het bedrag dat de klant voor 1 theoriepakket heeft betaald.<br />\r\n10.5 Aan eventuele tips en/of adviezen die op de website staan vermeld kan de klant geen rechten ontlenen.<br />\r\n<br />\r\n10.6 AAtheorie.nl kan op geen enkele wijze aansprakelijk worden gesteld voor het verlies van door de klant toegepaste inlogcodes. AAtheorie.nl kan er dan ook niet verantwoordelijk voor worden gesteld dat ongeautoriseerde derden gebruik maken van de inlogcodes van de klant.<br />\r\n10.7 AAtheorie.nl is nimmer aansprakelijk voor indirecte schade, daaronder begrepen gevolgschade en gemiste besparingen.<br />\r\n10.8 Indien AAtheorie.nl aansprakelijk mocht zijn voor enigerlei schade, dan is de aansprakelijkheid van AAtheorie.nl beperkt tot maximaal het bedrag dat de klant aan AAtheorie.nl heeft betaald.<br />\r\n<br />\r\n10.9 De in deze algemene voorwaarden opgenomen beperkingen van de aansprakelijkheid gelden niet indien de schade te wijten is aan opzet of grove schuld van AAtheorie.nl of haar ondergeschikten.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 11: Overmacht</strong><br />\r\n<br />\r\n11.1 In geval van overmacht is AAtheorie.nl niet gehouden tot vergoeding van de daardoor bij de klant ontstane schade, behoudens en voor zover AAtheorie.nl als gevolg van de overmachtsituatie een voordeel heeft gehad dat zij bij correcte nakoming niet zou hebben gehad.<br />\r\n11.2 Onder overmacht wordt in ieder geval verstaan: oproer, molest, brand, waterschade, overstroming, overheidsmaatregelen, het tijdelijk niet of niet toereikend beschikbaar zijn van hardware, software en/of internet- of andere telecommunicatieverbindingen welke noodzakelijk zijn voor het leveren van de diensten, alsmede iedere andere situatie waarop AAtheorie.nl geen (beslissende) controle kan uitoefenen, alles zowel in het bedrijf van AAtheorie.nl als in het bedrijf van derden die bij de overeenkomst zijn betrokken.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 12: Geheimhouding</strong><br />\r\n<br />\r\n12.1 AAtheorie.nl is verplicht tot geheimhouding van alle vertrouwelijke informatie die zij in het kader van de overeenkomst van de klant heeft verkregen. Informatie geldt als vertrouwelijk als dit door de klant is medegedeeld of als dit voortvloeit uit de aard van de informatie.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 13: Intellectuele eigendom</strong><br />\r\n<br />\r\n13.1 Door levering van diensten worden geen auteursrechten in de zin van de Auteurswet overgedragen. De klant verwerft niet-exclusieve gebruiksrechten. Alle rechten van intellectuele eigendom op de krachtens de overeenkomst ter beschikking gestelde programmatuur, materialen, bestanden, afbeeldingen, theoriepakketten e.d. berusten uitsluitend bij AAtheorie.nl of bij haar licentiegever. Het is uitdrukkelijk niet toegestaan om programmatuur, materialen, bestanden, afbeeldingen, theoriepakketten e.d. te kopi&euml;ren, te verveelvoudigen, openbaar te maken, voor directe of indirecte commerci&euml;le doeleinden te gebruiken, tenzij AAtheorie.nl of haar licentiegever daar toestemming voor heeft gegeven.<br />\r\n13.2 Het is AAtheorie.nl toegestaan om technische maatregelen te nemen en te onderhouden ter bescherming van de intellectuele eigendomsrechten op de theoriepakketten.<br />\r\n13.3 Het is enkel toegestaan om verkregen of uitgeprinte informatie aan te wenden voor persoonlijk gebruik.<br />\r\n<br />\r\n13.4. Alle teksten, informatie, foto&rsquo;s en ander lesmateriaal op deze site is voorzien van copyright en mag niet gebruikt worden voor uw eigen of andere commerci&euml;le doeleinden. Het is uitdrukkelijk verboden om programmatuur, materialen, bestanden, afbeeldingen, theoriepakketten van AAtheorie.nl door particuliere personen en bedrijven te gebruiken als lesmateriaal voor anderen. Wordt dit wel gedaan, dan wordt een boete van &euro;10.000 ge&euml;ist en &euro;500,00 per dag zolang de overtreding voortduurt.&nbsp; &nbsp;<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 14: Beveiliging en internet</strong><br />\r\n<br />\r\n14.1 AAtheorie.nl zal passende beveiligingsmaatregelen nemen om de website te beschermen tegen de risico&rsquo;s van onbevoegde toegang tot of wijziging, vernietiging of verlies van de door de klant via de website ingevoerde gegevens, maar AAtheorie.nl kan ter zake geen garantie geven.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 15: Slotbepalingen</strong><br />\r\n<br />\r\n15.1 Van toepassing is steeds de versie van de algemene voorwaarden zoals die gold ten tijde van de totstandkoming van de overeenkomst, tenzij de klant na de totstandkoming de gelding van een herziene versie van de algemene voorwaarden heeft aanvaard.<br />\r\n15.2 AAtheorie.nl en de klant zullen eerst een beroep op de rechter doen nadat zij zich tot het uiterste hebben ingespannen een geschil in onderling overleg te beslechten.<br />\r\n15.3 Op elke overeenkomst tussen AAtheorie.nl en de klant is Nederlands recht van toepassing.<br />\r\n15.4 Alle geschillen ter zake van overeenkomsten tussen de klant en AAtheorie.nl worden voorgelegd aan de bevoegde rechter in het arrondissement waar AAtheorie.nl gevestigd is, zulks voor zover de wettelijke bepalingen dit toestaan. Indien AAtheorie.nl een beroep doet op deze bepaling, heeft de klant de mogelijkheid om binnen een maand voor de volgens de wet bevoegde rechter te kiezen.</h5>', '<h4><strong>Algemene voorwaarden</strong></h4>\r\n\r\n<h4><strong>Algemene voorwaarden van&nbsp;</strong></h4>\r\n\r\n<h4><strong><a href=\"https://aatheorie.nl/\">AAtheorie.nl</a></strong><br />\r\n<strong>Versie: 11-11-2022</strong></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><strong>Artikel 1 Definities</strong><br />\r\n<br />\r\n1.1 Rijschool LAT beheert de website&nbsp;www.AAtheorie.nl<br />\r\n<br />\r\nVia deze website kan een internetgebruiker online het theorie-examen voor de auto, bromfiets, taxi, vrachtwagen en motor leren en/of oefenen.<br />\r\n<br />\r\n1.2 In deze algemene voorwaarden worden de hierna volgende termen in de navolgende betekenis gebruikt, tenzij uitdrukkelijk anders is aangegeven of uit de context anders blijkt:<br />\r\na. AAtheorie.nl: de gebruiker van deze algemene voorwaarden: gevestigd aan de Thomas a Kempisstraat 87, 8021BL te Zwolle.</h5>\r\n\r\n<ol>\r\n	<li>\r\n	<h5>klant: de persoon die via de website met AAtheorie.nl een overeenkomst aangaat;<br />\r\n	<br />\r\n	c. overeenkomst: de overeenkomst die via de website tot stand komt tussen AAtheorie.nl en de klant;</h5>\r\n	</li>\r\n	<li>\r\n	<h5>theorie-examen en theorie-examens: het online theorie-examen dat de klant via de website kan oefenen en/of leren;</h5>\r\n	</li>\r\n	<li>\r\n	<h5>tegoed: het tegoed dat de klant via de website kan bestellen om theorie-examens te oefenen;<br />\r\n	<br />\r\n	f. theoriepakket en theoriepakketten: het theoriepakket dat de klant via de website kan bestellen om het theorie-examen te leren, bestaande uit een online theorieboek en/of examentraining;<br />\r\n	<br />\r\n	g. website: de website www. AAtheorie.nl</h5>\r\n	</li>\r\n</ol>\r\n\r\n<h5><br />\r\n<br />\r\n<br />\r\n<strong>Artikel 2: Algemeen</strong><br />\r\n<br />\r\n2.1 Deze algemene voorwaarden gelden voor alle diensten en producten die worden aangeboden op de website en voor iedere overeenkomst tussen AAtheorie.nl en de klant waarop AAtheorie.nl deze algemene voorwaarden van toepassing heeft verklaard.<br />\r\n2.2 Eventuele afwijkingen op deze algemene voorwaarden zijn slechts geldig indien deze uitdrukkelijk schriftelijk of elektronisch zijn overeengekomen.<br />\r\n2.3 Indien van bepaalde, bij deze algemene voorwaarden geregelde onderwerpen, afwijkende bedingen zijn overeengekomen, blijven deze algemene voorwaarden voor het overige op de overeenkomst van kracht.<br />\r\n<br />\r\n2.4 Indien een of meerdere van de bepalingen in deze algemene voorwaarden nietig zijn of vernietigd mochten worden, blijven de overige bepalingen van deze algemene voorwaarden volledig van toepassing. AAtheorie.nl en de klant zullen dan in overleg treden teneinde nieuwe bepalingen ter vervanging van de nietige c.q. vernietigde bepalingen overeen te komen, waarbij indien en voor zoveel mogelijk het doel en de strekking van de oorspronkelijke bepaling in acht worden genomen.<br />\r\n<br />\r\n<strong>Artikel 3: Verantwoordelijkheid links website</strong><br />\r\n<br />\r\n3.1 De website bevat links naar andere websites dan www.AAtheorie.nl. AAtheorie.nl kan geen permanente controle uitoefenen op die andere websites, noch enige verantwoordelijkheid aanvaarden inzake de inhoud ervan. AAtheorie.nl kan voor deze inhoud niet aansprakelijk worden gesteld.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 4: Aanbiedingen</strong><br />\r\n<br />\r\n4.1 Alle aanbiedingen zijn vrijblijvend, tenzij anders is aangegeven.<br />\r\n4.2 AAtheorie.nl is niet gebonden aan haar aanbod indien sprake is van druk-, zet- of programmeerfouten in haar mailings of op de website.<br />\r\n<br />\r\nArtikel 5: Totstandkoming overeenkomst<br />\r\n<br />\r\n5.1 De overeenkomst komt tot stand op het moment van aanvaarding door de klant van het aanbod en het voldoen aan de daarbij gestelde voorwaarden.<br />\r\n5.2 AAtheorie.nl bevestigt onverwijld langs elektronische weg de ontvangst van de aanvaarding van het aanbod.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 6: Aangeschafte pakketten</strong><br />\r\n<br />\r\n6.1 De klant kan een pakket aanschaffen voor individueel gebruik.<br />\r\n6.2 &nbsp;De klant kan via de website een theoriepakket bestellen. De prijs van het theoriepakker staat op de website vermeld. De genoemde prijzen zijn inclusief btw.<br />\r\n6.3 Betaling van de aangeschafte diensten geschiedt via iDeal of PayPal of Creditcard.<br />\r\n6.4 Tegoeden kunnen niet ingewisseld worden voor geld.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 7: Het theorie-examen oefenen</strong><br />\r\n<br />\r\n7.1 Indien de klant een aanvang maakt met een theorie-examen en dit theorie-examen niet direct afmaakt, dan heeft de klant de keuze om het theorie-examen alsnog af te maken of om het theorie-examen in zijn geheel opnieuw te doen.<br />\r\n7.2 Indien de klant het theorie-examen afmaakt, dan blijft het tegoed van de klant ongewijzigd.<br />\r\n7.3 Indien de klant het theorie-examen niet afmaakt en dit theorie-examen opnieuw doet, dan kost dat de klant weer 1 tegoed.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 8: Herroepingsrecht</strong><br />\r\n<br />\r\n8.1 Indien de klant een product aanschaft die toegang biedt tot digitale inhoud van deze website geldt het herroepingsrecht alleen als de klant nog geen gebruik heeft gemaakt van het product. Het recht op herroeping vervalt als de klant toegang heeft gehad tot het product door in te loggen op de website.<br />\r\n<br />\r\n8.2 De klant kan in geen enkel geval beroep doen op het herroepingsrecht zodra hij is ingelogd.<br />\r\n8.3 Om gebruik te maken van het herroepingsrecht dient de klant zich te richten aan AAtheorie.nl. Dit contact dient op korte termijn na de levering van het product te worden gelegd, via het online contactformulier met een duidelijke opmerking waarom de klant gebruik wil maken van het herroepingsrecht.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 9: klachten</strong><br />\r\n<br />\r\n9.1 Klachten over de diensten welke worden aangeboden op de website kunnen worden gemeld &nbsp;bij:<br />\r\n<br />\r\nRijschool LAT<br />\r\n<br />\r\nThomas a Kempisstraat 87<br />\r\n<br />\r\n8021BL te Zwolle<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n9.2 Klachten worden door AAtheorie.nl binnen 30 dagen afgehandeld. Indien afhandeling van een klacht binnen de termijn van 30 dagen onverhoopt niet mogelijk is, zal de klant op de hoogte worden gesteld van de vertragingsduur.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Artikel 10: Aansprakelijkheid</strong><br />\r\n<br />\r\n10.1 De inlichtingen en diensten die op de website voorkomen, kunnen technische onjuistheden en/of tikfouten bevatten.<br />\r\n<br />\r\n10.2 De the