(57, 'UiTIWDWthS9dxWf', 'تريد الإنعطاف يساراً ، هل تموضعك صحيح ؟', 'Je wilt linksaf, sta je correct voorgesorteerd?', 24, 12, 'mcq', 'uploads/question/l8LJNp1672931470.jpg', 1, 'تشير اللوحة إلى شارع باتجاه واحد وبالتالي لا يوجد معاكسين لإتجاهك و بالتالي من ينعطف يساراً يتموضع أقصى اليسار  ويمكنك استخدام سكة الترام دائماً بشرط ألا تزعج الترام في حال تواجده', 'Bij een eenrichtingsweg mag je zoveel links voorsorteren als je links wil afslaan, ook al rijd je op een tramspoor zolang je geen andere verkeer hindert.', NULL, NULL, '2023-01-05 13:11:10', '2023-03-14 14:52:39'),
(58, 'A6wlUUSG6MVC5xM', 'ماذا ينتج عن ضغط الإطارات المرتفع ؟', 'Wat is het resultaat van een hoge bandenspanning?', 24, 12, 'mcq', 'uploads/question/fC86wG1672931561.jpg', 2, 'يؤدي ضغط الإطار المرتفع إلى : تقليل سطح التلامس بين الإطار و سطح الطريق و هذا سيقلل التماسك والثبات ، كما  سوف تتآكل الإطارات وتتشقق من المنتصف بسرعة كبيرة ، وينتج عن هذا كله: اهتزاز المركبة وعدم توازنها', 'Hoge bandenspanning  leidt tot: Het verminderen van het  contactoppervlak  tussen de  band en het  wegdek, en  dit zal de  grip en  stabiliteit verminderen, en   de banden  zullen zeer  snel slijten   en barsten in  het midden, wat resulteert  in  Dit alles: voertuigtrillingen  en onbalans', NULL, NULL, '2023-01-05 13:12:41', '2023-03-11 16:29:58'),
(59, '28tCrbCA9dYPBLu', 'اللوحة المرورية التالية لها علامة سفلية ، على ماذا تدل؟', 'Wat geeft dit onderbord aan?', 24, 12, 'mcq', 'uploads/question/2lPIB01672931649.jpg', 3, 'تشير اللوحة المرورية إلى منع التوقف والإصطفاف(الستيليتان والباركيرن) ،أما اللافتة السفلية تشير إلى أن المنع ينطبق من اليوم السادس عشر حتى الحادي والثلاثين .هذا المنع يشمل جانب الطريق الذي تتواجد فيه اللوحة.', 'Het verkeersbord geeft het stop- en parkeerverbod aan (stilstaan en parkeren) terwijl het onderste bord aangeeft dat het verbod geldt van de 16e tot de 31e dag.', NULL, NULL, '2023-01-05 13:14:09', '2023-03-14 19:58:00'),
(60, 'XMl9KQoNJzx4OLG', 'أي من العلامات التالية توضع على المركبات الزراعية و الصناعية الثقيلة ؟', 'Welke van de volgende markeringen wordt aangebracht op zware landbouw- en industriële voertuigen?', 24, 12, 'mcq', 'uploads/question/t3YdiI1672932341.jpg', 4, 'يجب تمييز المركبات الصناعية و المركبات الزراعية والمركبات ذات المحركات ذات السرعة البطيئة بالعلامة (c) ويتم تمييز وسائل النقل التي تحتوي على بضائع خطرة بعلامة (A) ،و تكون العلامة (B) في الجزء الخلفي لسيارة البروموبيل', 'Industriële voertuigen, landbouwvoertuigen en voertuigen met motoren met een laag toerental moeten worden gemerkt (C) en vervoermiddelen die gevaarlijke goederen bevatten, worden gemarkeerd met (A) en het merkteken (B) bevindt zich aan de achterzijde van de brommobiel.', NULL, NULL, '2023-01-05 13:25:41', '2023-03-14 19:58:35'),
(61, 'uabTiILdKqGIJ3c', 'بعد كم سنة يجب أن تخضع سيارة الركاب الجديدة ذات المحرك الكهربائي لأول فحص من قبل وزارة النقل؟', 'Na hoeveel jaar moet een nieuwe personenauto met een elektromotor de eerste keuring door het ministerie van Verkeer en Waterstaat ondergaan?', 24, 12, 'mcq', 'uploads/question/k0nMbY1672932426.jpg', 5, 'سيارات الركاب الشخصية التي تعمل بمحرك كهربائي تخضع لنفس قوانين سيارات الركاب الشخصية التي تعمل بالبنزين', 'Voor personenauto\'s die worden aangedreven door een elektromotor gelden dezelfde regels als voor persoonlijke personenauto\'s op benzine.', NULL, NULL, '2023-01-05 13:27:06', '2023-03-11 16:33:24'),
(62, 'KRRUf642obZVpXO', 'أنت تحت تأثير الكحول ، اختر الإجابة الصحيحة ؟', 'Je bent onder invloed van alcohol, kiest het juiste stelling?', 24, 12, 'mcq', 'uploads/question/ucN9pI1672932526.jpg', 6, 'مسافة التوقف هي عبارة عن مجموع : مسافة زمن رد  الفعل و مسافة الفرملة، وبما أن الكحول يقلل من انتباه السائق وبالتالي سيزداد زمن رد الفعل مما يؤثر إجمالاً على مسافة التوقف و يزيدها', 'De remweg is de som van: de reactietijdafstand en de remweg, en omdat alcohol de aandacht van de bestuurder vermindert en daarom de reactietijd zal toenemen, wat de totale remweg beïnvloedt en verhoogt.', NULL, NULL, '2023-01-05 13:28:46', '2023-03-14 19:59:33'),
(63, 'G4hDAkNhpMdarWx', 'من ماذا يتكون تسجيل السيارة الجديدة؟', 'Waaruit bestaat de registratie van een nieuwe auto?', 24, 12, 'mcq', 'uploads/question/uzSyhz1672932608.jpg', 7, 'بدءاً من ١ كانون الثاني عام٢٠١٤، بدلاً من شهادة التسجيل الورقية وشهادة نقل المركبة ستتلقى بطاقة تسجيل المركبة و كود تسجيل المركبة ، ستحتاج الى كود تسجيل المركبة إذا غيرت ملكية السيارة', 'Vanaf 1 januari 2014 ontvang je in plaats van een papieren kentekenbewijs en een voertuig overdrachtscertificaat de kentekenkaart en de voertuigregistratiecode, je hebt de voertuigregistratiecode nodig als je het voertuigeigendom wijzigt.', NULL, NULL, '2023-01-05 13:30:08', '2023-03-11 16:35:05'),
(64, 'urXUMebusjkhRh9', 'من هو مستخدم الطريق ؟', 'Wie is een weggebruiker?', 24, 12, 'mcq', 'uploads/question/ramV8N1672932679.jpg', 8, 'حركة المرور تشمل كل من يستخدم الطريق سواء مشاة أو سائقين', 'Verkeer omvat iedereen die de weg gebruikt, of het nu voetgangers of bestuurders zijn.', NULL, NULL, '2023-01-05 13:31:19', '2023-03-11 16:35:51'),
(65, 'IJ0PVBr0FbMHvoc', 'ما هي قواعد المرور التي يجب أن تتبعها سيارة البروموبيل ؟', 'Welke verkeersregels hoort een brommobiel te volgen?', 24, 12, 'mcq', 'uploads/question/l00Fzk1672932735.jpg', 9, NULL, NULL, NULL, NULL, '2023-01-05 13:32:15', '2023-03-14 20:01:41'),
(73, '80UssPGrmMQ2TW0', 'أين يجب تركيب عاكسات الضوء للمقطورة ؟', 'Waar moeten aanhangwagenlampen worden geïnstalleerd?', 24, 12, 'mcq', 'uploads/question/Lt2LFf1672932978.jpg', 10, 'يجب أن تكون المقطورة مزودة بعاكسين للضوء بلون أحمر في الخلف وعاكسين بلون أبيض في الأمام وعاكسات بلون برتقالي في الجانبين', 'De aanhangwagen moet zijn voorzien van twee rode reflectoren aan de achterzijde, twee witte reflectoren aan de voorzijde en oranje reflectoren aan de zijkanten.', NULL, NULL, '2023-01-05 13:36:18', '2023-03-11 16:37:22'),
(74, 'BiWmHeXpxxpYvB6', 'سيارتك تزن ٢٠٠٠ كغ و تريد جر عربة وزنها مع حمولتها ٢٠٠٠ كغ ،ما هي رخصة القيادة التي تحتاجها؟', 'Jouw  auto weegt 2000 kg en je wilt een hanger met een lading van 2000 kg trekken, welk rijbewijs heb je nodig?', 24, 12, 'mcq', 'uploads/question/0QxvmN1672933053.jpg', 11, 'عندما يكون وزن المقطورة مع حمولتها أكثر من ٧٥٠ كغ ويزيد الوزن الكلي للكتلة ( السيارة مع المقطورة وحمولتها ) عن ٣٥٠٠ كغ تحتاج رخصة من فئة B plus أو BE', 'Wanneer het gewicht van de hanger met zijn lading meer dan 750 kg is en het totale gewicht  (de auto met de aanhangwagen en zijn lading) meer dan 3500 kg bedraagt, hebt je een rijbewijs van categorie B plus of BE nodig.', NULL, NULL, '2023-01-05 13:37:33', '2023-03-14 20:02:52'),
(75, 'SeYlsS0hB5wqknK', 'هل يُسمح لك بالقيادة نهاراً إذا كان ضوء لوحة أرقام السيارة معطل ؟', 'Mag je overdag rijden als het kentekenplaat lampje van de auto defect is?', 24, 12, 'mcq', 'uploads/question/5y11JB1672933128.jpg', 12, 'يجب أن يكون ضوء لوحة الأرقام يعمل و بحالة جيدة سواء في الليل أو النهار', 'Het kentekenplaat lampje moet werken en in goede staat zijn, zowel overdag als \'s nachts.', NULL, NULL, '2023-01-05 13:38:48', '2023-03-14 20:04:00'),
(76, 'VgY7gdv1udlFRsA', 'ماسحات الزجاج الخلفية معطلة ، هل يسمح لك القيادة؟', 'de achter -ruitenwissers zijn niet in orde, mag je rijden?', 24, 12, 'mcq', 'uploads/question/Lb2iaO1672933205.jpg', 13, 'ماسحات الزجاج الأمامية إلزامية و يمنع القيادة اذا كانت معطلة أما بالنسبة لماسحات الزجاج الخلفية فهي غير إلزامية', 'Ruitenwissers aan de voorzijde zijn verplicht en rijden is verboden als ze buiten werking zijn, achterzijde ruitenwissers zijn niet verplicht.', NULL, NULL, '2023-01-05 13:40:05', '2023-03-14 12:25:17'),
(77, '0WUuz145T5OAET1', 'أي من العلامات التالية توجد على الجزء الخلفي من الشاحنة ؟', 'Welke van de volgende markeringen staat er op de achterkant van de vrachtwagen?', 24, 12, 'mcq', 'uploads/question/A1MCdH1672933375.jpg', 14, 'توجد علامة (ب)على الجزء الخلفي من الشاحنة. توجد علامة (أ) على الجزء الخلفي من المقطورات ونصف المقطورات التي وزنها يزيد عن ٣٥٠٠ كغ . قد يصل طول الشاحنة إلى ١٢ متر ، ويبلغ الحد الأقصى للطول المسموح به لشاحنة نصف مقطورة ١٦.٥ متر والحد الأقصى للطول المسموح به للشاحنة المزودة بمقطورة ١٨.٧٥ مترا.', 'Markering B hoort aan de achterkant van de vrachtwagen en markering A op de achterkant van aanhangwagens en opleggers met een gewicht van meer dan 3500 kg. De lengte van een vrachtwagen mag 12 meter bereiken, de maximaal toegestane lengte van een oplegger is 16,5 meter en de maximaal toegestane lengte van een vrachtwagen met een oplegger is 18,75 meter.', NULL, NULL, '2023-01-05 13:42:55', '2023-03-14 20:05:18'),
(78, 'ELGa8mX4Nq95N1k', 'على أي جانب من السيارة يوجد غطاء خزان الوقود ؟', 'Aan welke kant van de auto bevindt zich de tankdop?', 24, 12, 'mcq', 'uploads/question/2uTSH31672933461.jpg', 15, ' يدل وجود السهم على يمين رمز خزان الوقود إلى أن غطاء خزان الوقود  في الجانب الأيمن من السيارة', 'De pijl rechts van het brandstoftanksymbool geeft aan dat het deksel van de brandstoftank zich aan de rechterkant van de auto bevindt.', NULL, NULL, '2023-01-05 13:44:21', '2023-03-11 16:42:23'),
(82, 'ExRrRrLtsJNYYmm', 'ماذا تعني هذه اللوحة ؟', 'Wat betekent dit bord?', 24, 12, 'mcq', 'uploads/question/n7zUdX1672933621.jpg', 16, 'هذه اللوحة تشير إلى مسار (طريق) إلزامي لسائقي الدراجات الهوائية والسنورفيتس و البروم فيتس', 'Dit bord geeft een verplichte route (weg) aan voor fietsers, snorfietsers en bromfietsers.', NULL, NULL, '2023-01-05 13:47:01', '2023-03-11 16:43:00'),
(83, 'TMoqOHTimXJBDSa', 'ماذا تعني هذه اللوحة ؟', 'Wat betekent dit bord?', 24, 12, 'mcq', 'uploads/question/WrQbVO1672933692.jpg', 17, NULL, NULL, NULL, NULL, '2023-01-05 13:48:12', '2023-03-11 16:43:42'),
(84, 'ow07FLbMoUQ979D', 'أنت على مسار الدخول وتنوي الإنضمام للطريق السريع ،متى يجب عليك البدء بإعطاء اشارة ضوئية(غماز)؟', 'Je wilt hier invoegen op de snelweg, wanneer moet je beginnen met het geven van een richtingssignaal?', 24, 12, 'mcq', 'uploads/question/v1IQbO1672933815.jpg', 18, 'عندما تقود على مسار الدخول للطريق السريع ، يجب البدء بإعطاء اشارة ضوئية (غماز) لحظة أن تنوي الدخول الى الطريق السريع وأن تكون المكعبات الأرضية متواجدة', 'Wanneer je op de invoegstrook van de snelweg rijdt, moet je beginnen met het geven van een richtingssignaal op het moment dat je van plan bent in te voegen zodra de blokmarkeringen aanwezig zijn.', NULL, NULL, '2023-01-05 13:50:15', '2023-03-14 20:14:09'),
(85, 'xYvLBiYz8etBAbM', 'ما الذي يجب أخذه بعين الإعتبار عند الخروج من النفق؟', 'Waar moet rekening mee houden bij het verlaten van de tunnel?', 24, 12, 'mcq', 'uploads/question/24CE5S1678487342.jpg', 19, 'الإضاءة داخل النفق منخفضة و لا تعادل قوة ضوء النهار لذلك عند الإنتقال من مكان ذو إضاءة منخفضة إلى مكان ذو إضاءة أعلى ستقل الرؤية لوقت قصير ثم تعود لوضعها الطبيعي', 'De verlichting in de tunnel is laag en is niet gelijk aan de kracht van daglicht, dus wanneer je van een plaats met weinig licht naar een plaats met meer verlichting gaat, zal het zicht voor een korte tijd afnemen en dan terugkeren naar normaal.', NULL, NULL, '2023-01-05 13:53:19', '2023-03-14 20:14:39'),
(86, 'ecMytpjOm0E8KyP', 'على ماذا يدل ظهور هذا الرمز في لوحة القيادة لديك  ؟', 'Wat betekent dit symbool?', 24, 12, 'mcq', 'uploads/question/rMxBGA1672941001.jpg', 20, '  يساعد نظام الفرملة الأوتوماتيكي المساعدABS في منع انغلاق (توقف) العجلات عن الدوران في حال الضغط على الفرامل بقوة ، من خلال قيام المكابح بالضغط على قرص الفرملة على شكل ضغطات سريعة و متتالية وبالتالي يمنع  التوقف الكامل للإطارات عن الدوران و هذا يساعد في منع انزلاق المركبة', 'Het ABS-ondersteunend automatisch remsysteem helpt voorkomen dat de wielen blokkeren (stoppen) of draaien als de rem krachtig wordt ingedrukt, door de remschijf in te drukken, voorkomt het dat de wielen volledig stoppen met draaien en dit helpt voorkomen dat het voertuig wegglijdt.', NULL, NULL, '2023-01-05 15:50:01', '2023-03-14 20:15:42'),
(87, 'eiIyq5VJ6ZAteSd', 'في أي من الطريقين يمكنك القيادة بسرعة 100كم/سا ؟', 'Op welke weg mag je 100km/u rijden?', 24, 12, 'mcq', 'uploads/question/OIRijk1672941113.jpg', 21, 'إذا كنت تجر عربة . لا يسمح لك القيادة بسرعة أعلى من 90 كلم/ سا', 'Als je een aanhanger meesleept mag je niet sneller rijden dan 90 km/u.', NULL, NULL, '2023-01-05 15:51:53', '2023-03-14 20:16:22'),
(88, 'unF4PsziHBkhdMK', 'في أي من الحالتين يمكنك التوقف لإنزال راكب؟', 'In welk geval kun je stoppen om een passagier af te zetten?', 24, 12, 'mcq', 'uploads/question/Mx5juC1672941210.jpg', 22, 'في الحالة (أ) يمنع عليك التوقف بجانب أو على مسار الفيتس ستروك ، أما في الحالة (ب) يمنع عليك التوقف بجانب أو على مسار الباص', 'In geval (A) is het verboden om naast of op de fietsstrook te stoppen, in geval (B) is het verboden om naast of op de buslijn te stoppen.', NULL, NULL, '2023-01-05 15:53:30', '2023-03-14 20:16:39'),
(89, 'QESuUPIx5LNgd3J', 'في أي الأماكن تتوقع وجود هذه اللوحة ؟', 'Op welke plekken kun je dit bord verwachten?', 24, 12, 'mcq', 'uploads/question/9SKow91672941291.jpg', 23, 'هذه اللوحة تتواجد على الطريق غير السريع وتعرض معلومات الوجهات وأرقام الطرق و رمز الجسر وعلامة المنطقة الصناعية', 'Dit bord bevinden we niet op snelwegen, en deze toont bestemmingsinformatie, wegnummers, brugcode en markering van het industriegebied.', NULL, NULL, '2023-01-05 15:54:51', '2023-03-14 20:19:55'),
(90, 'ukOgvjsPomRisO1', 'ماذا تعني هذه اللوحة ؟', 'Wat betekent dit bord?', 24, 12, 'mcq', 'uploads/question/11DnFL1672941378.jpg', 24, 'يظهر هذا الرمز على اللوحات الإلكترونية ، ويعني نهاية التعليمات السابقة التي تواجدت على لوحات إلكترونية', 'Dit symbool verschijnt op elektronische borden en betekent het einde van de vorige instructies die op elektronische borden bestonden.', NULL, NULL, '2023-01-05 15:56:18', '2023-03-11 16:56:59'),
(91, 'bNBLLoT2DOAxDnR', 'إلى ماذا يُشير وجود أحد هذه الرموز على ظهر إحدى المركبات ؟', 'Wat geeft de aanwezigheid van een van deze symbolen op de achterkant van een voertuig aan?', 24, 12, 'mcq', 'uploads/question/L74IgJ1672941459.jpg', 25, 'قد يكون سائق إحدى المركبات يعاني من ضعف بالسمع لذلك يتم تزويد المركبة بإحدى الرموز المبينة في الصورة أعلاه لتحذير باقي السائقين', 'De bestuurder van een van de voertuigen kan last hebben van slechthorendheid, dus het voertuig is voorzien van een van de symbolen op de bovenstaande afbeelding om de rest van de bestuurders te waarschuwen.', NULL, NULL, '2023-01-05 15:57:39', '2023-03-11 16:58:23'),
(92, 'AEz6jeHIpYJ09H5', 'عند أي من اللوحات التالية يمكن أن تصادف سيارة البروموبيل؟', 'Bij welke van de volgende borden kun je een brommobiel tegenkomen?', 24, 12, 'mcq', 'uploads/question/DeBPai1672941547.jpg', 26, 'اللوحة (أ) تمنع دخول البروم فيتس والسنورفيتس فقط', 'Bord A verbiedt alleen het binnentreden van bromfietsers en snorfietsers.', NULL, NULL, '2023-01-05 15:59:07', '2023-03-11 16:59:31'),
(93, '9ihGrDZcvmC6TkJ', 'هل يسمح لك قيادة سيارة مزودة بناقل حركة يدوي إذا كنت حاصل على رخصة قيادة لسيارة اوتوماتيك؟', 'Mag je autorijden met een handgeschakelde versnellingsbak als je een rijbewijs hebt voor een automatische auto?', 24, 12, 'mcq', 'uploads/question/LABriL1672941643.jpg', 27, 'اذا كنت حاصل على رخصة قيادة لسيارة ذات ناقل اوتوماتيكي عندها يسمح لك فقط قيادة السيارات ذات الناقل الاتوماتيكي ،أما عند حصولك على رخصة قيادة لسيارة ذات ناقل يدوي عندها يمكنك قيادة كلا النوعين(يدوي و اوتوماتيك)', 'Als je een rijbewijs hebt voor een auto met een automatische versnellingsbak, dan mag je alleen auto\'s met een automatische versnellingsbak rijden, maar wanneer je een rijbewijs behaalt voor een auto met een handgeschakelde versnellingsbak, dan mag je beide typen rijden (handgeschakeld en automatisch).', NULL, NULL, '2023-01-05 16:00:43', '2023-03-11 17:00:24'),
(94, 'fMoIY8Efj57BaD7', 'أين تكون أنت عندما تصادف هذه اللوحة قبل التقاطع ؟', 'Waar bevind jij je als je dit bord tegenkomt?', 24, 12, 'mcq', 'uploads/question/9tzVuH1672941734.jpg', 28, 'تشير هذه اللوحة إلى طريق الأفضلية الرئيسي وعند وجودها بعد التقاطع فهي تدل على وجودك خارج المدينة ، أما في حال تواجدها قبل التقاطع فهي تدل على وجودك داخل المدينه', 'Dit bord geeft de voorrangsweg aan en wanneer deze zich na het kruispunt bevindt, geeft het aan dat je je buiten de stad bevindt, maar als deze zich vóór het kruispunt bevindt, geeft het aan dat je je in de stad bevindt.', NULL, NULL, '2023-01-05 16:02:14', '2023-03-14 12:24:02'),
(96, 'M57lej0i8EQp186', 'ماذا تفعل عند خروجك من حي سكني ؟', 'Wat doe je als je een woonerf verlaat?', 26, 13, 'mcq', 'uploads/question/eLp0bS1673033130.jpg', 2, NULL, NULL, NULL, NULL, '2023-01-06 17:25:30', '2023-03-13 09:42:58'),
(97, 'dL0HRnRuyWwJct8', 'ماهي نسبة الكحول المسموحة في دم السائق الخبير بالبروميلي؟', 'Wat is het toegestane percentage alcohol in het bloed van een ervaren bestuurder in promille?', 26, 13, 'mcq', 'uploads/question/je3y881673033222.jpg', 3, NULL, NULL, NULL, NULL, '2023-01-06 17:27:02', '2023-03-10 12:36:05'),
(98, 'zhfrJ0lndJc3gCb', 'ماذا تفعل بهذه الحاله؟', 'Wat doe je in deze situatie?', 26, 13, 'mcq', 'uploads/question/kappx71673033366.jpg', 5, NULL, NULL, NULL, NULL, '2023-01-06 17:29:26', '2023-03-05 10:37:05'),
(99, 'eVuSGixaNr6HHHj', 'الرجل الضرير رفع العصا  ، ماذا تفعل بهذه الحالة؟', 'De slechtziende man heft zijn taststok op, wat doe je in dit geval?', 26, 13, 'mcq', 'uploads/question/pkWyES1673033544.jpg', 6, 'إعطاء طريق وأفضليه للضرير حتى لو لم يقم برفع العصا.', 'Op de weg geef je voorrang  aan slechtzienden, zelfs als hij zijn taststok niet opheft.', NULL, NULL, '2023-01-06 17:32:24', '2023-03-13 09:45:05'),
(100, 'uUBgfifmzbB6KRW', 'أي من الحالتين تتوقع وجود سائقين قادمين من يمينك؟', 'In welke van de twee situaties kun je bestuurders van rechts verwachten?', 26, 13, 'mcq', 'uploads/question/nN09Ug1673033643.jpg', 7, 'كلا اللوحتين تُخاطبانك انت فقط(السيارة البيضاء)ولاتخص السائقين من يمينك ويسارك ،ففي الحالة A\r\n\r\nأنت مُجبر على الإنعطاف يميناً\r\n\r\nأما في الحالة B\r\n\r\nيُمكنك الذهاب يميناً ويساراً', 'Beide borden zijn alleen voor jou bestemd en zijn niet voor de kruisende bestuurders. In geval A ben je gedwongen rechtsaf te slaan, in geval B kun je naar rechts of naar links.', NULL, NULL, '2023-01-06 17:34:03', '2023-03-14 19:38:30'),
(101, 'N7PzCjRWnUslp3g', 'أنت تقود السيارة البيضاء ،هل يُسمح لك الإنعطاف يساراً؟', 'Mag je hier linksaf?', 26, 13, 'mcq', 'uploads/question/G81TUo1673033734.jpg', 8, 'السبب: حسب لوحة الإتجاه هذه يُمكنك متابعة السير للأمام ويمكنك الإنعطاف يساراً', 'Reden: Volgens dit richtingsbord kun je rechtdoor blijven rijden en kun je linksaf slaan.', NULL, NULL, '2023-01-06 17:35:34', '2023-03-14 19:38:44'),
(102, '3uWc01Yf5sGXxu4', 'على ماذا تدُل هذه اللوحة الإلكترونية ؟', 'Wat geeft dit elektronische bord aan?', 26, 13, 'mcq', 'uploads/question/tgfpPB1673033815.jpg', 9, 'هذه اللوحة الإلكترونية تُعطي حالة الطريق السريع ،حيثُ يشير الخط الأحمر على وجود إزدحام على الطريق السريع\r\n\r\nA10.', 'Dit elektronische bord geeft de staat van de snelweg aan, waarbij de rode lijn aangeeft dat er file is op de A10.', NULL, NULL, '2023-01-06 17:36:55', '2023-03-05 11:21:55'),
(103, 'rg2IY91po2VREBk', 'أنت تَقود السيارة البيضاء ، هل تتوقع وجود سائقين قادمين من يسارك؟', 'Je rijdt de witte auto, kun je bestuurders van links verwachten?', 26, 13, 'mcq', 'uploads/question/G3pIBf1673033908.jpg', 10, 'السبب:جميع السائقين بهذه الحالة مجبرين على إتباع إتجاه السهم وأنت مُجبرعلى الإنعطاف يساراً\r\n\r\nلذلك لاتتوقع وجود سائقين من اليسار يقُودون بعكس إتجاه السهم.', 'Alle automobilisten worden moeten de richting van de pijl te volgen, en voor jou wijst de pijl naar links, dus verwacht niet dat automobilisten van links tegen de richting van de pijl in rijden.', NULL, NULL, '2023-01-06 17:38:28', '2023-03-14 19:40:31'),
(104, 'V0cs7QkwLic2fHY', 'هل يُسمح لك بالإنتقال إلى المسارالذي على يمينك؟', 'Mag je invoegen op de rechterrijstrook?', 26, 13, 'mcq', 'uploads/question/17MKRE1673033986.jpg', 11, ' السبب: الخانة التي على يمينك مخصصة للباصات والشاحنات فقط.', 'Reden: de rijstrook van rechts is alleen voor bussen en vrachtwagens bestemd.', NULL, NULL, '2023-01-06 17:39:46', '2023-03-13 09:46:52'),
(105, 'CLy6LC1POqaFtRR', 'في أي من الحالتين تتوقع وجود فيتس قادم من يمينك؟', 'In welke situatie zou je fietsers van rechts kunnen verwachten?', 26, 13, 'mcq', 'uploads/question/eEXRUK1673034079.jpg', 12, 'السبب: في الحالة A:\r\n\r\nجميع السائقين مُجبرين على إتباع إتجاه السهم بإستثناء الفيتس والسنور فيتس ،\r\n\r\nاما في الحالة B:\r\n\r\nفقط الفيتس والسنورفيتس مُجبرين على إتباع السهم.', 'In situatie A zijn alle bestuurders verplicht om de richting van de pijl te volgen behalve de fiets en snorfiets. \r\nIn situatie B zijn alleen de fiets en snorfiets verplicht om de pijl te volgen.', NULL, NULL, '2023-01-06 17:41:19', '2023-03-14 19:41:09'),
(106, 'xA1WpKSeYB3KThS', 'أي من الزوايا التالية تعتبر زاوية ميتة بالنسبة لسائق الدراجة النارية ؟', 'Welke van de volgende hoeken is een dode hoek voor een motorrijder?', 26, 13, 'mcq', 'uploads/question/zLBcFE1673034170.jpg', 13, NULL, NULL, NULL, NULL, '2023-01-06 17:42:50', '2023-03-05 11:27:43'),
(107, 'Ozd0XCiWQUuVPaG', 'لقد تعرضت لحادث مروري ،إختر الإجابة الصحيحة؟', 'Je was betrokken bij een verkeersongeval, kies het juiste antwoord.', 26, 13, 'mcq', 'uploads/question/sVmZhI1673034254.jpg', 14, NULL, NULL, NULL, NULL, '2023-01-06 17:44:14', '2023-03-05 11:28:38'),
(108, 'SGDxvMjtighdVJ4', 'ما الذي يسرع عملية طرد الكحول من جسمك؟', 'Wat versnelt het proces van het verdrijven van alcohol uit het lichaam?', 26, 13, 'mcq', 'uploads/question/XV9cSy1673034332.jpg', 15, NULL, NULL, NULL, NULL, '2023-01-06 17:45:32', '2023-03-05 11:30:38'),
(109, '9ZJmFxMVrXm5BN4', 'على بُعد كم متر من موقف الباص يحق لك عمل باركير؟', 'Op hoeveel meter afstand van de bushalte mag je parkeren?', 26, 13, 'mcq', 'uploads/question/kICAUv1673034406.jpg', 16, ' يُمكن معرفة حدود موقف الباص من خلال بلوكات بيضاء أو خط أبيض متصل،\r\n\r\nوفي حال عدم وجودهما فإن حدود موقف الباص هي 12 متر قبل لوحة موقف الباص و 12 متر بعدها .', 'De grenzen van de bushalte kunnen worden geïdentificeerd door middel van witte blokken of een doorlopende witte lijn, en als deze niet aanwezig zijn, zijn de grenzen van de bushalte 12 meter voor het bord met de bushalte en 12 meter erna.', NULL, NULL, '2023-01-06 17:46:46', '2023-03-05 12:00:16'),
(110, 'ukiFWZDaVEa4XOR', 'تريد جرّ عربة بسيارتك ،في أي من الحالتين تقوم بتثبيت الكابل المسمى باللغة الهولندية hulpkoppeling بشكل صحيح؟', 'Je wilt een auto meeslepen, in welk geval monteer je de hulpkoppeling kabel op de juiste manier?', 26, 13, 'mcq', 'uploads/question/CnfSES1673034494.jpg', 17, 'الاجابة الصحيحة :\r\n\r\nB\r\n\r\nالسبب : عندما تريد جرّ عربة ليس لها نظام فرملة ذاتي\r\nمع السيارة فإنك تقوم بربط العربة مع السيارة عن طريق\r\nوضع التجويف الذي في مقدمة العربة في ساحب السيارة\r\nالمعقوف وبذلك يكون تم الربط بشكل جيد ولكن في حال\r\nانفصال العربة عن السيارة ستشكل خطورة كبيرة ،\r\nلذلك تم وضع كابل خاص يسمى باللغة الهولندية\r\nhulpkoppeling\r\nوظيفته إبقاء العربه معلقة بالسيارة في حال انفصالها\r\nويجب تمريره من خلال الجزء المعدني الأبيض أيضا المثبت\r\nفي الساحب المعقوف الخاص بالسيارة وليس في الساحب فقط.', 'Reden:  wanneer je een voertuig wil slepen dat geen zelf remmend systeem heeft met de auto wilt slepen, koppel je het voertuig aan de auto door de groef aan de voorzijde van het voertuig in de aangehaakte autotrekker te plaatsen, en zo is die goed geïnstalleerd.', NULL, NULL, '2023-01-06 17:48:14', '2023-03-13 09:49:17'),
(111, 'ELRt5u1kjuk61Va', 'هل تتوقع وجود أطفال إذا رأيت هذه اللوحة؟', 'Kun je kinderen verwachten op de weg wanneer je dit bord ziet?', 26, 13, 'mcq', 'uploads/question/u5uT7g1673034645.jpg', 18, 'السبب:في منطقة السرعة 30 نتوقع وجود أطفال او مشاة.', 'Reden: In de 30 km/u snelheidszone verwachten we de aanwezigheid van kinderen of voetgangers.', NULL, NULL, '2023-01-06 17:50:45', '2023-03-14 19:43:33'),
(112, 'OIUArnTYbQbCENq', 'هل يحق لك إستخدام الزمور ليلاً لتجنب خطر ما؟', 'Heb je het recht om \'s nachts de claxon te gebruiken om enig gevaar te vermijden?', 26, 13, 'mcq', 'uploads/question/jvIU821673034731.jpg', 19, 'السبب: يحق لك إستخدام الزمور ليلاً ونهاراً لتجنب خطر ما.', 'Je hebt het recht om de claxon overdag en ‘s nachts te gebruiken om enig gevaar te vermijden.', NULL, NULL, '2023-01-06 17:52:11', '2023-03-13 09:49:46'),
(113, 'AwZCCGkleeZrbJU', 'ماذا تعني هذه اللوحة؟', 'Wat betekent dit bord?', 26, 13, 'mcq', 'uploads/question/yqScrs1673034911.jpg', 20, NULL, NULL, NULL, NULL, '2023-01-06 17:55:11', '2023-03-05 11:43:59'),
(114, 'f9QkNEZ7gbJcp1Y', 'هل إستخدام جهاز الملاحة (GPS) يؤدي لتوفير الوقود والحفاظ على البيئة؟', 'Leidt het gebruik van het navigatieapparaat tot brandstofbesparing en milieubescherming?', 26, 13, 'mcq', 'uploads/question/ksKgaR1673034989.jpg', 21, 'إنّ ضبط جهاز الملاحة قبل البدء بالقيادة يساعد في إختيار الطريق الأقصر  والأسرع(زمن أقل)\r\nويزودك بمعرفة مسبقة عن حالة الطريق في حال وجود ازدحام أو طريق مغلق بسبب أعمال الصيانة\r\nاو حادث ، كل هذا يؤدي الى توفير الوقود والحفاظ على البيئة.', 'Het instellen van het navigatieapparaat voordat je gaat rijden helpt bij het kiezen van de kortste en snelste route en geeft je voorkennis over de toestand van de wegen in het geval van een file of een wegafsluiting door onderhoudswerkzaamheden of een ongeval. Dit leidt tot brandstofbesparing en milieubehoud.', NULL, NULL, '2023-01-06 17:56:29', '2023-03-14 19:49:16'),
(115, 'XbN08o0ofRpS3qv', 'على ماذا تدل هذه اللوحة؟', 'Wat geeft dit bord aan?', 26, 13, 'mcq', 'uploads/question/phU0zF1673035099.jpg', 22, NULL, NULL, NULL, NULL, '2023-01-06 17:58:19', '2023-03-05 11:47:04'),
(136, 'fT30eHhRWHkZvyL', 'هل تتوقع قدوم شاحنة  من أمامك؟', 'Kun je een vrachtwagen voor je op de weg verwachten?', 26, 13, 'mcq', 'uploads/question/3y27Ct1673274579.jpg', 23, 'السبب: حسب ما تُخبر به اللوحة أنّه إتجاه إجباري للشاحنات فقط ولايوجد شاحنات من أمامك.', 'Dit is een verplichte richting voor vrachtwagens en er rijden geen vrachtwagens voor je.', NULL, NULL, '2023-01-09 12:29:39', '2023-03-14 19:51:26'),
(137, 'qA0cYsvXpXea7pb', 'في أي من الحالات التالية تستطيع الإلتفاف والعودة ؟', 'Bij welke van de volgende situaties mag je keren?', 26, 13, 'mcq', 'uploads/question/NZJTht1673274665.jpg', 24, 'على الطريق السريع وطريق السيارات لا يمكنك الإلتفاف والعودة أمّا على طريق خارج المدينة مسموح ذلك.', 'Op de snelweg en autoweg is het niet toegestaan om te keren, op een weg buiten de bebouwde kom is dit wel toegestaan.', NULL, NULL, '2023-01-09 12:31:05', '2023-03-14 19:51:48'),
(138, 'tzlF52G8BavGxY6', 'في أي من الصورتين تكون وضعية الجر أكثر أمانا ؟', 'In welke van de twee situaties is het meeslepen veiliger?', 26, 13, 'mcq', 'uploads/question/qIQYRr1673274833.jpg', 25, 'الجواب  A\r\n\r\n. وضعية الجر و الحبل مشدود أكثر أمنا من وضعية الجر و الحبل مرخي .', 'De tractiepositie met het touw gespannen is veiliger dan de tractiepositie met het touw los.', NULL, NULL, '2023-01-09 12:33:53', '2023-03-13 09:51:44'),
(139, '7gCtZWDiigPFFOf', 'أي من الحالتين تكون القياده أكثر أماناً؟', 'In welke van de twee gevallen is autorijden veiliger?', 26, 13, 'mcq', 'uploads/question/TwTP3H1673274938.jpg', 26, NULL, NULL, NULL, NULL, '2023-01-09 12:35:38', '2023-03-05 11:53:35'),
(140, 'jzogMaoTBzMuj6Q', 'على ماذا يدل ظهور هذا الرمز في لوحة القيادة لديك؟', 'Wat geeft dit symbool aan?', 26, 13, 'mcq', 'uploads/question/11cUXC1673275019.jpg', 27, NULL, NULL, NULL, NULL, '2023-01-09 12:36:59', '2023-03-05 11:54:35'),
(141, 'P4iOQbKF8QwgsNK', 'على ماذا يدل ظهور هذا الرمز في لوحة القيادة لديك؟', 'Wat geeft dit symbool aan?', 26, 13, 'mcq', 'uploads/question/K0aU141673275106.jpg', 28, NULL, NULL, NULL, NULL, '2023-01-09 12:38:26', '2023-03-05 11:55:46'),
(142, 'ElzV8iaEHRTr2hx', 'أي نوع من الإطارات التالية يكون أكثر ثباتاً على سطح الطريق الرطب ؟', 'Welke van de volgende typen banden is het meest stabiel op een nat wegdek?', 31, 16, 'mcq', 'uploads/question/gTlomn1673275362.jpg', 1, 'الأجابة : الصحيحه : B - الإطار الرفيع\r\n\r\nالسبب: الإطار الرفيع مساحة سطحه أصغر من مساحة سطح\r\nالإطار العريض وبالتالي تجمع الماء فيه سيكون\r\nأقل من الإطار العريض في حالة حدوث أكوابلانغ\r\nو بالتالي انزلاق أقل وثبات أكبر على الطرقات الرطبه\r\nوخلاف ذلك يكون الإطار العريض أكثر ثباتاً على سطح الطريق الجاف', 'De reden: de dunne band heeft een kleiner oppervlak dan het oppervlak van de brede band, en daarom zal de wateropvang erin minder zijn dan de brede band in het geval van aquaplaning, en dus minder slippen en meer stabiliteit op nat wegdek, anders is de brede band stabieler op droog wegdek.', NULL, NULL, '2023-01-09 12:42:42', '2023-03-13 09:31:22'),
(143, 'wOM1Vs94MtNKpnP', 'هل يحق لك القيادة في الطقس الجيد إذا كانت ماسحات الزجاج الأمامية معطلة؟', 'Mag je bij mooi weer rijden als de ruitenwissers kapot zijn?', 31, 16, 'mcq', 'uploads/question/3wskzr1673275495.jpg', 2, 'بالنسبة لماسحات الزجاج الخلفية فهي غير إجبارية', 'Voor achter-ruitenwissers is dit niet verplicht.', NULL, NULL, '2023-01-09 12:44:55', '2023-03-14 19:10:31'),
(144, 'AuIgAnRK0dVEmtK', 'في أي الأماكن يحق لعربات ذوي الإحتياجات الخاصة السير Invalidenvoertuig ؟', 'Op welke plekken mogen invalidenvoertuigen rijden?', 31, 16, 'mcq', 'uploads/question/CgOEVu1673275575.jpg', 3, NULL, NULL, NULL, NULL, '2023-01-09 12:46:15', '2023-03-14 12:22:50'),
(145, 'N2egsUOCsXGZ9Nw', 'على ماذا تدل هذه اللوحة؟', 'Wat geeft dit bord aan?', 31, 16, 'mcq', 'uploads/question/SRVng01673275639.jpg', 4, NULL, NULL, NULL, NULL, '2023-01-09 12:47:19', '2023-03-04 12:50:50'),
(146, 'fm8BvOjCIv3SUkm', 'في أي من الطريقين تتوقع تقاطع بدون جسر ؟', 'Bij welk bord kun je een kruising verwachten zonder viaduct?', 31, 16, 'mcq', 'uploads/question/I54nkx1673275733.jpg', 5, ' على الطريق السريع يكون التقاطع من خلال جسر أو نفق وهذا اكثر أماناً بالنسبة للسرعات العالية\r\nأما على باقي الطرقات نتوقع التقاطع بدون جسر', 'Op de snelweg is de kruising door een viaduct of een tunnel, en dat is veiliger bij hoge snelheden, op de rest van de wegen verwachten we de kruising zonder viaduct.', NULL, NULL, '2023-01-09 12:48:53', '2023-03-14 19:13:16'),
(147, 'ziYzKXmF0hdWPJP', 'من ماذا تحذرك هذه اللوحة؟', 'Waar waarschuwt dit bord je voor?', 31, 16, 'mcq', 'uploads/question/xWCsfd1673275838.jpg', 6, 'حيث هذا الحاجز على شكل اسطوانة تختفي في الأرض لمرور المركبات', 'Deze verkeerspaal verdwijnt in de grond voor de doorgang van voertuigen', NULL, NULL, '2023-01-09 12:50:38', '2023-03-14 19:15:14'),
(148, 'QIOyNTeD8CAkP6j', 'في أي لوحة تتوقع قدوم فيتس من أمامك؟', 'Met welk bord kun je tegenliggende fietsers verwachten?', 31, 16, 'mcq', 'uploads/question/T0rNaH1673275932.jpg', 7, NULL, NULL, NULL, NULL, '2023-01-09 12:52:12', '2023-03-05 10:08:44'),
(149, 'eUu5o3ZNgeScejz', 'ما الذي سيحدث لزمن ردة الفعل إذا كنت تستخدم إطار شتوي في فصل الصيف؟', 'Wat gebeurt er met de reactietijd wanneer je winterbanden gebruikt tijdens de zomer?', 31, 16, 'mcq', 'uploads/question/6MhHkQ1673276022.jpg', 8, 'السبب:زمن ردة الفعل يتعلّق بالسائق وإنتباهه ولا علاقة له بالخصائص الميكانيكية للسيارة\r\nولكن الذي سيتغير هو إزدياد مسافة الفرملة لأن الإطار الشتوي تبدأ فعاليته في الشتاء (وليس في الصيف)\r\n.عند درجة حرارة 7مئوية ومادون', 'De reactietijd is gerelateerd aan de bestuurder en zijn aandacht en heeft niets te maken met de mechanische eigenschappen van de auto, maar wat wel verandert, is de verlenging van de remweg, want de winterband begint zijn effectiviteit in de winter (en niet in de zomer) bij een temperatuur van 7 graden Celsius en lager.', NULL, NULL, '2023-01-09 12:53:42', '2023-03-14 19:16:12'),
(150, 'bsRoAxc247EYSxn', 'أي من المقطورات التالية يجب ان تخضع لفحص ميكانيكي سنوي APK؟', 'Welke van de volgende aanhangwagens moet jaarlijks een APK-technische keuring ondergaan?', 31, 16, 'mcq', 'uploads/question/OLVoyh1673276110.jpg', 9, NULL, NULL, NULL, NULL, '2023-01-09 12:55:10', '2023-03-05 10:11:41'),
(151, 'qHIjSppokFwqewV', 'أي من اللوحات التالية تسمح بدخول المشاة؟', 'Welke van de volgende borden laat voetgangers toe?', 31, 16, 'mcq', 'uploads/question/IjGCQG1673276195.jpg', 10, 'كلا اللوحتين تمنع دخول المركبات ولاتخص المشاة بشيئ.', 'Beide borden verbieden het binnendringen van voertuigen en hebben geen betrekking op voetgangers.', NULL, NULL, '2023-01-09 12:56:35', '2023-03-14 19:16:59'),
(152, 'IsSV8Ql3KxUe3fL', 'ماذا تتوقع إذا قمت بتشغيل مثبت السرعة ؟', 'Wat verwacht je als je cruisecontrol aanzet?', 31, 16, 'mcq', 'uploads/question/gI1Qzf1673276279.jpg', 11, NULL, NULL, NULL, NULL, '2023-01-09 12:57:59', '2023-03-04 13:18:02'),
(153, 'FYBkFGT1sEBxce0', 'أين يتشكّل الجليد بشكل أكبر؟', 'Op welke plek is het meeste ijsvorming?', 31, 16, 'mcq', 'uploads/question/42izvV1673276349.jpg', 12, 'احتمالية تشكل التيارات البارده تكون اكثر في الأماكن المرتفعة المكشوفه', 'De mogelijkheid van vorming van koude stromingen is meer op hoge blootgestelde plaatsen.', NULL, NULL, '2023-01-09 12:59:09', '2023-03-14 12:20:53'),
(154, 'G3UzYGSeUDcEDlV', 'في أي من الحالتين تكون السرعة القصوى 90 فوراً؟', 'In welk geval is de maximale snelheid meteen 90 km/u?', 26, 13, 'mcq', 'uploads/question/zYbddk1673276495.jpg', 4, 'كلا اللوحتين تخبر بوجود إنزلاق وسرعة قصوى ٩٠كم/سا  ، لكن في اللوحة A السرعة القصوى ٩٠ في حال وجود رطوبة على الطريق فقط وفي حال عدم وجود رطوبة لا تطبق هذه السرعة ، أما اللوحة B السرعة القصوى ٩٠ من مكان وجود اللوحة ولغاية ١.٥ كم', 'Op beide borden staat dat er sprake is van slip en een maximumsnelheid van 90 km/u, maar op bord A is de maximumsnelheid 90 km/u alleen bij vocht op de weg en bij afwezigheid van vocht geldt deze snelheid niet. Bord B geeft de maximale snelheid van 90 km/u vanaf de plaats waar het bord zich bevindt tot 1,5 km.', NULL, NULL, '2023-01-09 13:01:35', '2023-03-13 09:43:52'),
(155, 'FzDFwJnz7mhj9Sh', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/bVxJLC1673780955.jpg', 1, 'سيارة الشرطة ستذهب أولاً لأنها تشغل ضوء و صوت تحذيري فهي سيارة أولوية  ،ثم سيذهب البايسكل لأنه قادم من يمين السيارة البيضاء (قاعدة اليمين) وأخيراً السيارة البيضاء', 'De politieauto gaat als eerste omdat deze optische en geluidsignalen aan heeft staan en omdat het een voorrangsauto is, daarna gaat de fiets omdat deze van rechts van de witte auto komt.', NULL, NULL, '2023-01-15 09:09:15', '2023-03-14 18:25:29'),
(156, '6WS6xNJqygZXO2t', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/utAPCs1673781227.jpg', 2, 'الترام سيذهب أولاً لأن التقاطع متساوي وأيضاً لن يتوقف للمشاة لعدم وجود زيبراباد ،ثم ستذهب الدراجة النارية لأنها قادمة من يمين السيارة البيضاء ، ثم ستذهب السيارة البيضاء لانها ترى كتف المشاة وبالتالي لن تعطيه الأفضلية ، وأخيراً سيذهب المشاة', 'De tram gaat eerst omdat het kruispunt gelijk is en deze stopt ook niet voor voetgangers omdat er geen voetgangersoversteekplaats is, dan gaat de motor omdat die van rechts van de witte auto komt, daarna gaat de witte auto en tot slot mag de voetganger gaan.', NULL, NULL, '2023-01-15 09:13:47', '2023-03-14 19:59:57'),
(157, 'N4AzlFg7TTr54Qt', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/idaE9d1673782134.jpg', 3, 'السيارة الأولى من الرتل العسكري عبرت التقاطع المتساوي لذلك لا يحق لأحد قطعهم وسيذهب الرتل أولاً ، ثم السكوتر لأنه قادم من يمين السيارة البيضاء ، وأخيراً السيارة البيضاء', 'De eerste auto van de militaire colonne is overgestoken op de gelijke kruising , dus niemand heeft het recht om ze af te snijden. De millitaire colonne gaat eerst, dan de scooter omdat deze van rechts van de witte auto komt, en als laatste de witte auto.', NULL, NULL, '2023-01-15 09:28:54', '2023-03-10 13:33:12'),
(158, 'ZI7mH7DplsGpuvU', 'من يذهب أولاً ؟', 'Wie mag eerst?', 32, 17, 'mcq', 'uploads/question/l7z1Wo1673782318.jpg', 4, 'السيارة البيضاء ستذهب أولاً لأنها تقود على طريق رئيسي و لا تعطي أفضلية للمشاة لعدم وجود زيبراباد (الترام والسيارة الحمراء لديهم أسنان القرش)', 'De witte auto gaat voor omdat deze op een voorangsweg weg rijdt en geen voorrang geeft aan voetgangers omdat er geen voetgangersoversteekplaats is (de tram en de rode auto hebben haaientanden).', NULL, NULL, '2023-01-15 09:31:58', '2023-03-14 18:26:38'),
(159, 'NcQyW3SOVqmHIUe', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/n05G1h1678835077.jpg', 5, 'السيارة البيضاء ستذهب أولاً  لأنها تتابع السير على طريق الأولوية (الطريق الرئيسي) ثم ستذهب السيارة السوداء التي تنعطف و تغادر الطريق الرئيسي ، وأخيراً المشاة', NULL, NULL, NULL, '2023-01-15 09:33:23', '2023-03-14 22:05:18'),
(161, 'QqodTir75D0Cmjs', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/HQmZ2q1674258279.jpg', 6, 'الترام في تقاطع متساوي مع السائقين فالأفضلية له و سيذهب أولاً ، ثم الدراجة النارية لأنها قادمة من يمين الشاحنة ، وأخيراً الشاحنة', 'De tram staat op een gelijk kruispunt met de bestuurders, dus die heeft de voorrang en gaat eerst, dan de motor omdat die van rechts van de vrachtwagen komt, en tenslotte de vrachtwagen.', NULL, NULL, '2023-01-20 21:44:39', '2023-03-10 13:37:37'),
(162, '9ilv9dmKYHBpF5a', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/gHZt3j1674258455.jpg', 7, 'الفيتس قادم من يمين السيارة البيضاء وبنفس الوقت هو لا يقطع طريق السيارة الخضراء لذلك سيذهب أولاً ، ثم ستذهب السيارة البيضاء قبل الخضراء  لأنها تتابع سير للأمام (من ينعطف يفقد الأفضلية)، وأخيراً ستذهب السيارة الخضراء', 'De fietser komt van rechts van de witte auto en hij kruist het pad van de groene auto niet, dus hij zal eerst gaan, daarna zal de witte auto voor de groene gaan omdat hij rechtdoor gaat (wie afslaat verleent voorrang), en tot slot gaat de groene auto.', NULL, NULL, '2023-01-20 21:47:35', '2023-03-14 18:28:27'),
(163, '47KpuhpPhpILfBD', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/HazEUH1674258719.jpg', 8, 'الترام و السبيارة السوداء سيتوقفان للمشاة على الزيبراباد ،لذلك سيذهب المشاة أولاً ،ثم سيذهب الترام ثانياً (اذا تساوى الترام مع باقي السائقين فهو الملك ) وأخيراً السيارة السوداء', 'De tram en de zwarte auto stoppen voor de voetganger op de voetgangersoversteekplaats, dus de voetganger gaat eerst, daarna de tram als tweede (als de tram gelijk is aan de rest van de bestuurders, dan heeft hij de voorrang) en tenslotte de zwarte auto.', NULL, NULL, '2023-01-20 21:51:59', '2023-03-14 18:33:15'),
(164, '4R2meZfxBKlSTuV', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/jYxJkd1674259082.jpg', 9, 'السيارة البيضاء قادمة من يمين السيارة الخضراء وبنفس الوقت هي لا تقطع طريق الدراجة النارية لذلك ستذهب أولاً ،و من ثم يبقى لدينا متحركان بنفس الشارع و من ينعطف يفقد الأفضلية أي ستذهب السيارة الخضراء ثانياً و أخيراً الدراجة النارية التي تنعطف.', 'De witte auto komt van rechts van de groene auto, en tegelijkertijd kruist hij het pad van de motorfiets niet, dus hij gaat eerst en dan hebben we twee bestuurders in dezelfde straat, en wie afslaat verleent voorrang. De groene auto gaat als tweede en als laatste de motor die afslaat.', NULL, NULL, '2023-01-20 21:58:02', '2023-03-14 20:07:38'),
(165, 'EIkdyqNZz3aLxjL', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'mcq', 'uploads/question/1m58OB1674259212.jpg', 10, 'السيارة الزرقاء قادمة من يمين السيارة الحمراء(قاعدة اليمين) وهي لا تعطي الأفضلية للمشاة لأنها ترى كتفه ولكن السيارة البيضاء لديها إلتفاف قصير (بالنسبة لإلتفاف السيارة السيارة الزرقاء الطويل) وهي لا تقطع طريق السيارة الحمراء لذلك ستذهب البيضاء أولاً ، ثم السيارة الزرقاء القادمة من اليمين ، وأخيراً السيارة الحمراء والمشاة معاً', 'De blauwe auto komt van rechts van de rode auto , en hij hoeft geen voorrang te verlenen aan de voetganger. De witte auto heeft een korte bocht (ten opzichte van de lange bocht van de blauwe auto), witte auto en oranje auto kuisen elkaar niet, dus de witte auto gaat eerst, daarna de blauwe auto die van rechts komt en en slotte de rode auto en de voetganger samen.', NULL, NULL, '2023-01-20 22:00:12', '2023-03-14 20:10:22'),
(166, '9nkMRl3qovkZpL0', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/qCdgJ81674259370.jpg', 11, 'السيارة الصفراء ستذهب أولاً لأنها تقود على طريق رئيسي ، و من ثم لدينا سائقان لديهما أسنان قرش إذاً هما متساويان وبالتالي نطبق قاعدة اليمين أي ستذهب ثانياً الدراجة النارية القادمة من يمين السيارة البيضاء وأخيراً السيارة البيضاء.', 'De gele auto gaat als eerste omdat hij op een voorrangsweg rijdt, en dan hebben we twee bestuurders met haaientanden, dus ze zijn gelijk en daarom passen we de rechterhand regel toe, de motor die van rechts van de witte auto komt, zal als tweede gaan en als laatste de witte auto.', NULL, NULL, '2023-01-20 22:02:50', '2023-03-14 18:35:27'),
(167, 'BkUexq8T1UEh491', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/Ja9S801674259475.jpg', 12, 'المشاة سيذهب أولاً لأن لديه ممر المشاة (زيبراباد) ومن ثم ستذهب السيارة البيضاء ثانياً لأنها على طريق رئيسي ، ومن ثم الترام بالمرتبة الثالثة (لأنه اذا تساوى الترام مع باقي السائقين فالأفضلية له) وأخيراً السيارة الحمراء', 'Voetgangers gaan eerst omdat ze een voetgangersoversteekplaats hebben, dan gaat de witte auto als tweede omdat deze op een voorrangsweg rijdt, dan gaat de tram op de derde plaats (want als de tram gelijk is aan de rest van de bestuurders heeft hij de voorrang) en tot slot de rode auto.', NULL, NULL, '2023-01-20 22:04:35', '2023-03-14 18:36:06'),
(168, 'NxTlxdMIXkqavgV', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/NfHm531674259625.jpg', 13, 'السيارة البيضاء ستذهب أولاً لأنها تقود على طريق رئيسي ، ثم سيذهب المشاة لأن الدراجة النارية قادمة من خلف المشاة وتنعطف في طريقه (ترى ظهر المشاة) وأخيراً الدراجة النارية', 'De witte auto gaat eerst omdat deze op de voorrangsweg rijdt, dan gaat de voetganger omdat de motor achter de voetganger aan komt rijden en zijn weg kruist (je ziet de achterkant van de voetganger) en tenslotte de motor.', NULL, NULL, '2023-01-20 22:07:05', '2023-03-14 18:36:43'),
(169, 'sok96eOzU0R1ihC', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'mcq', 'uploads/question/zluAe11674259714.jpg', 14, 'السيارة الصفراء  ستنتظر المشاة لأنها قادمه من خلفه وترى ظهر المشاة لذلك تذهب البيضاء أولاً لأنها ذات انعطاف قصير وهي لا تقطع طريق السيارة الصفراء وبنفس الوقت لا تعطي الأفضلية للمشاة لأنها ترى كتفه وهي من يمين السيارة الزرقاء  ، ومن ثم لدينا متحركان بنفس الشارع من ينعطف يفقد الأفضلية لذلك ستذهب السيارة الزرقاء والمشاة معاً لأن حركتهما لا تتقاطعان، وأخير السيارة الصفراء', 'Witte auto gaat eerst, omdat deze een korte bocht heeft. daarna gaan de blauwe auto en voetganger samen en tenslotte de gele auto omdat deze wil afslaan. Regel wie afslaat op de zelfde weg moet voorrang verlenen aan doorgaand verkeer.', NULL, NULL, '2023-01-20 22:08:34', '2023-03-14 20:28:53'),
(170, 'J4wKXq5SbF48bbA', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/EK4LSF1674299018.jpg', 15, 'السيارة السوداء تنتظر و تعطي الأفضلية لليمين واليسار لانها تغادر طريق ترابي ، لذلك ستذهب السيارة البيضاء أولاً لأنها قادمة من يمين التركس و تتابع السير للأمام بالنسبة للسيارة الحمراء التي تنعطف ، ثم سيذهب التركس ثانياً لأنه من يمين السيارة الحمراء ثم السيارة الحمراء وأخيراً السيارة السوداء', 'De zwarte auto wacht en verleent voorrang aan kruisende bestuurders omdat hij een onverharde weg verlaat, dus de witte auto gaat als eerste omdat hij van rechts van de tractor komt en rechtdoor gaat, dan gaat de tractor als tweede omdat hij rechts van de rode auto staat, dan de rode auto en tenslotte de zwarte auto.', NULL, NULL, '2023-01-21 09:03:38', '2023-03-14 18:58:31'),
(171, 'GGIocNXnRgWfFAz', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'mcq', 'uploads/question/TFeoKC1674299343.jpg', 16, 'البايسكل يذهب أولاً لأنه يتابع السير على طريق رئيسي حسب ما تخبر به اللوحات المعدنية ، ثم الباص والسيارة الزرقاء معاً لأن حركتهما لا تتقاطعان', 'De fiets gaat eerst omdat die op een voorrangsweg blijft rijden, daarna de bus en de blauwe auto samen omdat hun beweging elkaar niet kruist.', NULL, NULL, '2023-01-21 09:09:03', '2023-03-14 18:58:51'),
(172, 'oosAnuZoMxewScN', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/y3rCcF1674299478.jpg', 17, 'نطبق قاعدة اليمين (السائق الذي يمينه فارغ يذهب أولاً أو بمعنى آخر السائق القادم من اليمين هو الملك)', 'We passen de regel toe van; de bestuurder wie van rechts komt, gaat eerst).', NULL, NULL, '2023-01-21 09:11:18', '2023-03-14 19:01:01'),
(173, 'sl4CwDEPymULRya', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/Eh9AUe1674299615.jpg', 18, 'الدراجة النارية والباص لديهما أسنان القرش لذلك سيتوقفان لإعطاء الأفضلية للسائقين من اليمين واليسار فقط ، لذلك سيذهب البايسكل أولاً ثم السيارة البيضاء ثانياً(متحركان بنفس الشارع من ينعطف ينتظر) ثم تطبق نفس القاعدة بين الدراجة النارية والباص أي ستذهب الدراجة النارية بالمرتبة الثالثة و أخيراً الباص', 'De motor en de bus hebben haaientanden, dus ze zullen stoppen om voorrang te verlenen aan kruisende bestuurders, de fiets gaat eerst, dan de witte auto als tweede (ze rijden op dezelfde wen, wie afslaat verleent voorrang).\r\nDan geldt dezelfde regel tussen de motor en de bus, de motor gaat als derde en als laatste de bus.', NULL, NULL, '2023-01-21 09:13:35', '2023-03-14 20:22:09'),
(174, 'KYACjF2r7Bu1gtk', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/N6gkWU1674299745.jpg', 19, 'الفيتس والباص يقودان على طريق رئيسي وبالتالي من ينعطف يفقد الأفضلية ، أي سيذهب الفيتس أولاً ثم الباص وأخيراً السيارة الصفراء', 'De fietser en de bus rijden op een voorrangsweg, en daarom verleent degene die afslaat voorrang, wat betekent dat de fietser eerst gaan, dan de bus en ten slotte de gele auto.', NULL, NULL, '2023-01-21 09:15:45', '2023-03-14 19:02:31'),
(175, '3RkUb7zVC2qdkbA', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/6BEuhX1674299861.jpg', 20, 'الدراجة النارية لديها أسنان قرش لذلك ستنتظر السيارة البيضاء وأيضاً ستنتظر الفتاة (ترى ظهر الفتاة) ، السيارة البيضاء ترى كتف الفتاة وبطن الشاب لذلك ستعطي الأفضلية للشاب فقط ، و سيذهب الشاب أولاً ثم السيارة البيضاء ثانياً ثم الفتاة وأخيراً الدراجة النارية', 'De motorfiets heeft haaientanden, dus hij wacht op de witte auto en de voetganger (hij ziet de rug van het meisje), de witte auto ziet de schouder van het meisje en de buik van de man, dus hij geeft enkel voorrang aan de man, de man gaat eerst, dan de witte auto, dan het meisje en als laatste de motor.', NULL, NULL, '2023-01-21 09:17:41', '2023-03-13 10:51:49'),
(176, 'l1FcfczIKLZyFwp', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/6VRwy41674300001.jpg', 21, 'السيارة البيضاء والفيتس لديهما إشارة ضوئية خضراء وبالتالي الانعطاف القصير قبل الطويل أي ستذهب السيارة البيضاء أولاً ثم الفيتس ، وأخيراً الباص لأن لديه إشارة ضوئية حمراء', 'De witte auto en de fietser hebben groen licht, de korte bocht gaat voor de lange, de witte auto gaat eerst, dan de fietser en ten slotte de bus omdat deze rood licht heeft.', NULL, NULL, '2023-01-21 09:20:01', '2023-03-10 15:27:10'),
(178, '7sOTo42wNdQhR0g', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/eeYksN1674300184.jpg', 23, 'سيذهب البايسكل أولاً لأنه من ينعطف ينتظر', 'De fiets gaat voor, want wie afslaat, wacht.', NULL, NULL, '2023-01-21 09:23:04', '2023-03-10 15:29:58'),
(179, 'D7Uj67oqMqKXRXs', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/lmechg1674300329.jpg', 24, 'البايسكل يذهب أولاً لأنه يتابع السير في طريق رئيسي ، ثم سيذهب الباص الذي يغادر الطريق الرئيسي وأخيراً السيارة الصفراء', 'De fiets gaat eerst omdat hij rechtdoor rijdt op een voorrangsweg, daarna gaat de bus die de voorrangsweg verlaat en als laatste de gele auto.', NULL, NULL, '2023-01-21 09:25:29', '2023-03-14 19:06:36'),
(180, 'UXlFeclF4KC0GdC', 'في أي من الحالات التالية يجب على السائقين إعطاء الأفضلية للمشاة ؟', 'In welke van de volgende situaties moet de bestuurder voorrang geven aan de voetganger?', 32, 17, 'mcq', 'uploads/question/JZmf301674300458.jpg', 25, 'عندما يغادر السائقين مخرج يجب إعطاء الأفضلية لكافة مستخدمي الطريق', 'Bij het verlaten van een uitrit moeten alle weggebruikers voorrang krijgen.', NULL, NULL, '2023-01-21 09:27:38', '2023-03-13 10:52:46'),
(181, 'boGOkifMynD411v', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/73RCdZ1674300574.jpg', 26, 'السيارة الأولى من الرتل العسكري عبرت التقاطع المتساوي لذلك لا يحق لأحد قطعهم وسيذهب الرتل أولاً ، ثم السيارة الحمراء القادمة من يمين السيارة البيضاء ، وأخيراً السيارة البيضاء', 'De eerste auto van de militaire colonne is overgestoken op het gelijke kruispunt, dus niemand heeft het recht om ze af te snijden. De militaire colonne gaat als eerste, dan de rode auto die van rechts van de witte auto komt en als laatste de witte auto.', NULL, NULL, '2023-01-21 09:29:34', '2023-03-10 15:56:13'),
(182, 'Y3YVLjgdJe1eFjJ', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/MzTxc61674300693.jpg', 27, 'يجب إعطاء الأفضلية للسائقين الذين يغادرون الخط السريع', 'De voorrang moet worden gegeven aan bestuurders die de snelweg willen verlaten.', NULL, NULL, '2023-01-21 09:31:33', '2023-03-10 15:57:35');
INSERT INTO `questions` (`id`, `question_uuid`, `question_ar`, `question_nl`, `exam_category_id`, `exam_id`, `question_type`, `question_image`, `arrangment`, `answer_explanation_ar`, `answer_explanation_nl`, `question_en`, `answer_explanation_en`, `created_at`, `updated_at`) VALUES
(183, 'ok9YFaZWX0A7RUR', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 32, 17, 'drag_drop', 'uploads/question/aatCmg1674300806.jpg', 28, 'السيارة البيضاء تنعطف و تغادر الدوار (من ينعطف يفقد الأفضلية) أما الفيتس يتابع السير في الدوار لذلك سيذهب أولاً', 'De witte auto slaat af en verlaat de rotonde (wie afslaat verleent voorrang) terwijl de fietser op de rotonde blijft rijden, dus de fietser mag eerst.', NULL, NULL, '2023-01-21 09:33:26', '2023-03-14 19:08:02'),
(189, 'ouA3G6M7sclzyFY', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/e45DfV1677608514.png', 1, 'في الطرقات التي تحوي تضيقات يتم يتنظم السير بها من خلال لوحات مرورية دائرية حمراء و مربعة زرقاء،حيث اللوحة الدائريه الحمراء  تحرمك من حق الأفضلية بينما في اللوحة المربعة الزرقاء تمنحك حق الأفضلية \r\nلذلك ستذهب السيارة البيضاء أولا ثم السيارة الحمراء', 'Op wegen met een smalle rijstrook wordt het verkeer geregeld door middel van rode ronde verkeersborden en blauwe vierkante borden, waarbij het rode ronde bord je het recht van voorrang ontzegt, en het blauwe vierkante bord je het recht van voorrang geeft.', NULL, NULL, '2023-02-28 17:21:54', '2023-03-14 17:29:08'),
(190, '7iMYl8bQoGF3HI2', 'رتب الأفضلية؟', 'Wat is hier de juist volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/cNJ4791677608593.jpg', 2, 'السيارة البيضاء تذهب أولاً لأنها تتابع السير على طريق رئيسي ، ثم تذهب السيارة السوداء التي تنعطف و تغادر الطريق الرئيسي ، ومن ثم سيذهب البايسكل الذي لا يعطي الأفضلية للمشاة لأنه يرى كتفه ، وأخيراً المشاة', 'De witte auto gaat eerst omdat hij rechtdoor wilt op de voorrangsweg, dan gaat de zwarte auto die afslaat en de weg verlaat, dan de fiets die geen voorrang hoeft te geven aan de voetganger, en tenslotte gaat de voetganger.', NULL, NULL, '2023-02-28 17:23:13', '2023-03-14 19:29:41'),
(191, '3cwbrqIUi4Y4MnJ', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/6YJbG21677608805.png', 3, 'الترام سينتظر لأن لديه أسنان قرش , لذلك ستذهب السيارة الحمراء أولاً لأنها تتابع السير على طريق رئيسي و من ثم ستذهب السيارة البيضاء التي تنعطف و تغادر الطريق الرئيسي (متحركان بنفس الشارع من ينعطف يفقد الأفضلية) وأخيراً سيذهب الترام', 'De tram zal wachten omdat hij haaientanden heeft, dus de rode auto gaat eerst omdat hij op een voorrangsweg rechtdoor gaat, dan gaat de witte auto die afslaat en de voorrangsweg verlaat en ten slotte gaat de tram.', NULL, NULL, '2023-02-28 17:26:45', '2023-03-14 19:30:33'),
(192, 'Qi5hRDvzUwmvsuE', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/LSL0eu1677608938.png', 4, 'كلا السيارتين تنعطفان في طريق المشاة و احداهما ترى بطن المشاة و الأخرى ترى ظهره لذلك سيذهب المشاة أولاً ، ومن ثم نطبق قاعدة الإلتفاف القصير قبل الإلتفاف الطويل ، أي السيارة البيضاء ثانياً و أخيراً السيارة الزرقاء (أسنان القرش تخص السائقين فقط ولا علاقة لها بالمشاة)', 'Wie afslaat verleent voorrang aan doorgaand verkeer, daarom dat eerst de voetganger gaan, daarna de witte auto omdat deze een kort bocht heeft en als laatste de blauwe auto omdat deze een lange bocht heeft.', NULL, NULL, '2023-02-28 17:28:58', '2023-03-14 19:32:07'),
(193, 'yqujyZSjWYAKopA', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/OEDBzG1677612224.png', 5, 'السيارة و الدراجة النارية لا يتوقفان للمشاة بهذه الحالة لأن كلاهما يرى كتف المشاة ، لذلك تذهب الدراجة النارية أولاً ثم السيارة البيضاء ( متحركان بنفس الشارع من ينعطف ينتظر) وأخيراً يذهب المشاة', 'Haaientanden regelen voorrang tussen bestuurders, daarom gaat eerst de motor daarna de witte auto en als laatst de voetganger', NULL, NULL, '2023-02-28 18:23:44', '2023-03-14 19:33:38'),
(194, 'I85RSaq15RYCTlt', 'من يذهب أولاً ؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/6qmdI51677612477.png', 7, 'السيارة السوداء تغادر مخرج و عندها يجب أن تعطي الأفضلية لكافة مستخدمي الطريق', 'De zwarte auto verlaat een uitrit en moet voorrang verlenen aan alle weggebruikers.', NULL, NULL, '2023-02-28 18:27:57', '2023-03-14 17:37:00'),
(195, 'SiT2rmv1taXQCTV', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/cZ3W1X1677612614.png', 8, 'كلا السيارتين تنعطفان في طريق المشاة و احداهما ترى بطن المشاة و الأخرى ترى ظهره لذلك سيذهب المشاة أولاً ، ومن ثم نطبق قاعدة الإلتفاف القصير قبل الإلتفاف الطويل ، أي السيارة البيضاء ثانياً و أخيراً السيارة السوداء', NULL, NULL, NULL, '2023-02-28 18:30:14', '2023-03-14 19:34:55'),
(196, 'VNsZwknYMAYYVBS', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/xP4rFO1678537855.jpg', 9, 'لا أفضلية للمشاة هنا ، لكنه قرر عبور الشارع مشكلا حالة خطرة ،لذلك توقف و دعه يذهب', 'Er is hier geen voorrang voor voetgangers, maar de voetganger is al overgestoken en belandt hierdoor in een gevaarlijke situatie, dus stopt de witte auto.', NULL, NULL, '2023-02-28 18:34:25', '2023-03-11 11:30:55'),
(197, 'xSLs5o6urKoUMdk', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/v6TjrF1677613089.png', 10, 'الترام لا يتوقف للمشاة بهذه الحالة لعدم وجود زيبراباد (ممر مشاة) وكذلك لن يتوقف للسيارة السوداء لأنه في تقاطع متساوي ، لذلك سيذهب الترام أولأ ، ثم سيذهب المشاة ثانياً لأن السيارة السوداء ترى ظهر المشاة وتنعطف في طريقه ، وأخير تذهب السيارة السوداء', 'De tram stopt in dit geval niet voor voetgangers omdat er geen voetgangersoversteekplaats is en hij stopt niet voor de zwarte auto omdat deze op een gelijk kruispunt staat, dus de tram gaat eerst, dan gaat de voetganger als tweede omdat de zwarte auto wil afslaan en ten slotte gaat de zwarte auto.', NULL, NULL, '2023-02-28 18:38:09', '2023-03-14 19:36:01'),
(198, 'tqRzyHqIp3ehtIg', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/aIpY3O1677613204.png', 11, 'في هذا النوع من الدوارات و الذي لا يحوي أسنان قرش يعتبر كأنه تقاطع متساوي و تطبق قاعدة (الأفضلية للقادم من جهة اليمين )', 'De ambulance gaat als eerste omdat deze van rechts van de witte auto komt, d.w.z. alsof het een gelijk kruispunt is.', NULL, NULL, '2023-02-28 18:40:04', '2023-03-07 09:17:34'),
(199, 'IEGv4mqnIYTEUFu', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/r9oiK31677613321.png', 12, 'عندما ينوي السائق مغادرة الدوار فهو فاقد لحقّ الأفضلية أي تُطبّق قاعدة من ينعطف ينتظر', 'Wanneer de bestuurder van plan is de rotonde te verlaten, moet hij voorrang verlenen aan voetgangers.', NULL, NULL, '2023-02-28 18:42:01', '2023-03-14 19:37:14'),
(200, 'znMMzYJKojhVscl', 'من يذهب أولاً ؟', 'Wie mag eerst?', 33, 18, 'mcq', 'uploads/question/Eh5Q7p1677614117.png', 13, 'الطرقات التي تحوي تضيقات يتم يتنظم السير بها من خلال لوحات مرورية دائرية حمراء و مربعة زرقاء،حيث نلاحظ في هذه الحالة السيارة(A) لديها اللوحة الدائريه الحمراء التي تحرمها حق الأفضلية\r\nوبالتالي ستكون اللوحة المربعة الزرقاء التي تعطي حق الأفضلية بجهة السيارة (B) وهي مغطاة بالثلج\r\nلذلك ستذهب السيارة (B) أولا ثم (A)وهكذا بالنسبة لباقي السائقين(سائق من كل جهة بالتتالي) .', 'De wegen met versmallingen worden gereguleerd door ronde rode en vierkante blauwe verkeersborden, auto A een ronde rode plaat die hem de voorrang ontzegt. De blauwe vierkante plaat die voorrang geeft, bevindt zich dus aan de zijkant van de auto B terwijl deze bedekt is met sneeuw. Dus auto B gaat eerst, dan A en zo verder voor de rest van de bestuurders.', NULL, NULL, '2023-02-28 18:45:18', '2023-03-14 17:53:43'),
(201, 'iLjVsuAtLXQNfdA', 'من يذهب أولاً؟', 'Wie mag eerst?', 33, 18, 'mcq', 'uploads/question/RP5iGn1677613852.png', 6, 'السيارة السوداء تذهب أولاً لانها تسير على طريق رئيسي ، حيث أنها لم تنعطف وتغير مسارها إنما الطريق هو الذي انعطف ، لذلك تعتبر قادمة من يسار المشاة و سيارة الشرطة', 'De zwarte auto gaat als eerste omdat deze op een voorrangsweg rijdt.', NULL, NULL, '2023-02-28 18:50:52', '2023-03-14 19:34:01'),
(203, 'pe75txahsCcevKG', 'من يذهب أولاً ؟', 'Wie mag eerst?', 33, 18, 'mcq', 'uploads/question/JVgoha1677614291.png', 14, 'الأشخاص الذين تكون حركتهم بطيئة والشخص الضرير دائماً نعطيهم الأفضلية', 'Mensen die slecht te been zijn laten we altijd voor gaan.', NULL, NULL, '2023-02-28 18:58:11', '2023-03-14 19:40:07'),
(205, 'a6afZXFl9QcXosh', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/eQ73W71677614426.png', 15, NULL, NULL, NULL, NULL, '2023-02-28 19:00:26', '2023-03-07 09:32:02'),
(206, 'zBc9x31fhAyL0mT', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/BeQNQL1677622008.png', 16, 'أسنان القرش تخص السائقين فقط ، حيث سائق السيارة يرى كتف المشاة لذلك لا يعطي الأفضلية للمشاة', 'Haaientanden regelen de voorrang alleen tussen bestuurders. Voetgangers zijn geen bestuurders en daarom gaat de auto eerst.', NULL, NULL, '2023-02-28 21:06:48', '2023-03-14 19:42:27'),
(207, 'tpCmuUNsMUbRRoI', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/KAvkLp1677622110.png', 17, 'لوحة ستوب تخص السائقين فقط ، حيث سائق السيارة يرى كتف المشاة لذلك لا يعطي الأفضلية للمشاة', 'Het stopbord regelt voorrang tussen bestuurders alleen. voetganger is geen bestuurder daarom gaat eerst de auto voor.', NULL, NULL, '2023-02-28 21:08:30', '2023-03-14 19:44:23'),
(208, 'kL8qxk2XDo1H9rt', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'mcq', 'uploads/question/zi68MN1677622197.png', 18, 'السيارة البيضاء تذهب أولا لأنها تتابع السير للأمام ولا تنعطف و لا تعطي الأفضلية للمشاة لأنها ترى كتفه ، ومن ثم يذهب المشاة والسيارة الزرقاء معاً لأن حركتهما لا تتقاطعان', NULL, NULL, NULL, '2023-02-28 21:09:57', '2023-03-14 19:47:20'),
(209, 'N5JIQ5ZSgeFGPix', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/t6tItS1677622320.png', 19, 'كلا السيارتين تنعطفان في طريق المشاة و احداهما ترى بطن المشاة و الأخرى ترى ظهره لذلك سيذهب المشاة أولاً ، ومن ثم نطبق قاعدة الإلتفاف القصير قبل الإلتفاف الطويل ، أي السيارة البيضاء ثانياً و أخيراً السيارة الزرقاء', 'Wie afslaat verleent voorrang aan doorgaan verkeer. Daarom gaat de voetganger eerst, daarna korte bocht voor de lange bocht', NULL, NULL, '2023-02-28 21:12:00', '2023-03-14 19:48:30'),
(210, 'ihRWGiuqRengQyT', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/I3mzAn1678538621.jpg', 20, 'لا تتغير قواعد الأفضلية بين السائقين والمشاة داخل الحي السكني', 'De voorrangsregels tussen automobilisten en voetgangers veranderen niet binnen het woonerf.', NULL, NULL, '2023-02-28 21:16:29', '2023-03-12 20:47:15'),
(211, 'cqBX7B4cGQ61kch', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/iYxdV61678538912.jpg', 21, 'أنت تغادر حي سكني ويجب إعطاء الافضلية لكافة مستخدمي الطريق', 'Je verlaat een woonerf en moet alle weggebruikers voor laten gaan.', NULL, NULL, '2023-02-28 21:19:22', '2023-03-12 20:47:32'),
(212, 'xxf4AjJQkdUH604', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/GKnKMI1677622870.png', 22, 'المشاة في هذه الحالة أصبح في منتصف الجسر ولامجال لدخول السيارة لأنها ستشكل خطر على المشاة لذلك توقف ودعه يذهب قبلك', 'In dit geval bevindt de voetganger zich op het midden van de brug en is er geen ruimte voor de auto om over te steken. Omdat dit een gevaar vormt voor de voetganger, stop je en laat je de voetganger voor gaan. Het bord geldt voor bestuurders en geldt niet voor voetgangers.', NULL, NULL, '2023-02-28 21:21:10', '2023-03-14 17:57:48'),
(213, 'DV4QsqkcBl0jVir', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/HV7jvn1677623009.png', 23, 'المشاة في هذه الحالة أصبح في منتصف الجسر ولا مجال لدخول السيارة لأنها ستشكل خطر على المشاة لذلك توقف ودعه يذهب قبلك', 'In dit geval bevindt de voetganger zich in het midden van de brug en is er geen ruimte voor de auto om over te steken. Omdat deze een gevaar vormt voor de voetganger, stop je en laat je de voetganger voor gaan.', NULL, NULL, '2023-02-28 21:23:29', '2023-03-14 17:58:08'),
(214, 'bd66X5xHRmNirXO', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/D3TSnF1677623102.png', 24, 'عندما تنوي الدخول أو مغادرة مكان الباركير يجب إعطاء الأفضلية لكافة مستخدمي الطريق', 'Bij bijzondere manoeuvre laat je al het verkeer voorgaan.', NULL, NULL, '2023-02-28 21:25:02', '2023-03-14 19:51:04'),
(215, '9n0dNKxznWTQwFC', 'من يذهب أولاً؟', 'Wie mag eerst?', 33, 18, 'mcq', 'uploads/question/cSLWdY1677623206.png', 25, 'المشاة يذهب أولاً لأن لديه ممر المشاة و من ثم سيذهب الترام والسيارة البيضاء معاً لأن حركتهما لا تتقاطعان', 'De voetganger gaat eerst omdat die de voetgangersoversteekplaats heeft, en dan gaan de tram en de witte auto samen omdat hun beweging elkaar niet kruist.', NULL, NULL, '2023-02-28 21:26:46', '2023-03-14 19:52:52'),
(216, 'yVR1EAwL93SEPAu', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/02Kno91677623317.png', 26, 'السبب: عندما تغادر الدوار يجب إعطاء الأفضلية لكافة المتحركات على خانة الفيتس المحاذية للدوار\r\n\r\n،أي من يُريد تغير إتجاهه يجب أن يُعطي الأفضلية لمن يُريد متابعة الدوران\r\n\r\n(إذا كانت خانة الفيتس بعيده عن الدوار أو منظمة بأسنان قرش أو إشارة ضوئية ،هذه القاعدة لاتُطبّق)', 'Bij het verlaten van de rotonde moet al het verkeer op het fietspad naast de rotonde voorrang krijgen. Wie van richting wil veranderen, moet voorrang verlenen aan al het verkeer.', NULL, NULL, '2023-02-28 21:28:37', '2023-03-14 19:53:51'),
(217, 'IHzhMk3KhzjG9jI', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 33, 18, 'drag_drop', 'uploads/question/vTJG9C1677623399.png', 27, 'لا تتغير قواعد الأفضلية بالنسبة للمشاة إذا كنت تنوي دخول الدوار ، لكن المشاة يشكل خطر بهذه الحالة فهو متقدّم كثيراً لذلك توقف و دعه يذهب قبلك .', 'De voorrangsregels voor voetgangers veranderen niet als je van plan bent de rotonde op te gaan, maar de voetganger vormt in dit geval een gevaar omdat hij ver vooruit is, dus stop je en laat je de voetganger voor gaan.', NULL, NULL, '2023-02-28 21:29:59', '2023-03-16 12:17:52'),
