(220, 'DnPK1IBy1XOthtt', 'في أي من الحالتين تتوقع سائقين من يمينك؟', 'In welke situatie kun je bestuurders van de rechts verwachten?', 31, 16, 'mcq', 'uploads/question/fYG4dR1677666011.png', 13, 'في الحالة A لوحة الإتجاه التي تكون بلون أصفر تعني أن هناك تحويلة للطريق (طريق بديل)\r\n\r\nأو أعمال صيانة وأنت غير مجبر على إتباعها،أما لوحة الإتجاه في الحالة B\r\n\r\nتوجد في التقاطعات على شكل حرف T\r\n\r\nوهي تُجبر جميع السائقين على إتباع إتجاه السهم.', 'In situatie A betekent het gele richtingsbord dat er een omleiding (alternatieve route) of onderhoudswerkzaamheden is en dat je deze niet hoeft te volgen. \r\n\r\nIn situatie B staat het richtingsbord op kruispunten in de vorm van de letter T, en het verplicht alle bestuurders om de richting van de pijl te volgen.', NULL, NULL, '2023-03-01 09:20:11', '2023-03-14 19:18:03'),
(221, '6vTrSXurmCwByNg', 'ما هي نسبة الكحول المسموحة في دم السائق المبتدئ إذا كان عمره ١٧ عام ؟', 'Wat is het toegestane percentage alcohol in het bloed van een 17 jarige beginnende bestuurder?', 31, 16, 'mcq', 'uploads/question/uK1LNJ1677666102.png', 14, 'الأشخاص دون سن الثامنة عشرة ممنوع عليهم شرب الكحول', 'Personen onder de 18 jaar mogen geen alcohol drinken.', NULL, NULL, '2023-03-01 09:21:42', '2023-03-14 19:18:42'),
