(227, 'DKcZF6eQBUgVdOZ', 'أنت تقود على هذا طريق هل يجب عليك التوقف لإعطاء الأفضلية ؟', 'Je rijdt op deze weg, moet je stoppen om voorrang te geven?', 31, 16, 'mcq', 'uploads/question/IzdioH1677666825.png', 20, 'السبب: الرجل ذو الأحتياجات الخاصة نحاول دائما اعطاءه الطريق', 'We proberen altijd voorrang te geven aan mensen met speciale behoeften.', NULL, NULL, '2023-03-01 09:33:45', '2023-03-14 19:20:51'),
