(231, 'HyenHR3CDTg4FK8', 'هل يُسمح لك أن تدع أحد الركاب يجلس في المنزل المتنقل (الكرفان)أثناء القيادة؟', 'Mag je een passagier in de caravan laten zitten tijdens het rijden?', 31, 16, 'mcq', 'uploads/question/CeCkQ61677667214.png', 24, 'السبب: لأن الكرفان غير مجهز بأحزمة الأمان.', 'Reden: Omdat de caravan niet is voorzien van veiligheidsgordels.', NULL, NULL, '2023-03-01 09:40:14', '2023-03-04 13:54:23'),
(232, 'LRAHnsRxnoWa2pX', 'ماذا تفعل بهذه الحاله ؟', 'Wat doe je in deze situatie?', 31, 16, 'mcq', 'uploads/question/xFSwgr1677667295.png', 25, 'هنا المشاه في حاله خطر لانه خطا الخطوه الاولى في الطريق', NULL, NULL, NULL, '2023-03-01 09:41:35', '2023-03-10 13:55:41'),
(233, 'D1lj68v45lTnQP0', 'اذا تناولت كمية دواء أكثر من الوصفة الطبية ، هل يحق للشرطة مخالفتك عند القيادة ؟', 'Als je meer medicijnen hebt ingenomen dan voorgeschreven tijdens het rijden, heeft de politie dan het recht je een boete te geven?', 31, 16, 'mcq', 'uploads/question/5lszhB1677667373.png', 26, 'بعض انواع الادويه لها تاثير على سرعه رده الفعل والادراك لذلك لا يجوز تناول كميه اكبر من الوصفه الطبيه', 'Sommige soorten medicijnen hebben invloed op je rijvaardigheid, dus het is niet toegestaan ​​om een ​​grotere hoeveelheid dan voorgeschreven in te nemen.', NULL, NULL, '2023-03-01 09:42:53', '2023-03-14 19:22:40'),
