(235, 'BHwl480p2UILrvE', 'أي من الإطارات التالية يسبب انزلاق اكثر؟', 'Welke van de volgende banden veroorzaakt meer slip?', 31, 16, 'mcq', 'uploads/question/7UI50Q1677667542.png', 28, ' ضغط لإطار مرتفع جدا وسطح التماس بين الاطار وسطح الطريق قليل مما يؤدي الى إنزلاق اكثر', 'De bandenspanning is erg hoog en het contactoppervlak tussen de band en het wegdek is laag, wat leidt tot meer slip.', NULL, NULL, '2023-03-01 09:45:42', '2023-03-04 14:02:37'),
(236, 'Lol2iGrSZICyONv', 'أنت على الخط السريع و مستوى الوقود قليل  في خزان السيارة وقد فاتك المخرج إلى محطة الوقود, هل يسمح لك بالرجوع إلى الخلف للدخول في محطة الوقود؟', 'Je bevindt je op de snelweg en het brandstofniveau van de auto is laag , je hebt de afslag naar het tankstation gemist. Mag je terug keren?', 34, 19, 'mcq', 'uploads/question/X4H2wu1677669669.png', 1, 'يُمنع الإلتفاف والعودة والرجوع للخلف على الخط السريع', 'Draaien, keren en achteruitrijden op de snelweg is verboden.', NULL, NULL, '2023-03-01 10:21:09', '2023-03-14 16:50:23'),
(237, 'gJ9y2zz2baPgG5A', 'أنت تقود السيارة البيضاء في أي من الحالتين يجب عليك التوقف؟', 'Je rijdt de witte auto, in welke situatie moet je stoppen?', 34, 19, 'mcq', 'uploads/question/qOoOZo1677669948.png', 2, 'في الحالة (A) شرطي المرور يطلب من جميع السائقين التوقف ، أما في الحالة (B) شرطي المرور يقوم بمد ذراعيه و يطلب من القادمين من أمامه وخلفه التوقف', 'In geval (A) vraagt de verkeersregelaar alle automobilisten om te stoppen, terwijl in geval (B) de verkeersregelaar zijn armen uitsteekt en vraagt het verkeer wat hem van voor en achter nadert om te stoppen.', NULL, NULL, '2023-03-01 10:25:48', '2023-03-14 18:18:29'),
(238, '46obcC7FLciO3A2', 'أنت تقود السيارة البيضاء و خلفك سيارة إسعاف مع الضوء والصوت التحذيري ماذا تفعل؟', 'Je rijdt hier in de witte auto en achter je een rijdt een ambulance met optische en geluidssignalen, wat doe je?', 34, 19, 'mcq', 'uploads/question/IenNnb1677670006.png', 3, 'سياره الاسعاف تمر عادتا ( في حالات الطوارئ ) ما بين , الخانه ما قبل الاخيره الى اليسار, والخانة الاخيره الى اليسار.', NULL, NULL, NULL, '2023-03-01 10:26:46', '2023-03-14 18:21:39'),
(239, 't9uPyTlCmzwY7aa', 'رتب الأفضلية بهذه الحالة؟', 'Wat is de juiste volgorde van voor laten gaan?', 34, 19, 'drag_drop', 'uploads/question/nCveeJ1677670144.png', 4, 'الرتل العسكري يتوقف عند أسنان القرش لإعطاء الأفضلية للسائقين من اليمين واليسار ،ولدينا سائقان على الطريق الرئيسي ومن ينعطف يفقد الافضلية أمام من يريد متابعة السير للأمام', 'De militaire colonne stopt bij de haaientanden om de voorrang te verlenen aan kruisende bestuurders. We hebben twee bestuurders op de voorrangsweg, en wie afslaat verleent voorrang voor degenen die rechtdoor willen.', NULL, NULL, '2023-03-01 10:29:04', '2023-03-14 18:23:45'),
(240, 'YgCEhRodV0XOrIf', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 34, 19, 'drag_drop', 'uploads/question/2mrZMy1677670298.png', 5, 'الافضلية لك لانه لديك اللوحة المرورية المربعة الزرقاء و التي تعني  الافضلية لك عند التضيقات . و الطرف المقابل يملك لوحة مرورية مدورة تعني اعطاء الافضلية للغير عند التضيقات', 'Jij krijgt voorrang want je hebt het blauwe vierkante verkeersbord, wat betekent dat je voorrang hebt op een versmalde weg . En de andere kant heeft een rond verkeersbord, wat betekent dat je voorrang verleent aan anderen op een versmalde weg.', NULL, NULL, '2023-03-01 10:31:38', '2023-03-14 18:26:04'),
(241, 'xX1opoJCJ1B7smz', 'تقود مركبه مع مقطوره هل يُسمح لك تجاوز السيارة الحمراء ؟', 'Je rijdt de witte auto met aanhanger, mag je de rode auto inhalen?', 34, 19, 'mcq', 'uploads/question/GiSURS1677670447.png', 6, 'القانون لا يمنعك من التجاوز عندما تجر مقطورة ، ولكن يجبرك بالإلتزام بالمسارين أقصى اليمين في حال تجاوز الطول سبة أمتار و يمنعك من تجاوز حدود السرعة الخاصة بحالتك هذه.', 'De wet verbied je niet om in te halen wanneer je een aanhangwagen trekt, maar je moet de  twee uiterst rechtse rijstroken gebruiken als de lengte meer dan 7 meter bedraagt.', NULL, NULL, '2023-03-01 10:34:07', '2023-03-14 18:27:14'),
(242, 'BPIrxHXKqXukDvp', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 34, 19, 'drag_drop', 'uploads/question/qFluqc1677670557.png', 7, 'التقاطع متساوي و رتل الجنازة لم يقطع التقاطع اذا يعتبر سائق عادي وبما أن الترام متساوي مع السائقين فالأفضلية له ويذهب أولاً ،ثم ستذهب السيارة البيضاء لأنها قادمة من يمين رتل الجنازة و أخيراً الرتل', 'De kruising is gelijk en de rouwstoet is de kruising niet overgestoken, dus wordt deze als een normale bestuurder beschouwd, en aangezien de tram gelijk is aan de bestuurders heeft hij de voorrang en gaat hij eerst, daarna gaat de witte auto omdat deze rechts van de rouwstoet aankomt en tenslotte de rouwstoet.', NULL, NULL, '2023-03-01 10:35:57', '2023-03-04 18:18:51'),
(243, 'qqkvmpT1GgvTk2I', 'اذا كانت الوسادة الهوائية لا تعمل ، ما هي الطريقة الصحيحة لوضع الكرسي الخاص بالأطفال ؟', 'Wat is dan de juiste manier om de kinderstoel te plaatsen wanneer de airbag niet is ingeschakeld?', 34, 19, 'mcq', 'uploads/question/7PBcG51677670760.png', 8, 'يجب وضع الطفل كما في الحالة (ب) عند ما تكون الوسادة الهوائية لا تعمل وذلك لحماية الطفل وخاصة في حالات الحوادث والضغط على الفرامل بشكل مفاجئ', 'Wanneer de airbag niet is ingeschakeld moet het kind worden geplaatst zoals in situatie (b) om het kind te beschermen, vooral bij ongevallen en plotselinge remsituaties.', NULL, NULL, '2023-03-01 10:39:20', '2023-03-14 16:59:22'),
(244, 'zNLv3w4WPaOHOcY', 'ماذا تتوقع إذا تجاوزت الشاحنة؟', 'Wat kun je hier verwachten wanneer je de vrachtwagen inhaalt?', 34, 19, 'mcq', 'uploads/question/88iTSA1677671684.png', 9, 'الشاحنة تحميك الآن من الرياح، فإذا قمت بتجاوزها فسوف تدفع بك الرياح الشديدة يساراحيث جراب الرياح يشير إلى اتجاه الرياح يسارا.', 'De vrachtwagen beschermt je nu tegen de wind, als ls je hem passeert zal sterke wind je naar links duwen omdat  de windrichting naar links aangeeft.', NULL, NULL, '2023-03-01 10:54:44', '2023-03-14 17:01:14'),
(245, 'L98kgUyeDa22HOR', 'ماذا تفعل بهذه الحالة؟', 'Wat doe je in deze situatie?', 34, 19, 'mcq', 'uploads/question/JzUMb31677671755.png', 10, 'لا أفضلية للمشاة هنا ، لكنه قرر عبور الشارع قبلك ،لذلك توقف و دعه يذهب (الأفضلية لا تؤخد بالإجبار)', 'De voetganger heeft normaal gesproken geen voorrang, maar als voetgangers toch oversteken dan laten wij ze voor gaan omdat er direct een gevaar is. Voorrang moet je krijgen en niet nemen.', NULL, NULL, '2023-03-01 10:55:55', '2023-03-14 18:49:07'),
(246, 'ycTgcisXWB1rmob', 'من يذهب أولا؟', 'Wat is de juiste volgorde van voor laten gaan?', 34, 19, 'drag_drop', 'uploads/question/R3AfJL1677671881.png', 11, 'السبب أن خطوط ممر المشاة غير موجودة على مسار الترام لذلك لن يتوقف الترام لإعطاء الأفضلية للمشاة', 'De reden is dat de voetgangersoversteekplaats niet aanwezig is ​​op het tramspoor, dus de tram zal niet stoppen om voorrang te geven aan de voetganger.', NULL, NULL, '2023-03-01 10:58:01', '2023-03-14 18:50:21'),
(247, 'B3M6lEI6nz1jQss', 'اكتب في الفراغ أدناه كم متر تبعد عنك سكة القطار؟', 'Over hoeveel meter kan je een spoorwegovergang verwachten?', 34, 19, 'text_input', 'uploads/question/qrQp101677672005.png', 12, 'الإجابة 240 مترا.حسب اللوحة التي تشير إلى ثلاثة خطوط حمراء و كل خط أحمر يدل على ثمانين مترا وثلاث خطوط حمراء تدل على240 مترا.', 'Het antwoord is 240 meter, het bord heeft drie rode lijnen, en elke rode lijn geeft 80 meter aan.', NULL, NULL, '2023-03-01 11:00:05', '2023-03-14 18:58:02'),
(248, 'rPWxePbqrhgz89j', 'هل يُسمح لك تنزيل وتصعيد راكب هنا؟', 'Mag je hier iemand in- en uit laten stappen?', 34, 19, 'mcq', 'uploads/question/AprmkG1677672108.png', 13, 'الاجابة : نعم بسبب وجود الخط الأصفر المتقطع يُسمح تنزيل وتصعيد راكب', NULL, NULL, NULL, '2023-03-01 11:01:48', '2023-03-14 17:13:23'),
(249, '5gIU1wDdXweM2G0', 'تسحب عربة على الطريق السريع ماهي سرعتك القصوى في هذه الحالة ؟', 'Je trekt een aanhanger op de snelweg, wat de toegestane maximumsnelheid?', 34, 19, 'mcq', 'uploads/question/zXQBhk1677672182.png', 14, 'عندما تجر عربة خلفك تصبح سرعتك القصوى\r\n90 كيلو متر/ساعه  فقط', 'Als je een aanhanger trekt, is je maximumsnelheid slechts 90 km/u.', NULL, NULL, '2023-03-01 11:03:02', '2023-03-14 17:15:23'),
(250, 'RDQO81prTgXXQLG', 'في أي حالة تستطيع القيادة بسرعة  70  كم /سا؟', 'In welke van de volgende situaties mag je 70 km/u rijden?', 34, 19, 'mcq', 'uploads/question/bif3e81677672280.png', 15, 'في الحالة\r\nB\r\nانت ستصبح داخل المدينة و سرعتك القصوى 50 كيلو متر\r\nأما في الحالة\r\nA\r\nأنت ستصبح خارج المدينة وسرعتك القصوى 80 كيلو متر', 'In situatie B bevind jij je binnen de bebouwde kom met een maximale snelheid van 50 km. In situatie A bevind jij je buiten de bebouwde kom met een maximale snelheid van 80 km.', NULL, NULL, '2023-03-01 11:04:40', '2023-03-13 09:22:18'),
(251, 'eBWWpV5c5ndqJW4', 'ما هو الطول المحدد للأطفال دون سن الثامنة عشر كي يجلسو بمقاعد مخصصة لهم ؟', 'Wat is het lengtelimiet voor kinderen onder de achttien jaar om op een kinderstoel te zitten?', 34, 19, 'mcq', 'uploads/question/m69wTw1677672406.png', 16, 'الجواب : أقل من 135 سم\r\nالسبب: اذا كان طول الطفل أقل من 135 سم يجب وضعه بكرسي مخصص\r\nوهذا لا ينطبق على الأشخاص البالغين وطولهم أقل من 135 سم', 'Als het kind kleiner is dan 135 cm, moet het kind in een kinderstoel worden geplaatst, en dit geldt niet voor volwassenen met een lengte kleiner dan 135 cm.', NULL, NULL, '2023-03-01 11:06:36', '2023-03-14 17:17:25'),
(252, 'mkgZViNwEkDLPX5', 'عند أي خط يسمح لك تنزيل ركاب ؟', 'Bij welke lijn mag je passagiers afzetten?', 34, 19, 'mcq', 'uploads/question/OGIMPk1677672497.png', 17, 'السبب: عند الخط الاصفر المتصل ممنوع الوقوف والتوقف', 'Het is verboden te parkeren en te stoppen bij de doorgetrokken gele lijn.', NULL, NULL, '2023-03-01 11:08:17', '2023-03-14 17:17:43'),
(253, '2NaPxwNWv6zQEGx', 'أي من اللوحات التالية تدل على وجود فسحة توقف للبحث عن معلومات؟', 'Welke van de volgende borden geeft een informatiepunt aan?', 34, 19, 'mcq', 'uploads/question/dddpEq1677672577.png', 18, NULL, NULL, NULL, NULL, '2023-03-01 11:09:37', '2023-03-14 17:19:00'),
(254, 'bDqHMGs1D44Kmaz', 'أنت تقود السيارة البيضاء ،هل يُسمح لك الإنعطاف يساراً؟', 'Mag je hier linksaf?', 34, 19, 'mcq', 'uploads/question/E98puP1677686369.png', 19, NULL, NULL, NULL, NULL, '2023-03-01 14:59:29', '2023-03-14 17:19:21'),
(255, 'EGXE1ZkrOT6fEzv', 'أنت تقود داخل النفق وفجأة ظهر لك مؤشر زيت المحرك باللون الأحمر ماذا تفعل ؟', 'Je rijdt door de tunnel en plotseling knippert de motorolie-indicator rood, wat doe je?', 34, 19, 'mcq', 'uploads/question/skPLlB1677686497.png', 20, '    والسبب: يعتبر الوقوف داخل النفق من اخطر الحالات التي من الممكن ان تصادف السائقين\r\nلذلك حاول دائما ان تخرج من النفق  وتتوقف بعده فورا اذا كانت سيارتك بإمكانها متابعة السير\r\nحتى لو بدأ الدخان يتصاعد من تحت غطاء المحرك او ظهر رمز بلون أحمر', 'Parkeren in de tunnel wordt beschouwd als een van de gevaarlijkste situaties die automobilisten kunnen tegenkomen. Probeer daarom altijd de tunnel uit te komen en direct daarna te stoppen als jouw auto door kan rijden.Ook als er rook onder de motorkap vandaan komt of er een rood symbool verschijnt', NULL, NULL, '2023-03-01 15:01:37', '2023-03-14 17:20:11'),
(256, 'U1PdjMb2svndrLi', 'الرجل الضرير رفع العصا  ، ماذا تفعل بهذه الحالة؟', 'De slechtziende man heft zijn taststok op, wat doe je in deze situatie?', 34, 19, 'mcq', 'uploads/question/jvgaQg1677686601.png', 21, 'عندما يرفع الرجل الضرير عصاه فهو يحذرك أنه ينوي العبور', 'Wanneer een slechtziend persoon zijn taststok opheft, waarschuwt hij je dat hij van plan is om over te steken.', NULL, NULL, '2023-03-01 15:03:21', '2023-03-13 09:26:00'),
(257, 'sXCJlmTm9QFrceH', 'أي من الحالتين تتوقع وجود سائقين قادمين من يمينك؟', 'In welke van de twee situaties kun je bestuurders van rechts verwachten?', 34, 19, 'mcq', 'uploads/question/Y75JMl1677686689.png', 22, 'كلا اللوحتين تُخاطبانك انت فقط(السيارة البيضاء)ولاتخص السائقين من يمينك ويسارك ،ففي الحالةA\r\nأنت مُجبر على الإنعطاف يميناً\r\nأما في الحالة B\r\nيُمكنك الذهاب يميناً ويساراً\r\nأيضا في كل لوحة دائرية زرقاء تحوي سهم إتجاه نتوقع قادمين من الأمام.', 'Beide borden zijn alleen voor jou bestemd en zijn niet bestemd voor kruisende bestuurders. In situatie A moet je  rechtsaf slaan. In situatie B kun je links en rechts gaan, ook kun je tegenliggers verwachten.', NULL, NULL, '2023-03-01 15:04:49', '2023-03-14 17:22:37'),
(258, 'L8W8U6BlzzFgG4h', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 34, 19, 'drag_drop', 'uploads/question/OReCvE1677686802.png', 23, 'الفارس يعتبر سائق سواء كان راكب على حصانه أو يسير بجانبه والسائق الذي يخرج من طريق ترابي يعطي الأفضلية للسائقين من اليمين واليسار', 'De ruiter wordt beschouwd als een bestuurder, of hij nu op zijn paard rijdt of naast hem loopt, en de bestuurder die een onverharde weg verlaat verleent voorrang aan kruisende bestuurders.', NULL, NULL, '2023-03-01 15:06:42', '2023-03-04 21:35:44'),
(259, 'Lax5xGPmpxV4fxJ', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 34, 19, 'mcq', 'uploads/question/1qywa01678825112.jpg', 24, 'أمامك منعطف.وفي حالات الثلج، يجب أن تكون حذرا.من تشكل الجليد على السطح الإسفلتي لذلك من الأفضل عدم استخدام الفرام.ورفع القدم عن دواسة الوقود فقط.', 'Er is een bocht voor je, en bij sneeuw moet je oppassen tegen ijsvorming op het asfalt het is dus beter om de remmen niet te gebruiken en alleen het gas loslaten.', NULL, NULL, '2023-03-01 15:08:16', '2023-03-14 19:18:32'),
(260, '9x5dZ21SZ14emLV', 'الحمولة بارزة متر و نصف خلف العربة ،هل يجوز القيادة بهذا الشكل ؟', 'De lading steekt anderhalve meter achter de aanhangwagen uit, is het toegestaan om zo te rijden?', 34, 19, 'mcq', 'uploads/question/4dSYMN1677686995.png', 26, 'الجواب لا .\r\n\r\nلأنه عند بروز الحمولة أكثر من متر خلف العربة يجب وضع لوحة تحذيرية( لوحة مخططة بشكل قطري أحمر و أبيض ) في نهاية الحمولة  . و لا يجوز وضع قطعة قماش أو أي شيئ أخر بغرض التحذير .', 'Wanneer de lading meer dan een meter achter de hanger uitsteekt moet er een markeringsbord (een rood-wit diagonaal gestreept bord) aan het einde van de lading worden geplaatst. Het is niet toegestaan om een stuk stof of iets anders te plaatsen ter waarschuwing.', NULL, NULL, '2023-03-01 15:09:55', '2023-03-14 17:24:31'),
(261, 'lTiX0OQpJhgZNgF', 'في أي من هذه اللوحات المرورية، يجب عليك اتباع السرعة القصوى 90 كيلومترا في الساعة فوراً ؟', 'Bij welke van de bovenstaande verkeersborden moet je direct de maximumsnelheid van 90 km/u volgen?', 34, 19, 'mcq', 'uploads/question/aS2wgL1677687065.png', 27, 'اللوحة (B)تعني اتباع السرعة ٩٠فورا ومفعولها يبدأ بعد اللوحة ، أما اللوحة (C)تعني اتباع السرعة ٩٠ فوراً من مكان وجود اللوحة ولغاية ٥٠٠ متر بعدها', 'Bord (B) betekent dat de snelheid 90 km/u onmiddellijk na het bord wordt toegepast. Bord (C) betekent dat de snelheid 90 km/u onmiddellijk wordt gevolgd vanaf de locatie van het bord tot 500 meter erna.', NULL, NULL, '2023-03-01 15:11:05', '2023-03-13 09:30:19'),
(262, 'ZY9dnFsHYmwAA28', 'مستوى الرؤية   بسبب الضباب 40 مترهل يسمح لك بتشغيل ضوء الضباب الخلفي ؟', 'Het zicht is door de mist 40 meter, mag je het mistachterlicht aanzetten?', 34, 19, 'mcq', 'uploads/question/mbJnJT1677687208.png', 25, 'الجواب . نعم\r\n\r\nالسبب : ضوء الضباب الخلفي يستخدم\r\nاذا كان مدى الرؤية أقل من 50 متر\r\nفي الضباب والثلج فقط ويمنع\r\nتشغيله في المطر الكثيف', 'Het mistachterlicht wordt alleen gebruikt als het zichtbereik minder is dan 50 meter in mist en sneeuw en het is verboden om het in te schakelen bij hevige regen.', NULL, NULL, '2023-03-01 15:13:28', '2023-03-14 17:23:33'),
(263, '9m1MWql9wzwfMBF', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 34, 19, 'drag_drop', 'uploads/question/OggNC31677687296.png', 28, NULL, NULL, NULL, NULL, '2023-03-01 15:14:56', '2023-03-04 21:45:11'),
(264, 'mXz2srpncs87mxO', 'من يذهب اولأ؟', 'Wie mag eerst?', 35, 20, 'mcq', 'uploads/question/NAgNW21677687798.png', 1, 'واضح من الخطوط على الارض انه مكان مخصص للباركيرن واذا اردت مغادرة الباركيرن يجب اعطاء الافضليه للمشاة وكافة مستخدمي الطريق', 'Aan de belijning op de grond is duidelijk te zien dat het een plek is die is aangewezen voor het parkeren, en als je de parkeerplek wilt verlaten dien je voorrang te verlenen aan voetgangers en alle weggebruikers.', NULL, NULL, '2023-03-01 15:23:18', '2023-03-05 13:32:03'),
(265, 'w52TOZkdvmxWTAr', 'ما هو الإرتفاع الأقصى للحمولة فوق العربة أو السيارة ؟', 'Wat is de maximale hoogte van de lading boven aanhangwagen of de auto?', 35, 20, 'mcq', 'uploads/question/eSyh2Y1677687883.png', 2, 'الإرتفاع الأقصى للحمولة فوق العربة أو السيارة هو ٤متر إبتداءً من سطح الأرض ولا يحتاج لوحة تحذيرية', 'De maximale hoogte van de lading boven het voertuig of de auto is 4 meter, uitgaande van het grondoppervlak en er is geen waarschuwingsbord nodig.', NULL, NULL, '2023-03-01 15:24:43', '2023-03-05 13:53:05'),
(266, '7lTs23ajLuRW967', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 35, 20, 'drag_drop', 'uploads/question/8lY5Vr1677688300.jpg', 3, 'السيارة البيضاء لديها اللوحة المربعة الزرقاء التي تعطيها حق الأفضلية على السائقين القادمين من الأمام والذين لديهم اللوحة المدورة الحمراء التي تحرمهم من الأفضلية عند وجود تضيق في الطريق', 'De witte auto heeft het blauwe vierkante bord die hem de voorrang geeft ten opzichte van de tegenliggende bestuurder met het rode ronde bord die hem de voorrang ontzegt wanneer de weg smaller wordt.', NULL, NULL, '2023-03-01 15:31:40', '2023-03-13 08:53:42'),
(268, 'S3Oaspmnh2azlCA', 'إذا كنت ذاهب إلى زڤولا ، أي من اللوحات التالية تدل على التحويلة المؤقتة؟', 'Je wilt naar Zwolle, welke van de volgende borden is een tijdelijke verwijzing?', 35, 20, 'mcq', 'uploads/question/S5q7KD1677688430.png', 4, 'تدل اللوحة (c) على التحويلة المؤقتة المؤدية إلى زڤولا ،وأنت غير مجبر على اتباعها', 'Bord (c) geeft de tijdelijke omleiding naar Zwolle aan, deze hoef je niet te volgen.', NULL, NULL, '2023-03-01 15:33:50', '2023-03-05 13:55:18'),
(269, 'PO4gPDq5VlJqVWt', 'إجتزت الإمتحان النظري و العملي بنجاح . هل يحق لك قيادة السيارة قبل الحصول على بطاقة رخصة القيادة ؟', 'Je hebt het theorie- en praktijkexamen met goed gevolg afgelegd. Heb je het recht om een auto te besturen voordat je een rijbewijs hebt?', 35, 20, 'mcq', 'uploads/question/0RClRq1677688519.png', 5, NULL, NULL, NULL, NULL, '2023-03-01 15:35:19', '2023-03-05 14:35:00'),
(270, 'OLBbYzb8T4Mhbbn', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 35, 20, 'drag_drop', 'uploads/question/6s7kia1677688611.png', 6, 'السائق الذي يخرج من طريق ترابي يعطي الأفضلية للسائقين من اليمين واليسار على الطريق الإسفلتي أمامه،لذلك سيذهب البايسكل ثم السيارة البيضاء ومن بعدها التراكس ثم الفارس لأنه من ينعطف يفقد الأفضلية أمام من يريد متابعة السير للأمام', 'De bestuurder die een onverharde weg verlaat, verleent voorrang aan de kruisende bestuurders op de asfaltweg voor hem, dus de fiets gaat eerst, dan de witte auto, dan de tractor en dan de ruiter, want wie afslaat verliest de voorrang voor degenen die rechtdoor willen gaan.', NULL, NULL, '2023-03-01 15:36:51', '2023-03-13 08:55:27'),
(271, 'SEk1cjSRkVanc4A', 'هل يحق لك القيادة إذا كان حزام الأمان لكرسي الراكب الذي بجانبك معطل ، علماً بأنه فارغ لا يجلس عليه أحد ؟', 'Heb je het recht om te rijden als de veiligheidsgordel van de passagiersstoel naast je kapot is, wetende dat deze leeg is en er niemand op zit?', 35, 20, 'mcq', 'uploads/question/HvodDN1677688750.png', 7, 'يجب أن تكون جميع أحزمة الأمان تعمل وبحالة جيدة', 'Alle veiligheidsgordels moeten werken en in goede staat zijn.', NULL, NULL, '2023-03-01 15:39:10', '2023-03-05 14:35:24'),
(272, 'plXEVQiZJSFH8c7', 'أي مخرج من مخارج الدوار التالية تؤدي الى التحويلة الدائمة(الطريق الاحتياطي) ؟', 'Welke van de volgende afslagen op de rotonde leidt naar de definitieve omleiding (de reserveweg)?', 35, 20, 'mcq', 'uploads/question/jtbEsD1677688861.png', 8, 'التحويلة الدائمة(‏الطريق الاحتياطي)\r\nuitwijkroute\r\n و يرمز له بلوحة إضافية صغيرة تحوي سهم اتجاه و عليها حرف\r\nU\r\n  .و هو طريق تحويل دائم لحركة المرور في حالة إغلاق الطريق السريع أو عدم توفره جزئيا‏', 'Permanente omleiding uitwijkroute, die wordt gesymboliseerd door een klein extra bord met een richtingspijl met de letter U. Het is een permanente omleiding van het verkeer voor het geval de snelweg is afgesloten of gedeeltelijk niet beschikbaar is.', NULL, NULL, '2023-03-01 15:41:01', '2023-03-05 14:02:15'),
(273, 'jN7BYtstG4L1ADv', 'ماذا تعني هذه اللوحة ؟', 'Wat betekent dit bord?', 35, 20, 'mcq', 'uploads/question/pwIPhF1677688961.png', 9, 'هذه اللوحة إرشادية تتواجد داخل المدينة و تدل على أرقام الأحياء الموجودة فيها', 'Dit bord bevindt zich binnen de bebouwde kom en geeft de nummers van de wijken aan.', NULL, NULL, '2023-03-01 15:42:41', '2023-03-13 08:56:54'),
(274, 'nBq0xsWAnZnNFih', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 35, 20, 'drag_drop', 'uploads/question/4gsWxG1677689054.png', 10, 'السيارة البيضاء ترى كتف المشاة فلا تعطيه الأفضلية و الترام لا يتوقف للمشاة اذا لم يتواجد معبر مشاة ،واذا تساوى الترام مع السائقين فالأفضلية له.', 'De witte auto ziet de schouder van de voetganger, dus geeft hem geen voorrang, en de tram stopt niet voor voetgangers als er geen voetgangsersoversteekplaats is, en als de tram gelijk is aan de bestuurders, dan heeft hij de voorrang.', NULL, NULL, '2023-03-01 15:44:14', '2023-03-13 09:01:16'),
(275, 'a91CbS6bwqJrebH', 'ما الذي سيحدث لزمن ردة الفعل إذا كنت تستخدم إطار شتوي في فصل الصيف؟', 'Wat gebeurt er met je reactietijd als je in de zomer een winterband gebruikt?', 35, 20, 'mcq', 'uploads/question/R0nbpS1677689182.png', 11, 'السبب:زمن ردة الفعل يتعلّق بالسائق وإنتباهه ولا علاقة له بالخصائص الميكانيكية للسيارة', 'De reden: de reactietijd is gerelateerd aan de bestuurder en zijn aandacht en heeft niets te maken met de mechanische eigenschappen van de auto.', NULL, NULL, '2023-03-01 15:46:22', '2023-03-05 14:09:29'),
(276, '6hFV6XqeUHN9KnI', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 35, 20, 'drag_drop', 'uploads/question/A0uQvu1677689273.png', 12, 'السيارة البيضاء لديها أسنان قرش وبالتالي يجب أن تعطي الأفضلية للقادمين من اليمين واليسار ،وبالتالي سيذهب الإلتفاف القصير(البايسكل) قبل الإلتفاف الطويل (السيارة الزرقاء)', 'De witte auto heeft haaientanden en zou daarom de voorrang moeten geven aan kruisende bestuurders dus de korte bocht (de fiets) gaat eerder dan de lange bocht (de blauwe auto).', NULL, NULL, '2023-03-01 15:47:53', '2023-03-05 14:11:12'),
(277, '9QjaXWhwJBR23pS', 'في أي من الحالتين يُسمح لك بالقيادة؟', 'In welke situatie is het toegestaan om te rijden?', 35, 20, 'mcq', 'uploads/question/8UyrYq1677689407.png', 13, 'الاجابة الصحيحة الحالة\r\nB\r\n السبب: يُمنع عليك القيادة اذا كان عداد السرعة معطل كما في الحالة\r\nA', 'Reden: je mag niet rijden als de snelheidsmeter kapot is, zoals in geval A.', NULL, NULL, '2023-03-01 15:50:07', '2023-03-13 09:02:18'),
(278, 'aGS5l8jPkXL8tL3', 'مدى الرؤية لديك أقل من 50 متر بسبب المطرالكثيف ،هل القيادة بهذه الوضعية صحيحة ؟', 'Je zichtbereik is minder dan 50 meter door een hevige regenval, is het toegestaan om op deze manier te rijden?', 35, 20, 'mcq', 'uploads/question/mWiSRr1677689461.png', 14, 'الإجابة الصحيحة : لا\r\nالسبب : ضوء الضباب الخلفي يستخدم\r\nاذا كان مدى الرؤية أقل من 50 متر\r\nفي الضباب والثلج فقط ويمنع\r\nتشغيله في المطر الكثيف لأنه يسبب عمى للسائقين', 'Reden: Het mistachterlicht wordt alleen gebruikt als het zichtbereik minder is dan 50 meter bij mist en sneeuw, en het is verboden om het in te schakelen bij hevige regen omdat het bestuurders verblindt.', NULL, NULL, '2023-03-01 15:51:01', '2023-03-13 09:03:18'),
(279, 'MYS9UZ1m9ng8JIR', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 35, 20, 'drag_drop', 'uploads/question/ebcQIl1677689538.png', 15, 'السيارة البيضاء لديها أسنان قرش وبالتالي يجب أن تعطي الأفضلية للقادمين من اليمين واليسار ،وبما أن التراكس لديه عائق يجب عليه اعطاء الأفضلية للبايسكل', 'De witte auto heeft haaientanden, dus hij zou de voorrang moeten verlenen aan de kruisende bestuurders, en aangezien de tractor een obstakel heeft, zou hij voorrang moeten verlenen aan de fiets.', NULL, NULL, '2023-03-01 15:52:18', '2023-03-05 14:16:30'),
(280, 'g7xg5uM35VAym38', 'ماهي كمية الكحول المسموحة في دم سائق الدراجة الهوائية (فيتس) كحد أقصى بالبروميلي؟', 'Wat is de maximale toegestane hoeveelheid alcohol in het bloed van een fietser, in promille?', 35, 20, 'mcq', 'uploads/question/mEl0Z21677689643.png', 16, NULL, NULL, NULL, NULL, '2023-03-01 15:54:03', '2023-03-13 09:04:27'),
(281, '0ikITv3jDEMzYqI', 'تريد الذهاب إلى حركة التدفق المروي ، هل تقُود بالإتجاه الصحيح ؟', 'Je wilt naar het doorgaande verkeer, rijd je in de goede richting?', 35, 20, 'mcq', 'uploads/question/BCkuzE1677689909.png', 17, 'هذه اللوحة تدُل على اتجاه حركة التدفق المروري', 'Dit bord geeft de richting van de verkeersstroom aan.', NULL, NULL, '2023-03-01 15:58:29', '2023-03-05 14:18:35'),
(282, 'bQOfDQIpd2zfTJY', 'رتّب الأفضلية ؟', 'Wat is de juiste volgorde van voor laten gaan?', 35, 20, 'drag_drop', 'uploads/question/bdug921677689968.png', 18, 'السيارة البيضاء تذهب أولاً لأنها قادمة من يمين الدراجة النارية وبنفس الوقت لا تعطي المشاة أفضلية لأنها ترى كتفه ،ثم يذهب المشاة والدراجة النارية معاً لأن حركتهما لا تتقاطعان.', 'De witte auto gaat eerst omdat hij van rechts van de motor komt en geeft tegelijkertijd de voetganger geen voorrang omdat hij zijn schouder ziet, daarna gaan de voetganger en de motor samen omdat hun beweging elkaar niet kruist.', NULL, NULL, '2023-03-01 15:59:28', '2023-03-05 14:21:50'),
(283, 'Cs43sLbpVwkqzqW', 'هل يحقّ لك الإنعطاف يساراً بهذه الحالة؟', 'Mag je hier linksaf?', 35, 20, 'mcq', 'uploads/question/U6Nj8L1677690085.png', 19, 'الجواب نعم\r\n\r\nالسبب: مفعول اللوحة يبدأ ما بعدها ولا تخص الشارع الذي تنوي الدخول به', 'Reden: De geldigheid van het bord begint daarna en heeft geen betrekking op de straat die je wilt inrijden.', NULL, NULL, '2023-03-01 16:01:25', '2023-03-05 14:22:52'),
(285, 'bQxREbbWDbYt16A', 'تُريد الذهاب إلى محطة الوقود متى يجب عليك البدء بإعطاء إشارة ضوئية (غماز)؟', 'Je wilt naar het tankstation wanneer moet je een richtingssignaal geven?', 35, 20, 'mcq', 'uploads/question/YEmamm1677690761.png', 20, 'الاجابة : عند هذه اللوحة\r\nالسبب: يجب إعطاء إشارة ضوئية (غماز) قبل 300 متر\r\nمن مخرج الطريق السريع وكما تشير اللوحة أنه تبقّى 300 متر\r\nعلى المخرج الى محطة الوقود', 'Reden: Er moet 300 meter voor de afrit van de snelweg een richtingssignaal worden gegeven en het bord geeft aan dat er nog 300 meter over is bij de afrit naar het tankstation.', NULL, NULL, '2023-03-01 16:12:41', '2023-03-13 09:06:28'),
(286, 'RqUesvKBeBOnnqB', 'رتّب الافضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 35, 20, 'mcq', 'uploads/question/JddJMl1677690862.png', 21, 'الترام والسيارة البيضاء أولاً لأن حركتهما لا تتقاطعان وكذلك السيارة البيضاء ترى كتف المشاة لذلك لا تعطي المشاة أفضلية', 'De tram en de witte auto eerst, omdat hun beweging elkaar niet kruist, en de witte auto ziet ook de schouder van de voetganger, dus heeft de voetganger geen voorrang.', NULL, NULL, '2023-03-01 16:14:22', '2023-03-10 14:32:37'),
(287, 'v5EpqnsKlPoL0kK', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 35, 20, 'drag_drop', 'uploads/question/qvuGZ51677691004.png', 22, 'السائق الذي يخرج من طريق ترابي يعطي الأفضلية للسائقين من اليمين واليسار على الطريق الإسفلتي أمامه ،أما بالنسبه للسائق المقابل نطبق قواعد الأفضلية في حال عدم وجود لوحات تحدد الأفضلية ، وهنا متحركان بنفس الشارع من ينعطف يفقد الأفضلية أمام من يريد متابعة السير للأمام', 'Een bestuurder die een onverharde weg verlaat verleent voorrang aan de kruisende bestuurders op de asfaltweg voor hem. Wat de tegenliggende bestuurder betreft, passen we de voorrangssregels toe bij afwezigheid van voorrangsborden, en hier rijden ze verder in dezelfde straat. Wie afslaat verliest de voorrang tegenover degenen die rechtdoor willen.', NULL, NULL, '2023-03-01 16:16:44', '2023-03-13 09:07:26'),
(288, '3O80CeQEIFmYBxs', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 35, 20, 'drag_drop', 'uploads/question/1hnN8a1677691114.png', 23, ' البايسكل يذهب أولاً لأن الفارس يعتبر سائق سواء كان راكب على حصانه أو يسير بجانبه والسائق الذي يخرج من طريق ترابي يعطي الأفضلية للسائقين من اليمين واليسار فقط على الطريق الإسفلتي الذي أمامه وبنفس الوقت البايسكل قادم من يمين السيارة البيضاء فالأفضليه له ثم سيذهب الفارس قبل السيارة البيضاء لأنه من ينعطف يفقد الأفضلية', 'De fiets gaat eerst omdat de ruiter als bestuurder wordt beschouwd, of hij nu op zijn paard rijdt of naast hem loopt, en de bestuurder die een onverharde weg verlaat, geeft de voorrang aan kruisende bestuurders op de asfaltweg ervoor. Wie een afslaat verliest ook de voorrang.', NULL, NULL, '2023-03-01 16:18:34', '2023-03-13 09:08:06'),
(289, '5yn9e3dLKS8x3ws', 'الدراجة النارية تجاوزت أسنان القرش , من يذهب أولا؟', 'De motor is de haaientanden gepasseerd, wie mag eerst?', 35, 20, 'drag_drop', 'uploads/question/qBItIg1677691230.png', 24, '  من ينعطف يفقد  الأفضلية أمام من يريد متابعة السير للأمام', 'Degene die afslaat, verliest de voorrang ten opzichte van degene die rechtdoor willen gaan.', NULL, NULL, '2023-03-01 16:20:30', '2023-03-13 09:08:40'),
(290, 'IkOAJTh9pZARXIX', 'لقد وضعت الحمولة في مؤخرة العربة بهذا الشكل ،هل هذا صحيح؟', 'Je hebt de lading zo achter in de aanhangwagen gezet, mag dit?', 35, 20, 'mcq', 'uploads/question/13w8od1677691304.png', 25, 'الجواب لا\r\n\r\nالسبب: وضع الحمولة في مؤخرة العربة يسبب في اختلال توازن  السيارة مع العربه وهذا غير آمن لذلك يجب توزيع الحمولة بشكل آمن وجيد على العربة', 'Reden: Door de lading achter op de aanhangwagen te plaatsen, raakt de auto uit balans met de aanhangwagen en dit is niet veilig, dus de lading moet veilig en goed over de aanhangwagen worden verdeeld.', NULL, NULL, '2023-03-01 16:21:44', '2023-03-13 09:10:00');
INSERT INTO `questions` (`id`, `question_uuid`, `question_ar`, `question_nl`, `exam_category_id`, `exam_id`, `question_type`, `question_image`, `arrangment`, `answer_explanation_ar`, `answer_explanation_nl`, `question_en`, `answer_explanation_en`, `created_at`, `updated_at`) VALUES
(291, '5LXPBpG5OATflsb', 'أنت تقود السيارة البيضاء ،هل يسمح لك التجاوز في هذه الحالة؟', 'Je rijdt in de witte auto, mag je in deze situatie inhalen?', 35, 20, 'mcq', 'uploads/question/JuuM3c1677691403.png', 26, 'هذه اللوحة تمنع تجاوز جميع المركبات من نوع (موتور فورتاوخ ) بعضها البعض.', 'Dit bord verbiedt dat alle motorvoertuigen elkaar inhalen.', NULL, NULL, '2023-03-01 16:23:23', '2023-03-13 09:10:19'),
(292, 'CmzZrQFnuUFjWpJ', 'في أي من الحالات تكون  وضعية حزام الأمان صحيحة ؟', 'In welke gevallen is de gordelpositie correct?', 35, 20, 'mcq', 'uploads/question/Gop25f1677691513.png', 27, 'يجب أن يكون حزام الأمان مشدود و ملتصق بالجسم', 'De veiligheidsgordel moet strak zitten en vastzitten aan het lichaam.', NULL, NULL, '2023-03-01 16:25:13', '2023-03-05 14:32:03'),
(293, 'CYw0Ji9bWvnQ34L', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 35, 20, 'drag_drop', 'uploads/question/wQk9hW1677691605.png', 28, 'التقاطع متساوي لذلك نطبق قاعدة اليمين ، أي ستذهب السيارة البيضاء أولاً ثم سيارات الجيش وأخيراً السيارة السوداء .ملاحظة :اذا كانت سيارات الجيش بدون أعلام فلا تنطبق عليها قواعد الرتل العسكري', 'De kruising is gelijk, dus we passen de rechterhandregel toe, dat wil zeggen dat de witte auto eerst gaat, dan de legerauto\'s en als laatste de zwarte auto. Opmerking: als de legerauto\'s geen vlaggen hebben, gelden de regels van het leger colonne en zijn deze niet op hen van toepassing.', NULL, NULL, '2023-03-01 16:26:45', '2023-03-05 14:32:46'),
(294, 'tUIi8bqClL87XCC', 'أي من الإشارات الضوئية التالية يجب عليك إتباعها ؟', 'Welke verkeerslichten moet je hier volgen?', 36, 21, 'mcq', 'uploads/question/OtsGrF1677692029.png', 1, 'الإشارة الضوئية الحمراء تخص سائقي الباصات ونحن غير ملزمين بإتباعها', 'Het rode licht is voor busbestuurders.', NULL, NULL, '2023-03-01 16:33:49', '2023-03-14 15:26:01'),
(295, 'SB6ByEHnoyTgPe9', 'ما الذي تستخدمه لتحديد وقت تبديل الگير إلى سرعة أعلى ؟', 'Waarmee bepaal je wanneer je naar een hogere versnelling moet schakelen?', 36, 21, 'mcq', 'uploads/question/O6cY591677692095.png', 2, 'يجب تحويل الگير إلى سرعة أعلى عندما تصبح عدد دورات المحرك بين ٢٠٠٠-٢٥٠٠ دورة بالدقيقة', 'De versnelling moet naar een hogere snelheid worden geschakeld wanneer het aantal toeren tussen 2000-2500 tpm ligt.', NULL, NULL, '2023-03-01 16:34:55', '2023-03-08 13:30:15'),
(296, 'pHoZohIxKcL1qsf', 'كم عدد أضواء الفرامل التي يجب أن تكون سيارة الركاب مجهزة بها ؟', 'Hoeveel remlampen moet een auto hebben?', 36, 21, 'mcq', 'uploads/question/w8nZGI1678475962.jpg', 3, 'سيارات الركاب التي بدأ استخدامها لأول مرة بعد شهر أيلول من عام ٢٠٠١ يجب أن تكون مزودة بثلاثة أضواء للفرامل', 'Personenauto\'s die voor het eerst in gebruik zijn genomen na september 2001 moeten drie remlichten bevatten.', NULL, NULL, '2023-03-01 16:36:27', '2023-03-14 15:27:13'),
(297, '2kn0ah2QByutdNj', 'هل منطقة وقوف السيارات جزء من الطريق السريع؟', 'Maakt de vluchthaven deel uit van de snelweg?', 36, 21, 'mcq', 'uploads/question/gUsR9N1678480565.jpg', 4, NULL, NULL, NULL, NULL, '2023-03-01 16:38:18', '2023-03-14 15:30:01'),
(298, '5EvKu1rb26fmTjL', 'يوجد كسر في إحدى المرايا الجانبية ،هل يسمح لك بالقيادة؟', 'Een van de zijspiegels is kapot, mag je zo rijden?', 36, 21, 'mcq', 'uploads/question/t9xxDI1677692389.png', 5, ' بسبب الكسر لن تكون قادر على رؤية ما خلفك ، و لا يحق لك القيادة اذا كان هناك كسر في إحدى المرايا', 'Door de breuk kun je niet zien wat er achter je gebeurt en is het dus verboden om te rijden.', NULL, NULL, '2023-03-01 16:39:49', '2023-03-14 15:29:46'),
(299, '0wMJaIIn03Y08BR', 'لقد تسببت بحادث عندما كنت في حالة سكر ، هل يمكن لشركة التأمين أن تجعلك تدفع مقابل الضرر؟', 'Je hebt een ongeluk veroorzaakt toen je dronken was, mag de verzekeringsmaatschappij jou de schade laten betalen?', 36, 21, 'mcq', 'uploads/question/ec06Du1677692464.png', 6, NULL, NULL, NULL, NULL, '2023-03-01 16:41:04', '2023-03-14 15:30:49'),
(300, 'xZp72bBPs9gMtuI', 'متى يجب عليك القيام بفحص ضغط الإطارات ؟', 'Wanneer moet je een bandenspanning controle uitvoeren?', 36, 21, 'mcq', 'uploads/question/1hm3hh1677692577.png', 7, NULL, NULL, NULL, NULL, '2023-03-01 16:42:57', '2023-03-08 15:47:58'),
(301, 'NWWaRPtXx0AO6Vs', 'هل سخان الزجاج الخلفي يستهلك وقود أكثر؟', 'Verbruik je meer brandstof door de achterruitverwarming in te schakelen?', 36, 21, 'mcq', 'uploads/question/UsVDeA1677692663.png', 8, 'إن تشغيل أي جهاز اضافي في المركبة يتطلب وقود أكثر من الحالة الطبيعية لعمل المحرك', 'De werking van elk extra optie in het voertuig vraagt meer brandstof dan normaal.', NULL, NULL, '2023-03-01 16:44:23', '2023-03-14 15:32:14'),
(302, 'Wdc8usbqkXkNnMj', 'أي من الإطارات التالية يؤدي لصرف وقود أكثر ؟', 'Welke van de volgende banden heeft meer invloed op het brandstofverbruik?', 36, 21, 'mcq', 'uploads/question/jZOnwf1677692749.png', 9, 'سطح التماس مع الطريق في الإطار العريض أكبر منها في الإطار الرفيع وبالتالي مقاومة الإحتكاك في الاطار العريض أكبر وهذا سيؤدي بدوره إلى صرف وقود أكثر.', 'Het contactoppervlak met de brede band is groter dan dat van de dunne band, en daarom is de wrijvingsweerstand in de brede band groter, en dit leidt tot meer brandstofverbruik.', NULL, NULL, '2023-03-01 16:45:49', '2023-03-14 16:32:05'),
(303, 'JoEfmYDsyT5zpQC', 'في أي من الحالتين تقوم بصرف وقود أكثر ؟', 'In welke van de twee gevallen verbruik je meer brandstof?', 36, 21, 'mcq', 'uploads/question/ZmMJid1677699340.png', 10, 'في حالة الصعود تستهلك السيارة وقود أكثر', 'Tijdens een helling verbruikt de auto meer brandstof.', NULL, NULL, '2023-03-01 18:35:40', '2023-03-14 16:32:25'),
