(306, 'gvprTww93y6aVBb', 'هل جرّ العربة يؤثر على الأضوية ؟', 'Heeft de aanhangwagen invloed op de verlichting?', 36, 21, 'mcq', 'uploads/question/LB7CyV1677706293.png', 13, 'عندما تقوم بسحب عربة فإنها تسبب في ارتفاع مقدمة السيارة و الذي بدوره يؤدي إلى تغيير في توجه الإضاءة للأعلى', 'Wanneer je een aanhangwagen trekt, zorgt dit ervoor dat de voorkant van het voertuig omhooggaat, wat op een gegeven moment leidt tot een verandering in de richting van de boven verlichting.', NULL, NULL, '2023-03-01 20:31:33', '2023-03-14 16:34:02'),
(307, '21Nuy7fODvc6UeH', 'اذا كانت الشمس تغرب خلفك ، على من سيكون تأثيرها بشكل أكبر؟', 'Als de zon achter je zou verdwijnen, wie zou hier het meeste last van hebben?', 36, 21, 'mcq', 'uploads/question/CVLtMt1677706396.png', 14, 'عند شروق وغروب الشمس فإن أشعتها تكون موازية لسطح الأرض أي تكون الأشعة الضوئية متجهة مباشرة على السائقين ، فإذا كانت الشمس تغرب خلفك فإن أشعتها  ستؤثر على رؤيتك من خلال انعكاسها في المرايا ولكن بشكل قليل وستؤثر بشكل أكبر على السائقين القادمين من أمامك لأنها تتجه مباشرة على رؤيتهم', 'Bij zonsopgang en zonsondergang zijn de stralen evenwijdig aan het aardoppervlak, dat wil zeggen dat de lichtstralen direct op de bestuurders worden gericht, dus als de zon achter je ondergaat, zullen de stralen jouw zicht beïnvloeden door de reflectie in de spiegels, maar op een normale manier en dit zal meer invloed hebben op de bestuurders die voor je komen omdat het rechtstreeks op hun zicht is gericht.', NULL, NULL, '2023-03-01 20:33:16', '2023-03-14 16:36:12'),
(308, 'aYklHpXh4EhIwCL', 'على ماذا يؤثر ضغط الإطار المنخفض ؟', 'Wat is het effect van een lage bandenspanning?', 36, 21, 'mcq', 'uploads/question/ijHs4i1678482593.jpg', 15, 'ضغط الإطار المنخفض يؤدي إلى تماس أكبر بين أجزاء الإطار وسطح الطريق وهذا بدوره يؤدي إلى صدور أصوات مزعجة', 'Een lage bandenspanning leidt tot meer contact tussen de onderdelen van de band en het wegdek, wat weer leidt tot vervelende geluiden.', NULL, NULL, '2023-03-01 20:35:16', '2023-03-14 16:37:15'),
