(311, '5Ta6TyuWqK9E0p2', 'أنت تقود في طريق نزول ، ما هي الطريقة الأفضل لتخفيف السرعة ؟', 'Je rijdt bergafwaarts, wat is de beste manier om af te remmen?', 36, 21, 'mcq', 'uploads/question/8j4Ruf1677706885.png', 18, 'في حالة  النزول من الأفضل تخفيف السرعة بالإنتقال إلى رقم غيار  أقل لتجنب استهلاك الفرامل والحفاظ عليها', 'Bij een afdaling is het beter om af te remmen door naar een lager versnellingsnummer te schakelen om remslijtage te voorkomen.', NULL, NULL, '2023-03-01 20:41:25', '2023-03-14 16:39:05'),
(312, 'eaVkmB3cGFzKOGG', 'هل يسمح لك الدخول بهذا الطريق ؟', 'Mag je deze straat inrijden?', 36, 21, 'mcq', 'uploads/question/wdDI9U1677707046.png', 19, 'لا يوجد أي لوحة تمنعك من الدخول ، واللوحة المعدنية الصفراء تخبرك بإيقاف تشغيل جهاز الملاحة لأن الطريق جديد و غير مدرج في برنامج الملاحة و سيعطي معلومات خاطئة عن الطريق', 'Er is geen bord die dit verbiedt, het gele bord vertelt je om het navigatieapparaat uit te schakelen omdat de weg nieuw is en niet is opgenomen in het navigatieprogramma, en je verkeerde informatie zult ontvangen.', NULL, NULL, '2023-03-01 20:44:06', '2023-03-14 16:41:39'),
(313, '3j9d7FucJ2A9vRX', 'اذا كنت ذاهب الى utrecht ، هل تتموضع بشكل صحيح ؟', 'Als je naar Utrecht wilt, rijd je dan goed?', 36, 21, 'mcq', 'uploads/question/w4GT6d1677707149.png', 20, 'كما تُظهر اللوحة ، هناك مساران يؤديان الى اوتريخت وانت تتموضع في المسار اليمين وبالتالي تموضعك صحيح ،', 'Er twee rijstroken die naar Utrecht leiden en je bevind je op de rechterrijstrook en daarom rijd je goed.', NULL, NULL, '2023-03-01 20:45:49', '2023-03-14 16:42:42'),
(314, '5wQ6qy01JD56AYj', 'هل يسمح لك تنزيل و تصعيد راكب في هذا المكان ؟', 'Mag je hier een passagier in en -of uit laten stappen?', 36, 21, 'mcq', 'uploads/question/f3mrGW1677707265.png', 21, 'في أي موقف باركيرن يسمح لك تنزيل وتصعيد ركاب او بضائع', 'Op elke parkeerplaats mag je passagiers in- uit laten stappen en aflossen/inladen.', NULL, NULL, '2023-03-01 20:47:45', '2023-03-14 16:43:19'),
