(321, 'D5YWhF6RutJzHh8', 'صادفت شخص لديه ألم بالرقبة جراء حادث ، هل يسمح لك بتحريكه ؟', 'Je komt iemand tegen die nekpijn heeft als gevolg van een ongeluk, mag je hem verplaatsen?', 36, 21, 'mcq', 'uploads/question/TBDWiG1677707957.png', 28, 'يمنع تحريك الأشخاص الذين يعانون من ألم بالرقبة أو الظهر أو أي منطقة بالجسم تحوي أعصاب حساسة', 'Het is verboden om mensen te verplaatsen die last hebben van pijn in de nek, rug of enig lichaamsdeel dat gevoelige zenuwen bevat.', NULL, NULL, '2023-03-01 20:59:17', '2023-03-08 16:11:17'),
(322, 'y4Z5Jb3xdhrXYZD', 'هل أنت مجبر على الوقوف هنا ؟', 'Ben je verplicht om hier te stoppen?', 37, 22, 'mcq', 'uploads/question/1Bn20N1677708581.gif', 1, 'هذه الإشارة الضوئية تومض و تنطفئ بلون برتقالي وهذا تحذير من وجود اشارة ضوئية بعد ٣٠٠ متر', 'Dit stoplicht knippert met een oranje kleur, en dit is een waarschuwing voor een verkeerslicht na 300 meter.', NULL, NULL, '2023-03-01 21:09:41', '2023-03-14 17:44:42'),
