(325, 'wccQ4PIDqg3nH80', 'هل يسمح لك الإنعطاف يساراً بهذه الحالة ؟', 'Mag je hier linksaf?', 37, 22, 'mcq', 'uploads/question/UcKGRN1677708908.png', 4, 'اللوحة الزرقاء أمامك تخبرك أنه اذا أردت متابعة السير للأمام يجب عليك الإلتزام بنفس المسار ، ولا يوجد ما يمنعك من الإنعطاف يساراً', 'Het bord geeft aan dat als je rechtdoor wilt, je op dezelfde rijstrook moet blijven. Het verbiedt je niet om links af te slaan.', NULL, NULL, '2023-03-01 21:15:08', '2023-03-14 14:57:38'),
(326, '6SBvhPbjgehAGVN', 'هل يسمح لك الدخول بهذا الطريق ؟', 'Mag je deze weg inrijden?', 37, 22, 'mcq', 'uploads/question/1SLnxo1677709001.png', 5, 'يسمح لك الدخول ولا يوجد ما يمنع ذلك ، حيث توجد لوحات منع الباركيرن ولوحة تخبرك أنك ستصبح خارج المدينة و سرعتك القصوى ٦٠كم/سا', 'Het bord aan de rechterkant is een parkeerverbod bord', NULL, NULL, '2023-03-01 21:16:41', '2023-03-14 17:48:51'),
(327, 'OuNQnSMSAfIvjSq', 'هل يسمح لك تنزيل أو تصعيد راكب في الجهة اليمين من هذا الطريق ؟', 'Mag je een passagier aan de rechterkant van deze weg laten in- of uitstappen?', 37, 22, 'mcq', 'uploads/question/kYHEQv1677709097.png', 6, 'اللوحة تمنعك من عمل باركيرن يمين الطريق وبعد اللوحة فقط ولا يوجد ما يمنع تنزيل أو تصعيد راكب', 'Dit bord geeft een parkeerverbod aan, dus je mag iemand in of uitlaten stappen.', NULL, NULL, '2023-03-01 21:18:17', '2023-03-14 17:50:52'),
(328, 'FVJovvp4e8o1gBR', 'هل تتوقع وجود سائقين من اليمين ؟', 'Kun je hier bestuurders van rechts verwachten?', 37, 22, 'mcq', 'uploads/question/BOayGq1677709172.png', 7, 'هذه اللوحة تخاطب السائق الذي يراها وتعني جميع السائقين مجبرين على إتباع إتجاه السهم بإستثناء الفيتس والسنورفيتس والبروم فيتس ،وهي لا تخص السائقين على التقاطع أمامك', 'Dit bord geldt alleen voor bestuurders die dit bord zien, alle bestuurders zijn verplicht deze te volgen met uitzondering van (brom) fietsers.', NULL, NULL, '2023-03-01 21:19:32', '2023-03-14 17:52:30'),
(329, 'Mf6U2pKj3hO67hR', 'هل عدد دورات المحرك بهذه الحالة يصرف وقود أكثر ؟', 'Verbruik je in dit geval meer brandstof?', 37, 22, 'mcq', 'uploads/question/kvSo4g1677709269.png', 8, 'السرعة منخفضة و عدد دورات المحرك منخفض وبالتالي لا يوجد استهلاك أكثر للوقود', 'Het toerental is laag  waardoor er niet meer brandstof wordt verbruikt dan gebruikelijk.', NULL, NULL, '2023-03-01 21:21:09', '2023-03-14 17:53:22'),
(330, 'LQbIl1jzZpUvXW0', 'هل تتوقع أن يتشكل الجليد على سطح الطريق عند درجة حرارة ٢ مئوية ؟', 'Kun je ijsvorming op het wegdek verwachten bij een temperatuur van 2 graden(℃)?', 37, 22, 'mcq', 'uploads/question/JQ4Pu41677709364.png', 9, 'من الممكن أن يتشكل الجليد عند حرارة ٢ مئوية لأن مقياس درجة الحرارة يعطي قراءة وسطية لعدة قياسات للحرارة', 'Bij 2°C kan zich ijs vormen omdat de thermometer een gemiddelde aflezing geeft van meerdere temperatuurmetingen. Daarnaast is de grond kouder dan de lucht er boven.', NULL, NULL, '2023-03-01 21:22:44', '2023-03-14 17:54:35'),
(331, 'X0vn6jw8bpoIFYD', 'ما هي المدة الزمنية اللازمة لأخذ قسط من الراحة أثناء القيادة لفترة طويلة ؟', 'Na hoelang rijden is het nodig om rust te nemen?', 37, 22, 'mcq', 'uploads/question/7C9IRn1677709438.png', 10, NULL, NULL, NULL, NULL, '2023-03-01 21:23:58', '2023-03-14 17:55:46'),
