(333, '2JONhHWQpAJlvmR', 'ما هي المدة الزمنية القصوى المسموح بها عمل باركيرين عند هذه اللوحة ؟', 'Hoelang is het toegestaan om hier te parkeren?', 37, 22, 'mcq', 'uploads/question/ODWac41677709618.png', 12, 'تخبرك اللوحة أنه موقف باركيرن كحد أقصى ٥ دقائق', 'Het bord geeft aan dat het een parkeerstop van maximaal 5 minuten is.', NULL, NULL, '2023-03-01 21:26:58', '2023-03-14 15:08:29'),
