(336, 'SdCNwJTPoWLCg1h', 'من يملك الأفضلية على الطريق السريع ؟', 'Wie heeft de voorrang op de snelweg?', 37, 22, 'mcq', 'uploads/question/2cEDIi1677709965.png', 15, NULL, 'uitvoegend verkeer heeft voorrang op invoegend verkeer', NULL, NULL, '2023-03-01 21:32:45', '2023-03-14 18:04:42'),
(337, '5bXNNW26aSWWp1o', 'أنت تقود السيارة السوداء هل يسمح لك مغادرة الخط السريع؟', 'Je rijdt in de zwarte auto, mag je hier alsnog uitvoegen?', 37, 22, 'mcq', 'uploads/question/XZtiBH1677710075.png', 16, 'المسار الأيمن هو مسار خروج من الطريق السريع و لا يسمح لك الإنتقال إليه عند انتهاء المكعبات البيضاء', 'Je mag niet van rijstrook wisselen bij een doorgetrokken streep.', NULL, NULL, '2023-03-01 21:34:01', '2023-03-14 14:41:39'),
(338, 'ZhLws3z8MKHCSNO', 'هل تموضعك صحيح ؟', 'Je rijdt op deze rijstrook, mag dit?', 37, 22, 'mcq', 'uploads/question/ixlJUC1677710181.png', 17, 'تموضعك صحيح لأن المسار اليمين هو خانة طوارئ مغلقة  ويسمح لك القيادة فيها اذا كانت مفتوحة فقط', 'De rechter strook is een vluchtstrook, op dit moment rijd je op de je juiste rijstrook.', NULL, NULL, '2023-03-01 21:36:21', '2023-03-14 14:43:17'),
(339, '3xTmI68ZkjSQWYz', 'تريد الإنعطاف يساراً ، هل يجب عليك أن تدع السائقين القادمين من أمامك يذهبوا قبلك ؟', 'Je wilt links afslaan, moet je tegenliggers voor laten gaan?', 37, 22, 'mcq', 'uploads/question/5gHZzz1677710265.png', 18, ' الإشارة الضوئية خضراء مدورة وليست سهم أي من الممكن أن تتقاطع حركتك مع سائقين آخرين ، لكن اللوحة البيضاء تخبرك أنه  عندما تصبح الإشارة الضوئية خضراء يجب إعطاء الأفضلية للسائقين القادمين من أمامك إذا أردت الإنعطاف يساراً', 'Het onderbord geeft aan dat je het doorgaand verkeer voor moet laten gaan', NULL, NULL, '2023-03-01 21:37:45', '2023-03-14 18:06:46'),
(340, 'cLfkhjcubryO2JW', 'لقد أدركت بوقت متأخر أنك في المخرج الخاطئ هل يحق لك العودة للطريق السريع بهذه الحالة؟', 'Je merkt te laat dat je op de verkeerde afrit zit en je besluit om toch de snelweg op te blijven door 2 stroken op te schuiven, mag dit?', 37, 22, 'mcq', 'uploads/question/pnAVqG1677710410.png', 19, 'يمنع عليك العودة للطريق السريع عندما تصبح على مسار الخروج', 'Je mag niet terugkeren naar de snelweg als jij je op de afrit bevindt.', NULL, NULL, '2023-03-01 21:40:10', '2023-03-14 18:08:44'),
(341, 'h8r7xA1VtHKkODN', 'تريد متابعة السير للأمام ، هل تتموضع بشكل صحيح ؟', 'Je wilt rechtdoor, sta je correct voorgesorteerd?', 37, 22, 'mcq', 'uploads/question/7CJFSK1677710484.png', 20, 'يوجد مسارين يؤديان للأمام وانت تقود في المسار اليمين', 'Er zijn twee rijstroken die rechtdoor gaan, en jij rijdt op de rechterrijstrook.', NULL, NULL, '2023-03-01 21:41:24', '2023-03-14 15:13:29'),
(342, 'GchG3jJdPZ8rx8G', 'تريد الإنعطاف يساراً بعد ٢٠٠ متر ، هل تموضعك صحيح ؟', 'Je wilt over 200 meter linksaf slaan, sta je correct voorgesorteerd?', 37, 22, 'mcq', 'uploads/question/mz5JOU1677711329.png', 21, 'يحق لك استخدام المسار الأيسر اذا كنت تنوي الانعطاف يساراً وذلك بهدف التحضير المسبق و كي تكون آمن و قريب أكثر من الإنعطاف', 'Je hebt het recht om de linkerrijstrook te gebruiken als je van plan bent linksaf te slaan,  om goed voorbereid te zijn.', NULL, NULL, '2023-03-01 21:55:29', '2023-03-14 15:14:43'),
(343, 'uXogevHN4fYwCSp', 'لقد تناولت 0.1 بروميلي من الكحول ، هل هذا سيؤثر على ردة الفعل ؟', 'Je hebt 0,1 promille alcohol geconsumeerd, heeft dit invloed op de reactietijd?', 37, 22, 'mcq', 'uploads/question/5Emnxt1677711424.png', 22, 'إن تناول الكحول حتى لو كان بكميات قليلة سيؤثر على ردة فعل السائق ويقلل من انتباهه', 'Het consumeren van alcohol (ook in kleine hoeveelheden) zal de reactie van de bestuurder beïnvloeden en zijn aandacht verminderen.', NULL, NULL, '2023-03-01 21:57:04', '2023-03-14 15:15:07'),
(344, 'IEBm75tEdV7dDew', 'هل تتوقع سائق فيتس قادم من أمامك ؟', 'Kun je hier een tegenliggende fietser verwachten?', 37, 22, 'mcq', 'uploads/question/V1YSvk1677711507.png', 23, 'حسب ما تخبر به اللوحة المعدنية الزرقاء :الشارع بإتجاه واحد للأمام ،يمكنك الذهاب يميناً ويساراً ، ولا يوجد سائقين معاكسين لإتجاهك والشخص الذي يقود الفيتس يعتبر سائق', 'Het blauwe bord geeft eenrichtingsverkeer aan voor alle bestuurders', NULL, NULL, '2023-03-01 21:58:27', '2023-03-14 18:10:22'),
(345, 'xHvbFG5BaDdACcW', 'ما هو الوقت الأنسب لقياس مستوى زيت المحرك ؟', 'Wat is het beste moment om je motoroliepeil te meten?', 37, 22, 'mcq', 'uploads/question/ddyTK31677711608.png', 24, 'الوقت الأمثل لقياس مستوى زيت المحرك هو عندما يكون المحرك بارد ، لأنه عندما يكون المحرك ساخن سيؤدي لرفع حرارة الزيت وبالتالي تمدده وزيادة حجمه وبالتالي قراءة خاطئة لمستوى زيت المحرك', 'Het optimale moment om het motorolie peil te meten is als de motor koud is, want als de motor warm is zal de temperatuur van de olie stijgen en dus het volume vergroten.  Je krijgt dan een verkeerde aflezing van het motorolie peil.', NULL, NULL, '2023-03-01 22:00:08', '2023-03-05 15:26:38'),
(346, 'eilISK1kyDCTBBd', 'هل يسمح لك عمل ومضات(ترميش) بالضوء العالي لتجنب خطر ما ؟', 'Mag je met het grootlicht knipperen om gevaar te vermijden?', 37, 22, 'mcq', 'uploads/question/2u6dat1677711710.gif', 25, NULL, NULL, NULL, NULL, '2023-03-01 22:01:50', '2023-03-14 15:20:07'),
(347, '9s6qTftRNsktgg9', 'على ماذا يدل تشغيل هذا الضوء ؟', 'Wat voor soort licht is dit?', 37, 22, 'mcq', 'uploads/question/b8V2fl1677711862.png', 26, NULL, NULL, NULL, NULL, '2023-03-01 22:04:22', '2023-03-14 15:20:28'),
(348, 'Xqmz57QE7EBb0I9', 'ما هو لون الضوء العادي dimlicht ؟', 'Wat is de kleur het dimlicht?', 37, 22, 'mcq', 'uploads/question/yRnaad1677711948.png', 27, NULL, NULL, NULL, NULL, '2023-03-01 22:05:48', '2023-03-14 15:20:52'),
(349, 'TLjhoy2fpjDKra9', 'لماذا يسبب السائقين اليافعين خطورة أكبر؟', 'Waarom veroorzaken jonge bestuurders meer ongevallen?', 37, 22, 'mcq', 'uploads/question/fau3wl1677712018.png', 28, NULL, NULL, NULL, NULL, '2023-03-01 22:06:58', '2023-03-14 18:12:59'),
(354, 'RUYzQo4tpXWMziV', 'هل يسمح لك تشغيل ضوء الضباب الخلفي بهذه الحالة ؟', 'Mag je in deze situatie het mistachterlicht aanzetten?', 39, 24, 'mcq', 'uploads/question/FjDjOt1677788503.png', 1, 'المسافة بين عاكسين ضوء متتالين ٥٠ متر ،وشرط تشغيل ضوء الضباب الخلفي أن يكون مدى الرؤية أقل من ٥٠ متر في الضباب والثلج ، وفي حالتنا هذه انت ترى عاكسين للضوء وبالتالي رؤيتك  أكثر من ٥٠ متر .', 'in dit geval is de afstand tussen twee lichtreflectoren 50 meter, en de voorwaarde voor het inschakelen van het mistachterlicht is dat het zichtbereik minder dan 50 meter is bij mist en sneeuw.', NULL, NULL, '2023-03-02 19:21:43', '2023-03-14 15:24:32'),
(355, 'xrcS0Xv8fNbCfnf', 'هل أنت مجبر على تشغيل الضوء العادي dimlicht بهذه الحالة ؟', 'Ben je in dit geval genoodzaakt om het dimlicht aan te zetten?', 39, 24, 'mcq', 'uploads/question/zY9cVU1677788568.png', 2, 'يجب تشغيل الضوء العادي وقت شروق و غروب الشمس بسبب الرؤية القليلة و كي تتم رؤيتك بشكل واضح من قبل باقي السائقين', 'Dimlichten moeten worden ingeschakeld bij zonsopgang en zonsondergang vanwege slecht zicht en om duidelijk gezien te worden door andere bestuurders.', NULL, NULL, '2023-03-02 19:22:48', '2023-03-08 17:40:07'),
(356, 'Tq43bTDvL8YEAGc', 'ما هي سرعتك القصوى بعد هذه اللوحة ؟', 'Wat is de toegestane maximale snelheid na dit bord?', 39, 24, 'mcq', 'uploads/question/oPn7xf1677788642.png', 3, 'اللوحة تشير إلى بداية منطقة السرعة القصوى ٣٠ كم/سا', 'Het bord geeft het begin aan van de 30 km/u zone.', NULL, NULL, '2023-03-02 19:24:02', '2023-03-12 21:13:46'),
(357, 'ybaHNTdStmOS7bt', 'هل يُسمح لك عمل باركيرن بهذه الحالة ؟', 'Mag je hier parkeren?', 39, 24, 'mcq', 'uploads/question/7CXOyf1677788749.png', 4, 'على الطريق خارج المدينة يسمح لك الباركيرن والستيلستان على العشب', 'Buiten de bebouwde kom mag je parkeren en stilstaan op het gras.', NULL, NULL, '2023-03-02 19:25:49', '2023-03-12 21:14:22'),
(358, '9Fmcswg79LwUTeq', 'هل يسمح لك تشغيل ضوء الضباب الأمامي بهذه الحالة ؟', 'Mag je in deze situatie het mist-voorlicht aanzetten?', 39, 24, 'mcq', 'uploads/question/DWUxOq1677788812.png', 5, 'يسمح بتشغيل ضوء الضباب الأمامي اذا كان مدى الرؤية لديك أقل من ٢٠٠ متر في الضباب و الثلج و المطر ، وفي هذه الحالة أنت ترى عاكسين للضوء فقط بسبب الضباب وبالتالي مدى الرؤية لديك أقل من ٢٠٠ متر', 'Het is toegestaan om het mist-voorlicht aan te zetten als jouw zichtbereik minder dan 200 meter is bij mist, sneeuw en regen, en je in dit geval alleen 2 reflectoren ziet door de mist en jouw zichtbereik dus minder is dan 200 meter.', NULL, NULL, '2023-03-02 19:26:52', '2023-03-13 18:57:38'),
(359, 'zqpYykXSA61idxI', 'هل يُسمح لك تشغيل الضوء العالي بهذه الحالة ؟', 'Mag je in deze situatie het grootlicht aanzetten?', 39, 24, 'mcq', 'uploads/question/iyxutd1677789356.png', 6, 'لا يُسمح بتشغيل الضوء العالي في النهار إلا في حالات الخطر(ترميش)', 'Het is niet toegestaan om overdag het grootlicht aan te zetten, behalve in geval van gevaar (knipperen).', NULL, NULL, '2023-03-02 19:35:56', '2023-03-08 17:43:27'),
(360, 'rb4ULaYwJC0QIcw', 'اي من الخطوط التالية تدل على مغادرة الخط السريع ؟', 'Welke van de volgende lijnen geeft het verlaten van de snelweg aan?', 39, 24, 'mcq', 'uploads/question/bQBLuP1677789541.png', 7, 'يدل وجود المكعبات الأرضية البيضاء على منطقة دخول أو مغادرة الخط السريع', 'De aanwezigheid van witte blokmarkering geeft de in- of uitgang van de snelweg aan.', NULL, NULL, '2023-03-02 19:39:01', '2023-03-13 18:58:52'),
(361, 'YuulUIeECUaHNjM', 'هل يُسمح لك القيادة ليلاً بهذه الحالة في حال وجود أشخاص أمامك ؟', 'Mag je ’s nachts in deze situatie rijden?', 39, 24, 'mcq', 'uploads/question/6HMgOw1677789638.png', 8, 'رمز الضوء العالي بلون أبيض و هو في وضع التشغيل الاوتوماتيكي ، أي  في حال وجود حركة مرور سيقوم النظام بإطفاء الضوء العالي وفي حال عدم وجودها سيقوم النظام بتشغيله.(الضوء العالي يكون رمزه بلون أزرق بالحالة الطبيعية)', 'Het symbool voor grootlicht is wit en staat in de automatische bedrijfsmodus, dat wil zeggen als er verkeer is schakelt het systeem het grootlicht uit en als er geen verkeer is schakelt het systeem het in. (Grootlicht is symbolisch blauw in de normale toestand).', NULL, NULL, '2023-03-02 19:40:38', '2023-03-08 17:46:58'),
(362, 'dXUug1IDFf30ag3', 'ما هي سرعتك القصوى بعد هذه اللوحة ؟', 'Wat is de toegestane maximumsnelheid na dit bord?', 39, 24, 'mcq', 'uploads/question/foclZy1677789708.png', 9, 'أنت على طريق السيارات ذو السرعة القصوى ١٠٠كم/سا واللوحة تخبرك أنه ستنتهي السرعة القصوى ٨٠كم/سا التي كانت محددة على جزء من الطريق و سوف تعود لسرعة الطريق الطبيعية', 'Jij bevindt je op een autoweg met een maximumsnelheid van 100 km/u en het bord informeert jou dat de maximumsnelheid van 80 km/u die voor een deel van de weg beperkt was zal eindigen en je zult terugkeren naar de normale snelheid op de weg.', NULL, NULL, '2023-03-02 19:41:48', '2023-03-12 21:17:53'),
(363, 'ec0cDX77K1iYGTO', 'هل يُسمح لك التجاوز بهذه الحالة ؟', 'Mag je inhalen op deze weg?', 39, 24, 'mcq', 'uploads/question/WEd3w71677789797.png', 10, 'السهم يخاطب السائقين القادمين من أمامك فقط و يجبرهم بعدم التجاوز والإلتزام بمسارهم', 'De pijl richt zich alleen op tegenliggers en dwingt hen niet in te halen en op hun rijstrook te blijven.', NULL, NULL, '2023-03-02 19:43:17', '2023-03-08 17:48:36'),
(364, '6DRHF5j2Ct0xPQN', 'ما هي سرعتك القصوى بعد هذه اللوحة ؟', 'Wat is de toegestane maximumsnelheid na dit bord?', 39, 24, 'mcq', 'uploads/question/zRdXve1677789858.png', 11, 'أنت ستدخل طريق السيارات ذو السرعة القصوى ١٠٠كم/سا ، لكن اللوحة المعدنية  تجبرك بسرعة قصوى ٨٠كم/سا', 'Je gaat de autoweg op met een maximale snelheid van 100 km/u, maar de snelheidsbord geeft een maximumsnelheid aan van 80 km/u.', NULL, NULL, '2023-03-02 19:44:18', '2023-03-13 19:02:31'),
(365, '2pY46newwrhfCJE', 'في أي من الحالات التالية لا يسمح لك بالتجاوز ؟', 'In welke van de volgende situaties mag je niet inhalen?', 39, 24, 'mcq', 'uploads/question/0KyNhK1677789952.png', 12, 'السهم المرسوم على الطريق في الحالة (ب) يُجبرك بعدم التجاوز والإلتزام بمسارك الحالي', 'De pijl die in geval (b) op de weg is getekend, verbiedt je om in te halen en op jouw huidige rijstrook te blijven.', NULL, NULL, '2023-03-02 19:45:52', '2023-03-12 21:19:15'),
(366, 'vTFCES0in8psLrX', 'ما هي سرعتك القصوى بعد هذه اللوحة ؟', 'Wat is de toegestane maximumsnelheid na dit bord?', 39, 24, 'mcq', 'uploads/question/MRkvtH1677790053.png', 13, 'عند انتهاء طريق السيارات تكون السرعة القصوى ٨٠ كم/سا ، إلا في حال وجود لوحة تحدد ذلك', 'Aan het einde van de autoweg is de maximumsnelheid 80 km/u, tenzij een bord dat aangeeft.', NULL, NULL, '2023-03-02 19:47:33', '2023-03-12 21:19:37'),
(367, 'JLeIuj08NNIs2hX', 'أين تقع كونبلين ؟', 'Waar ligt Coenplein?', 39, 24, 'mcq', 'uploads/question/P3DiMe1677790160.png', 14, NULL, NULL, NULL, NULL, '2023-03-02 19:49:20', '2023-03-08 17:51:33'),
(368, 'WHUppwrqc7VPuRZ', 'أنت تقود في طريق صعود وأمامك تضيق في الطريق وسيارة مقابلة ، لمن أفضلية المرور بهذه الحالة؟', 'Je rijdt op een hellingen voor je is de weg versmald met tegenliggers, wie heeft hier de voorrang?', 39, 24, 'mcq', 'uploads/question/p9UP8d1677790250.png', 16, 'في الطرق المنحدرة التي تحوي تضيقات وفي حال عدم وجود لوحات تحدد الأفضليه تكون الأفضلية للسائقين في حالة الصعود على السائقين المعاكسين في حالة النزول', 'Op hellende wegen met versmallingen en bij gebrek aan borden die de voorrang aangeven wordt de voorrang gegeven aan klimmend verkeer.', NULL, NULL, '2023-03-02 19:50:38', '2023-03-13 19:05:56'),
(369, 'r6ZAaILi4qEpt9R', 'الحمولة بارزة متر ونصف خلف العربة ، هل يسمح لك القيادة ليلاً بهذه الحالة ؟', 'De lading steekt anderhalve meter achter de aanhangwagen. Mag je in deze \'s nachts in deze situatie rijden?', 39, 24, 'mcq', 'uploads/question/5EkAst1677795136.jpg', 17, 'يجب أن تكون اللوحة التحذيرية مجهزة بعاكسات للضوء عند القيادة ليلاً', 'Het markeringsbord moet bij nachtelijke ritten zijn voorzien rood licht.', NULL, NULL, '2023-03-02 19:53:06', '2023-03-13 19:09:42'),
(370, '89Zkk1cgeF2BdGo', 'على ماذا تدل هذه اللوحة ؟', 'Wat betekent dit bord?', 39, 24, 'mcq', 'uploads/question/SJ9lrW1677790753.png', 18, 'هذه اللوحة تحذر من تواجد الطين على الطريق والذي يؤدي لإنزلاق المركبة و زيادة مسافة الفرملة', 'Dit bord waarschuwt voor de aanwezigheid van modder op de weg, waardoor het voertuig kan slippen en de remweg langer wordt.', NULL, NULL, '2023-03-02 19:59:13', '2023-03-08 17:58:57'),
(371, 'OSN7wKNZZzaRJKA', 'هل يحق لك عمل باركيرين بهذا المكان يوم الثلاثاء الساعة 14:00؟', 'Mag je hier dinsdag om 14:00 parkeren?', 39, 24, 'mcq', 'uploads/question/TBiwxk1677790852.png', 19, 'هذا مكان باركيرن مخصص للشاحنات ولكن ضمن الأوقات التالية : من الإثنين للجمعة ومن الساعة ٧ صباحاً حتى ١٢ ظهراً ،وخارج هذه الأوقات يسمح لك عمل باركيرين', 'Dit is een parkeerplek voor vrachtwagens, maar binnen de volgende tijden: van maandag t/m zaterdag en van 07.00 uur tot 12.00 uur, en buiten deze tijden mag je parkeren.', NULL, NULL, '2023-03-02 20:00:52', '2023-03-08 18:00:01'),
(372, 'jyt0YD8F8kMgoJJ', 'هل يسمح لك الإلتفاف والعودة بهذا الطريق ؟', 'Mag je hier keren?', 39, 24, 'mcq', 'uploads/question/OgjaVt1677791028.png', 15, 'هذه اللوحة تتواجد في التقاطعات من نوع T و تمنع السير بعكس إتجاه السهم', 'Dit bord staat op T-kruisingen en geeft aan dat het een eenrichtingsverkeer is. Het is niet toegestaan om te keren op een eenrichtingsweg.', NULL, NULL, '2023-03-02 20:03:48', '2023-03-13 19:05:11'),
(373, '7X8Sz5NDEJPfwWy', 'لقد قمت بمناورة التجاوز ، متى يجب عليك العودة إلى مسارك ؟', 'Je hebt een inhaalmanoeuvre uitgevoerd, wanneer is het veilig om terugkeren naar jouw rijstrook?', 39, 24, 'mcq', 'uploads/question/vUaA4H1677791259.jpg', 20, NULL, NULL, NULL, NULL, '2023-03-02 20:07:39', '2023-03-13 19:13:43'),
(375, 'mUGCmBmFNzKKOFl', 'توقفت هنا لقراءة رسالة نصية هل يسمح لك الباركيرن بهذا المكان ؟', 'Je staat stil om een sms te lezen, mag dit?', 39, 24, 'mcq', 'uploads/question/w6w6Wo1678739667.png', 21, 'أنت على طريق خارج المدينة و هذا موقف خاص بالباركيرن ويسمح لك الوقوف فيه', 'Bij een bord P mag je parkeren. SMS lezen valt onder parkeren.', NULL, NULL, '2023-03-02 20:20:13', '2023-03-13 19:34:27'),
(376, 'yCgedGZs2ojbymi', 'ما هي سرعتك القصوى قبل اللوحة ؟', 'Wat is de toegestane maximumsnelheid VOOR dit bord?', 39, 24, 'mcq', 'uploads/question/IfnNa11677792093.jpg', 22, 'قبل اللوحة أنت ما زلت على طريق السيارات autoweg والسرعة القصوى على هذا الطريق ١٠٠ كم/سا', 'Voor het bord bevind jij je nog op een autoweg, de maximumsnelheid op deze weg is 100 km/u.', NULL, NULL, '2023-03-02 20:21:33', '2023-03-13 19:29:03'),
(377, 'deLnKP2Za5xnDHO', 'هل يحق لك التجاوز في هذا الطريق؟', 'Is het toegestaan om in te halen op deze weg?', 39, 24, 'mcq', 'uploads/question/HjLAHW1677792169.jpg', 23, 'إذا لم يكن هناك خط متصل في المنتصف ، يُسمح بالتجاوز.', 'Als er geen doorgetrokken streep in het midden is aangebracht dan is het toegestaan om in te halen.', NULL, NULL, '2023-03-02 20:22:49', '2023-03-13 19:30:21'),
(378, '3lkKFJzzGBPYy67', 'أنت ذاهب إلى utrecht ، هل تموضعك صحيح ؟', 'Je gaat naar Utrecht, ben je zo goed voorgesorteerd', 39, 24, 'mcq', 'uploads/question/WdwQRL1677792273.jpg', 24, 'أنت تقود على مسار الخروج من الطريق السريع ، ويجب التموضع في المسار اليمين من الطريق السريع المؤدي إلى utrecht', 'De meest rechter rijstrook gaat niet richting Utrecht.', NULL, NULL, '2023-03-02 20:24:33', '2023-03-13 19:35:47'),
(379, 'YxQr7gentQM8wDA', 'عل ماذا يدل  وجود هذه اللوحات ؟', 'Wat geeft een combinatie van deze borden aan?', 39, 24, 'mcq', 'uploads/question/Ei06Uv1677792346.jpg', 25, NULL, NULL, NULL, NULL, '2023-03-02 20:25:46', '2023-03-13 19:36:37'),
(380, 'ZnUcYSVaSPohR98', 'هل أنت مُجبر على تشغيل الضوء العادي dimlicht بهذه الحالة ؟', 'Ben je in dit geval genoodzaakt om het dimlicht aan te zetten?', 39, 24, 'mcq', 'uploads/question/1V5jRl1677792423.jpg', 26, 'أنت مجبر قانوناً على تشغيل الضوء العادي dimlicht قبل دخول النفق ، بسبب الإضاءة القليلة داخل النفق وكي يتم رؤيتك بشكل واضح من قِبل باقي السائقين', 'Je bent wettelijk verplicht om het dimlicht aan te zetten voordat je de tunnel inrijdt, vanwege de weinige verlichting in de tunnel en om goed gezien te worden door andere bestuurders.', NULL, NULL, '2023-03-02 20:27:03', '2023-03-12 21:25:46'),
(381, 'ukJsVVjSLJ5q1zw', 'هل يحق لك القياده في هذا الطريق المغطى بالاشجار فقط بتشغيل ضوء النهار؟', 'Mag je overdag met dagrijverlichting op deze weg te rijden?', 39, 24, 'mcq', 'uploads/question/oCN7vP1677792519.jpg', 27, 'يحق لك القياده في في اثناء النهار بطريق مغطى بالاشجار بتشغيل ضوء النهار daglich . وفي حال عدم وجود ضوء النهار  ال daglich فانت مجبر باستخدام ال Dimlicht .', 'Overdag mag je met daglicht rijden op een weg met overhangende bomen. Oudere autos die geen daglicht hebben, dan is dimlicht verplicht.', NULL, NULL, '2023-03-02 20:28:39', '2023-03-13 20:06:42'),
(382, 'vDBnhesSGFArN8g', 'هل تتوقع قدوم شاحنة من أمامك ؟', 'Kan je tegenliggende vrachtwagens verwachten wanneer je dit bord treft?', 39, 24, 'mcq', 'uploads/question/0dxllk1677792588.jpg', 28, 'تشير اللوحة إلى أنه إتجاه إلزامي للأمام للشاحنات ولا تخص أي من السائقين المعاكسين القادمين من الأمام', 'Het bord geeft aan dat het een verplichte rijrichting is voor vrachtwagens en geldt niet voor tegenliggende bestuurders. Verplichte rijrichting is anders dan een eenrichtingsweg.', NULL, NULL, '2023-03-02 20:29:48', '2023-03-13 19:50:19'),
(383, 'mH1WldYh6TjbNX8', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/tnnC1s1678530051.jpg', 1, 'رتل الجنازة يتوقف على الإشارة الضوئية الحمراء', 'De witte auto mag voor omdat de rouwstoet verplicht is om te stoppen voor rood licht.', NULL, NULL, '2023-03-03 08:20:11', '2023-03-11 09:20:51'),
(384, 'W3ZvVYP3wFBRSFa', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/nPvEP21678530136.jpg', 2, 'رتل الجنازة لا يعطي الأفضلية للباص الذي ينوي مغادرة موقفه سواء داخل أو خارج المدينة', 'De rouwstoet hoeft geen voorrang te verlenen aan de bus die de bushalte wil verlaten.', NULL, NULL, '2023-03-03 08:29:46', '2023-03-12 10:13:39'),
(385, 'ZGrMD43Dg6fsYou', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/B19nXa1678530326.jpg', 3, 'رتل الجنازة يتوقف عند أسنان القرش لإعطاء الأفضلية للسائقين من اليمين و اليسار', 'De rouwstoet verleent voorrang bij de haaientanden.', NULL, NULL, '2023-03-03 08:32:30', '2023-03-11 09:25:26'),
(386, 'rgT33O64kvqpuSq', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/EIkuE41678530258.jpg', 4, 'في التقاطع المتساوي ،اذا لم يقطع رتل الجنازة التقاطع نطبق قواعد الأفضلية ،وفي هذه الحالة الأفضلية للسائق القادم من اليمين(السيارة البيضاء)', 'Als de rouwstoet bij de gelijke kruising de kruising niet oversteekt, gelden de voorrangsregels en heeft in dit geval de bestuurder die van rechts komt (de witte auto) voorrang.', NULL, NULL, '2023-03-03 08:39:20', '2023-03-11 09:24:18'),
(387, 'FeP6xElDC4eSiAj', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/k5Fzc51677837179.jpg', 5, 'سيارات الرتل العسكري ما بعد السيارة الأولى  لا تتوقف على الإشارة الضوئية الحمراء اذا كانت السيارة الأولى من سيارات الرتل العسكري قد عبرت التقاطع', 'Wanneer de militaire colonne de kruising is overgestoken met de eerste auto, hoeft deze niet meer te stoppen voor rood licht.', NULL, NULL, '2023-03-03 08:52:59', '2023-03-12 10:15:09'),
(388, 'Zdv29gwun4ylIzq', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/ImLUdB1677837545.jpg', 6, 'رتل الجنازة لا يتوقف لإعطاء الأفضلية للمشاة على خط عبور المشاة ،ولكن في هذه الحالة المشاة يشكل حالة خطر ويجب على رتل الجنازة أن يتوقف.', 'De rouwstoet hoeft een voetganger geen voorrang te verlenen bij een zebrapad, maar in deze situatie is de voetganger al aan het oversteken. bij gevaar moeten alle bestuurder voetgangers wel voor laten gaan.', NULL, NULL, '2023-03-03 08:59:05', '2023-03-12 10:18:00'),
(389, 'WAnSYuUTUzlZXxv', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/OtqJrS1678531156.jpg', 7, 'مجموعات المشاة و الفرق الموسيقية و رتل المشاة العسكري يعتبر سائق و الأفضلية له في هذه الحالة لأنه قادم من اليمين في تقاطع متساوي', 'De colonne wordt als bestuurder beschouwd en heeft de voorrang omdat deze van rechts komt op een gelijk kruispunt.', NULL, NULL, '2023-03-03 09:04:59', '2023-03-12 10:19:16'),
(390, 'TpGth3AiYJNNZxT', 'أنت تقود بين سيارات الرتل العسكري ,هل يحق لك قطع الاشارة الضوئيه الحمراء ومتابعه السير ؟', 'Je rijdt tussen de militaire colonne in, mag je door rood rijden?', 40, 25, 'mcq', 'uploads/question/uyiOga1677838071.jpg', 8, 'لا يحق لك مخالفة القانون وقطع الإشارة الضوئية الحمراء', 'Als bestuurder mag je nooit door rood rijden, behalve als er een verkeersregelaar dat van je vraagt.', NULL, NULL, '2023-03-03 09:07:51', '2023-03-12 10:20:46'),
(391, 'H9wFlGtXXmn2S0N', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/28xdEz1677838279.jpg', 9, 'سيارات الرتل العسكري تتوقف عند لوحة ستوب لإعطاء الأفضلية للسائقين من اليمين واليسار', 'Militaire colonne voertuigen stoppen bij een stopbord om de voorrang te verlenen aan kruisende bestuurders.', NULL, NULL, '2023-03-03 09:11:19', '2023-03-06 15:25:09'),
(392, 'gHcuv2LJJG6GKQP', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/KdHQ3H1677838407.jpg', 10, 'سيارات الرتل العسكري تتوقف عند أسنان القرش لإعطاء الأفضلية للسائقين من اليمين واليسار', 'Militaire colonne voertuigen stoppen bij de haaientanden om de voorrang te verlenen aan kruisende bestuurders.', NULL, NULL, '2023-03-03 09:13:27', '2023-03-12 10:22:02'),
(393, 'S6dJ7FHIqMf8WNS', 'أي من السيارات التالية هي السيارة الأولى من سيارات الرتل العسكري؟', 'Welke van de bovenstaande voertuigen behoort tot de eerste militaire colonne voertuig?', 40, 25, 'mcq', 'uploads/question/nmfQQt1677838533.jpg', 11, 'السيارة الأولى من سيارات الرتل العسكري تكون بعلمين بلون أزرق وضوء أزرق من جهة اليمين ، والسيارات ما بعد الأولى تكون بعلم أزرق وضوء أزرق من جهة اليمين أما  السيارة الأخيرة من سيارات الرتل العسكري تكون بعلم أخضر وضوء أخضر من جهة اليمين', 'De eerste auto van de militaire colonne heeft twee blauwe vlaggen en een blauw licht aan de rechterkant, en de auto\'s na de eerste hebben een blauwe vlag en een blauw licht aan de rechterkant. De laatste auto van de militaire colonne hebben een groene vlag en een groen licht aan de rechterkant.', NULL, NULL, '2023-03-03 09:15:33', '2023-03-06 15:27:40'),
(394, 'fkUMbwtrTSLcg9H', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/FXkiAk1677838718.jpg', 12, 'بما أن التقاطع متساوي والسيارة الأولى من سيارات رتل الجنازة قد قطعت التقاطع فلا يحق لأحد قطعهم،لذلك ستذهب سيارات رتل الجنازة أولاً ، ثم نطبق قاعدة اليمين أي ستذهب السيارة الزرقاء ثانياً ثم السيارة الحمراء وأخيراً البيضاء', 'Aangezien dit een gelijkwaardig kruising is en de eerste auto van de rouwstoet de kruising is overgestoken, mogen bestuurders de rouwstoet niet doorsnijden. Daarom gaat de rouwstoet eerst, daarna passen we de rechterhandregel toe, d.w.z. de blauwe auto gaat als tweede, dan de rode auto en tenslotte de witte auto.', NULL, NULL, '2023-03-03 09:18:38', '2023-03-12 10:24:43'),
(395, 'BV7u53bykv5qm0x', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/jEaCio1677838967.jpg', 13, 'التقاطع متساوي والسيارة الأولى من سيارات الرتل العسكري قد قطعت التقاطع وبالتالي لا يحقّ لأحد قطعهم أي ستذهب سيارات الرتل العسكري أولاً', 'De kruising is gelijk en de eerste auto van de militaire colonne is de kruising overgestoken en daarom heeft niemand het recht om ze te doorsnijden, wat betekent dat de militaire colonne als eerste gaat.', NULL, NULL, '2023-03-03 09:22:47', '2023-03-12 10:26:29'),
(396, 'BF1mvU0QdupzHIJ', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/lOHbX21677838984.jpg', 1, 'سرعتك مناسبة ولا وجود لخطر يهددك وبإمكانك تجاوز هذا الإنعطاف الصغير بهذه السرعه.', 'Je snelheid is passend en er is geen gevaar, je kunt deze kleine bocht met deze snelheid passeren.', NULL, NULL, '2023-03-03 09:23:04', '2023-03-09 09:59:42'),
(397, '6Du0erA4zvbraRR', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/8T2FW51677839086.jpg', 14, 'الرتل العسكري سيذهب أولاً لأنه قادم من يمين السيارة البيضاء وكما أنه لا يتوقف للمشاة على الزيبراباد ، ثم سيذهب المشاة ، ومن بعده السياره البيضاء كونها قادمة من يمين البرومفيتس وأخير سيذهب البرومفيتس', 'De militaire colonne zal als eerste gaan omdat het van rechts komt van de witte auto en hoeft de voetgangers geen voorrang te verlenen op een zebrapad.', NULL, NULL, '2023-03-03 09:24:46', '2023-03-12 10:29:00'),
(398, 'rUgm8ttdWVWvcGX', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/xerton1677839180.jpg', 2, 'سرعتك مناسبة حيث لا وجود لخطر يهددك واللوحة المعدنية تمنع دخول آليات البناء ولا تخصك بشيء.', NULL, NULL, NULL, '2023-03-03 09:26:20', '2023-03-15 21:07:51'),
(399, 'O5HAB4cl6lW9QI5', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/MplWFU1677839288.jpg', 3, 'أنت تقترب من مطب وسرعتك تعتبر عالية قليلا  لذلك خفف سرعتك و تجاوزه بسرعة أقل.', 'Je nadert een drempel en je snelheid is wat hoog, dus verlaag je snelheid en passeer deze met een lagere snelheid.', NULL, NULL, '2023-03-03 09:28:08', '2023-03-09 10:02:32'),
(400, 'xtwSO8YYO7rKDDT', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/9w86tG1677839299.jpg', 15, 'سيارات الرتل العسكري لا تتوقف لإعطاء الأفضلية للمشاة على خط عبور المشاة', 'Militaire colonne hoeft geen voorrang te verlenen aan voetgangers op een voetgangersoversteekplaats.', NULL, NULL, '2023-03-03 09:28:19', '2023-03-12 10:31:49'),
(401, 'VQ9t2y939CweGvC', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/6aN3Oc1677839380.jpg', 4, 'أنت تقترب من منعطف حاد وسرعتك عالية نوعاً ما ،لذلك خفف سرعتك بالضغط على الفرامل كي تتجاوز المنعطف بأمان.', 'Je nadert een scherpe bocht en jouw snelheid is vrij hoog, dus verlaag je snelheid door te remmen en om de bocht veilig te passeren.', NULL, NULL, '2023-03-03 09:29:40', '2023-03-09 10:04:25'),
(402, 'p8fR9DWIHW5RtsA', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/d4RwEg1677839497.jpg', 5, 'سرعتك مناسبة ولا وجود لخطر يهددك.', NULL, NULL, NULL, '2023-03-03 09:31:37', '2023-03-15 21:08:19'),
(403, '56ua5PNMT9hzo0M', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'mcq', 'uploads/question/eGBfa41677839549.jpg', 16, 'التقاطع متساوي والسيارة الأولى من سيارات الرتل العسكري قد قطعت التقاطع وبالتالي لا يحقّ لأحد قطعهم أي ستذهب سيارات الرتل العسكري أولاً،ثم سيذهب الترام  والمشاة معاً لأن حركتهما لا تتقاطعان  و أخيراً السيارة البيضاء', 'De kruising is gelijk en de eerste auto van de militaire colonne is de kruising overgestoken, en daarom heeft niemand het recht om ze te doorsnijden. Dat wil zeggen, de militaire colonne auto’s eerst gaan. Daarna gaan de tram en voetgangers samen omdat ze elkaar niet kruisen, en tenslotte de witte auto.', NULL, NULL, '2023-03-03 09:32:29', '2023-03-12 10:33:38'),
(404, 'dKiavPWviV1TDMz', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/qxpLPW1677839598.jpg', 6, 'السبب: سرعة الشاحنة على الطريق السريع\r\n\r\n     ٨٠كم/سا وانت تقود بسرعة ٩٠كم/سا\r\n\r\n لذلك خفف سرعتك للحفاظ على مسافة أمان أكبر بينك وبين الشاحنة.', 'Reden: De snelheid van de vrachtwagen op de snelweg is 80 km/u en je rijdt met een snelheid van 90 km/u, dus vertraag om een ​​grotere veiligheidsafstand tussen jou en de vrachtwagen aan te houden.', NULL, NULL, '2023-03-03 09:33:18', '2023-03-09 10:06:38'),
(405, 'YcOgch3VekAMfxj', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/D6TjnA1677839783.jpg', 7, 'خفف سرعتك وابقى خلف الفيتس فلا مجال للتجاوز هنا بسبب وجود سيارة مقابلة لك .', NULL, NULL, NULL, '2023-03-03 09:36:23', '2023-03-15 21:08:54'),
(406, 'CPF8DtvtCzU8MRP', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/wYuKQC1677839897.jpg', 8, 'أنت تقترب من دوار وأسنان قرش وسرعتك عالية لذلك خفف سرعتك بالضغط على الفرامل.', NULL, NULL, NULL, '2023-03-03 09:38:17', '2023-03-15 21:09:37'),
(407, 'CcYUPJH8qYtCp1v', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/sE8sQY1677840093.jpg', 9, ' ليس من الجيد تجاوز الفيتس الذي أمامك  بسبب وجود سائق على يسارك وبنفس الوقت يجب عليك إعطاء الأفضلية لسائق الدراجة النارية\r\n\r\nالقادم من اليمن لذلك خفف سرعتك بالضغط على الفرامل وربما تحتاج للتوقف لإفساح المجال لاحقاً.', NULL, NULL, NULL, '2023-03-03 09:41:33', '2023-03-15 21:09:48'),
(408, 'PClbpYDuozeTxmr', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/1BisZN1677840249.jpg', 10, 'الشارع ضيق نوعاً ما  بسبب وجود الفيتس والسيارة المقابلة لذلك خفف السرعة قليلاً وتجاوزهم بأمان .', 'De straat is vrij smal door de aanwezigheid van de fiets en de auto aan de overkant, dus minder vaart en passeer ze veilig.', NULL, NULL, '2023-03-03 09:44:09', '2023-03-09 10:12:15');
INSERT INTO `questions` (`id`, `question_uuid`, `question_ar`, `question_nl`, `exam_category_id`, `exam_id`, `question_type`, `question_image`, `arrangment`, `answer_explanation_ar`, `answer_explanation_nl`, `question_en`, `answer_explanation_en`, `created_at`, `updated_at`) VALUES
(409, 'Ihw4X6os27IoLpg', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/XfzP5t1677840379.jpg', 11, 'أنت تقود على طريق سريع و سرعتك مناسبة ومسافة الأمان كافية ولا وجود لخطر يهددك.', 'Je rijdt op een snelweg, jouw snelheid is gepast en de veiligheidsafstand is voldoende, er is geen gevaar.', NULL, NULL, '2023-03-03 09:46:19', '2023-03-09 10:13:23'),
(410, '536fzQ6D3GcTJZr', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/HeLqcF1677840487.jpg', 12, 'أنت تعطي غماز إلى اليسار و تريد الانتقال للخانة المجاورة فخانتك أوشكت على الإنتهاء\r\n، لذلك خفف سرعتك قليلاً للمحافظة على مسافة أمان أكبر بينك وبين المركبة التي أمامك', NULL, NULL, NULL, '2023-03-03 09:48:07', '2023-03-15 21:10:26'),
(411, 'HqtWxBjI2bU7OZW', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/rVunMW1677840575.jpg', 17, 'سيارات الرتل العسكري لا تتوقف لإعطاء الأفضلية للباص الذي ينوي مغادرة موقفه سواء داخل أو خارج المدينة', 'Militaire colonne hoeft geen voorrang te verlenen aan de bus die zijn halte verlaat.', NULL, NULL, '2023-03-03 09:49:35', '2023-03-12 10:35:44'),
(412, 'hTwxPiAGyXLLURk', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/nDyUpx1677840583.jpg', 13, 'سائق السيارة التي أمامك استخدم الفرامل وانت مقترب منه بشكل كبير لذلك قم بالضغط على الفرامل كي لا تصطدم به\r\n\r\nحيث لا مجال لتجاوزه بسبب تضيق الطريق و وجود سائقين معاكسين', NULL, NULL, NULL, '2023-03-03 09:49:43', '2023-03-15 21:10:48'),
(413, 'SMSf0ofqorAivcx', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/kUDiOn1677840673.jpg', 14, 'خفف سرعتك باستخدام الفرامل لأنك تقترب من منعطف حاد وسيارة مقابلة لك وانت لا ترى القادمين من يمينك .', 'Verlaag je snelheid door te remmen want je nadert een scherpe bocht en je hebt een tegenliggende auto op de weg, ook heb je geen inzicht van rechts.', NULL, NULL, '2023-03-03 09:51:13', '2023-03-09 10:19:59'),
(414, 'F1Y8GNeDWDDzqpc', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/2AyNBJ1677840776.jpg', 18, 'التقاطع متساوي والسيارة الأولى من سيارات رتل الجيش قد قطعت التقاطع اذاً ستذهب سيارات الجيش أولاً ثم نطبق قاعدة اليمين بين السائقين أي ستذهب السيارة السوداء ثانياً و أخيراً البيضاء.', 'De kruising is gelijk en de eerste auto van de militaire colonne is de kruising overgestoken, dus de colonne gaat eerst, daarna passen we de rechterhandregel tussen de bestuurders toe, de zwarte auto gaat als tweede en als laatste de witte.', NULL, NULL, '2023-03-03 09:52:56', '2023-03-12 10:36:37'),
(415, '8BGkHVSKZ0teRti', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/XkrOpl1677840879.jpg', 15, 'خفف سرعتك وابقى خلف الفيتس، الشارع ضيق نوعاً ما ولا مجال لك للتجاوز', 'Verlaag je snelheid en blijf achter de fiets, de straat is vrij smal en je kunt niet inhalen.', NULL, NULL, '2023-03-03 09:54:39', '2023-03-09 10:20:54'),
(416, '3tiO5XMsGEuhZwY', 'أي من الأعلام التالية هو العَلم الخاص برتل الجنازة؟', 'Welke van de volgende vlaggen is bestemd voor de rouwstoet?', 40, 25, 'mcq', 'uploads/question/4ac6ij1677840951.jpg', 19, 'علم رتل الجنازة يكون بلون أسود و يحوي ثلاث خطوط بيضاء من كل جهة.', 'De vlag van de rouwstoet is zwart en bevat aan elke kant drie witte strepen.', NULL, NULL, '2023-03-03 09:55:51', '2023-03-06 18:54:26'),
(417, '2QQ8oO3uAFHfSbw', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/A0XV3C1677840978.jpg', 16, 'الإشارة الضوئية خضراء و سرعتك مناسبة حيث لا وجود لخطر يهددك.', NULL, NULL, NULL, '2023-03-03 09:56:18', '2023-03-15 21:11:48'),
(418, 'gfMotGjrjcsLou1', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/oPj83f1677841077.jpg', 17, 'أنت تنوي الانعطاف يميناً وأمامك فيتس وتقاطع وانت لا ترى القادمين من يمينك لذلك خفف سرعتك\r\n\r\nباستخدام الفرامل كي تتجنب خطر الفيتس وتتجاوز الإنعطاف بسرعة أقل.', NULL, NULL, NULL, '2023-03-03 09:57:57', '2023-03-15 21:11:59'),
(419, 'J6oqo8XSJnobVui', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/fxb3iB1677841169.jpg', 18, 'الإشارة الضوئية حمراء ،لذلك استخدم الفرامل كي تصل الإشارة بسرعة صفر .', NULL, NULL, NULL, '2023-03-03 09:59:29', '2023-03-15 21:12:11'),
(420, 'uyzpe74sa4i2p3p', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/I41HDr1677841181.jpg', 20, 'التقاطع متساوي لذلك نطبق قاعدة اليمين ، أي ستذهب السيارة البيضاء أولاً ثم سيارات الجيش وأخيراً السيارة السوداء .ملاحظة :اذا كانت سيارات الجيش بدون أعلام تعتبر سائق عادي و لا تنطبق عليها قواعد الرتل العسكري', 'De kruising is gelijk, dus we passen de rechterhand regel toe, dat wil zeggen: de witte auto gaat eerst, dan de legerauto\'s en als laatste de zwarte auto. \r\nOpmerking: als de legerauto\'s geen vlaggen hebben dan zijn de regels van de militaire colonne niet op hen van toepassing.', NULL, NULL, '2023-03-03 09:59:41', '2023-03-06 18:55:54'),
(421, 'NpNVUHAq85u8f2m', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/GhkeaK1677841356.jpg', 21, 'الرتل العسكري سيتوقف عند أسنان القرش لإعطاء الأفضلية للسائقين من اليمين واليسار على الطريق الرئيسي ،لذلك نطبق قاعدة متحركان بنفس الشارع من ينعطف ينتظر ،اذا ستذهب السيارة السوداء أولاً ثم البيضاء وأخيراً الرتل العسكري', 'De militaire colonne zal stoppen bij de haaientanden om voorrang te verlenen aan kruisende  bestuurders op de hoofdweg. Daarom passen we de regel van twee rijden in dezelfde straat toe. Wie afslaat, wacht, dus de zwarte auto gaat eerst, dan de witte auto en ten slotte de militaire colonne.', NULL, NULL, '2023-03-03 10:02:36', '2023-03-06 18:57:49'),
(422, 'vUrCNMOJ8Qo4qyN', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/hcBA351678632980.jpg', 22, 'السيارة و الرتل العسكري سيتوقفان عند أسنان القرش لإعطاء الأفضلية للسائقين من اليمين واليسار فقط لذلك سيذهب الفيتس أولاُ , ثم سيذهب الرتل العسكري لأنه من ينعطف ينتظر , و أخيراُ السيارة البيضاء', 'De militaire colonne stopt bij de haaientanden om voorrang te verlenen aan kruisende bestuurders.', NULL, NULL, '2023-03-03 10:04:32', '2023-03-12 14:10:28'),
(423, 'sg7E8rG7LVz9lcb', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/GNSzEb1677841608.jpg', 23, 'السيارة الأولى من سيارات الرتل العسكري لم تقطع التقاطع لذلك تنطبق عليها قواعد الأفضلية ،وفي هذه الحالة نطبق قاعدة اليمين أي السيارة البيضاء أولاً ثم الرتل العسكري', 'Het eerste voertuig van de militaire colonne is de kruising niet gepasseerd, dus hierop zijn de voorrangsregels van toepassing. In dit geval passen we de regel van rechts gaat voor, eerst de witte auto, daarna de militaire colonne.', NULL, NULL, '2023-03-03 10:06:48', '2023-03-12 10:40:41'),
(424, 'LPlKN8XVODMk5kE', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/hDfcDN1677841805.jpg', 24, 'التقاطع متساوي والسيارة الأولى من سيارات الرتل العسكري قد قطعت التقاطع وبالتالي لا يحقّ لأحد قطعهم أي سيذهب الرتل العسكري أولاً ،ثم سيذهب الترام ثانياً لأنه عندما يتساوى مع السائقين فالأفضلية له ،وأخيراً السيارة البيضاء', 'De kruising is gelijk, en de eerste auto van de militaire colonne is de kruising overgestoken, en daarom heeft niemand het recht om ze te doorsnijden. Dat wil zeggen dat de militaire colonne eerst gaat, dan gaat de tram als tweede en tot slotte de witte auto.', NULL, NULL, '2023-03-03 10:10:05', '2023-03-12 10:42:04'),
(425, 'KCjqwZjNclnwQOs', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/hIK4N81677842211.jpg', 19, 'السائق الذي أمامك قد استخدم الفرامل للتوقف ولا مجال لك للتجاوز بسبب ضيق الشارع و وجود سائقي الفيتس المعاكسين لإتجاهك ،\r\n\r\nلذلك توقف حتى يُصبح الوضع أكثر أمانا و يُفسَح لك المجال ومن بعدها تابع السير.', NULL, NULL, NULL, '2023-03-03 10:16:51', '2023-03-15 21:12:27'),
(426, '7EZFGOgTrwKbJo5', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/sVI8hU1677842284.jpg', 25, 'التقاطع متساوي والسيارة الأولى من سيارات رتل الجنازة لم تقطع التقاطع لذلك تنطبق عليها قواعد الأفضلية وعندما يتساوى الترام مع باقي السائقين فالأفضلية له ،أي سيذهب الترام أولاً ثم نطبق قاعدة اليمين أي ستذهب السيارة البيضاء ثانياً كونها قادمة من يمين رتل الجنازة وأخيراً رتل الجنازة.', 'De kruising is gelijk, en de eerste auto van de rouwstoet is de kruising niet overgestoken, dus daarop gelden de normale voorrangsregels. Als de tram gelijk is aan de rest van de bestuurders, heeft deze voorrang. De tram gaat eerst, daarna passen we de rechterhand regel toe, de witte auto gaat als tweede omdat deze van rechts komt van de rouwstoet, en ten slotte de rouwstoet.', NULL, NULL, '2023-03-03 10:18:04', '2023-03-12 10:44:38'),
(427, 'mqZiwzYg0XvQc1h', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/HrKr3E1677842502.jpg', 26, 'التقاطع متساوي والسيارة الأولى من سيارات رتل الجنازة قد قطعت التقاطع وبالتالي لا يحقّ لأحد قطعهم أي ستذهب سيارات رتل الجنازة أولاً ثم السيارة البيضاء', 'De kruising is gelijk en de eerste auto van de rouwstoet is de kruising overgestoken en daarom heeft niemand het recht om ze te doorsnijden, de rouwstoet auto\'s gaan eerst en daarna de witte auto.', NULL, NULL, '2023-03-03 10:21:42', '2023-03-12 10:45:21'),
(428, '3LTLg8oGQDkwhvA', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 40, 25, 'drag_drop', 'uploads/question/f19OcR1677842582.jpg', 27, 'رتل الجنازة يتوقف عند أسنان القرش لإعطاء الأفضلية للسائقين من اليمين واليسار', 'De rouwstoet stopt bij de haaientanden om voorrang te verlenen aan kruisende bestuurders.', NULL, NULL, '2023-03-03 10:23:02', '2023-03-06 19:03:04'),
(429, 'vyhjyDAqwifd20u', 'هل يُسمح لك الدخول بين سيارات رتل الجنازة بهذه الحالة؟', 'Is het hier toegestaan om in te voegen tussen de rouwstoet?', 40, 25, 'mcq', 'uploads/question/GZ4vMt1677842751.jpg', 28, 'عند دخولك الطريق السريع يسمح لك الانضمام الى رتل الجنازه اورتل الجيش', 'Bij het invoegen op een autosnelweg mag je tussen de uitvaartauto\'s invoegen en later verlaten wanneer de toestand veilig is.', NULL, NULL, '2023-03-03 10:25:51', '2023-03-12 10:50:13'),
(430, '0DiaLTmjxSTfw0y', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/DfVaLv1677843162.jpg', 20, 'الجو ماطر و الطريق رطب وهناك احتمال لحدوث أكوابلانغ(انزلاق) وسرعتك عالية  لذلك خفف سرعتك قليلاً برفع القدم عن دواسة الوقود للحفاظ على مسافة أمان أكبر\r\n\r\nبينك وبين المركبات أمامك وتجنب حدوث أكوابلانغ.', NULL, NULL, NULL, '2023-03-03 10:32:42', '2023-03-15 21:12:35'),
(431, 'clhPA4asPUTuzXb', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/JgSagZ1677843287.jpg', 21, 'سرعتك مناسبة ولا وجود لخطر يهددك.', 'Jouw snelheid is passend en er is geen gevaar.', NULL, NULL, '2023-03-03 10:34:47', '2023-03-09 10:34:54'),
(432, '2HRrx8qCgCaE6U3', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/fKNtj41677843360.jpg', 22, 'أنت تقترب من تقاطع وأسنان قرش وشارعك ضيق وهناك سائقين مقابلين لك حيث تعتبر حالة خطرة ، لذلك خفف سرعتك بالضغط على الفرامل.', 'Je nadert een kruispunt met haaientanden, de straat is smal en je hebt tegenliggende fietsers op de weg, wat als een gevaarlijke situatie wordt beschouwd, dus verlaag je snelheid door op de rem te trappen.', NULL, NULL, '2023-03-03 10:36:00', '2023-03-09 10:37:17'),
(433, 'B78Y7jcpktMptE2', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/awibXM1677843529.jpg', 23, 'سرعتك مناسبة  ومسافة الأمان كافية و لا وجود لخطر يهددك .', NULL, NULL, NULL, '2023-03-03 10:38:49', '2023-03-15 21:13:05'),
(434, '8mRmkjKLx69yCQ2', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/fBaBw41677843631.jpg', 24, ' أنت تعطي إشارة ضوئية (غماز) لليمين وتقترب من تقاطع ومنعطف وسرعتك عالية قليلاً\r\n\r\nعلى هذا المنعطف لذلك خفف سرعتك لتتجاوزه بأمان.', NULL, NULL, NULL, '2023-03-03 10:40:31', '2023-03-15 21:13:13'),
(435, '0GMHIrVsc2O0nxp', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 41, 26, 'mcq', 'uploads/question/X2aFgV1677843723.jpg', 25, 'السيارة أمامك استخدمت الفرامل بسبب وجود الفيتسات ، لذلك خفف سرعتك قليلاً تجنباً لأي أمر طارئ.', 'De auto voor je gebruikte de remmen vanwege de aanwezigheid van de fietser, dus verlaag je snelheid een beetje om een ​​noodsituatie te voorkomen.', NULL, NULL, '2023-03-03 10:42:03', '2023-03-09 10:40:48'),
(436, '8wWC3Az6h3u5CRW', 'هل يسمح للسيارة البيضاء تجاوز السيارة السوداء بهذه الحالة ؟', 'Mag de witte auto in dit geval de zwarte auto inhalen?', 42, 27, 'mcq', 'uploads/question/YKdhCa1677850129.jpg', 1, 'التجاوز يكون دائماً من اليسار إلا في بعض الحالات يُسمح التجاوز من اليمين ، حيث يسمح التجاوز من اليمين على الطريق السريع إذا كانت البلوكات الأرضية(مكعبات السكر ) على يسارك و في الإزدحام وفي حالتنا هذه لا يوجد ازدحام ولا بلوكات ، وبالتالي ممنوع التجاوز من اليمين', 'Je mag rechts niet inhalen. Er zijn uitzonderingen, maar dit geldt niet in deze situatie.', NULL, NULL, '2023-03-03 12:28:49', '2023-03-13 20:32:13'),
(437, '36Q48c3qr0wlQUd', 'هل يسمح لك أن تستمر بالقيادة في هذا المسار ؟', 'Mag je op deze strook blijven rijden?', 42, 27, 'mcq', 'uploads/question/Kp64qs1677850936.jpg', 2, 'جميع المسارات مفتوحة للسير و يسمح لك استخدامها لكن التموضع يجب أن يكون أقصى اليمين', 'Het is niet toegestaan om onnodig links te blijven rijden.', NULL, NULL, '2023-03-03 12:32:28', '2023-03-13 20:32:55'),
(438, 'XCQNKX7Amj6JiuG', 'أي من اللوحات التالية تدل على رقم المخرج ؟', 'Welke van de volgende borden geeft de afritnummer aan?', 42, 27, 'mcq', 'uploads/question/jNDv8n1677851193.jpg', 3, 'اللوحة التي تعطي رقم المخرج هي لوحة afrit', 'De bord die het afrit nummer geeft, is het afrit bord', NULL, NULL, '2023-03-03 12:36:28', '2023-03-14 12:12:59'),
(439, 'gofxrisJfEbF3vb', 'ما هي مسافة التوقف ؟', 'Wat is de stopafstand?', 42, 27, 'mcq', 'uploads/question/yzrZbq1677851911.gif', 4, 'مسافة التوقف هي عبارة عن مجموع مسافة رد الفعل(انتباه السائق و تفاعله مع الخطر)+ مسافة الفرملة(المسافة التي تقطعها المركبة من لحظة الضغط الضغط على الفرامل حتى تتوقف)', NULL, NULL, NULL, '2023-03-03 12:58:31', '2023-03-14 19:54:46'),
(440, 'UeoLQ6gM3lNY4t9', 'أين تقع معظم الحوادث ؟', 'Waar vinden de meeste ongelukken plaats?', 42, 27, 'mcq', 'uploads/question/e3SZ1X1677852472.jpg', 5, NULL, NULL, NULL, NULL, '2023-03-03 13:07:52', '2023-03-09 15:20:33'),
(441, 'Peg34F7yII1Ya3M', 'هل يسمح لك القيادة بهذا الشكل ؟', 'Mag je op deze manier rijden?', 42, 27, 'mcq', 'uploads/question/SsxtBr1677852570.jpg', 6, 'أنت تستخدم لوحة أرقام خاصة بالتاكسي ولا يسمح لك القيادة بهذه الحالة', 'Je gebruikt een taxinummerplaat en het is in dit geval niet toegestaan om zo te rijden.', NULL, NULL, '2023-03-03 13:09:30', '2023-03-10 12:26:00'),
(442, '8KSND7DHVJoNKjH', 'هل يسمح لك القيادة بهذه الحالة ؟', 'Mag je op deze manier rijden?', 42, 27, 'mcq', 'uploads/question/Qqw1oc1677852713.jpg', 7, 'عند تجربة قيادة سيارة من معرض السيارات بغاية شرائها توضع عليها لوحة أرقام خضراء ويسمح لك القيادة بهذه اللوحة', 'Wanneer je een proefrit maakt met een nieuwe auto, heeft deze een groene nummerplaat en is het toegestaan om met deze groene kentekenplaten te rijden als ze zijn geregistreerd.', NULL, NULL, '2023-03-03 13:11:53', '2023-03-13 20:41:20'),
(443, 'M1VoKAPato4CCYl', 'هل تحتوي رخصة القيادة على الرقم الوطني BSN number؟', 'Heeft het rijbewijs een BSN nummer?', 42, 27, 'mcq', 'uploads/question/doqpgu1677854453.jpg', 8, NULL, NULL, NULL, NULL, '2023-03-03 13:40:53', '2023-03-09 15:26:55'),
(444, 'EXDJ6b995zDmv9Y', 'لقد خرجت الإطارات اليمنى  إلى العشب الرطب ، ماذا تفعل ؟', 'Je rechterbanden zijn de natte berm ingereden, wat doe je?', 42, 27, 'mcq', 'uploads/question/H7fOto1677855962.jpg', 9, 'تجنّب الضغط على الفرامل بقوة أو تحريك المقود بسرعة لأن ذلك سيؤدي لإنزلاق المركبة وخروجها عن الطريق وقد يؤدي لإنقلابها .', NULL, NULL, NULL, '2023-03-03 13:45:09', '2023-03-14 20:01:39'),
(445, 'xqj7ERri41eyUMf', 'أي من اللوحات التالية لا تدل على اتجاه إجباري للسير ؟', 'Welke van de volgende borden geeft geen verplichte rijrichting aan?', 42, 27, 'mcq', 'uploads/question/XEbyIU1677856094.jpg', 10, 'اللوحة A هي لوحة دلالة وتحوي سهم يشير الى جهة المسار الذي يجب اتباعه في حال متابعة السير للأمام ولكنها لا تمنعك من الإنعطاف يميناً أو يساراً', 'Bord A is een indicatiepaneel en bevat een pijl die de richting aangeeft van de weg dat je moet volgen als je doorrijdt, maar het verbiedt niet dat je naar rechts of links afslaat.', NULL, NULL, '2023-03-03 14:08:14', '2023-03-13 20:43:53'),
(446, 'R98vncvR0DT4lkV', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 42, 27, 'drag_drop', 'uploads/question/ma3ngM1677856215.jpg', 11, 'السائق الذي يغادر طريق ترابي يعطي الأفضلية للسائقين من اليمين واليسار فقط على الطريق الإسفلتي أمامه ، لذلك تذهب السيارة البيضاء أولاً لأنها تتابع سير للأمام ثم الحمراء التي تنعطف(متحركان بنفس الشارع من ينعطف يفقد الأفضلية) ، وأخير التركس', 'Een bestuurder die een onverharde weg verlaat, verleent voorrang aan kruisende bestuurders alleen op de asfaltweg voor hem, dus de witte auto gaat eerst omdat hij rechtdoor gaat en dan de rode auto die een bocht neemt (Degene die afslaat verleent voorrang de degene die rechtdoor gaat), en ten slotte de tractor.', NULL, NULL, '2023-03-03 14:10:15', '2023-03-13 20:45:04'),
(447, 'zN2FFL6Cu1zB4Iz', 'من يذهب آخراً؟', 'Wie gaat er als laatste?', 42, 27, 'mcq', 'uploads/question/ZusE2l1677856331.jpg', 12, 'سيذهب أولاً البرومفيتس و السيارة البيضاء لأن لديهما انعطاف قصير وأخيرا تذهب السيارة الحمراء ذات الإنعطاف الطويل', 'Eerst gaan de bromfiets en de witte auto omdat ze een korte bocht nemen en tot slot gaat de rode auto met een grote bocht.', NULL, NULL, '2023-03-03 14:12:11', '2023-03-10 12:34:28'),
(448, 'H8Q7ZLGZSK392mH', 'رتب الأفضلية', 'Wat is de juiste volgorde van voor laten gaan?', 42, 27, 'drag_drop', 'uploads/question/FP3OJF1677857000.jpg', 13, 'الرجل الضرير سيذهب أولاً ، ثم سيذهب الترام لأنه متساوي مع السائقين فالأفضلية له ، ثم من ينعطف يفقد الأفضلية أي السيارة البيضاء لأنها تتابع السير للأمام وأخير الفيتس', NULL, NULL, NULL, '2023-03-03 14:14:20', '2023-03-14 20:09:34'),
(449, 'R0ufW69qRVB9NHT', 'من يذهب أولاً ؟', 'Wie mag eerst?', 42, 27, 'mcq', 'uploads/question/qV2ccq1677857365.jpg', 14, 'سيذهب الباص أولاً لأنه يقود على طريق رئيسي', 'De bus gaat als eerste omdat hij op een voorrangsweg rijdt.', NULL, NULL, '2023-03-03 14:29:25', '2023-03-13 20:46:22'),
(450, 'St5yTdoFaXSRZMi', 'هل يحق لك القيادة إذا كان هنالك ركاب داخل الكرافان ؟', 'Is het toegestaan om te rijden met een caravan als er een persoon zich nog bevindt in de caravan?', 42, 27, 'mcq', 'uploads/question/nBmtNp1677860949.jpg', 15, 'الكرفان غير مجهز بأحزمة أمان والقانون يمنع القيادة بدون حزام الأمان', NULL, NULL, NULL, '2023-03-03 15:29:09', '2023-03-14 20:11:30'),
(451, 'BFkRDpwIuHymYsA', 'هل يسمح لك القيادة بهذه الحالة ؟', 'Is het toegestaan om op deze manier rijden?', 42, 27, 'mcq', 'uploads/question/jq0YuA1677861132.jpg', 16, 'يسمح بروز الحمولة متر واحد خلف العربة بدون لوحة تحذيرية ، ولكن لا مانع إن وضعت بهذه الحالة', 'De lading mag zonder waarschuwingsbord een meter achter de aanhangwagen uitsteken, maar het is altijd toegestaan om een markeringsbord te gebruiken bij lading.', NULL, NULL, '2023-03-03 15:32:12', '2023-03-13 20:49:25'),
(452, 'KTh0PUCJGe69ebG', 'كيف تتأثر ردة فعل السائق اذا كان الإطار قديم أو جديد  ؟', 'Hoe wordt de reactietijd van de bestuurder beïnvloed als de band oud of nieuw is?', 42, 27, 'mcq', 'uploads/question/4bjWe41677861193.jpg', 17, 'ردة الفعل تتعلق بالسائق وانتباهه ولا علاقة لها بالخصائص الميكانيكية للسيارة', 'De reactietijd heeft te maken met de bestuurder en zijn aandacht en heeft niets te maken met de mechanische eigenschappen van de auto.', NULL, NULL, '2023-03-03 15:33:13', '2023-03-13 20:50:29'),
(453, 'ADn6HfadgvmdfHv', 'ما هي عدد المسارات التي يتألف منها هذا الطريق ؟', 'Uit hoeveel rijstroken bestaat deze weg?', 42, 27, 'mcq', 'uploads/question/NRHge91677861289.jpg', 18, 'الخطوط الصفراء تلغي وجود الخطوط البيضاء ، و أصبح الطريق مؤلف من ثلاث مسارات بعد أن كان مؤلف من مسارين', 'Gele lijnen heffen de aanwezigheid van witte lijnen op en de weg en bestaat uit drie rijstroken nadat deze uit twee rijstroken bestond.', NULL, NULL, '2023-03-03 15:34:49', '2023-03-10 12:39:06'),
(454, 'VpT09ajwhVX7ous', 'هل يسمح لك الباركيرن يسار الطريق بهذه الحالة ؟', 'Mag je op de linker rijstrook parkeren ?', 42, 27, 'mcq', 'uploads/question/VpH6yU1677861387.jpg', 19, 'اللوحة تمنع الباركيرن على طريق الذهاب اليميني ، و هذا الطريق مؤلف من مسارين ذهاب ولا يمكنك استخدام جهة اليسار لعمل باركيرن', 'Het bord verbiedt het parkeren aan de rechterrijbaan. Deze rijbaan bestaat uit twee rijstroken en je kunt de linkerrijstrook niet gebruiken om er te parkeren.', NULL, NULL, '2023-03-03 15:36:27', '2023-03-14 12:10:43'),
(455, 'g2ICej8x4xGdm6D', 'هل من الحكمة تجاوز الباص ؟', 'Is het verstandig om de bus in te halen in deze situatie?', 42, 27, 'mcq', 'uploads/question/N9xYs61677861466.jpg', 20, 'أنت تقع في الزاوية الميتة بالنسبة للباص ولا تمتلك رؤية واضحة لحالة الطريق أمامك', 'Je bevindt je in de dode hoek ten opzichte van de bus en je hebt geen duidelijk zicht op de toestand van de weg.', NULL, NULL, '2023-03-03 15:37:46', '2023-03-10 12:52:25'),
(456, 'bn6wlPyV3a2aUbs', 'هل يسمح لك الباركيرن يسار الطريق بهذه الحالة ؟', 'Is het toegestaan om aan de linkerzijde te parkeren in deze situatie?', 42, 27, 'mcq', 'uploads/question/QYuqx91677861519.jpg', 21, 'هذا طريق خاص و تخبر اللوحة السفلية أن منع الباركيرن ينطبق على جانبي الطريق', 'Het onderbord geeft aan dat het parkeerverbod voor beide kanten van de weg geldt.', NULL, NULL, '2023-03-03 15:38:39', '2023-03-14 12:08:21'),
(457, 'acfaglgJ8MkTS03', 'هل يسمح لك الدخول بهذا الطريق ؟', 'Is het toegestaan om deze weg op te rijden?', 42, 27, 'mcq', 'uploads/question/bNdJWk1677861592.jpg', 22, 'مسموح الدخول حيث تشير اللوحة إلى أن السيارات ستكون ضيف في طريق الفيتس', 'Toegang is toegestaan omdat het bord aangeeft dat de auto\'s te gast zullen zijn op het fietsstraat.', NULL, NULL, '2023-03-03 15:39:52', '2023-03-13 20:55:18'),
(458, 'Lru3FPjQMUBzTiu', 'رتّب الأفضلية بهذه الحالة ؟', 'Wat is de juiste volgorde van voor laten gaan?', 42, 27, 'drag_drop', 'uploads/question/TZmTx71677861664.jpg', 23, 'السيارة البيضاء ستذهب أولاً لأنها تقود على طريق رئيسي ، ثم سيذهب المشاة لأن الدراجة النارية قادمة من خلف المشاة وتنعطف في طريقه (ترى ظهر المشاة) وأخيراً الدراجة النارية', 'De witte auto mag eerst omdat hij op een voorrangsweg rijdt en hij slaat in dit geval niet af, dan mag de voetganger omdat de motorfiets van achter de voetgangers komt en de voetganger zal kruisen (afslaand verkeer verleent voorrang aan doorgaand verkeer) en ten slotte de motorfiets.', NULL, NULL, '2023-03-03 15:41:04', '2023-03-13 20:57:19'),
(459, 'TFSwUZNfXFT0den', 'من يذهب أولاً ؟', 'Wie mag eerst?', 42, 27, 'mcq', 'uploads/question/0zkZDO1677861993.gif', 24, 'السيارة البيضاء لديها اشارة ضوئية برتقالية تومض و تشتعل وهي إما معطلة او تحذيرية لذلك يتم ترتيب الافضلية حسب الخطوط على الطريق ، لذلك تذهب السيارة الحمراء أولاً', 'Bij knipperend oranje verkeerslicht, gelden de normale voorrangregels. En in dit geval moet de witte auto voorrang verlenen aan de rode auto omdat de witte auto haaientanden heeft.', NULL, NULL, '2023-03-03 15:46:33', '2023-03-13 21:03:16'),
(460, 'pQJjGL7PhBpdmMm', 'من يذهب أولاً ؟', 'Wie mag eerst?', 42, 27, 'mcq', 'uploads/question/BpS1so1677862084.jpg', 25, 'الإشارات الضوئية تلغي مفعول الخطوط على الأرض، وبما أن السيارة البيضاء لديها اشارة ضوئية خضراء لذلك تذهب أولاً', 'Verkeerslichten heffen het effect van lijnen op de grond op, en omdat de witte auto een groen licht heeft, gaat deze als eerste.', NULL, NULL, '2023-03-03 15:48:04', '2023-03-10 13:16:58'),
(461, 'cAWnIfcG3Zy8Ciz', 'هل أنت مجبر بالوقوف بهذه الحالة ؟', 'Ben je verplicht te stoppen hier?', 42, 27, 'mcq', 'uploads/question/dO2ycH1677862173.jpg', 26, 'الإشارة الضوئية سهم أخضر  ولست مجبر بالوقوف ، أما الإشارة الضوئية الحمراء فهي تخص سائقي الباص', 'Het stoplicht is groen je bent niet verplicht om te stoppen, Het rode verkeerslicht geldt voor bus bestuurders.', NULL, NULL, '2023-03-03 15:49:33', '2023-03-13 21:02:31'),
(462, '7elUJRcKeuhnngG', 'هل يحق لك وضع البروم فيتس في حمالة الفيتس؟', 'Is het toegestaan om de bromfiets op deze manier mee te dragen op een fietsendrager?', 42, 27, 'mcq', 'uploads/question/7T25VI1677862251.jpg', 27, 'حمالة الفيتس مخصصة للفيتسات فقط', NULL, NULL, NULL, '2023-03-03 15:50:51', '2023-03-14 20:20:43'),
(463, 'EGcwP7rR7QT8Zjv', 'هل يحق لك عمل الباركيرن هنا ؟', 'Is het toegestaan om hier te parkeren?', 42, 27, 'mcq', 'uploads/question/HY9SeI1677862306.jpg', 28, 'يمنع صف السيارة (الباركيرن) على الجسور.', 'Het is niet toegestaan om op bruggen te parkeren.', NULL, NULL, '2023-03-03 15:51:46', '2023-03-14 20:21:48'),
(464, 'G3S4PhEa2M4jm0u', 'ما هو الوزن الأقصى للمركبة مع رخصة القيادة فئة B ؟', 'Wat is het maximale voertuiggewicht met een rijbewijs B?', 43, 28, 'mcq', 'uploads/question/slkjbg1677867717.jpg', 1, 'الإجابة الصحيحة : 3500 kg', NULL, NULL, NULL, '2023-03-03 17:21:57', '2023-03-07 23:15:42'),
(465, 'cKMiLlMHnLh9aqA', 'ماهو الحد الاقصى لوزن المركبة مع العربة وحمولتها مع رخصة القيادة فئه B ؟', 'Wat is het maximale gewicht van het voertuig met een aanhangwagen en de lading met rijbewijs B?', 43, 28, 'mcq', 'uploads/question/OqnunF1677867908.jpg', 2, 'تستطيع قيادة مركبة مع عربة (وزنها مع حمولتها أكثر من kg 750) \r\nبحيث لا يتجاوز الوزن الكلي (عربة, حمولة, سيارة) 3500 kg', 'Het juiste antwoord: je kunt een voertuig besturen met een aanhangwagen (het gewicht en de lading is meer dan 750 kg) zodat het totale gewicht (autolading voertuig) niet meer dan 3500 kg bedraagt.', NULL, NULL, '2023-03-03 17:25:08', '2023-03-07 23:17:58'),
(466, 'nnx7K4FXzk5oriZ', 'في أي سن تستطيع التقدم لدروس القيادة العملي ؟', 'Vanaf welke leeftijd kun je praktijk rijlessen volgen?', 43, 28, 'mcq', 'uploads/question/oULwN01677868397.jpg', 3, NULL, NULL, NULL, NULL, '2023-03-03 17:33:17', '2023-03-06 14:48:48'),
(467, 'GFitxvcmSTBmFgy', 'ما هي مدة صلاحية رخصة القيادة للأشخاص دون سن 65 عام ؟', 'Wat is de geldigheid van een rijbewijs voor personen jonger dan 65 jaar?', 43, 28, 'mcq', 'uploads/question/86U1ea1677868529.jpg', 4, 'الإجابة الصحيحة : 10 سنوات\r\nالسبب : \r\nالأشخاص دون سن ال 65 عام يحصلون على رخصة قيادة لمدة عشر سنوات ، والأشخاص مابين 65و70 يحصلون على رخصة\r\nصالحة لعمر ال75 , والأشخاص فوق سن ال 70 يحصلون على رخصة قيادة صالحة لمدة خمس سنوات', 'Reden: Mensen onder de 65 jaar krijgen een rijbewijs dat tien jaar geldig is. Mensen tussen de 65 en 70 krijgen een rijbewijs dat geldig is voor de leeftijd van 75 jaar, en mensen ouder dan 70 jaar krijgen dus een rijbewijs dat vijf jaar geldig is.', NULL, NULL, '2023-03-03 17:35:29', '2023-03-07 23:18:58'),
(468, 'tAzEG3vVPG8ZmoC', 'اذا كانت سيارتك جديده وتعمل بالبنزين متى يجب عليك عمل اول فحص ميكانيكي APK ؟', 'Als je auto nieuw is en op benzine rijdt, wanneer moet je dan de eerste mechanische APK-keuring uitvoeren?', 43, 28, 'mcq', 'uploads/question/586six1677868647.jpg', 5, 'الإجابة الصحيحة : بعد أربع سنوات\r\nالسبب: لنفترض أنك قمت بشراء سيارة بنزين جديدة في عام 2020 فأول فحص ميكانيكي سيكون عام 2024\r\nوثاني فحص ميكانيكي سيكون بعد سنتين أي في عام 2026 وثالث فحص أيضا بعد سنتين أي عام 2028\r\nومن بعدها سيكون الفحص كل عام. أما بالنسبة لسيارات الديزل (المازوت) الجديدة فأول فحص ميكانيكي سيكون بعد ثلاث سنوات ومن بعدها سيكون الفحص الميكانيكي كل عام والسيارات الكهربائيه تعامل معاملة سيارات البنزين لفحص  APk', 'Reden: Stel dat je in 2020 een nieuwe benzineauto hebt gekocht, dus de eerste mechanische keuring is in 2024, de tweede mechanische keuring is na twee jaar, dus in 2026 en de derde keuring is ook na twee jaar, dus in 2028, daarna is het examen elk jaar. Wat nieuwe dieselauto\'s betreft, is de eerste mechanische keuring na drie jaar en daarna is de mechanische keuring elk jaar. Elektrische auto\'s worden behandeld als benzineauto\'s voor APK-keuringen.', NULL, NULL, '2023-03-03 17:37:27', '2023-03-07 23:20:43'),
(469, '3IYKImkhqnUd4ED', 'هل يسمح لك إظهار نسخة مصورة عن رخصة قيادتك للسلطات ؟', 'Mag je een kopie van jouw rijbewijs aan de autoriteiten tonen?', 43, 28, 'mcq', 'uploads/question/FPVLZy1677868792.jpg', 6, 'يجب إظهار النسخة الأصلية من رخصة القيادة ولا يجوز إظهار نسخة مصورة عنها .', 'Het originele exemplaar van het rijbewijs moet worden getoond, dit mag dus geen fotokopie zijn.', NULL, NULL, '2023-03-03 17:39:52', '2023-03-06 12:56:55'),
(470, 'CTWQuzAiL8Dm8Ww', 'أي من الأشياء التالية يكون حملُه غير إلزامي أثناء القيادة داخل هولندا؟', 'Welke van de volgende dingen zijn niet verplicht om mee te nemen tijdens het rijden in Nederland?', 43, 28, 'mcq', 'uploads/question/uW6mdo1677868892.jpg', 7, NULL, NULL, NULL, NULL, '2023-03-03 17:41:32', '2023-03-06 14:49:35'),
(471, 'xzP5v6h2dUZoZ1W', 'اذ قمت بإلغاء التأمين أو الضريبة (Schorsen) عن سيارتك لأنك لم تعد تستخدمها فأين يحق لك ركنها ؟', 'Als je de verzekering of belasting  van jouw auto opzegt omdat je deze niet meer gebruikt (schorsen), waar mag je deze dan parkeren?', 43, 28, 'mcq', 'uploads/question/upUsGS1677868989.jpg', 8, 'الإجابة الصحيحة :\r\nفي مكان تابعة ملكيته لك كحديقة أو كراج منزلك', NULL, NULL, NULL, '2023-03-03 17:43:09', '2023-03-13 09:54:56'),
(472, 'OD1QcE60ZNkuYU8', 'أي من أنواع التأمين التالية يجب على كافة السائقين الإشتراك به على الأقل ؟', 'Welke van de volgende soorten verzekeringen moeten alle bestuurders ten minste onderschrijven?', 43, 28, 'mcq', 'uploads/question/cxODDC1677869094.jpg', 9, 'الإجابة الصحيحة : WA\r\nالسبب: \r\nيجب على كافة السائقين الاشتراك على الأقل بالتأمين WA ((Wettelijke aansprakelijkheid))\r\nوهو التأمين الذي يغطي الأضرار التي تقع منك على الغير.', 'Reden: Alle bestuurders moeten in ieder geval een WA-verzekering hebben afgesloten. Dit is een verzekering die de door jou schade aan derden dekt.', NULL, NULL, '2023-03-03 17:44:54', '2023-03-07 23:23:41'),
(473, 'CP7m22eySnMzB7r', 'هل تستطيع قيادة هذه الدراجة النارية مع رخصة القيادة فئة B؟', 'Mag je deze motorfiets besturen met een rijbewijs categorie B?', 43, 28, 'mcq', 'uploads/question/NeTHzX1677869199.jpg', 10, 'السبب: هذه الدراجة النارية ودراجات السباق motorfiets\r\nالمصنفة موتورفورتاوخ تحتاج لرخصة قيادة فئة A1 أو A2 أو A', 'Reden: Deze motor en race motorfiets vereist een rijbewijs categorie A1, A2 of A.', NULL, NULL, '2023-03-03 17:46:39', '2023-03-13 09:55:54'),
(474, 'spJRyDXlMoZRMyO', 'أيّ من الأشياء التالية يكون حمله إلزامي أثناء القيادة؟', 'Welke van de volgende documenten ben je verplicht mee te nemen tijdens het rijden?', 43, 28, 'mcq', 'uploads/question/dHaXkN1677869300.jpg', 11, NULL, NULL, NULL, NULL, '2023-03-03 17:48:20', '2023-03-06 13:05:29'),
(475, 'F7lcbSTiXDMhGNe', 'أي من الآليات التالية تستطيع قيادتها إذا كانت رخصة قيادتك مسحوبة  Rijontzegging ؟', 'Welke van de volgende voertuigen mag je besturen als je een rijontzegging hebt?', 43, 28, 'mcq', 'uploads/question/hxjl791677869406.jpg', 12, 'السبب: إن سحب رخصة القيادة Rijontzegging تطبقهُ السلطات في حال تم ضبط السائق تحت تأثير كميات\r\nكبيرة من المخدرات أو القيام بأعمال جنونية أثناء القيادة وعندها يمنع السائق من قيادة أي مركبة مزودة بمحرك\r\nوتتطلب رخصة قيادة ،وقد يستمر سحب الرخصة لعدة أيام أو عدة أشهر ،وعندها يسمح للسائق قيادة الدراجة\r\nالهوائية (الفيتس) فقط لأنه لا يتطلب رخصة قيادة', 'Reden: Rijontzegging wordt door de autoriteiten toegepast als de bestuurder onder invloed van grote hoeveelheden drugs wordt betrapt of krankzinnig wordt tijdens het rijden. Ook als een bestuurder een gemotoriseerd voertuig bestuurd waarvoor een rijbewijs vereist is kan de bestuurder een rijontzegging krijgen voor een aantal dagen of een aantal maanden. De bestuurder mag dan enkel gebruik maken van de fiets omdat je hiervoor geen rijbewijs voor nodig hebt.', NULL, NULL, '2023-03-03 17:50:06', '2023-03-07 23:25:38'),
(476, '9OrCyrojUf7iK84', 'من سيكون المسؤول عن الغرامه في حال تم ضبطك من قبل السلطات اذا قمت باستعارة سيارة منتهية صلاحية  APK؟', 'Wie krijgt de boete als de bestuurder  betrapt wordt op het lenen van een auto met verlopen APK?', 43, 28, 'mcq', 'uploads/question/g3YVWc1677869545.jpg', 13, NULL, NULL, NULL, NULL, '2023-03-03 17:52:25', '2023-03-06 13:10:31'),
(477, 'Px1Hj8HLqB3dsAb', 'هل يسمح لك استخدام السماعات اللاسلكية أثناء القيادة  ؟', 'Mag je een draadloze koptelefoon gebruiken tijdens het rijden?', 43, 28, 'mcq', 'uploads/question/ysTb651677869644.jpg', 14, NULL, NULL, NULL, NULL, '2023-03-03 17:54:04', '2023-03-06 13:11:35'),
(478, 'ar6rBLdntJLa9SL', 'اذا كنت محروم Rijverbod من القيادة أي من المركبات التالية لا تستطيع قيادتها ؟', 'Welke van de volgende voertuigen mag je niet besturen wanneer je een rijverbod hebt?', 43, 28, 'mcq', 'uploads/question/ItroTT1677869745.jpg', 15, 'الحرمان من القيادة تطبقه السلطات عندما يعاني السائق من مشكله عقلية \r\nكشرب الكحول مثلاً وعندها يمنع السائق من قيادة أي نوع من المركبات حتى الفيتس \r\nويستمر الحرمان حتى يعود الشخص لوعيه الطبيعي', 'De rijontzegging wordt door de autoriteiten toegepast wanneer de bestuurder lijdt aan een psychisch probleem, zoals het drinken van alcohol. De persoon mag geen enkel voertuig meer besturen, zelfs geen fiets. De ontzegging gaat door totdat de persoon terug keert naar zijn normale bewustzijn.', NULL, NULL, '2023-03-03 17:55:45', '2023-03-07 23:27:29'),
(479, 'MttTcuzLhw7mcMk', 'ما هي المدة القصوى للحرمان من القيادة (Rijverbod ) في حال تم ظبط السائق شارباً كميات غير قانونية من الكحول  ؟', 'Wat is de maximale rijverbodsduur (Rijverbod) als de bestuurder wordt betrapt op het drinken van illegale hoeveelheden alcohol?', 43, 28, 'mcq', 'uploads/question/OAinCV1677869898.jpg', 16, NULL, NULL, NULL, NULL, '2023-03-03 17:58:18', '2023-03-06 13:13:45'),
(480, 'mm7WG4KT8YqxVgE', 'إذا لم تكن حاصل على رخصة القياده B هل يُسمح لك قيادة بروموبيل ؟', 'Als je geen rijbewijs-B hebt, mag je dan wel een brommobiel rijden?', 43, 28, 'mcq', 'uploads/question/AEj1ca1677870001.jpg', 17, 'الإجابة الصحيحة : AM\r\n تستطيع مع رخصة القيادة فئة AM قيادة سنور فيتس و بروم فيتس وسكوتر و بروموبيل ،\r\nأما اذا كنت حاصل على رخصة قيادة فئة B فلست بحاجة الى الحصول على الرخصة AM لقيادة هذه المركبات', 'Reden: Met een rijbewijs categorie AM mag je de snorfiets, bromfiets, scooter en brommobiel besturen, maar als je een rijbewijs categorie B hebt hoef je voor deze voertuigen geen rijbewijs AM te halen.', NULL, NULL, '2023-03-03 18:00:01', '2023-03-13 09:57:58'),
(481, 'OgZCFr8snjvBvBT', 'ما هو الطول الأقصى للمركبة مع رخصة القيادة فئة  B', 'Wat is de maximale lengte van het voertuig met een rijbewijs categorie B?', 43, 28, 'mcq', 'uploads/question/HyLz711677870094.jpg', 18, NULL, NULL, NULL, NULL, '2023-03-03 18:01:34', '2023-03-06 13:24:43'),
(482, '16Xh1qWZdHeT43e', 'كيف يمكنك معرفة الحمولة القصوى أو الوزن الفارغ لسيارتك ؟', 'Hoe weet je wat de maximale belading of leeggewicht van jouw auto is?', 43, 28, 'mcq', 'uploads/question/qicTc91677870185.jpg', 19, NULL, NULL, NULL, NULL, '2023-03-03 18:03:05', '2023-03-06 14:31:42'),
(483, '0Gv7VRGhAK5N67P', 'ما هو العمر الأدنى الذي تستطيع فيه التقدم لفحص القيادة العملي ؟', 'Wat is de minimumleeftijd waarop je een praktijkexamen kunt aanvragen?', 43, 28, 'mcq', 'uploads/question/hTfJpj1677870272.jpg', 20, 'الإجابة الصحيحة : عند بلوغك لعمر 17 عام', NULL, NULL, NULL, '2023-03-03 18:04:32', '2023-03-07 23:29:47'),
(484, 'TU5JPTUBwtKPCYu', 'هل يُسمح لك نقل ثمانية ركاب بحافلة مجهزة بثلاثة عشر مقعداً   برخصة قيادة فئة B؟', 'Mag je met een rijbewijs categorie B, 8 passagiers vervoeren in een bus met 13 zitplaatsen?', 43, 28, 'mcq', 'uploads/question/i7yBYD1677870368.jpg', 21, NULL, NULL, NULL, NULL, '2023-03-03 18:06:08', '2023-03-14 11:20:01'),
(485, '7WtNUY6FdKA01W2', 'أي من المركبات التالية تستطيع قيادتها،اذا حصلت على رخصة قياده فئه  B؟', 'Welke van de volgende voertuigen mag je besturen als je in het bezit bent van een rijbewijs categorie B?', 43, 28, 'mcq', 'uploads/question/hMeEOD1677870453.jpg', 22, NULL, NULL, NULL, NULL, '2023-03-03 18:07:33', '2023-03-06 14:53:14'),
(486, 'uKduSS61WIxH2s0', 'ماهي صلاحيات البوليس اذا تم ضبط أحد السائقين تحت تأثير المخدرات ؟', 'Wat zijn de bevoegdheden van de politie als een bestuurder wordt betrapt onder invloed van drugs?', 43, 28, 'mcq', 'uploads/question/jTsHAL1677870532.jpg', 23, NULL, NULL, NULL, NULL, '2023-03-03 18:08:52', '2023-03-06 14:36:57'),
(487, 'QUcAzyTh7TX8ppn', 'اذا تناول شخص ثلاث كؤوس(ستاندر) من البيره خلال ساعة فهل يحق له قيادة السياره ؟', 'Als iemand binnen één uur drie standaardbieren drinkt, heeft hij dan het recht om auto te rijden?', 43, 28, 'mcq', 'uploads/question/L5ar3L1677870611.jpg', 24, 'الإجابة الصحيحة : لا\r\nلأن تناول كوب واحد من الكحول يستغرق ساعة تقريباً ليخرج من الدورة الدموية، \r\nمع العلم إن ثلاثة أكواب بيرة تكون كميتها أكثر من 0.5 بروميلي في الدم', 'Omdat het drinken van één glas alcohol ongeveer een uur nodig heeft om in het bloed af te breken, overigens bevatten drie glazen bier meer dan 0,5 promille.', NULL, NULL, '2023-03-03 18:10:11', '2023-03-07 23:31:48'),
(488, 'K4jm3iJI6fKEH68', 'هل يسمح لسائق سياره الرد على مكالمة هاتفية اثناء القياده ؟', 'Mag een automobilist tijdens het rijden een telefoontje beantwoorden?', 43, 28, 'mcq', 'uploads/question/01ai6m1677870697.jpg', 25, NULL, NULL, NULL, NULL, '2023-03-03 18:11:37', '2023-03-06 14:39:07'),
(489, '9b5rn1cmKtX5UoL', 'إذا كان السائق متناول كمية غير قانونية من الكحول وتسبب بحادث مروري فهل ستقوم شركة التأمين بتعويضة عن الاضرار ؟', 'Als de bestuurder een illegale hoeveelheid alcohol heeft gedronken en een verkeersongeval heeft veroorzaakt, vergoedt de verzekeringsmaatschappij dan de schade?', 43, 28, 'mcq', 'uploads/question/kRPBjx1677870779.jpg', 26, NULL, NULL, NULL, NULL, '2023-03-03 18:12:59', '2023-03-06 14:40:23'),
(490, 'TqZnYoDIyvNLorG', 'هل تحتاج إلى رخصة قيادة ،لقيادة هذه الدراجة الكهربائية والمسماة سبيد بيدلك speed pedelec؟', 'Heb je een rijbewijs nodig om met deze speed pedelec te rijden?', 43, 28, 'mcq', 'uploads/question/CnE0V21677870866.jpg', 27, 'هذه الدراجة الكهربائية اسمها سبيد بيدلك سرعتها القصوى 45كم/سا ،تحمل لوحة أرقام بلون أصفر\r\nو تُعامل معاملة البروم فيتس ، سائقها مجبر على ارتداء خوذه تحتاج رخصة قيادة من نوع AM أو B', 'Deze elektrische fiets heet Speed Pedal, hij heeft een maximale snelheid van 45 km/u en heeft een gele kentekenplaat. Deze wordt gekwalificeerd als een bromfiets, de bestuurder is verplicht een helm te dragen waarvoor een AM- of B-rijbewijs vereist is.', NULL, NULL, '2023-03-03 18:14:26', '2023-03-07 23:32:50'),
(491, 'OTls189aGtleCmd', 'تُريد جر عربه وزنها مع الحمولة اكثر من 4500 كغ مانوع رخصه القيادة التي يسمح بها لذلك؟', 'Je wilt een voertuig meeslepen dat meer dan 4.500 kg weegt, welk type rijbewijs heb je nodig?', 43, 28, 'mcq', 'uploads/question/nBU0Dv1677870952.jpg', 28, NULL, NULL, NULL, NULL, '2023-03-03 18:15:52', '2023-03-06 14:41:55'),
(492, 'gXvaO7RO4AJoYGH', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/8IaPMK1677876193.jpg', 1, 'الجو ماطر و الطريق رطب وهناك احتمال لحدوث أكوابلانغ(انزلاق) وسرعتك عالية لذلك خفف سرعتك قليلاً\r\n\r\nبرفع القدم عن دواسة الوقود للحفاظ على مسافة أمان أكبر وتجنب حدوث أكوابلانغ.', NULL, NULL, NULL, '2023-03-03 19:43:13', '2023-03-15 18:21:40'),
(493, 'nIEmUhkHfK1kUWr', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/rk1M4z1677876653.jpg', 2, 'سرعتك ٨٠كم/سا واللوحة المعدنية تجبرك بسرعة قصوى ٧٠كم/سا ،\r\n\r\nوأمامك منعطف وأنت لا ترى القادمين من أمامك فهذه الحالة خطرة لذلك استخدم الفرامل لتخفيف سرعتك مباشرة .', NULL, NULL, NULL, '2023-03-03 19:50:53', '2023-03-15 18:22:23'),
(494, 'AbWQcHKUSf5ZPP0', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/RzVsUS1677876753.jpg', 3, 'أنت تقود على طريق خارج المدينه ذو السرعه القصوى\r\n\r\n٨٠كم/سا، و سرعتك مناسبة على هذا الطريق ولا وجود لخطر يهددك .', NULL, NULL, NULL, '2023-03-03 19:52:33', '2023-03-15 18:22:52'),
(495, 'q15tRSRBnOizVen', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/ALQ4Sy1677876861.jpg', 4, 'اللوحة الإلكترونية تجبرك بسرعة قصوى ٩٠كم/سا\r\n\r\nلذلك خفف سرعتك قليلاً برفع القدم عن دواسة الوقود كي تتماشى مع حدود السرعة المطلوبة.', 'Het elektronische bord legt een ​​maximumsnelheid van 90 km/u op.\r\n\r\nVerlaag je snelheid door jouw voet van het gaspedaal te halen.', NULL, NULL, '2023-03-03 19:54:21', '2023-03-15 18:32:25'),
(496, 'nNZvhydfvALC3Xy', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/rCNqlQ1677877019.jpg', 5, ' توقف مباشرة بالضغط على الفرامل فقد يخرج أحد الأطفال من خلف السيارة لإلتقاط الكرة .', 'Stop onmiddellijk door op de rem te trappen, aangezien een van de kinderen achter de auto vandaan kan komen om de bal op te pakken.', NULL, NULL, '2023-03-03 19:56:59', '2023-03-13 13:37:41'),
(497, '5uunOU6vVDHmaiF', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/SupRh51677877106.jpg', 6, 'الأرض زلقة بسبب وجود الثلج وسرعتك تعتبر عالية بهذه الحالة وأمامك منعطف\r\n\r\nلذلك خفف سرعتك قليلاً برفع القدم عن دواسة الوقود وتجنّب الضغط على الفرامل في الثلج لأنه سيؤدي لإنزلاق السيارة وعدم إمكانية التحكم بها.', 'De weg is glad en je snelheid is hoog in deze toestand en je hebt een bocht voor je.\r\n\r\nverlaag je snelheid door het gas los te laten en vermijd het intrappen van de remmen in de sneeuw, omdat de auto dan gaat slippen en onbestuurbaar wordt.', NULL, NULL, '2023-03-03 19:58:26', '2023-03-15 18:36:40'),
(498, 'dbcfPvJPSICJ4qv', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/HhUDQp1677877202.jpg', 7, ' انت في نهاية طريق السيارات و تقترب من الدوار بسرعة عالية ،\r\n\r\n.لذلك استخدم الفرامل لتخفيف سرعتك كي تصل الدوار بسرعة قليلة', NULL, NULL, NULL, '2023-03-03 20:00:02', '2023-03-15 18:40:53'),
(499, 'JDYCbcWD4Wm3jT4', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/SxHD9B1677877305.jpg', 8, 'سائق السيارة التي امامك قد استخدم الفرامل مشكلاً حالة خطر\r\n\r\nلذلك اضغط على الفرامل فأنت مقترب منه بسرعه عالية نوعاً ما .', 'De bestuurder van het voertuig voor je heeft de remmen gebruikt, waardoor een gevaarlijke situatie is ontstaan.\r\n\r\nTrap dus op de rem, je nadert hem met vrij hoge snelheid.', NULL, NULL, '2023-03-03 20:01:45', '2023-03-15 18:42:10'),
(500, 'J26ufsRqwgsJKZu', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/MQ7k9K1677877387.jpg', 9, ' سرعتك عالية نوعاً ما والإشارة الضوئية حمراء أمامك ،لذلك خفف سرعتك برفع القدم عن دواسة الوقود من موقعك هذا\r\n\r\nفربما تحتاج للضغط على الفرامل لاحقاً وربما تنقلب الإشارة الضوئية إلى اللون الأخضر', NULL, NULL, NULL, '2023-03-03 20:03:07', '2023-03-15 18:44:43'),
(501, 'fq37fMZloBKZPLd', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/fGZXyH1677877467.jpg', 10, 'الأرض زلقة بسبب وجود الثلج وأمامك منعطفين لذلك خفف سرعتك قليلاً برفع القدم عن دواسة الوقود\r\n\r\nوتجنّب الضغط على الفرامل في الثلج لأنه سيؤدي لانزلاق السيارة وعدم امكانية التحكم بها.', 'De weg is glad door de aanwezigheid van sneeuw en er zijn twee bochten voor je, dus vertraag je snelheid door je voet van het gaspedaal te halen.\r\n\r\nVermijd hetremmen in de sneeuw, omdat de auto hierdoor gaat slippen en niet meer onder controle kan worden gehouden.', NULL, NULL, '2023-03-03 20:04:27', '2023-03-15 21:00:38'),
(502, '7G99NANQBbBs0xI', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/ncYV6o1677877562.jpg', 11, 'لوحة ستوب تجبرك على التوقف فأنت تقترب من خط لعبور الفيتس والسنورفيتس والبروم فيتس،\r\n\r\nلذلك استخدم الفرامل و توقف.', 'Een stopbord geeft aan om te stoppen als je de oversteekplaats van een fiets, bromfiets en snorfiets nadert.', NULL, NULL, '2023-03-03 20:06:02', '2023-03-15 21:00:53'),
(503, 'CS91EnEbKr9VAR3', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/GCqFFe1677879694.jpg', 12, ' سائقي الفيتس أمامك غير مدركين وجودك و وتقترب منهم بسرعة عالية قليلاً لذلك خفف سرعتك بالضغط على الفرامل.', NULL, NULL, NULL, '2023-03-03 20:41:34', '2023-03-15 21:01:07'),
(504, '8KovDMZD9yfkh2k', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/UZQ4Sl1677879797.jpg', 13, 'أنت تقترب من منعطف و مطب لذلك خفف سرعتك برفع القدم عن دواسة الوقود.', 'Je nadert een bocht en een drempel, dus verlaag je snelheid door het gas los te laten.', NULL, NULL, '2023-03-03 20:43:17', '2023-03-15 21:02:23'),
(505, 'Us33I7jK80Zrby2', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/t5iAPp1677879890.jpg', 14, ' أنت تقترب من دوار وأسنان قرش ، لذلك خفف سرعتك بالضغط على الفرامل فالأفضلية للسائق القادم من يسارك داخل الدوار.', NULL, NULL, NULL, '2023-03-03 20:44:50', '2023-03-15 21:02:33'),
(506, 'GQLH84132huXz5z', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/kZze471677879992.jpg', 15, 'السيارة التي أمامك دخلت بخانتك ومسافة الأمان غير كافية لذلك خفف سرعتك برفع القدم عن دواسة الوقود.', NULL, NULL, NULL, '2023-03-03 20:46:32', '2023-03-15 21:02:46'),
(507, 'unNna8ZMXyTWnr0', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/3swAVB1677880038.jpg', 16, 'أنت داخل المدينة والأفضلية للباص الذي ينوي مغادرة موقفه لذلك توقف ودعه يذهب قبلك.', 'Je bent binnen de bebouwde kom en de bus die van plan is zijn halte te verlaten heeft voorrang, dus stop en laat hem voor je gaan.', NULL, NULL, '2023-03-03 20:47:18', '2023-03-13 19:19:26'),
(508, 'cTdOINvPIBSvVBC', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/JMM7R01677880122.jpg', 17, 'سرعتك مناسبة و لا وجود لخطر يهددك ،بالنسبة للفيتس لديه أسنان قرش والأفضلية لك.', 'Je snelheid is passend en er is geen gevaar , want de fietsers hebben haaientanden en jij hebt de voorrang.', NULL, NULL, '2023-03-03 20:48:42', '2023-03-05 12:53:44'),
(509, 'kyt4WP9YmnLpZ2W', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/cp1kU71677880199.jpg', 18, 'سرعتك مناسبة و لا وجود لخطر يهددك.', NULL, NULL, NULL, '2023-03-03 20:49:59', '2023-03-15 21:03:22'),
(510, 'uoIAZFyKcQujrJr', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/bIrkSf1677880273.jpg', 19, 'أنت تقترب من دوار وسرعتك عالية نوعاً ما لذلك خفف سرعتك باستخدام الفرامل.', NULL, NULL, NULL, '2023-03-03 20:51:13', '2023-03-15 21:03:32'),
(511, 'xl3iCja7D4MDPOV', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/8wuBCO1677880493.jpg', 21, 'اللوحة المعدنية تُجبرك بسرعة قصوى ٨٠كم/سا وانت تسير بسرعة٩٠كم/سا،\r\n\r\nلذلك خفف سرعتك قليلاً برفع القدم عن دواسة الوقود كي تتماشى مع حدود السرعة المطلوبة.', 'Het verkeersbord legt een maximale snelheid van 80 km/u op terwijl je 90 km/u rijdt. Verlaag je snelheid door het gas los te laten om de vereiste maximumsnelheid aan te houden.', NULL, NULL, '2023-03-03 20:52:53', '2023-03-15 21:04:44'),
(512, 'Gxb7R92s5OPkEDb', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/fEcOdu1677880373.jpg', 20, 'السيارة التي أمامك دخلت بخانتك ومسافة الأمان غير كافية لذلك خفف سرعتك\r\n\r\nبرفع القدم عن دواسة الوقود واترك مسافة أكبر بينك وبينه.', NULL, NULL, NULL, '2023-03-03 20:52:53', '2023-03-15 21:03:55'),
(513, 'vSNZ5qiEx7YG8lU', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/bLF1931677880642.jpg', 22, ' الإشارة الضوئية حمراء أمامك لذلك خفف سرعتك بالضغط على الفرامل.', 'Het stoplicht staat op rood, dus verminder je snelheid door te remmen.', NULL, NULL, '2023-03-03 20:57:22', '2023-03-05 12:50:09'),
(514, 'r2OIwhc1uVjPz9L', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/bFbWs91677880750.jpg', 23, ' سرعتك مناسبة و لا وجود لخطر يهددك .', NULL, NULL, NULL, '2023-03-03 20:59:10', '2023-03-15 21:04:59'),
(515, 'ALjfUxEwSPVXW44', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/Zbl3gN1677880825.jpg', 24, ' الإشارة الضوئية خضراء و سرعتك مناسبة  و لا وجود لخطر يهددك .', 'Het stoplicht staat op groen, je snelheid is gepast en er is geen gevaar.', NULL, NULL, '2023-03-03 21:00:25', '2023-03-05 12:49:24'),
(516, 'yiqFgNm766dbmMV', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 44, 29, 'mcq', 'uploads/question/rAGXgC1677880903.jpg', 25, ' انت تقود بالسرعة القصوى لهذا الطريق والجو مثلج و ضبابي و الأرض زلقة\r\n\r\nلذلك خفف سرعتك برفع القدم عن دواسة الوقود وتجنب الضغط على الفرامل في مثل هذه الحالات.', NULL, NULL, NULL, '2023-03-03 21:01:43', '2023-03-15 21:06:46'),
(517, '8UHW5lZ3tIK9b4l', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/goE0Ty1677881090.jpg', 1, 'أنت تقترب من تقاطع و الفيتس أمامك يتموضع في منتصف\r\n\r\nالشارع وهو غير مدرك وجودك وسرعتك تعتبر\r\n\r\nعالية بالنسبة له لذلك خفف سرعتك بالضغط على الفرامل وابقى خلفه', 'De fietser voor je fietst ​​midden op straat, hij is zich niet bewust van jouw aanwezigheid, dus vertraag door te remmen en blijf achter de fietser.', NULL, NULL, '2023-03-03 21:04:50', '2023-03-15 15:54:21'),
(518, 'aP8y3NY6xxURWnm', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/cmiEHw1677881180.jpg', 2, ' أنت تقترب من منعطف و أمامك فيتسات و سرعتك تعتبر\r\n\r\nعالية لذلك خفف سرعتك بالضغط على الفرامل قليلاً كي تتجاوز هذا الموقف بأمان', NULL, NULL, NULL, '2023-03-03 21:06:20', '2023-03-15 15:56:47');
INSERT INTO `questions` (`id`, `question_uuid`, `question_ar`, `question_nl`, `exam_category_id`, `exam_id`, `question_type`, `question_image`, `arrangment`, `answer_explanation_ar`, `answer_explanation_nl`, `question_en`, `answer_explanation_en`, `created_at`, `updated_at`) VALUES
(519, '4mmmMPmAc1A6QXz', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/prHXaJ1677881285.jpg', 3, 'سرعتك مناسبة نوعاً ما ،لكن وجود السيارة\r\nالمقابلة والفيتس الذي يقوم بتجاوزها يشكل\r\nخطورة ،حيث لا مجال لك لمتابعة السير\r\nوالتجاوز لأنك ستصطدم بالفيتس المقابل\r\n، لذلك توقف ودعه يمر', NULL, NULL, NULL, '2023-03-03 21:08:05', '2023-03-15 15:56:59'),
(520, 'PyYc2BIb27toX4s', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/xhWRxu1677881380.jpg', 4, 'هناك عملية تحميل وتنزيل بضائع أمامك والشارع ضيق قليلاً و ربما يفتح أحدهم باب سيارته فجأة لذلك خفف سرعتك قليلاً.', NULL, NULL, NULL, '2023-03-03 21:09:40', '2023-03-15 15:57:19'),
(521, 'VTBnel63WPrRCRt', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/GEoXWH1677881464.jpg', 5, 'أنت تقترب من جسر والطريق ضيق بسبب وجود الفيتس\r\nوالمشاة ولا مجال لك للمرور لذلك توقف حتى يفرغ الطريق ثم تابع السير', 'Je nadert een brug en de weg is smal vanwege de aanwezigheid van fietsers en voetgangers en je kunt er niet langs, dus stop tot de weg leeg is en rijd dan verder.', NULL, NULL, '2023-03-03 21:11:04', '2023-03-15 15:57:36'),
(522, 'zOS5ZZzOWjN010S', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/oXVerw1677881537.jpg', 6, 'سرعتك مناسبة  ومسافة الأمان كافية و لا وجود لخطر يهددك', NULL, NULL, NULL, '2023-03-03 21:12:17', '2023-03-15 15:57:47'),
(523, 'Qucv9O4r8qXWhvu', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/yTUUuk1677881836.jpg', 7, 'سرعتك مناسبة  ومسافة الأمان كافية و لا وجود لخطر يهددك', NULL, NULL, NULL, '2023-03-03 21:17:16', '2023-03-15 15:57:58'),
(524, 'i1kJs1Bik1lhnJa', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/1gk0wu1677881932.jpg', 8, 'سرعتك مناسبة بهذا الشارع لكن سائق السيارة\r\nالتي أمامك يعطي إشارة ضوئية (غماز) لليمين فهو يريد الدخول\r\nفي موقف الباركير ولا مجال لتجاوزه بسبب وجود\r\nسيارة مقابلة ، لذلك خفف سرعتك بالضغط على\r\nالفرامل قليلاً حتى يصبح الوضع أكثر أماناً', NULL, NULL, NULL, '2023-03-03 21:18:52', '2023-03-15 16:04:31'),
(525, 'FkNLRYzTpTo5bLo', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/b5OpOq1677882035.jpg', 9, 'الإشارة الضوئية حمراء أمامك و سرعتك\r\n\r\nعالية لذلك خفف سرعتك بالضغط على الفرامل', 'Het verkeerslicht voor je staat op rood en je snelheid is hoog, dus verlaag je snelheid door te remmen.', NULL, NULL, '2023-03-03 21:20:35', '2023-03-08 12:22:20'),
(526, 'A1j2hEuIwFL3S4O', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/Fl8mkL1677882119.jpg', 10, 'الإشارة الضوئية خضراء أمامك\r\n\r\nو سرعتك مناسبة لتجاوز المنعطف', 'Het stoplicht staat verderop op groen en je snelheid is geschikt om de afslag te passeren.', NULL, NULL, '2023-03-03 21:21:59', '2023-03-08 12:24:02'),
(527, '0ORB7JKLl0Rllan', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/F16w2F1677882193.jpg', 11, 'الأفضلية هنا للسائق القادم من\r\n\r\nاليمن لذلك توقف ودعه يذهب قبلك', 'De voorrang hier is voor de bestuurder die van rechts komt.', NULL, NULL, '2023-03-03 21:23:13', '2023-03-15 16:05:19'),
(528, '4lEHOHAqvLXuULx', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/Jk1DpF1677882285.jpg', 12, 'الشاحنة تنوي الدخول بشارعك وسوف\r\nتستخدم جزء من خانتك وبالتالي لا يمكنك\r\nمتابعة السير للأمام لذلك توقف يميناً\r\nحتى يفرغ الشارع ومن ثم تابع السير', 'De vrachtwagen is van plan dezelfde straat in te rijden en zal een deel van de rijstrook gebruiken en daarom kun je niet verder rijden, dus stop aan de rechterzijde van de weg totdat de straat leeg is en rijd dan verder.', NULL, NULL, '2023-03-03 21:24:45', '2023-03-08 12:28:29'),
(529, '8kquBwTXdrNd0Is', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/bdhMg61677882357.jpg', 13, 'سرعتك عالية قليلاً بسبب وجود السيارة\r\nالتي دخلت أمامك بسرعة قليلة لذلك\r\nخفف سرعتك برفع القدم عن دواسة الوقود', NULL, NULL, NULL, '2023-03-03 21:25:57', '2023-03-15 16:08:02'),
(530, 'Lyi2Z6NZJPSnJ9h', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/k7qiYg1677882443.jpg', 14, 'انت تعطي إشارة ضوئية(غماز) الى اليمين بغية الإنعطاف لاحقاً\r\nو الإشارة الضوئية الخاصة بخانتك حمراء والسيارات\r\nأمامك قد استخدمت الفرامل للتوقف لذلك استخدم الفرامل\r\nكي تتوقف خلف السيارات ريثما تنقلب الإشارة الضوئية\r\nالى اللون الأخضر ثم تتابع السير', NULL, NULL, NULL, '2023-03-03 21:27:23', '2023-03-15 16:08:15'),
(531, 'dQfkvHwHl82sqGR', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/xyfn4A1677882526.jpg', 15, 'سرعتك مناسبة ومسافة الأمان\r\n\r\nكافية و لا وجود لخطر يهددك', 'Je snelheid is passend, de veiligheidsafstand is voldoende en er is geen gevaar.', NULL, NULL, '2023-03-03 21:28:46', '2023-03-08 12:35:44'),
(532, 'lc6mKASN8f14tj2', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/Dd8wtG1677882596.jpg', 16, 'سائق السيارة أمامك بدأ بالإنعطاف يميناً\r\nوأنت مقترب منه بسرعة عالية والتجاوز\r\nهنا غير آمن لأن الرؤية غير واضحة بشكل\r\nكامل لحالة الطريق أمامك لذلك خفف سرعتك\r\nفوراً بالضغط على الفرامل', 'De bestuurder van de auto voor je begint rechtsaf te slaan terwijl je hem met hoge snelheid nadert, en inhalen is hier niet veilig omdat het zicht van de toestand van de weg voor je niet helemaal duidelijk is, dus verlaag je snelheid onmiddellijk door op de rem te trappen.', NULL, NULL, '2023-03-03 21:29:56', '2023-03-08 12:38:11'),
(533, 'q4wQqmHrLNQd6nR', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/EL9QjT1677882677.jpg', 17, 'أنت مقترب من الفيتسات و سرعتك عالية\r\nولا يمكنك تجاوزهم بسبب وجود السيارة\r\nوالفيتس الذين يقومون بالإنعطاف يساراً\r\nلذلك خفف سرعتك بالضغط على\r\nالفرامل كي لا تصطدم بهم', 'Je nadert de fietsers en je snelheid is hoog. Je kunt ze niet inhalen vanwege de aanwezigheid van de auto en de fietsers die naar links afslaan, verlaag je snelheid door te remmen .', NULL, NULL, '2023-03-03 21:31:17', '2023-03-15 16:09:32'),
(534, 'QIgUqO7dYEKDSGV', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/hbO32j1677882757.jpg', 18, 'سرعتك مناسبة بهذا الشارع\r\nلكن وجود المشاة الغير مدرك\r\nلوجودك يفرض عليك الضغط\r\nعلى الفرامل والتوقف', NULL, NULL, NULL, '2023-03-03 21:32:37', '2023-03-15 16:10:01'),
(535, 'UbcZW3ckpYln6rD', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/CysaMD1677882855.jpg', 19, 'الشارع ضيق للمرور بسبب وجود السيارة\r\nالمتوقفة وسرعتك تعتبر عالية بهذه الحالة\r\nلذلك خفف سرعتك عن طريق الفرامل فربما\r\nيخرج السائق من خلف السيارة وهو غير مدرك وجودك', 'De straat is smal voor verkeer vanwege de aanwezigheid van de auto die stilstaat, en je snelheid wordt in dit geval als hoog beschouwd. Verlaag je snelheid door te remmen, aangezien de bestuurder achter de auto vandaan kan komen zonder je aanwezigheid te beseffen.', NULL, NULL, '2023-03-03 21:34:15', '2023-03-15 16:10:42'),
(536, '6O1yVpryoVEwM72', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/TvDfBw1677882936.jpg', 20, 'سرعتك مناسبة ومسافة الأمان كافية ولا وجود لخطر يهددك.', 'Je snelheid is passend, de veiligheidsafstand is voldoende en er is geen gevaar.', NULL, NULL, '2023-03-03 21:35:36', '2023-03-08 12:53:12'),
(537, 'aRjA8tNjKZrIQM2', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/ejN7ct1677883013.jpg', 21, 'اللوحة تخبرك بسرعة قصوى ٣٠كم/سا وانت تقود بسرعة ٤٠كم/سا\r\n\r\nوالشارع ضيق و مزدحم قليلاً وأمامك سائقين ولا مجال للتجاوز لذلك خفف سرعتك بالضغط على الفرامل  .', 'Op het bord staat een maximumsnelheid van 30 km/u terwijl je 40 km/u rijdt. De straat is smal en een beetje druk,  er zijn twee bestuurders voor je, en er is geen ruimte om in te halen. Verlaag je snelheid door te remmen.', NULL, NULL, '2023-03-03 21:36:53', '2023-03-15 18:18:05'),
(538, 'XzIGoDhNSHZ3vgz', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/SLIBN11677883094.jpg', 22, 'لا يمكنك تغيير مسارك وتجاوز الفيتس بسبب وجود الخط الأبيض المتصل على الطريق، لذلك استخدم الفرامل و ابقى خلف الفيتس', 'Je kunt niet van rijstrook wisselen en de fiets inhalen omdat er een ononderbroken witte lijn op de weg is, dus gebruik de remmen en blijf achter de fiets.', NULL, NULL, '2023-03-03 21:38:14', '2023-03-15 18:18:41'),
(539, 'UFh04egk25diKi5', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/Ww2mPt1677883177.jpg', 23, ' أنت تعطي إشارة ضوئية (غماز) لليسار وتقترب من المنعطف بسرعة عالية\r\n\r\nلذلك خفف سرعتك بالضغط على الفرامل حتى تتمكن من اجتياز المنعطف بأمان.', NULL, NULL, NULL, '2023-03-03 21:39:37', '2023-03-15 18:18:49'),
(540, 'C29iJzvumf6EAAH', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/izcdon1677883253.jpg', 24, ' الفيتس دخل أمامك ومسافة الأمان قليلة جداً وأمامك سيارة مقابلة حيث لا مجال للمرور لذلك توقف مباشرة.', NULL, NULL, NULL, '2023-03-03 21:40:53', '2023-03-15 18:18:59'),
(541, 'NZtxDhEcfdwfzEy', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 45, 30, 'mcq', 'uploads/question/ooKI8a1677883328.jpg', 25, 'سائق السيارة أمامك قد استخدم الفرامل وأمامك منعطف وسرعتك عالية\r\n\r\nلذلك خفف سرعتك بالضغط على الفرامل.', 'De bestuurder van de auto voor je remt en je rijdt met hoge snelheid, rem dus af.', NULL, NULL, '2023-03-03 21:42:08', '2023-03-15 18:19:16'),
(542, '7MEhDiZrgwpuCod', 'على ماذا تدل هذه اللوحة؟', 'Wat geeft dit bord aan?', 48, 33, 'mcq', 'uploads/question/hcB0KL1677927384.jpg', 1, 'الخانه الاضافيه مفتوحه للسير\r\nوبعرض أقصى للمركبات قدره 2.3 متر', 'Een extra rijstrook aan de linkerkant wordt plusstrook genoemd.', NULL, NULL, '2023-03-04 09:56:24', '2023-03-14 12:13:49'),
(543, 'uyFQuU8zTrGn956', 'على ماذا تدل هذه اللوحة؟', 'Wat geeft dit bord aan?', 48, 33, 'mcq', 'uploads/question/xKR8v51678804630.jpg', 2, 'هذه اللوحة تتواجد على الطريق السريع وتدل على أن الطريق السريع سينقسم أو يتفرع إلى طريقين سريعين', NULL, NULL, NULL, '2023-03-04 09:57:49', '2023-03-14 13:37:10'),
(544, 'xrMGxae4H9PDRz0', 'أي من اللوحات التالية تدل على وجود فسحة توقف للبحث عن معلومات؟', 'Welke van de volgende borden geeft een informatiepuntverwijzing aan?', 48, 33, 'mcq', 'uploads/question/cLzZle1678804399.jpg', 3, NULL, NULL, NULL, NULL, '2023-03-04 09:59:14', '2023-03-14 13:33:19'),
(545, 'WXKogjTu38hWq6w', 'أين توجد هذه اللوحة؟', 'Waar staat dit bord bevestigd?', 48, 33, 'mcq', 'uploads/question/fwnVdR1678805946.jpg', 4, 'هذه اللوحة تتواجد على الطريق السريع وتدل على اتجاه المخرج', NULL, NULL, NULL, '2023-03-04 10:00:29', '2023-03-14 13:59:06'),
(546, '7OFg9zE4lJrolnu', 'أنت تقود مركبه مع مقطوره الطول الكلي لهما 7.5 مترهل يسمح لك تجاوز السيارة الزرقاء بسرعه 90كم /ساعه؟', 'Je rijdt met een aanhangwagen, samen met je auto is de lengte 7,5 meter in totaal. Mag je de blauwe auto inhalen met 90 km/u?', 46, 31, 'mcq', 'uploads/question/O0RdMn1677927762.jpg', 1, 'عندما يتجاوز طول السيارة مع المقطورة سبعه امتار تصبح ملزمه\r\n بالسير على اول خانتين فقط من الجهه اليمين للخط السريع.', 'Wanneer de lengte van het voertuig met de aanhanger meer dan zeven meter bedraagt, mag je alleen de twee rechter rijstroken gebruiken.', NULL, NULL, '2023-03-04 10:02:42', '2023-03-14 20:39:59'),
(547, '96C99dsHeSMQpDl', 'هل يُسمح لك القياده بهذا الشكل؟', 'Mag je op deze manier rijden?', 46, 31, 'mcq', 'uploads/question/cmCLrS1677927875.jpg', 2, 'السبب: يجب وضع قاعده لتثبيت الحموله بشكل جيد', 'Reden: Er moet een onderstel worden geplaatst om de lading goed te bevestigen.', NULL, NULL, '2023-03-04 10:04:35', '2023-03-14 20:40:22'),
(548, 'hmoFBXM4YWjr7zP', 'الحمولة بارزه متر من الأمام , هل يُسمح لك القياده بهذا الشكل؟', 'De lading steekt 1 meter uit aan de voorzijde, mag je op deze manier rijden?', 46, 31, 'mcq', 'uploads/question/OQ9IWE1677928116.jpg', 3, 'السبب: \r\nلان الحموله اكثر من قطعه فوق السيارة \r\nوبتالي ممنوع ان تبرز من مقدمة السيارة', 'De deelbare lading mag niet uitsteken aan de voorzijde.', NULL, NULL, '2023-03-04 10:06:21', '2023-03-14 20:42:58'),
(549, 'C7U7UTSG2KahMbq', 'ما هو الحدّ الأقصى لوزن المركبة مع العربة وحمولتها ، مع رخصة القيادة فئة B ؟', 'Wat is de maximummassa wat je mag vervoeren met rijbewijs B (auto + aanhanger + lading)', 46, 31, 'mcq', 'uploads/question/kOv2HD1677928256.jpg', 4, NULL, NULL, NULL, NULL, '2023-03-04 10:10:56', '2023-03-14 20:57:39'),
(550, 'Nak0JWV2QaKJakV', 'الحمولة بارزة متر من خلف السيارة , هل يُسمح لك القياده بهذا الشكل؟', 'De lading steekt 1 meter uit aan de achterzijde, mag je op deze manier rijden?', 46, 31, 'mcq', 'uploads/question/f7kUUZ1677928369.jpg', 5, 'اذا كانت الحموله اكثر من قطعه مسموح ان تبرز متر واحد فقط من الخلف كحد أقصى', 'Als de lading uit meer dan één stuk bestaat, mag deze slechts één meter aan de achterkant uitsteken.', NULL, NULL, '2023-03-04 10:12:49', '2023-03-14 20:59:34'),
(551, 'Tg0nfyyQrIKxlyg', 'الحمولة بارزه متر من الأمام و متر من الخلف هل يُسمح لك القيادة بهذا الشكل؟', 'De lading steekt zowel aan de voorzijde als de achterzijde 1 meter uit, mag je op deze manier rijden?', 46, 31, 'mcq', 'uploads/question/2OBQYp1677928490.jpg', 6, 'بما ان الحموله قطعه واحده فمسموح \r\nان تبرز متر امام مقدمة السيارة ومتر من الخلف  كحد أقصى', 'Aangezien de lading uit één stuk bestaat, mag deze één meter aan de voorkant van de auto uitsteken en één meter aan de achterkant.', NULL, NULL, '2023-03-04 10:14:50', '2023-03-14 20:59:19'),
(552, 'vkX4ueK7mxG58pj', 'الحمولة بارزه 25 سم من كل جانب هل يُسمح لك القياده؟', 'De lading steekt aan beide zijde 25 cm uit, mag dit?', 46, 31, 'mcq', 'uploads/question/EB3Jn11677928586.jpg', 7, 'بما ان الحموله قطعه واحده فمسموح \r\nان تبرز 20سم فقط من كل جانب كحد أقصى', 'De lading mag maximaal 20 cm uitsteken aan beide kanten.', NULL, NULL, '2023-03-04 10:16:26', '2023-03-14 21:00:50'),
(553, 'udprFMxP9RSyVdy', 'هل يُسمح لك القياده بهذا الشكل؟', 'Mag je op deze manier rijden?', 46, 31, 'mcq', 'uploads/question/COabfl1677928698.jpg', 8, 'السبب: \r\nلم تقم بوضع الحموله بشكل امن خاصه ان الحموله بارزه\r\n امام و خلف المقطوره وغير مثبته وفي حال الضغط على الفرامل \r\nستندفع الى الامام مشكله خطرا عليك وعلى السائقين.', 'Reden: je hebt de lading niet correct geplaatst, vooral omdat de lading voor de aanhangwagen uitsteekt en niet goed is bevestigd. Als je op de rem trapt, zal de lading zich naar voren verplaatsen wat een gevaar vormt voor jou en de weggebruikers.', NULL, NULL, '2023-03-04 10:18:18', '2023-03-14 21:01:53'),
(554, 'Kouq1YTbNvvSgSD', 'في أي من اللوحات التالية تستطيع الدراجة الهوائية (فيتس)الدخول؟', 'Welke van de volgende borden geeft aan dat fietsen is toegestaan in deze straat?', 48, 33, 'mcq', 'uploads/question/mdCXeC1678804198.jpg', 5, 'اللوحة A تعني أن الدراجة الهوائية ستكون ضيف في طريق المشاة ، واللوحة B تعني أن السيارات ستكون ضيف في طريق الدراجات  الهوائية ،أي كلا  اللوحتين تسمحان بدخول الدراجات الهوائية', 'Bord A geeft aan dat fietsen te gast zijn in deze straat. Bord B geeft aan dat auto\'s te gast zijn op een fietsstraat.', NULL, NULL, '2023-03-04 10:20:43', '2023-03-14 13:29:58'),
(555, '3ZSgOgLjkQMpI1s', 'في أي من الحالتين يُسمح لك القياده؟', 'In welk geval mag je rijden?', 46, 31, 'mcq', 'uploads/question/q4kP3c1677929035.jpg', 9, 'السبب: \r\nلان حمالة الفيتسات في الحاله A لاتحوي أضواء ولا لوحة ارقام', 'De fiets-drager moet altijd beschikken over verlichting en een witte kentekenplaat.', NULL, NULL, '2023-03-04 10:23:55', '2023-03-14 21:03:17'),
(556, 'kZ22flzzgdzI5pj', 'هل السيارة البيضاء مجبرة بإعطاء الأفضلية للمشاة بوجود هذه اللوحة؟', 'Is de witte auto verplicht om voorrang te geven aan voetganger met dit bord?', 48, 33, 'mcq', 'uploads/question/aqSzkt1677929100.jpg', 6, 'هذه اللوحة تخص السائقين ولا علاقة لها بالمشاة', 'Dit bord regelt de voorrang tussen bestuurders en geldt niet voor voetgangers', NULL, NULL, '2023-03-04 10:25:00', '2023-03-14 12:16:59'),
(557, 'BJxu9DtQq1p5Ci2', 'لقد قمت بتثبيت الحموله بشكل جيد هل يُسمح لك القياده بهذا الشكل؟', 'Je hebt de lading correct bevestigd, mag je op deze manier rijden?', 46, 31, 'mcq', 'uploads/question/IXlDum1677929148.jpg', 10, 'السبب: \r\nبالنسبه للحمولات البارزه امام المقطوره يجب  الايتجاوز بروزها منطقة الكوبيل \r\nوهي منطقه ربط المقطوره مع السيارة بالاضافه الى تثبيتها بشكل جيد.', 'Wat betreft uitstekende ladingen aan de voorkant van de aanhangwagen, deze mogen niet verder uitsteken dan de trekhaak, het gebied waar de aanhangwagen aan de auto is gekoppeld.', NULL, NULL, '2023-03-04 10:25:48', '2023-03-14 21:05:48'),
(558, 'wIjTaRikS4m5sev', 'على بُعد كم متر تتوقع أن تتقاطع حركتك مع سكة قطار أمامك؟', 'Op hoeveel meter afstand kun je een treinspoor verwachten?', 48, 33, 'mcq', 'uploads/question/4pQ9Jg1678801201.jpg', 7, 'اللوحة التحذيرية تخبرك انه ستتقاطع حركتك مع سكة قطار غير محمية بحاجز ، أما العامود الأبيض يحوي على خطوط حمراء تدل على المسافة بين هذا العامود وسكة القطار  حيث كل خط أحمر يشير الى مسافة قدرها (٨٠ متر )', 'Elk rood streep staat gelijk aan 80 meter. op dit bord zien we 3 strepen wat gelijkstaat aan 240 meter', NULL, NULL, '2023-03-04 10:26:11', '2023-03-14 12:40:01'),
(559, 'YuaZrlIJfxTgIq1', 'الحموله بارزه 4.5 متر خلف المقطورة وقمت بوضع لوحة تحذيرية هل يُسمح لك القيادة على هذا الشكل؟', 'De lading steekt 4,5 meter uit de aanhangwagen met een markeringsbord, mag je op deze manier rijden?', 46, 31, 'mcq', 'uploads/question/XGa6kj1677929237.jpg', 11, 'الحد الأقصى لبروز الحموله خلف المقطورة هو خمس أمتار بدءا من محور الدولاب الخلفي للمقطورة', 'Het uitsteken van de lading mag niet meer dan vijf meter bedragen, uitgaande van de as van het achterwiel van de aanhangwagen.', NULL, NULL, '2023-03-04 10:27:17', '2023-03-14 21:06:42'),
(560, 'y8v7s0CItRHnQix', 'هل يُسمح لك الدخول بهذا الشارع؟', 'Is het toegestaan om deze straat in te rijden?', 48, 33, 'mcq', 'uploads/question/0PBwNL1677929260.jpg', 8, 'هذه اللوحة تمنع الباركيرن و الستيليستان فقط و هي لا تمنع من الدخول', 'Reden: Dit bord betekent dat het verboden is om te parkeren of stil te staan.', NULL, NULL, '2023-03-04 10:27:40', '2023-03-12 08:07:57'),
(561, 'kOeE5gYn3MArHKN', 'الحمولة بارزة 1.5 متر خلف العربة هل يُسمح لك القيادة على هذا الشكل؟', 'De lading steekt 1,5 meter uit aan de achterzijde van de aanhangwagen, mag je op deze manier rijden?', 46, 31, 'mcq', 'uploads/question/5mAjTk1677929332.jpg', 12, 'يسمح ببروز الحموله أكثر من متر خلف العربه لكن عندها يجب وضع لوحه تحذيريه', 'De lading mag meer dan een meter uitsteken aan de achterzijde van de aanhangwagen, maar dan moet er wel een markeringsbord worden geplaatst.', NULL, NULL, '2023-03-04 10:28:52', '2023-03-14 21:09:19'),
(562, 'cR3o6hg9LV9LnpE', 'هل يُسمح لك الدخول بهذا الطريق؟', 'Is het toegestaan om deze weg op te rijden?', 48, 33, 'mcq', 'uploads/question/Vfskmt1677929365.jpg', 9, ' هذه اللوحة تمنع دخول الخيالة مع أحصنتهم فقط', NULL, NULL, NULL, '2023-03-04 10:29:25', '2023-03-14 12:20:40'),
(563, 'smN44JEu1J3af83', 'الحمولة بارزه 80 سم خلف العربة هل يسمح لك القيادة على هذا الشكل؟', 'De lading steekt 80 cm uit aan de achterzijde van de aanhangwagen, mag je op deze manier rijden?', 46, 31, 'mcq', 'uploads/question/jjWZ4l1677929448.jpg', 14, 'يسمح بروز الحموله متر خلف العربه بدون لوحه تحذيريه \r\nوالحموله موضوعه ومثبته بشكل جيد', 'De lading mag zonder markeringsbord maximaal één meter uitsteken aan de achterzijde van de aanhangwagen.', NULL, NULL, '2023-03-04 10:30:48', '2023-03-14 21:14:08'),
(564, 'p7qtyebJrlczExQ', 'تجر مقطورة وزنها مع حمولتها 850 كغ والحمولة بارزة اكثر من متر هل يُسمح لك القيادة بهذا الشكل؟', 'Je trekt een aanhangwagen en het gewicht (aanhanger+lading) wegen samen 850 kilo en de lading steekt 1 meter uit aan de achterzijde, mag je zo rijden?', 46, 31, 'mcq', 'uploads/question/QNz4wt1677929727.jpg', 13, 'عندما يتجاوز وزن المقطوره مع حمولتها ال 750كيلو غرام \r\nتأخذ لوحه ارقام صفراء غير مطابقة للوحه ارقام السيارة.', 'Wanneer het gewicht van de aanhanger met lading zwaarder is dan 750 kilo, moet er een gele kentekenplaat geplaatst worden die niet overeenkomt met de kentekenplaat van de auto.', NULL, NULL, '2023-03-04 10:33:06', '2023-03-14 21:11:55'),
(565, 'H0YkW4jt7dTZdON', 'ماذا تعني هذه اللوحة ؟', 'Wat geeft dit bord aan?', 48, 33, 'mcq', 'uploads/question/kXp0Vh1678806260.jpg', 10, NULL, NULL, NULL, NULL, '2023-03-04 10:33:06', '2023-03-14 14:04:20'),
(566, '60ZqS46NRlouAL9', 'هل يُسمح لك تجاوز الدراجات الهوائية بهذا الطريق؟', 'Mag je op deze weg fietsers inhalen?', 48, 33, 'mcq', 'uploads/question/mfmzPC1678806339.jpg', 11, 'اللوحة تدل على نهاية وجود السيارات كضيوف في مسار البايسكل ، ولكنها لا تمنع من التجاوز', 'Het bord geeft het einde van fietsstraat aan, maar het verbiedt het inhalen niet.', NULL, NULL, '2023-03-04 10:34:24', '2023-03-14 14:05:39'),
(567, 'PsxkXUx7j7qb9WK', 'الحموله بارزه اكثر من متر خلف المقطوره في اي من الوضعيتين تكون لوحه التحذير صحيحة؟', 'De lading steekt meer dan 1 meter uit, in welk geval is het markeringsbord op de juiste manier bevestigd?', 46, 31, 'mcq', 'uploads/question/RGsLQv1677929813.jpg', 15, 'لان لوحه التحذير يجب ان توضع بطريقه تسمح برؤيتها \r\nمن قبل السائقين المتواجدين خلفك وليس بجانبك', 'Het markeringsbord moet zichtbaar zijn voor het verkeer achter je.', NULL, NULL, '2023-03-04 10:36:53', '2023-03-14 21:15:59'),
(568, 'FJfXNXipNiR9vZM', 'في أي لوحة تتوقع وجود منعطف إلى اليمين؟', 'Op welk bord verwacht je eerst een bocht naar rechts?', 48, 33, 'mcq', 'uploads/question/Ozs7nU1678803924.jpg', 12, NULL, NULL, NULL, NULL, '2023-03-04 10:37:46', '2023-03-14 13:25:24'),
(569, 'BErc2p9YlwdCg6I', 'الحموله بارزه 1.5 متر خلف المقطورة هل تستطيع القياده بهذا الشكل؟', 'De lading steekt 1,5 meter uit aan de achterzijde van de aanhangwagen, mag je op deze manier rijden?', 46, 31, 'mcq', 'uploads/question/k6QMFa1677929944.jpg', 16, 'يجب وضع اللوحه التحذيرية الخاصه بالحمولات\r\n \"مخططه ابيض واحمر \" وليس قطعه قماش', 'Het markeringsbord moet wit en rood gestreept zijn, een rood doek is niet voldoende.', NULL, NULL, '2023-03-04 10:39:04', '2023-03-14 21:19:04'),
(570, '1ie6DsztdkjRbC2', 'على ماذا تنبه هذه اللوحة؟', 'Waar waarschuwt dit bord je voor?', 48, 33, 'mcq', 'uploads/question/uX2xwG1677929975.jpg', 13, NULL, NULL, NULL, NULL, '2023-03-04 10:39:18', '2023-03-09 07:41:18'),
(571, 'JrcSBleAQurPyuc', 'هل يحق لك جر عربة في النهار, إذا كان غماز العربه معطل ؟', 'Mag je overdag een aanhangwagen gebruiken wanneer één van de richtingaanwijzers het niet doet?', 46, 31, 'mcq', 'uploads/question/h6FDdD1677930038.jpg', 17, 'يمنع عليك جر عربة اذا كان الغماز أو أحد الأضواء معطل سواء في الليل أو النهار', 'Het is zowel \'s nachts als overdag verboden.', NULL, NULL, '2023-03-04 10:40:38', '2023-03-14 21:20:10'),
(572, 'JX7aVQqtFuaz6Go', 'على ماذا تدل هذه اللوحة؟', 'Wat geeft dit bord aan?', 48, 33, 'mcq', 'uploads/question/ugdSEg1677930051.jpg', 14, NULL, NULL, NULL, NULL, '2023-03-04 10:40:51', '2023-03-09 07:42:03'),
(573, 't5v3cdqxSu0qCV0', 'هل وضع الدراجة الهوائية بهذا الشكل يستهلك وقود أكثر؟', 'Als je op deze manier fietsen vervoert, verbruik je dan meer brandstof?', 46, 31, 'mcq', 'uploads/question/5B8ngF1677930112.jpg', 18, 'أي حمولة فوق السيارة أو داخلها و حتى جر العربة يتطلب جهد اضافي من المحرك و بالتالي صرف وقود أكثر', 'Elk extra gewicht op of in de auto maakt de auto zwaarder, waardoor de auto meer brandstof verbruikt.', NULL, NULL, '2023-03-04 10:41:52', '2023-03-14 21:23:20'),
(574, 'VJkrMT0MFbAW590', 'ماذا تعني هذه اللوحه؟', 'Wat betekent dit bord?', 48, 33, 'mcq', 'uploads/question/36dt1n1677930112.jpg', 15, NULL, NULL, NULL, NULL, '2023-03-04 10:41:52', '2023-03-09 07:42:44'),
(575, '0Qk7BNKpleafh6t', 'أي من لوحات الهكتوميتر التالية  تدل على الطريق السريع فقط؟', 'Welke van de volgende hectometerborden geeft alleen de snelweg aan?', 48, 33, 'mcq', 'uploads/question/ykDnkq1678803642.jpg', 16, 'يُرمز للطريق السريع في هولندا بحرف A و رقم هذا الطريق ضمن مستطيل أحمر ، أما الطريق الذي يرمز له بحرف N فهو طريق غير سريع و تحدد السرعة عليه من خلال لوحة', NULL, NULL, NULL, '2023-03-04 10:43:01', '2023-03-14 13:20:42'),
(576, 'YtFP5Zj0akove3x', 'هل يُسمح لك نقل الحموله بهذه الوضعيه؟', 'Mag je de lading op deze manier vervoeren?', 46, 31, 'mcq', 'uploads/question/kSal081677930200.jpg', 19, 'لايسمح لانها اكثر من قطعه واحده وبالتالي ممنوع أن تبرز من جانبي السيارة.', 'Het is niet toegestaan omdat de lading uit meer dan één stuk bestaat. De deelbare lading mag niet uitsteken aan de zijkanten.', NULL, NULL, '2023-03-04 10:43:20', '2023-03-14 21:25:09'),
(577, 'b9nIBGeaextQ5Kn', 'ماذا تعني هذه اللوحة؟', 'Wat betekent dit bord?', 48, 33, 'mcq', 'uploads/question/llWpbx1678804815.jpg', 17, 'هذه اللوحة تمنع  من دخول المركبات في هذا الطريق لكنها لا تمنع من الخروج أي أن الطريق بإتجاه واحد', NULL, NULL, NULL, '2023-03-04 10:44:31', '2023-03-14 13:40:15'),
(578, 'Ey7ZjK5KqQTm9lv', 'هل تقود خلف شاحنه ام قاطرة ومقطوره؟', 'Rijd je achter een vrachtwagen of vrachtauto?', 46, 31, 'mcq', 'uploads/question/xC4DSi1677930334.jpg', 20, 'الشاحنة تكون بلوحة مخططة بالأصفر والأحمر', 'De vrachtauto is te herkennen aan het geel met rood gestreepte markeringsbord aan de achterzijde.', NULL, NULL, '2023-03-04 10:45:34', '2023-03-14 21:27:13'),
(579, 'dh7V7udO8fQOgii', 'على ماذا تدل هذه اللوحه؟', 'Wat betekent dit bord?', 48, 33, 'mcq', 'uploads/question/pEEWpV1678804939.jpg', 18, NULL, NULL, NULL, NULL, '2023-03-04 10:46:03', '2023-03-14 13:42:19'),
(580, 'yzVpHKA10jMdDjP', 'على ماذا تدل هذه اللوحة؟', 'Wat geeft dit bord aan?', 48, 33, 'mcq', 'uploads/question/x1g6CR1678801301.jpg', 19, NULL, NULL, NULL, NULL, '2023-03-04 10:47:26', '2023-03-14 12:41:41'),
(581, 'A7CRpMCam50ZYBi', 'أين تتوقع وجود هذه اللوحة؟', 'Waar kun je dit bord verwachten?', 48, 33, 'mcq', 'uploads/question/2s7CAh1677930557.jpg', 20, NULL, NULL, NULL, NULL, '2023-03-04 10:47:26', '2023-03-09 07:45:42'),
(582, 'nMGNmKzCExQcPGE', 'ماهو الحد الاقصى لعرض الحمولة على العربة ؟', 'Wat is de maximale breedte van de lading op een aanhangwagen?', 46, 31, 'mcq', 'uploads/question/VzKZQo1677930560.jpg', 21, NULL, 'De maximale breedte van de lading op een aanhangwagen mag nooit meer dan 3 meter zijn.', NULL, NULL, '2023-03-04 10:49:20', '2023-03-14 21:28:46'),
(583, 'eWANgAijMFlPU7t', 'على ماذا تدل هذه اللوحة؟', 'Wat geeft dit bord aan?', 48, 33, 'mcq', 'uploads/question/NVZFyA1677930663.jpg', 21, 'هذه اللوحة الخضراء هي لوحة الهيكتومتر و تدل على وجودك على الطريق السريع اليميني A16 ، حيث Re هي اختصار لكلمة rechts وتعني اليمين', 'Op autosnelwegen heb je een linker en een rechterrijbaan. De letters Re geven aan dat je op de rechterrijbaan rijdt van de autosnelweg', NULL, NULL, '2023-03-04 10:51:03', '2023-03-14 12:33:14'),
(584, 'HajqdaIAOKwNxKo', 'ماهو اقصى طول للسيارة مع العربه؟', 'Wat is de maximale lengte van een auto met aanhangwagen?', 46, 31, 'mcq', 'uploads/question/addaVX1677930681.jpg', 22, NULL, NULL, NULL, NULL, '2023-03-04 10:51:21', '2023-03-14 21:29:37'),
(585, '5Har3n7PavmfNQS', 'ماذا تعني هذه اللوحة؟', 'Wat betekent dit bord?', 48, 33, 'mcq', 'uploads/question/QdAzfE1678801441.jpg', 22, NULL, NULL, NULL, NULL, '2023-03-04 10:52:39', '2023-03-14 12:44:01'),
(586, 'zJ3r5dtK4nZjNqa', 'طول مركبتك مع العربه لايتجاوز 7 أمتار هل يحق لك الدخول بهذا الشارع؟', 'De lengte van je voertuig met de aanhangwagen is niet meer dan 7 meter, mag je deze weg in?', 46, 31, 'mcq', 'uploads/question/22kZfs1677930813.jpg', 23, 'هذه اللوحة تمنع أي مركبة مصنفة موتورفورتاوخ وتجر عربة  من الدخول.', 'Dit bord verbiedt motorvoertuigen met een aanhangwagen.', NULL, NULL, '2023-03-04 10:53:33', '2023-03-14 21:31:18'),
(587, 'ihVL9GwnUA684kS', 'هل أنت مجبر على الوقوف بهذه اللوحة ؟', 'Moet je stoppen wanneer je dit bord ziet?', 48, 33, 'mcq', 'uploads/question/JK5Zxk1677930823.jpg', 23, 'هذه لوحة أسنان القرش و عندها أنت لست مجبر بالوقوف، بل بإعطاء الأفضليه للسائقين من اليمين و اليسار', 'Dit is een haaientandenbord, je bent niet verplicht om te stoppen, maar wel om bestuurders van rechts en links voorrang te verlenen.', NULL, NULL, '2023-03-04 10:53:43', '2023-03-11 19:06:05'),
(588, 'FbFSkSO19R81A8B', 'تقود سيارة مع عربة الطول الكلي لهما 9 متر،هل يحق لك التجاوز بهذه الحالة؟', 'Je rijdt een auto met een aanhanger waarvan de totale lengte 9 meter is, mag je hier inhalen?', 46, 31, 'mcq', 'uploads/question/zoqMIf1677930944.jpg', 24, 'اللوحة المعدنية تمنع الشاحنات فقط \r\nمن التجاوز بهذا الطريق وهي لا تخصك بشيء', 'Het bord verbiedt alleen vrachtwagens om in te halen op deze weg, dit geldt niet voor jou.', NULL, NULL, '2023-03-04 10:55:44', '2023-03-14 21:32:20'),
(589, 'LhVZ6DJJ15TSbu2', 'ماذا تعني هذه اللوحة ؟', 'Wat geeft dit bord aan?', 48, 33, 'mcq', 'uploads/question/BxTOMG1677930951.jpg', 24, NULL, NULL, NULL, NULL, '2023-03-04 10:55:51', '2023-03-09 07:48:33'),
(590, '9Wot4NGclkhsuN4', 'ماذا تعني هذه اللوحة ؟', 'Wat geeft dit bord aan?', 48, 33, 'mcq', 'uploads/question/CTbZbp1677931023.jpg', 25, 'هذه لوحة تحذيرية و تدل على انك تقترب من تقاطع خطر', NULL, NULL, NULL, '2023-03-04 10:57:03', '2023-03-14 12:36:34'),
(591, '5eSGFkhyDrQroa0', 'اذا كان ارتفاع الحمولة مع السيارة 3 امتار هل تحتاج الى لوحه تحذيرية ؟', 'Als de hoogte van de lading met de auto 3 meter is, heb je dan een markeringsbord nodig?', 46, 31, 'mcq', 'uploads/question/daVaBB1677931037.jpg', 25, 'بالنسبة للحمولات فوق السيارة ،ليست بحاجة للوحة تحذيرية، \r\nويجب ألا يتجاوز ارتفاع الحمولة مع السيارة 4م ابتداءاً من سطح الأرض', 'Voor ladingen boven de auto is een markeringsbord niet nodig, en de hoogte van de lading vanaf de grond mag niet hoger zijn dan 4 meter.', NULL, NULL, '2023-03-04 10:57:17', '2023-03-14 21:34:10'),
(592, 'Apa9Nqurj1Y07bA', 'أي لوحه تدل على موقف الباص؟', 'Welk bord geeft de bushalte aan?', 48, 33, 'mcq', 'uploads/question/TM1GTV1678805193.jpg', 26, NULL, NULL, NULL, NULL, '2023-03-04 10:58:07', '2023-03-14 13:46:33'),
(593, 'Zn3sutjS9TUGOiM', 'أي من المقطورات التالية تكون ذات لوحة أرقام غير مطابقة للوحة أرقام السيارة ؟', 'Welke van de volgende aanhangwagens heeft een kenteken dat niet overeenkomt met het kenteken van de auto?', 46, 31, 'mcq', 'uploads/question/UE9Hv11677931135.jpg', 26, 'السبب : \r\nالمقطورات التي يكون وزنها مع حمولتها أكثر من ٧٥٠ كغ تحمل لوحة \r\nأرقام بلون أصفر غير مطابقة للوحة أرقام السيارة ولها كرت ميكانيك خاص بها .', 'Reden: Aanhangwagens van meer dan 750 kg hebben een eigen kentekenplaat.', NULL, NULL, '2023-03-04 10:58:55', '2023-03-14 21:36:21'),
(594, 'OOXzWzN9ig76pC7', 'ماذا تعني هذه اللوحة؟', 'Wat geeft dit bord aan?', 48, 33, 'mcq', 'uploads/question/bIqgZY1678805500.jpg', 27, 'لا يمكنك عمل باركيرن بدون ستيلستان', 'Je kunt niet parkeren zonder stil te staan', NULL, NULL, '2023-03-04 10:59:21', '2023-03-14 13:51:40'),
(595, 'gpr0tiuyzwuKw4c', 'تقود مركبه مع مقطوره هل تستطيع تجاوز السيارة الحمراء بسرعه 100كم /ساعه ؟', 'Je rijdt een auto met aanhangwagen, mag je de rode auto met 100 km/uur inhalen?', 46, 31, 'mcq', 'uploads/question/f3PZQP1677931265.jpg', 27, ' عند جر مقطورة على الخط السريع او طريق السيارات \r\nتكون سرعتك القصوى 90 كم / ساعه فقط.', 'Bij het trekken van een aanhangwagen op de autoweg of snelweg geldt de maximumsnelheid van 90 km/u.', NULL, NULL, '2023-03-04 11:01:06', '2023-03-14 21:37:08'),
(596, 'oUsnzZsrXHyNxR4', 'ماذا تعني هذه اللوحة التحذيرية؟', 'Wat geeft dit waarschuwingsbord aan?', 48, 33, 'mcq', 'uploads/question/8oFWUA1678805596.jpg', 28, NULL, NULL, NULL, NULL, '2023-03-04 11:01:43', '2023-03-14 13:53:16'),
(597, 'JJ43a7zWedVeEiQ', 'هل يسمح لك بعمل باركيرن بهذا الشكل؟', 'Mag je op deze manier parkeren?', 46, 31, 'mcq', 'uploads/question/1xjxIM1677931360.jpg', 28, 'يسمح لك بعمل باركيرن للسيارة مع المقطورة في خانتي اصطفاف\r\nولكن لا يسمح ببروز الحمولة إلى خانة الاصطفاف الثالثة لأنها تشكل خطورة', 'Met aanhangwagen mag je maximaal gebruik maken van 2 parkeervakken.', NULL, NULL, '2023-03-04 11:02:40', '2023-03-14 21:38:29'),
(598, 's8LV4LkTpB7RB3o', 'هل يسمح لك القيادة بهذه الحالة ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/iE8uxP1677931565.jpg', 1, 'الفيتسات على حمالة الفيتس تعتبر حمولة و يسمح ببروز \r\nالفيتسات ٢٠ سم كحد أقصى من كل جانب من جوانب السيارة', NULL, NULL, NULL, '2023-03-04 11:06:05', '2023-03-11 15:23:34'),
(599, 'X5ispCFFTNzSTRn', 'في أي من الحالتين تستهلك السيارة وقود أكثر ؟', 'In welke van de volgende situatie verbruikt de auto meer brandstof?', 47, 32, 'mcq', 'uploads/question/AADF3u1677931656.jpg', 2, 'صرف الوقود عند جر عربة بلوحة صفراء أكبر من صرف الوقود عند جر عربة بلوحة بيضاء ، \r\nلأن العربات ذات اللوحة الصفراء يكون وزنها مع حمولتها أكبر من ٧٥٠ كغ بينما العربات \r\nذات اللوحة البيضاء يكون وزنها مع حمولتها أقل من ٧٥٠ كغ ، وكلما زاد وزن الحمولة زاد صرف الوقود.', 'Hoe meer gewicht hoe meer je brandstof verbruik. Het kentekenplaat op foto B is geel van kleur wat betekend dat deze aanhangwagen mogelijk meer dan 750 kg als lading heeft', NULL, NULL, '2023-03-04 11:07:36', '2023-03-14 12:50:32'),
(600, 'w4R9F5KugQDAW10', 'هل ضوء الضباب الخلفي إلزامي في العربة ؟', 'Is het mistachterlicht verplicht op de aanhangwagen?', 47, 32, 'mcq', 'uploads/question/r3uFrf1677931761.jpg', 3, 'ضوء الضباب الخلفي و ضوء الغماز و ضوء الفرامل و ضوء الرجوع للخلف جميعها إلزامي في العربة', 'Mistachterlicht, signaallicht, remlicht en achteruitrijlicht zijn allemaal verplicht op een aanhangwagen.', NULL, NULL, '2023-03-04 11:09:21', '2023-03-11 15:35:44'),
(601, 'YsKnfv89tMCwm3M', 'هل يسمح لك القيادة بهذه الحالة ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/6gkPHA1677931848.jpg', 4, 'حمالة الفيتس تستخدم لنقل الفيتس فقط \r\nو يمنع القيادة عند استخدامها لنقل حقائب أو بضائع أُخرى', 'De fietsdrager wordt alleen gebruikt om fietsen te vervoeren en het is verboden om te rijden wanneer deze wordt gebruikt voor het vervoer van tassen of andere goederen.', NULL, NULL, '2023-03-04 11:10:48', '2023-03-11 15:36:53'),
(602, 'JJi05s2V8S9ShfV', 'متى يُسمح لك تثبيت الحمولة بهذا الشكل  ؟', 'Wanneer is het toegestaan om de lading op deze manier te vervoeren?', 47, 32, 'mcq', 'uploads/question/8ZV7kq1677931929.jpg', 5, 'لا يُسمح لك نقل الأشخاص في العربة', 'Het is niet toegestaan om mensen in de aanhangwagen te vervoeren.', NULL, NULL, '2023-03-04 11:12:09', '2023-03-16 12:24:22'),
(603, '2k4bNSIhcqKQDpF', 'إذا كان أحد أضواء العربة معطل ، متى يحق لك القيادة ؟', 'Als een van de lichten van het voertuig defect is, wanneer is het dan toegestaan om te rijden?', 47, 32, 'mcq', 'uploads/question/cKVhA31677932025.jpg', 6, 'يمنع عليك القيادة إذا كان أحد أضواء العربة معطل :\r\n(ضوء الفرامل-ضوء الغماز -ضوء الضباب الخلفي - ضوء الرجوع للخلف)', 'Het is verboden om te rijden als een van de lichten defect is  (remlicht - signaallicht - mistachterlicht - achteruitrijlicht)', NULL, NULL, '2023-03-04 11:13:45', '2023-03-14 12:55:43'),
(604, 'zawtW7DzlVqgX5J', 'هل يسمح لك القيادة بهذه الحالة ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/Yws8CF1677932136.jpg', 7, 'الحمولة مثبتة بشكل جيد و بارزة متر و نصف خلف العربة \r\nولكن اللوحة التحذيرية يجب أن تكون مخططة بالأبيض و الأحمر', 'De lading zit goed vast en steekt anderhalve meter uit aan de achterzijde van de aanhangwagen, maar het markeringsbord moet in wit en rood zijn gestreept.', NULL, NULL, '2023-03-04 11:15:36', '2023-03-14 12:57:24'),
(605, 'n67mbDJppMMliyc', 'متى يحق لك القيادة بهذا الشكل ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/qlYvsC1677932258.jpg', 8, 'اللوحة التحذيرية يجب أن تكون موجهه للخلف وليس للجوانب ، \r\nبحيث تؤدي الغرض الذي صنعت لأجله و هي تحذير السائقين \r\nالذين يقودون خلفك وليس بجانبك', 'Het waarschuwingsbord moet naar achteren worden gericht en niet naar de zijkanten, zodat het voldoet aan het doel waarvoor het is gemaakt, namelijk om bestuurders te waarschuwen die achter je rijden en niet naast je.', NULL, NULL, '2023-03-04 11:17:38', '2023-03-11 15:42:45'),
(606, 'w1xGjkpdrcBkzET', 'هل يحقّ لك القيادة بهذه الحالة ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/MyBwdk1677932464.jpg', 9, 'يمنع القيادة بهذه الحالة لأن حمالة الفيتس لا تحوي أضواء', 'Het is in dit geval verboden om te rijden omdat de fietsdrager geen lichten heeft.', NULL, NULL, '2023-03-04 11:21:04', '2023-03-12 08:55:16'),
(607, 'qjbsNsXK9222rDw', 'هل يحقّ لك القيادة بهذه الحالة ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/RuxDVF1677932558.jpg', 10, 'يمنع القيادة بهذه الحالة لأن حمالة الفيتس لا تحوي لوحة أرقام السيارة', 'Het is in dit geval verboden om te rijden omdat de fietsdrager geen nummerplaat bevat.', NULL, NULL, '2023-03-04 11:22:38', '2023-03-12 08:56:16'),
(608, 'FzuCFt0AverRoLQ', 'هل القيادة بهذه الحالة يصرف وقود أكثر ؟', 'Verbruikt de auto in deze situatie meer brandstof?', 47, 32, 'mcq', 'uploads/question/zddVd61677932659.jpg', 11, 'هذه القطعة فوق السيارة تعتبر حمولة ، \r\nووجود أي حمولة يؤدي لصرف وقود أكثر من الحالة الطبيعية بدون حمولة', 'Elke extra lading verbruikt meer brandstof', NULL, NULL, '2023-03-04 11:24:19', '2023-03-14 13:04:36'),
(609, 'mOrDLpJ4cLiTmuw', 'على أي جانب من الطريق تتوقع وجود هذه اللوحة؟', 'Aan welke kant van de weg kun je dit bord verwachten?', 49, 34, 'mcq', 'uploads/question/w3HKzF1677932706.jpg', 1, 'العاكسات الحمراء تتواجد يمين الطريق وبالتالي هذه اللوحة متواجدة يمين الطريق', 'De rode reflectoren bevinden zich aan de rechterkant van de weg en daarom staat dit bord aan de rechterkant van de weg.', NULL, NULL, '2023-03-04 11:25:06', '2023-03-09 07:56:35'),
(610, '4V6kZPvFwYhRy23', 'ارتفاع الحمولة  مع السيارة 3.5متر ، هل تحتاج لوحة تحذيرية؟', 'De hoogte van je auto met lading is 3,5 meter, is een markeringsbord verplicht?', 47, 32, 'mcq', 'uploads/question/jgOEm21677932746.jpg', 12, 'الحمولات فوق السيارة لا تحتاج لوحة تحذيرية بشرط الا يتجاوز ارتفاع الحمولة 4 متر بدءاُ من سطح الأرض', 'Lading in hoogte heeft geen markeringsbord nodig.', NULL, NULL, '2023-03-04 11:25:46', '2023-03-16 12:26:09'),
(611, 'iYj7Bubxmb4door', 'في أي حالة تتوقع وجود سنورفيتس معك على الرايبان؟', 'In welk geval verwacht je een snorfiets op dezelfde rijbaan?', 49, 34, 'mcq', 'uploads/question/yfssMh1678620461.jpg', 2, 'كلا اللوحتين تخاطبان البرومفيتس ولا تخص السنور فيتس ، حيث السنور فيتس سيقود على خانته المشتركة المتواجدة يمين الطريق', 'Beide borden gaan over de bromfiets en hebben niets te maken met de snorfiets, snorfiets zal rijden op het fietspad aan de rechterkant van de weg.', NULL, NULL, '2023-03-04 11:26:10', '2023-03-14 11:32:52'),
(612, 'OWaynWj61CCSSD6', 'عند جرّ عربة ، أي من الزوايا التالية هي زاوية ميتة بالنسبة لسائق المركبة؟', 'Welke hoeken zijn de dodehoek in dit geval', 47, 32, 'mcq', 'uploads/question/fm2QXR1677932852.jpg', 13, 'الزاوية A هي زاوية ميتة لا يمكن رؤيتها بالمرايا الجانبية للسيارة \r\nكما تشكل العربة زاوية ميتة C إضافية خلف السيارة ولا يمكن رؤيتها بالمرآة الداخلية', 'Hoek A is een dode hoek die niet te zien is in de zijspiegels van de auto en de aanhangwagen vormt een extra dode hoek C achter de auto en is niet te zien in de binnenspiegel.', NULL, NULL, '2023-03-04 11:27:32', '2023-03-14 13:07:55'),
(613, '3CT3SpfgHey03LJ', 'هل يُسمح لك الدخول بهذا الشارع؟', 'Mag je deze straat in?', 49, 34, 'mcq', 'uploads/question/hEnnym1677932877.jpg', 3, 'هذه اللوحة تخبرك أن السيارات ستكون ضيف في مسار الدراجات', 'Dit bord geeft aan dat er auto\'s te gast zijn op het fietsstraat', NULL, NULL, '2023-03-04 11:27:57', '2023-03-14 11:33:19'),
(614, 'crm31qyo4WqLbkt', 'هل يُسمح لك القيادة بهذه الحالة ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/8zZM321677932965.jpg', 14, 'يُسمح ببروز الحمولة متر واحد فقط خلف السيارة', 'De lading mag slechts één meter achter het voertuig uitsteken.', NULL, NULL, '2023-03-04 11:29:25', '2023-03-12 09:00:49'),
(615, 'U7hVAZ3J6Q0pv6Q', 'هل أنت مجبر على وضع شبك فوق الحمولة ؟', 'Ben je verplicht om een net over de lading te bevestigen?', 47, 32, 'mcq', 'uploads/question/Z7d5BM1677933044.jpg', 15, 'أنت غير مجبر على وضع شبك فوق الحمولة \r\nولكن يجب أن تكون آمنة و مثبتة بشكل جيد', 'Je bent niet verplicht om een net over de lading te leggen, maar het moet wel veilig zijn bevestigd.', NULL, NULL, '2023-03-04 11:30:44', '2023-03-14 13:11:28'),
(616, 'UKkAC4SpRnPfB2l', 'هل يحقّ لك تجاوز السيارة الخضراء بهذه الحالة ؟', 'Is het toegestaan om de groene auto in te halen in deze situatie?', 47, 32, 'mcq', 'uploads/question/S3oGOy1677933121.jpg', 16, 'بما أن الطول الكلي للمركبة مع العربة لا يتجاوز 7 أمتار و بالتالي \r\nيحق لها استخدام جميع المسارات و سرعتها القصوى ٩٠ كم/ساعه', 'Aangezien de totale lengte van het voertuig met de aanhangwagen niet langer is dan 7 meter, heb je daarom het recht om alle rijstroken te gebruiken en is de maximale snelheid 90 km/u.', NULL, NULL, '2023-03-04 11:32:01', '2023-03-12 09:02:53'),
(617, 'yFijK034qXoDANf', 'هل يسمح لك القيادة بهذه الحالة ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/Y9nLrG1677933213.jpg', 17, 'يُمنع بروز الحمولة من جانبي السيارة اذا كانت أكثر من قطعة (مجزأة)', 'Deelbare lading mag niet uitsteken aan de zijkanten.', NULL, NULL, '2023-03-04 11:33:33', '2023-03-14 13:14:53'),
(618, 'XalIIsSe4XsKLrP', 'هل يسمح لك القيادة بهذا الشكل ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/cBVL011677933288.jpg', 18, 'مسموح القيادة لأن ارتفاع الحمولة فوق السيارة لا يتجاوز  4 متر بدءاُ من سطح الأرض', 'De laadhoogte is 350 cm en is minder dan 4 meter vanaf de grond.', NULL, NULL, '2023-03-04 11:34:48', '2023-03-12 09:05:17'),
(619, 'JNn8Rx4Q9dv2od4', 'هل يسمح لك القيادة بهذه الحالة ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/Hnq86i1677933366.jpg', 19, 'مسموح بروز الحمولة متر واحد فقط كحد أقصى خلف السيارة', 'De lading mag maximaal een meter achter het voertuig uitsteken.', NULL, NULL, '2023-03-04 11:36:06', '2023-03-12 09:05:54'),
(620, 'b5A25eWo8YEV2n8', 'قمت بتثبيت الحمولة بشكل جيد ، هل يسمح لك القيادة ؟', 'Je hebt de belading veilig bevestigd, mag je op deze manier rijden?', 47, 32, 'mcq', 'uploads/question/CtEez51677933450.jpg', 20, 'لوحة أرقام العربة مكتوبة على صفيحة عشوائية و بخط اليد و هذا ممنوع', 'De nummerplaat van de aanhangwagen is geschreven op een kartonnenplaat en met de hand geschreven.', NULL, NULL, '2023-03-04 11:37:30', '2023-03-14 13:18:23'),
(621, 'QfpCyrbHuCROXFL', 'هل يسمح لك القيادة بهذه الحالة ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/orou441677933551.jpg', 21, 'الفيتسات على حمالة الفيتس تعتبر حمولة و يسمح ببروز \r\nالفيتسات متر واحد كحد أقصى خلف السيارة', 'De fietsen op de fietsdrager worden beschouwd als lading en maakt het mogelijk om maximaal 1 meter achter het voertuig uit te steken.', NULL, NULL, '2023-03-04 11:39:11', '2023-03-12 09:08:22'),
(622, '1mqJ6vYDs1fy6vu', 'هل يسمح لك القيادة بهذا الشكل ؟', 'Mag je op deze manier rijden?', 47, 32, 'mcq', 'uploads/question/FcjPmR1677933631.jpg', 22, 'يسمح بروز الحمولات متر واحد خلف العربة بدون \r\nلوحة تحذيرية ولكن لا مانع إن وضعت فهي وسيلة أمان', 'Het is toegestaan dat de ladingen een meter achter het voertuig  uitsteken zonder een waarschuwingsbord, maar er is geen bezwaar als het wordt geplaatst, het is een veiligheidsmiddel.', NULL, NULL, '2023-03-04 11:40:31', '2023-03-12 09:10:05'),
(623, 'PBB40J944nZkBCV', 'هل يسمح لك القيادة بهذا الشكل ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/V1bms51677933715.jpg', 23, 'يسمح ببروز الحمولات متر واحد خلف السيارة كحد أقصى بدون \r\nلوحة تحذيرية ولكن لا مانع إن وضعت فهي وسيلة أمان', 'De ladingen boven de auto hebben geen waarschuwingsbord nodig, maar er is geen bezwaar als je het plaatst, het is een veiligheidsmiddel.', NULL, NULL, '2023-03-04 11:41:55', '2023-03-12 09:10:44'),
(624, 'cnVmGbCEpV9OEid', 'هل يسمح لك القيادة بهذا الشكل ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/OP2oVg1677933798.jpg', 24, 'اللوحة التحذيرية يجب أن تكون مخططة بالأبيض و الأحمر', 'Het markeringsbord moet wit en rood zijn gestreept.', NULL, NULL, '2023-03-04 11:43:18', '2023-03-14 13:24:24'),
(625, 'G7G5f9aN4wcnm36', 'هل يحقّ لك القيادة بهذه الحالة ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/7YYxeN1677933879.jpg', 25, 'لوحة الأرقام البيضاء للعربة يجب أن تكون مطابقة للوحة أرقام السيارة', 'De witte nummerplaat van het voertuig moet identiek aan de nummerplaat van de auto zijn.', NULL, NULL, '2023-03-04 11:44:39', '2023-03-12 09:12:21'),
(626, 'mKeYxQT6vfg9aP1', 'هل يسمح لك القيادة بهذه الحالة ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/hOZoxw1677933950.jpg', 26, 'لوحة أرقام العربة يجب أن تكون إما بلون أصفر أو أبيض', 'De nummerplaat van de aanhangwagen hoort geel of wit te zijn.', NULL, NULL, '2023-03-04 11:45:50', '2023-03-12 09:13:26'),
(627, 'O6RDSTktjao6LVZ', 'هل يسمح لك القيادة بهذا الشكل ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/c6EsGk1677934026.jpg', 27, 'الحد الاقصى لإرتفاع الحمولة هو ٤ أمتار بدءاً من سطح الأرض.', 'De maximale laadhoogte is 4 meter vanaf het grondoppervlak.', NULL, NULL, '2023-03-04 11:47:06', '2023-03-12 09:14:08'),
(628, 'cNOUNTdL8PdoY5X', 'هل يسمح لك القيادة بهذه الحالة ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/4ORmxY1677934158.jpg', 28, 'الحمولات فوق السيارة لا تحتاج إلى لوحة تحذيرية ولكن لا مانع إن وضعت.', 'De ladingen boven de auto hebben geen waarschuwingsbord nodig maar het is geen probleem als je deze wel plaatst.', NULL, NULL, '2023-03-04 11:49:18', '2023-03-14 13:31:42'),
(629, 'vXcBkJg3RSmcBcw', 'هل يسمح لك القيادة بهذا الشكل ؟', 'Is het toegestaan om op deze manier te rijden?', 47, 32, 'mcq', 'uploads/question/Xm11zR1677934244.jpg', 29, 'الحد الأقصى لبروز الحمولة من جوانب العربة هو ٢٠ سم  من كل جانب\r\nو عند بروزها أكثر من ١٠ سم من جوانب العربة يجب وضع اللوحة التحذيرية المخططة بالأبيض و الأحمر', 'De lading mag maximaal 20cm uitsteken vanaf de zijkanten van de aanhangwagen, en wanneer deze meer dan 10 cm uit de zijkanten van de aanhangwagen steekt, moet er een waarschuwingsbord worden geplaatst.', NULL, NULL, '2023-03-04 11:50:44', '2023-03-12 09:17:12'),
(630, 'SsnAPI4e128SIzp', 'في أي من الحالتين سيكون خطر الشاحنة عليك أكبر ؟', 'In welke situatie levert de vrachtwagen meer gevaar op tijdens het inhalen?', 50, 35, 'mcq', 'uploads/question/XHXWqr1677934579.jpg', 1, 'في كلا الحالتين نتوقع وجود خطورة لكن في الحالة B انت والشاحنة \r\nفي منعطف الى اليمين وبالتالي احتمال الانزلاق سيكون باتجاه اليسار (انت والشاحنة)\r\nلكن لا ننسى أن الشاحنة ستنزلق  باتجاهك مسببة خطر إضافي عليك (انت تقود يسار الشاحنة)\r\nأما في الحالة A انت والشاحنة في منعطف لليسار اي احتمال الانزلاق لليمين (انت والشاحنه)\r\nلكن الشاحنة هنا لن تنزلق باتجاهك وإنما انت الذي ستنزلق باتجاهها وبالتالي خطرها عليك أقل.', 'In beide gevallen verwachten we dat er gevaar zal zijn, maar in geval B rijden jij en de vrachtwagen op een bocht naar rechts en is er een kans op uitglijden naar links. Vergeet niet dat de vrachtwagen naar jou toe zal glijden, waardoor je extra gevaar loopt (je rijdt links van de vrachtwagen). \r\nWat betreft geval A: jij en de vrachtwagen rijden op een bocht naar links, dat wil zeggen dat er een mogelijkheid is om naar rechts te glijden maar de vrachtwagen  zal niet naar jou toe glijden omdat jij naar de vrachtwagen zal glijden, en daarom is het gevaar voor jou minder.', NULL, NULL, '2023-03-04 11:56:19', '2023-03-14 10:49:39'),
(631, 'QoZkYFfTwPWsYnx', 'أنت تقود داخل النفق وفجأة ظهر لك مؤشر زيت المحرك باللون الأحمر ماذا تفعل ؟', 'Je rijdt door de tunnel en plotseling knippert de motorolie-indicator rood, wat doe je?', 50, 35, 'mcq', 'uploads/question/8UInup1677934698.jpg', 2, 'يعتبر الوقوف داخل النفق من اخطر الحالات التي من الممكن ان تصادف السائقين \r\nلذلك حاول دائما ان تخرج من النفق  وتتوقف بعده فورا اذا كانت سيارتك بإمكانها \r\nمتابعة السير حتى لو بدأ الدخان يتصاعد من تحت غطاء المحرك او ظهر رمز بلون أحمر', 'Reden: parkeren in de tunnel wordt beschouwd als een van de gevaarlijkste situaties die automobilisten kunnen tegenkomen, dus probeer altijd de tunnel uit te komen en onmiddellijk daarna te stoppen als jouw auto door kan rijden, zelfs als er rook onder de motorkap begint op te stijgen.', NULL, NULL, '2023-03-04 11:58:18', '2023-03-14 10:51:36'),
(632, 'YJtyxWwRM10xkRy', 'كم تُقدّر مسافة الامان التي يجب ان تتركها بينك وبين المركبة التي أمامك في ظروف الطقس الجيدة ؟', 'Hoeveel afstand moet je minimaal houden bij goede weersomstandigheden?', 50, 35, 'mcq', 'uploads/question/4usfVP1677934812.jpg', 3, 'ثانيتين على الأقل مسافة الأمان هي المسافة التي يجب ان يتركها\r\n السائق بينه و بين المركبة التي تسير امامه وتبلغ ثانيتين في ظروف \r\nالطقس الجيدة  وأكثر من ثانيتين في ظروف الطقس السيئة', 'Reden: De veiligheidsafstand is de afstand die de bestuurder moet laten tussen hem en zijn voorligger, minimaal twee seconden bij goed weer en meer dan twee seconden bij slecht weer.', NULL, NULL, '2023-03-04 12:00:12', '2023-03-14 10:53:39'),
(633, 'tqDl8YZOmhlbwYG', 'كم تُقدّر مسافة الامان التي يجب ان تتركها بينك وبين المركبة التي أمامك في هذه الحالة ؟', 'Hoeveel afstand moet je in dit geval aanhouden tussen jou en het voertuig voor je?', 50, 35, 'mcq', 'uploads/question/L0edMB1677934929.jpg', 4, 'مسافة الأمان تكون أكثر من ثانيتين في ظروف الطقس السيئة', 'Bij slecht zicht of weersomstandigheden wordt aangeraden om meer dan 3 seconden afstand te houden.', NULL, NULL, '2023-03-04 12:02:09', '2023-03-14 10:55:05');
INSERT INTO `questions` (`id`, `question_uuid`, `question_ar`, `question_nl`, `exam_category_id`, `exam_id`, `question_type`, `question_image`, `arrangment`, `answer_explanation_ar`, `answer_explanation_nl`, `question_en`, `answer_explanation_en`, `created_at`, `updated_at`) VALUES
(634, 'pnPLTexeTE5UFbY', 'انت تقود على طريق سريع وصادفت أمامك حادث جسيم مع أضرار و ضحايا ماذا تفعل ؟', 'Je rijdt op een snelweg en ziet een ernstig ongeval met schade en gewonden, wat doe je als eerst?', 50, 35, 'mcq', 'uploads/question/NHioZu1677935035.jpg', 5, 'تؤمن على نفسك ثم تتصل بالطوارئ  يجب ان يكون انتباهك على الطريق والسائقين \r\nالذين يسيرون خلفك لذلك قم بتأمين نفسك من خلال تشغيل ضوء التحذير الرباعي\r\nوتخفيف سرعتك ومن ثم التوقف في مكان آمن للاتصال بالطوارئ.', 'Reden: Zorg altijd er eerst voor dat je je zelf in veiligheid brengt dan dan anderen helpt.', NULL, NULL, '2023-03-04 12:03:55', '2023-03-14 10:56:35'),
(635, 'CgNj4N16yTTdeMm', 'أنت تقود داخل النفق وأمامك سيارة محترقة ماذا تفعل ؟', 'Je rijdt de tunnel in en je ziet een auto in brand staan, wat doe je?', 50, 35, 'mcq', 'uploads/question/ABJFmR1677935159.jpg', 6, 'تتوقف فورا و تسير باتجاه مخرج الطوارئ\r\nالسبب: \r\nوجود السيارة المحترقة تشكل خطر عليك و على باقي السائقين\r\nحيث لا مجال لك للمرور لذلك قم بالتأمين على نفسك من خلال \r\nالتوقف مباشرة وقم بتشغيل ضوء التحذير الرباعي واترك المفاتيح بداخل السيارة\r\nحتى يتسنى لفرق الطوارئ تحريكها لاحقاً, وتوجه باتجاه مخرج الطوارئ', 'Reden: De aanwezigheid van de brandende auto vormt een gevaar voor jou en de rest van de bestuurders, aangezien je geen doorgang hebt, verzeker jezelf dus door: onmiddellijk te stoppen, de waarschuwingslichten aan te zetten en de sleutels in de auto laten zodat hulpdiensten hem later kunnen verplaatsen wanneer nodig is.', NULL, NULL, '2023-03-04 12:05:59', '2023-03-14 11:00:00'),
(636, 'zTdn69U00MwOjM9', 'ماذا تتوقع اذا كان هذا الزر قيد التشغيل ؟', 'Wat kun je verwachten wanneer deze knop aanstaat?', 50, 35, 'mcq', 'uploads/question/6o8i5D1677935283.jpg', 7, 'هذا زر تشغيل مكيف الهواء وكما يظهر في الصورة \r\nفهو قيد التشغيل وبالتالي سيتطلب جهد اضافي من المحرك \r\nكي يقوم بعملية التكييف والتبريد وبالتالي صرف وقود أكثر و تأثير على البيئه', 'Reden: Dit is de knop om de airconditioner te starten, en zoals op de afbeelding te zien is, is deze in werking. Daarom zal het extra inspanning van de motor vergen om het airconditioning- en koelproces uit te voeren, waardoor er meer brandstof wordt verbruikt en het milieu aantast.', NULL, NULL, '2023-03-04 12:08:03', '2023-03-14 08:16:55'),
(637, 'M9wGOTonCVdjWyb', 'ما هي الوضعية الصحيحة التي يجب بها وضع الاشخاص الفاقدين للوعي ؟', 'Wat is de juiste positie waarin bewusteloze personen moeten worden geplaatst?', 50, 35, 'mcq', 'uploads/question/mzs40l1677935439.jpg', 8, 'السبب : اذا كان الشخص فقط فاقد للوعي يجب وضعه بالوضعية B\r\nلانها تحافظ على عدم اغلاق مجرى التنفس و تسهل خروج السوائل في حال استفراغ الشخص الفاقد للوعي وكي لا يبتلع لسانه ويختنق.', 'Reden: Als de persoon alleen bewusteloos is, moet hij in positie B worden geplaatst, omdat dit voorkomt dat de luchtweg sluit en de afvoer van vloeistoffen vergemakkelijkt in het geval dat de bewusteloze persoon braakt en zodat hij zijn tong niet inslikt en stikt.', NULL, NULL, '2023-03-04 12:10:39', '2023-03-14 08:18:06'),
(638, 'HOIhtVt5puc1MXU', 'السيارة مغطاة بالثلج وتريد القيادة ماذا تفعل ؟', 'De auto is bedekt met sneeuw en je wilt rijden, wat doe je?', 50, 35, 'mcq', 'uploads/question/nWH4DR1678796044.jpg', 9, 'يجب أن تقوم بازالة الثلج عن كامل أجزاء السيارة كي لا يتطاير على السائقين ثم تقوم بتشغيل المحرك و تقود مباشرة و لا داعي للانتظار حتى يسخن المحرك و ذلك للحفاظ على البيئة', 'Je moet de sneeuw van alle delen van de auto verwijderen om je medeweggebruikers niet te hinderen als de sneeuw eraf waait als zij achter en naast je rijden. Vervolgens de motor starten en direct rijden, je hoeft niet te wachten tot de motor is opgewarmd, dit is om het milieu te beschermen.', NULL, NULL, '2023-03-04 12:12:06', '2023-03-14 13:21:20'),
(639, 'f9uiqZVpQ6XObvU', 'ما فائدة هذه الأداة في السيارة ؟', 'Wat is het nut van dit gereedschap in de auto?', 50, 35, 'mcq', 'uploads/question/fbmUw41677935643.jpg', 10, 'هذه مطرقة الامان حيث يستخدم الجزء A لكسر الزجاج الجانبي \r\nفي الحالات الطارئة (كالغرق مثلا)  ويستخدم الجزء B لقطع حزام الامان', 'Dit is een veiligheidshamer, waarbij deel A wordt gebruikt om de zijruit te breken in noodgevallen (zoals verdrinking) en deel B wordt gebruikt om de veiligheidsgordel door te snijden.', NULL, NULL, '2023-03-04 12:14:03', '2023-03-14 08:23:58'),
(640, 'vZpvVN3sNAgu0xS', 'انت تقود داخل النفق و فجأة توقفت سيارتك عن العمل ماذا تفعل ؟', 'Je rijdt door de tunnel en plotseling stopt je auto ermee, wat doe je?', 50, 35, 'mcq', 'uploads/question/sH1cyj1677935784.jpg', 11, 'الوقوف داخل النفق خطر عليك و على باقي السائقين لذلك قم بتأمين نفسك \r\nمن خلال : تشغيل ضوء التحذير الرباعي اذا أمكن واترك المفاتيح بداخل السيارة \r\nحتى يتسنى لفرق الطوارئ تحريكها لاحقا وتوجه باتجاه مخرج الطوارئ', 'In de tunnel staan is gevaarlijk voor jou en de rest van de bestuurders, beveilig jezelf daarom door: mogelijk de waarschuwingslichten aan te zetten de sleutels in de auto laten zodat de hulpdiensten deze later kan verplaatsen richting de nooduitgang.', NULL, NULL, '2023-03-04 12:16:24', '2023-03-14 11:06:59'),
(641, 'udONrR8ERiV9zfE', 'أنت تقترب من تقاطع ، عند أي لوحة مرورية تتوقع سائقين من اليسار ؟', 'Je nadert een T-splitsing, bij welk verkeersbord kun je bestuurders van links verwachten?', 51, 36, 'mcq', 'uploads/question/tWepSv1677935838.jpg', 1, 'اللوحة (A) تجبر جميع السائقين على اتباع اتجاه السهم ، أما اللوحة (B) فهي تخصك انت و تجبرك على اتباع اتجاه السهم فقط ولا تخص باقي السائقين على الطريق المتقاطع أمامك', 'Bord A verplicht alle automobilisten de richting van de pijl te volgen, terwijl bord B enkel op jou betrekking heeft en je verplicht bent om alleen de richting van de pijl te volgen, en is niet van toepassing op de rest van de automobilisten op de kruisende weg voor je.', NULL, NULL, '2023-03-04 12:17:18', '2023-03-12 12:36:15'),
(642, '3YGyRuXr6FMEoZU', 'اذا رأيت هذا الزر قيد التشغيل في  السيارة ماذا تتوقع ؟', 'Wat kun je verwachten wanneer deze knop aanstaat?', 50, 35, 'mcq', 'uploads/question/5a4GpT1677935903.jpg', 12, 'وجود هذا الزر قيد التشغيل في السيارة يدل على أن نظام تشغيل واطفاء المحرك الأتوماتيكي \r\nقيد التشغيل ،أي عند التوقف على إشارة المرور مثلاً سيقوم النظام بإطفاء المحرك وبمجرد الضغط\r\nعلى دواسة الوقود سيعمل المحرك و تتحرك السيارة وبالتالي هذا النظام يوفر الوقود و يحافظ على البيئة', 'Reden: De aanwezigheid van deze knop in de auto geeft aan dat het automatische start- en stopsysteem van de motor in werking is, dat wil zeggen dat wanneer je bijvoorbeeld stopt bij een verkeerslicht, het systeem de motor uitschakelt en zodra je drukt het gaspedaal, de motor zal starten en de auto zal rijden, en dus bespaart dit systeem brandstof en is goed voor het milieu.', NULL, NULL, '2023-03-04 12:18:23', '2023-03-14 08:28:49'),
(643, 'vDm8tu2vsPUxSul', 'متى تستخدم هذا الزر ؟', 'Wanneer gebruik je deze knop?', 50, 35, 'mcq', 'uploads/question/Mmswyw1677936004.jpg', 13, 'هذا زر ضوء التحذير الرباعي ويتم تشغيله في الحالات الخطرة او التي\r\nيتوقع حدوث خطر بها لتحذير السائقين', 'Dit is het gevarenlicht en wordt ingeschakeld in gevaarlijke situaties, of wanneer er gevaar wordt verwacht om bestuurders te waarschuwen.', NULL, NULL, '2023-03-04 12:20:04', '2023-03-14 13:23:35'),
(644, 'ikcBXwovLO72BRF', 'في أي من الطريقين تكون الخطورة أكبر؟', 'Welke weg is meer gevaarlijk?', 50, 35, 'mcq', 'uploads/question/RldXK71677936111.jpg', 14, 'يعتبر الطريق السريع(الحالة A) من أكثر الطرق أماناً حيث أنك لن  تصادف سائقين معاكسين لإتجاهك ، أما على طريق autoweg (الحالة B) تكون الخطورة أكبر لأنه طريق ذهاب و إياب و بالتالي يوجد معاكسين لإتجاهك', 'Reden: op de autowegen gebeuren meer ongelukken dan op snelwegen, omdat je tegenliggers kan verwachten.', NULL, NULL, '2023-03-04 12:21:51', '2023-03-14 11:08:47'),
(645, 'TLiMjZ4yYQDE5jI', 'تقود على الطريق السريع وحصل معك عطل طارئ ، ما هو المكان الأكثر أماناً للوقوف ؟', 'Je rijdt op de snelweg en hebt pech, wat is de veiligste plek om stil te staan?', 50, 35, 'mcq', 'uploads/question/eRBXGK1677936214.jpg', 15, 'في حال حصل معك عطل طارئ أو أردت التوقف للإبلاغ عن حادث يكون ترتيب الأمان للوقوف \r\nبدءاً من الأعلى أماناُ : العشب-فسحة الطوارئ-خانة الطوارئ \r\n( أي كلما ابتعدنا عن الطريق يكون الأمان أكبر)', 'In het geval van pech of in het geval dat je wilt stoppen om een verkeersongeval te melden, de veiligste plekken om te stoppen op volgorde in dit geval zijn: Berm->............ ->vluchtstrook', NULL, NULL, '2023-03-04 12:23:34', '2023-03-14 13:42:59'),
(646, 'P3UDpbUbGj6sLtA', 'انت تقود على الطريق السريع بجانب الشاحنة وخلفك سيارة اسعاف مع الصوت والضوء التحذيري ماذا تفعل ؟', 'Je rijdt op de snelweg naast de vrachtwagen en er rijdt een ambulance achter je met optische en geluidssignalen, wat doe je?', 50, 35, 'mcq', 'uploads/question/pSbzkc1677936385.jpg', 16, 'السرعة القصوى للشاحنة  80كم/سا على الطريق السريع  وسرعتك القصوى بهذه الحالة 100كم/سا و بالتالي بإمكانك تجاوزها , حيث تخفيف السرعة سيعيق السير خلفك و قد يسبب خطورة', 'Reden: de snelheid van de vrachtwagen is 80 km/u op de snelweg en daarom kun je hem in dit geval inhalen, aangezien het verminderen van de snelheid het verkeer achter je hindert en gevaar kan opleveren.', NULL, NULL, '2023-03-04 12:26:25', '2023-03-14 11:06:30'),
(648, '2y3JbrCCYElKAxI', 'أنت تسير داخل دوار وخلفك سيارة اسعاف مع الصوت والضوء التحذيري ماذا تفعل ؟', 'Je rijdt een rotonde binnen en er rijdt een ambulance achter je met een waarschuwingssignaal en licht, wat doe je?', 50, 35, 'mcq', 'uploads/question/eH1uPS1677936528.jpg', 17, NULL, NULL, NULL, NULL, '2023-03-04 12:28:48', '2023-03-07 11:58:13'),
(649, '11eDyNgI9JJW5il', 'ماهي نسبة الكحول المسموحة في التنفس للسائق المبتدئ بالميكروغرام ؟', 'Hoeveel microgram alcohol mag er in het bloed zitten van een beginnende bestuurder?', 50, 35, 'mcq', 'uploads/question/XuvTM01677936650.jpg', 18, 'يعتبر السائق مبتدئ من تاريخ حصوله على الرخصة ولغاية خمس سنوات . بغض النظر عن العمر الذي حصل فيه على رخصة القيادة', 'De bestuurder wordt beschouwd als een beginner vanaf de datum van het behalen van zijn rijbewijstot vijf jaar. Ongeacht de leeftijd waarop hij zijn rijbewijs heeft gehaald.', NULL, NULL, '2023-03-04 12:30:50', '2023-03-14 11:11:44'),
(650, 'nni5LoLxHoDbn4U', 'عند سقوط سيارتك في النهر ما هو التصرف الصحيح ؟', 'Wat is de juiste handeling  als je auto in het water (rivier) valt?', 50, 35, 'mcq', 'uploads/question/pMqFkv1677936787.jpg', 19, 'عند سقوط سيارتك أو غرقها في النهر يفضل تشغيل الانارة \r\nكضوء التحذير الرباعي أو الضوء العالي..., كي يسهل اكتشافك من قبل فرق الطوارئ أو لكشف طريقك في حال قمت بالسباحة ليلاُ', 'Reden: Als jouw auto in de rivier valt of zinkt, moet je de lichten aanzetten, zoals de waarschuwingslampjes om jouw detectie door noodteams te vergemakkelijken.', NULL, NULL, '2023-03-04 12:33:07', '2023-03-14 11:13:05'),
(651, '9ipIVcgNADNbIEf', 'ما هي الطريقة الصحيحة لكسر الزجاج الجانبي في الحالات الطارئة ؟', 'Wat is de juiste manier om de ruiten te breken in noodgevallen?', 50, 35, 'mcq', 'uploads/question/NpZy8A1677936932.jpg', 20, 'يفضل كسر الزجاج الجانبي في الأطراف كما في الحالة \"B\"\r\nلأنه سينكسر بشكل كامل و أسرع من كسره في المنتصف كما في الحالة \"A\"', 'Reden: Het glas moet aan de randen worden gebroken, zoals in geval B, omdat het volledig en sneller zal breken dan in het midden, zoals in geval A.', NULL, NULL, '2023-03-04 12:35:32', '2023-03-14 09:40:49'),
(652, 'wB95ueBbgGHllpu', 'اذا كانت الوسادة الهوائية لاتعمل، ما هي الطريقة الصحيحة لوضع الكرسي الخاص بالأطفال ؟', 'Als de passagiersairbag uitgeschakeld staat, wat is dan de juiste manier om het kinderzitje te plaatsen?', 50, 35, 'mcq', 'uploads/question/HAygHM1677937026.jpg', 21, 'اذا كانت الوسادة الهوائية لا تعمل فيفضل وضع الأطفال بوضعية الجلوس للخلف (عكس اتجاه جلوس السائق ) كما في الحالة B وذلك للحفاظ على رقبة و ظهر الطفل', 'Als je een een baby vervoert op de passagiersstoel is het veiliger om zijn hoofd richting de stoel te plaatsen, zo voorkom je minder letsel bij ongevallen.', NULL, NULL, '2023-03-04 12:37:06', '2023-03-14 13:44:15'),
(653, 'pz6pid8x6MfJFEn', 'ما هو الطول المحدد للأطفال دون سن الثامنة عشر كي يجلسو بمقاعد مخصصة لهم ؟', 'Wat is de lengtelimiet voor kinderen onder de achttien jaar om in de voor hen bestemde stoelen te zitten?', 50, 35, 'mcq', 'uploads/question/DZHxud1677937117.jpg', 22, 'اذا كان طول الطفل أقل من 135 سم يجب وضعه بكرسي مخصص\r\nوهذا لا ينطبق على الأشخاص البالغين وطولهم أقل من 135 سم', 'Reden: Als het kind kleiner is dan 135 cm, moet die in een daarvoor bestemde stoel worden geplaatst. Dit geldt niet voor volwassenen met een lengte kleiner dan 135 cm.', NULL, NULL, '2023-03-04 12:38:37', '2023-03-14 09:41:47'),
(654, 'MaMJoQXvy47b7WQ', 'ما هو العمق القانوني الأدنى لبروفايل إطار السيارة ؟', 'Wat is de wettelijke diepte voor een autobandprofiel?', 50, 35, 'mcq', 'uploads/question/zlHbbm1677937242.jpg', 23, 'العمق القانوني الأدنى لبروفايل جميع أنواع الاطارات هو ١.٦ مليمتر سواء كان الإطار صيفي أو شتوي\r\nلكن يُنصح في الإطار الشتوي  أن يكون عمق البروفايل ٤ مم على الأقل', 'De minimale wettelijke diepte voor het profiel van een autoband is 1,6 mm, of het nu een zomer- of winterband is. Voor de winterband wordt aanbevolen dat de profieldiepte minimaal 4 mm is.', NULL, NULL, '2023-03-04 12:40:42', '2023-03-14 09:49:20'),
(655, 'UJjy7rQvoc5f47t', 'ما هو التصرف الصحيح إذا أردت إجتياز المنعطف بأمان ؟', 'Wat is de juiste handeling  als je veilig door de bocht wilt?', 50, 35, 'mcq', 'uploads/question/ANt7ih1677937342.jpg', 24, 'إن تخفيف السرعة قبل الإنعطاف ثم زيادتها قليلاً أثناء الإنعطاف سوف يولد قوة معاكسة لقوة الطرد المركزي وهذا بدوره يساعد في توازن السيارة وثباتها  على المنعطفات', NULL, NULL, NULL, '2023-03-04 12:42:22', '2023-03-14 14:15:52'),
(656, 'fuEEwqwm8czdgGc', 'لقد حصل معك عطل طارئ على هذا الطريق السريع هل يحق لك التوقف على خانة الطورائ بهذه الحالة ؟', 'Als je pech hebt op de snelweg, mag je stoppen op de vluchtstrook in deze situatie?', 50, 35, 'mcq', 'uploads/question/5NpoxU1677937445.jpg', 25, 'اذا حصل معك عطل طارئ على الطريق السريع بإمكانك التوقف \r\nعلى العشب او في فسحة الطوارئ او على خانة الطوارئ (اذا كانت مغلقة) و بما أن خانة الطوارئ مغلقة فيمكنك التوقف عليها في الحالات الطارئة ، أما اذا كانت مفتوحة فيجب عليك التوقف على العشب أو في فسحة الطوارئ', NULL, NULL, NULL, '2023-03-04 12:44:05', '2023-03-14 14:16:12'),
(657, 'Gf2Ya2LZOC1jf6p', 'توقفت هنا لإنتظار شخص سوف يأتي بعد ثلاث دقائق ، هل من الأفضل إطفاء المحرك ؟', 'Je bent hier gestopt om te wachten op iemand die over drie minuten komt, is het beter om de motor uit te zetten?', 50, 35, 'mcq', 'uploads/question/47nHbV1677937550.jpg', 26, 'لا تترك المحرك يعمل اذا طالت فترة وقوفك لتوفير \r\nصرف الوقود و لتقليل صدور الانبعاثات التي تضر بالبيئة', 'Reden: Laat de motor niet gedurende lange tijd draaien om brandstof te besparen en de uitstoot te verminderen die schadelijk is voor het milieu.', NULL, NULL, '2023-03-04 12:45:50', '2023-03-14 11:01:12'),
(658, 'ROlEZ37ICi98Nwd', 'إذا كنت تقود سيارتك، وكان عدد دورات المحرك مرتفع ، فهل سوف يزداد إنبعاث غاز ثاني أكسيد الكربون co2؟', 'Als je aan het rijden bent, en de toeren zijn hoog, wordt er dan meer CO2 uitgestoten?', 50, 35, 'mcq', 'uploads/question/jWeIyO1677937658.jpg', 27, 'كلما زاد عدد دورات المحرك (rpm) زاد صرف الوقود وبالتالي زيادة انبعاث غاز co2\r\nلذلك يجب المحافظة على عدد دورات للمحرك بين 2500-2000 دورة بالدقيقة \r\nلتقليل صرف الوقود و للتقليل من انبعاثات غاز ثاني اكسيد الكربون co2', 'Reden: Het aantal motortoeren moet tussen de 2.500-2.000 tpm worden gehouden om het brandstofverbruik te verminderen en de CO2-uitstoot te verminderen.', NULL, NULL, '2023-03-04 12:47:38', '2023-03-14 10:07:47'),
(659, 'pvPuUPo2L4pF2Iw', 'في أي حالة تستهلك السيارة وقود اكثر؟', 'In welke toestand verbruikt de auto meer brandstof?', 50, 35, 'mcq', 'uploads/question/fhn9wK1677937768.jpg', 28, 'السبب:\r\nعندما تكون النوافذ مفتوحة تزداد مقاومة الهواء وبتالي صرف وقود أكثر', 'De reden: als de ramen open staan, neemt de luchtweerstand toe en wordt er dus meer brandstof verbruikt.', NULL, NULL, '2023-03-04 12:49:28', '2023-03-07 22:35:09'),
(660, 'vqeKk2I1zkXApE0', 'أي من الزوايا التالية تعتبر زوايا ميتة بالنسبة لسائق السيارة ؟', 'Welke van de bovenstaande hoeken zijn de dode hoeken voor de bestuurder?', 52, 37, 'mcq', 'uploads/question/h1oOrs1678001097.jpg', 1, 'الزاوية الميتة : هي الزاوية التي لا يمكن رؤيتها بالمرايا الجانبية للسيارة أو المرآة الداخلية', 'Dode hoek: Het is de hoek die niet kan worden gezien door de zijspiegels van de auto of de binnenspiegel.', NULL, NULL, '2023-03-05 06:24:57', '2023-03-13 10:22:08'),
(661, 'tUm0uhDZgSheLio', 'هل يُسمح لك تنزيل وتصعيد راكب في هذا المكان ؟', 'Mag je hier een passagier in en -of uit laten stappen?', 52, 37, 'mcq', 'uploads/question/IgIdL01678001367.jpg', 2, 'يمنع التوقف على ممر المشاة (الزيبراباد)', 'Reden: het is verboden om te stoppen op het voetgangersoversteekplaats.', NULL, NULL, '2023-03-05 06:29:27', '2023-03-13 10:22:38'),
(662, 'l4DVgOC1B3UNurJ', 'ماذا تتوقع عند رؤيتك لهذه اللوحة في الطريق ؟', 'Wat kun je verwachten op deze weg wanneer je dit bord tegenkomt?', 52, 37, 'mcq', 'uploads/question/d9O1xb1678001494.jpg', 3, 'في بعض الطرق و نتيجة سير المركبات الثقيلة يحدث هبوط بسيط في أجزاء من الطريق في أماكن سير العجلات مشكلا بذلك مجرى تجري فيه مياه الأمطار والثلوج', 'Op sommige wegen ontstaat er als gevolg van de beweging van zware voertuigen op delen van de weg een lichte verzakking op de plaatsen waar de wielen rijden, waardoor er spoorvorming ontstaat waar regen- en sneeuwwater doorheen stromen.', NULL, NULL, '2023-03-05 06:31:34', '2023-03-13 10:24:54'),
(663, 'trRuQiuLfHtHroC', 'ماذا تتوقع عند رؤيتك لهذه اللوحة والأسهم على سطح الطريق ؟', 'Wat doe je wanneer je dit bord tegenkomt op de weg?', 52, 37, 'mcq', 'uploads/question/rNbPt31678001649.jpg', 4, 'لا يمكنك مغادرة المسار فوراً بسبب وجود الخط المتصل حيث يمكنك مغادرته لاحقاُ عندما يصبح الخط متقطع', 'Je kunt de rijstrook niet onmiddellijk verlaten vanwege de aanwezigheid van de ononderbroken lijn, deze kun je verlaten wanneer de lijn onderbroken wordt.', NULL, NULL, '2023-03-05 06:34:09', '2023-03-13 10:25:48'),
(664, 'vuhzrBoMigAwwtF', 'هل يسمح لك الدخول بهذا الشارع ؟', 'Mag je deze straat inrijden?', 52, 37, 'mcq', 'uploads/question/yOwY6j1678001772.jpg', 5, 'الجواب : نعم\r\nتستطيع الدخول بهذا الشارع ولا يوجد ما يمنع ذلك .', 'Je mag deze straat in, omdat het bord jou alleen informatie geeft over de richting van de doorgaan verkeer.', NULL, NULL, '2023-03-05 06:36:12', '2023-03-14 09:47:50'),
(665, 'SWITUA7ikMYAG4d', 'ما فائدة هذا الميلان في سطح الطريق ؟', 'Wat is het nut van deze verhoging in het wegdek?', 52, 37, 'mcq', 'uploads/question/R3Hjhl1678002009.jpg', 6, 'السبب : بما أن المنعطف لليسار سيكون الانزلاق خارج المنعطف (بإتجاه اليمين)\r\nوبالتالي  وجود هذا الميلان سيشكل قوة معاكسة لقوة الطرد المركزي\r\nوبالتالي ثبات أكبر للمركبة على المنعطف (كما في حلبات السباق)', 'Reden: aangezien de bocht naar links is, zal er slipgevaar buiten de bocht zijn (aan de rechterkant). Daarom zal de aanwezigheid van deze verhoging een tegengestelde kracht vormen voor het middelpunt, en zorgt dus voor meer stabiliteit van het voertuig in de bocht (zoals op racecircuits).', NULL, NULL, '2023-03-05 06:40:09', '2023-03-14 09:49:16'),
(666, 'xLcbmrutwptv0SA', 'تريد الذهاب إلى حركة التدفق المروري ، هل تقُود بالإتجاه الصحيح ؟', 'Je wilt naar het doorgaande verkeer, rijd je de goede kant op?', 52, 37, 'mcq', 'uploads/question/Iev8Gk1678002136.jpg', 7, 'هذه اللوحة تدُل على ، اتجاه حركة التدفق المروري', 'Dit bord geeft de richting van de verkeersstroom aan.', NULL, NULL, '2023-03-05 06:42:16', '2023-03-07 13:51:11'),
(667, 'SwqpUbZOS7rNXCS', 'على ماذا تنبهك هذه الرسمة على  سطح الطريق ؟', 'Welk gevaar wordt hier door het teken op het wegdek aangegeven?', 52, 37, 'mcq', 'uploads/question/hEymrs1678002264.jpg', 8, 'هذه رسمة للوحة تحذيرية تنبهك من وجود أطفال', 'Dit is een waarschuwingsbord voor de aanwezigheid van kinderen', NULL, NULL, '2023-03-05 06:44:24', '2023-03-13 10:27:08'),
(668, 'zHOrNrrxaTBHTR3', 'ماذا تعني رسمه المثلث على سطح الطريق ؟', 'Wat geeft de aanwezigheid van dit witte driehoek op het wegdek aan?', 52, 37, 'mcq', 'uploads/question/p5wWKo1678002486.jpg', 9, 'هذه الرسمة تعني وجود أسنان القرش', 'Dit teken betekent de aanwezigheid van haaientanden.', NULL, NULL, '2023-03-05 06:48:06', '2023-03-13 10:27:44'),
(669, 'vfor88wzAWjHnpi', 'ماذا تتوقع إذا صادفت هذه اللوحة ؟', 'Wat kun je verwachten wanneer je dit bord treft?', 52, 37, 'mcq', 'uploads/question/IU6srv1678002609.jpg', 10, 'تخبر اللوحة أن WIJK IN AANBOUW\r\nأي الحي تحت الإنشاء وهناك لوحات تدل على وجود أعمال اصلاحات و انشاءات و كذلك سطح طريق سيئ وسرعة قصوى ٣٠', 'Op het bord staat  WIJK IN AANBOUW, dit betekent dat de buurt in aanbouw is, en er zijn borden die wijzen op herstel- en bouwwerkzaamheden, slecht wegdek en maximumsnelheid.', NULL, NULL, '2023-03-05 06:50:09', '2023-03-13 10:28:50'),
(670, '5XAdYD1Cb5tOgIf', 'هل تستطيع تجاوز الشاحنة ؟', 'Je wilt de vrachtwagen inhalen, mag dat?', 52, 37, 'mcq', 'uploads/question/gSOgQZ1678002824.jpg', 11, 'وجود الخط الأصفر يلغي مفعول الخط الأبيض\r\nوبما أن الخط الأصفر متصل يصبح عندها ممنوع التجاوز', 'Reden: De aanwezigheid van de gele lijn heft het effect van de witte lijn op. Aangezien de gele lijn een doorgetrokken lijn is, is inhalen verboden.', NULL, NULL, '2023-03-05 06:53:44', '2023-03-14 09:51:44'),
(671, 'JQmGorK0jvlQ56Q', 'هل تستطيع تجاوز الشاحنة ؟', 'Je wilt de vrachtwagen inhalen, mag dat?', 52, 37, 'mcq', 'uploads/question/DUjyZ21678003041.jpg', 12, 'وجود الخط الأصفر  يلغي مفعول الخط الأبيض\r\nوبما أن الخط الأصفر متقطع  يصبح عندها مسموح التجاوز', 'Reden: De aanwezigheid van de gele lijn heft het effect van de witte lijn op. Aangezien de gele lijn is onderbroken, is inhalen toegestaan.', NULL, NULL, '2023-03-05 06:57:21', '2023-03-14 09:52:28'),
(672, 'mgIQskEsuNnA8ti', 'أي من الأسهم التالية يجب عليك اتباعه اذا كنت ذاهب إلى (مركز المدينة)  centrum؟', 'Je wilt naar het centrum, welke richting  volg je?', 52, 37, 'mcq', 'uploads/question/jP71hC1678454630.jpg', 13, 'تشير اللوحة المعدنية والأسهم على سطح الطريق أنه أول سهم لليمين يقودك إلى مركز المدينة ، أما اذا تابعت السير للأمام مباشرةُ فأنت ذاهب إلى stadshagen - frankhuis', 'Reden: Volgens de pijlen op het bord en op het wegdek moet je op deze rijstrook gepositioneerd staan. De eerste pijl naar rechts leidt je naar het stadscentrum (centrum).', NULL, NULL, '2023-03-05 06:59:09', '2023-03-13 10:30:18'),
(673, 'SKJIWQnWzXdvKhV', 'هل تتموضع بشكل صحيح ؟', 'Sta je zo goed voorgesorteerd?', 52, 37, 'mcq', 'uploads/question/Ym9ApB1678003260.jpg', 14, 'يُمنع السير على خانة الفيتس ستروك\r\nاذا كان الخط الأبيض متصل', 'Reden: Het is verboden om op de fietsstrook te rijden als de witte lijn is ononderbroken is.', NULL, NULL, '2023-03-05 07:01:00', '2023-03-14 09:55:11'),
(674, '7ECI4HEFLxj2ZyR', 'أي من الخطوط التالية أنت مُجبر على إتباعه ؟', 'Welke van de volgende lijnen ben je verplicht te volgen?', 52, 37, 'mcq', 'uploads/question/QTccr21678003348.jpg', 15, 'وجود الخط الأصفر يلغي مفعول الخط الأبيض', 'De aanwezigheid van de gele lijn heft het effect van de witte lijn op.', NULL, NULL, '2023-03-05 07:02:28', '2023-03-13 10:31:00'),
(675, '2ZtWpMuFdsF4kky', 'توقفت هنا للرد على اتصال هاتفي ،هل وقوفك صحيح ؟', 'Je stopt hier om een telefoontje op te beantwoorden mag dit?', 52, 37, 'mcq', 'uploads/question/eFVFqh1678003447.jpg', 16, 'يمنع الباركيرن والستيلستان بجانب الخط الأصفر المتصل المتواجد على الرصيف\r\nوبما أن الرد على اتصال هاتفي يندرج ضمن الباركيرن فهو ممنوع بهذه الحالة', 'Reden: parkeren en stilstaan zijn verboden naast de doorgetrokken gele lijn. Aangezien je wilt antwoorden op een telefoontje wordt dit beschouwd als parkeren en is dat in dit geval verboden.', NULL, NULL, '2023-03-05 07:04:07', '2023-03-14 09:55:58'),
(676, 'mM3A33feRoxciHG', 'توقفت هنا لقراءة رسالة نصية على هاتفك ،هل تموضعك صحيح؟', 'Je staat hier stil om een bericht te lezen op je mobiel, mag dit?', 52, 37, 'mcq', 'uploads/question/CGHnFm1678004482.jpg', 17, 'قراءة رسالة نصية يعتبر باركيرن حيث نلاحظ وجود موقف باركيرن مؤقت خاص للباركير  , و يجب الوقوف في موقف الباركيرن بجانب الخط الأزرق', 'Het lezen van een SMS wordt beschouwd als een parkeren, bij een blauwe schijfzone is het alleen toegestaan om te parkeren bij parkeerplaatsen die worden gemarkeerd met een blauwe lijn.', NULL, NULL, '2023-03-05 07:17:12', '2023-03-14 09:57:41'),
(677, 'nUMfDghq3SLqXvy', 'على ماذا يدل هذا الخط الأزرق ؟', 'Wat betekend de blauwe lijn op het wegdek?', 52, 37, 'mcq', 'uploads/question/BpB7hl1678004386.jpg', 18, 'الجواب :موقف باركيرن مؤقت', NULL, NULL, NULL, '2023-03-05 07:19:46', '2023-03-14 09:59:25'),
(678, 'tH0lDoxhZ2penko', 'عند الإنتظار في أي من الحالتين تكون وضعية الإطارات الأمامية صحيحة ؟', 'Je wacht op een auto omdat je links wilt afslaan, in welke situatie staan je banden goed?', 52, 37, 'mcq', 'uploads/question/96gV691678004592.jpg', 19, 'في الحالة  A\r\n اذا تعرضت سيارتك لإصطدام من الخلف ستندفع سيارتك للخانة المجاورة\r\n مشكلة خطراً على السائقين الذين يقودون بشكل معاكس لإتجاهك\r\n لذلك يجب أن تكون الاطارات متجهه للأمام كما في الحالة B', 'Reden: omdat als je in geval A van achter wordt aangereden, wordt je auto naar het aangrenzende vak geduwd. Dit zorgt voor gevaar voor de automobilisten die in de tegenovergestelde richting van je rijden, daarom moeten de banden naar voren wijzen, zoals in geval B.', NULL, NULL, '2023-03-05 07:23:12', '2023-03-14 10:56:26'),
(679, 'ruXYUCvwdu4wZX5', 'في أي صورة تتوقع تغيير في حالة الطريق ؟', 'In welke situatie kun je verandering op de weg verwachten?', 52, 37, 'mcq', 'uploads/question/eZ1kEP1678004684.jpg', 20, 'إذا كانت الفراغات( المسافة بين الخطوط ) أطول من الخطوط نفسها\r\n فهذا يعني أن ليس هنالك تغيير\r\nاما اذا كانت الفراغات بين الخطوط أقصر من الخطوط نفسها فهذا يعني أن هنالك تغيير في حالة الطريق(أي قد يصبح الخط متصل و يمنع عندها التجاوز)', 'Wanneer de afstand tussen de strepen langer is dan de strepen zelf betekent dit dat er geen veranderingen op de weg zullen zijn. En wanneer de afstand tussen de strepen kort is betekent dit dat er wel veranderingen op de weg zullen zijn.', NULL, NULL, '2023-03-05 07:24:44', '2023-03-13 10:37:39'),
(680, '5beURuoFiHJjjZx', 'هل يُسمح لك تجاوز السيارة الحمراء من اليمين بهذه الحالة ؟', 'Mag je de rode auto op deze manier inhalen?', 52, 37, 'mcq', 'uploads/question/kAnuZm1678004773.jpg', 21, 'يسمح التجاوز من اليمين  اذا كان السائق على يسارك  يريد الانعطاف يساراً', 'Inhalen van rechts is toegestaan, als de bestuurder links van je linksaf wil afslaan.', NULL, NULL, '2023-03-05 07:26:13', '2023-03-14 10:02:29'),
(681, 'TsuFutYLVDXkIjc', 'ما هو العرض الأقصى للمركبة على الطريق الترابي ؟', 'Wat is de maximale breedte van het voertuig op een onverharde weg?', 52, 37, 'mcq', 'uploads/question/pmYUVx1678004842.jpg', 22, 'الاجابة : 220 سنتيمتر', NULL, NULL, NULL, '2023-03-05 07:27:22', '2023-03-13 10:38:07'),
(682, 'TYS84UUZZ86Iwqf', 'هل يُسمح لك تجاوز السيارة الحمراء بهذه الحالة ؟', 'Mag je in deze situatie de rode auto inhalen?', 52, 37, 'mcq', 'uploads/question/5pSgEU1678795674.jpg', 23, 'عند الزيبراباد يمنع تجاوز أي مركبة باستثناء الفارس مع حصانه يسمح بتجاوزه \r\nملاحظة : المركبة هي كل آلية تسير على عجلات', 'Reden: je mag op een zebrapad niet inhalen.', NULL, NULL, '2023-03-05 07:29:30', '2023-03-14 11:07:54'),
(683, 'qRzYXzwWMIgqWqN', 'هل يُسمح لك تجاوز السيارة الخضراء من اليمين بهذه الحالة ؟', 'Mag je de groene auto van rechts inhalen?', 52, 37, 'mcq', 'uploads/question/KBntoR1678005039.jpg', 24, 'يسمح التجاوز من اليمين داخل الدوار وقبل دخول الدوار', 'Binnen de rotonde is inhalen van rechts toegestaan.', NULL, NULL, '2023-03-05 07:30:39', '2023-03-10 09:04:26'),
(684, 'GFOWxpvD1zR80Kg', 'هل يُسمح لك تجاوز السيارات من اليمين بهذه الحالة ؟', 'Is het toegestaan om de auto’s via rechts in te halen in deze situatie?', 52, 37, 'mcq', 'uploads/question/fr08Z31678005106.jpg', 25, 'في الإزدحام ، يُسمح التجاوز من اليمين', 'Tijdens file mag van rechts worden ingehaald.', NULL, NULL, '2023-03-05 07:31:46', '2023-03-13 10:39:27'),
(685, 'WS2CIJNFSTNniDr', 'من الذي يُمكنه تجاوز الترام من اليمين ؟', 'Wie mag de tram inhalen via rechts?', 52, 37, 'mcq', 'uploads/question/OXMdgN1678005268.jpg', 26, 'جميع السائقين ، يحق لهم تجاوز الترام عن يمينه', 'Alle bestuurders hebben het recht om de tram in te halen van rechts.', NULL, NULL, '2023-03-05 07:34:28', '2023-03-07 18:26:56'),
(686, 'X1aBSGIkoqkkVAd', 'هل يُسمح لك تجاوز السياره الحمراء من اليمين بهذه الحالة ؟', 'Mag je de rode auto op de manier inhalen?', 52, 37, 'mcq', 'uploads/question/oZ8oUL1678005363.jpg', 27, 'الاجابة : نعم\r\nيحق لك التجاوز من اليمين اذا كانت البلوكات الأرضية على يسارك', 'Het is toegestaan om rechts in te halen als er blokmarkering aanwezig is.', NULL, NULL, '2023-03-05 07:36:03', '2023-03-14 10:06:12'),
(687, 'IcOaGSBxJAe5exw', 'هل يُسمح للسيارة البيضاء تجاوز الباص من  اليمين؟', 'Je wilt de bus inhalen via rechts, mag dit?', 52, 37, 'mcq', 'uploads/question/AkjCtN1678005482.jpg', 28, NULL, NULL, NULL, NULL, '2023-03-05 07:38:02', '2023-03-13 10:40:14'),
(688, 'ciLlryXrV7829u0', 'تُريد الإنعطاف يميناً ؛ في أي من الحالتين تتموضع بشكل صحيح ؟', 'Je wilt rechtsaf, op welke afbeelding sta je goed voorgesorteerd?', 53, 38, 'mcq', 'uploads/question/jwddOi1678006499.jpg', 1, 'بما أن الخط مقطع فيجب التموضع على خانة الفيتس   \r\nلإغلاق الزاوية الميتة وإفساح مجال للسائقين', 'Reden: voorsorteren op de suggestiestrook is velliger wat betreft de dode hoek en om plaats te maken voor de bestuurders.', NULL, NULL, '2023-03-05 07:54:59', '2023-03-13 23:03:22'),
(689, 'EyB5shANxemTzuZ', 'في أي من الحالتين يكون تموضعك صحيح؟', 'In welke situatie sta je correct voorgesorteerd?', 53, 38, 'mcq', 'uploads/question/FZKbN51678006624.jpg', 2, 'السبب: \r\nإذا توقفت بجانب لوحة STOP كما في الصورة الثانيه B\r\nودخلت الشاحنة بشارعك سيدخل الجزء الخلفي للشاحنة بخانتك \r\nمشكلة خطراً عليك لذلك يجب تقدير الحالة \r\nوترك مسافة أمامك لدخول الشاحنة بشكل آمن', 'Zorg er altijd voor dat je bestuurders van vrachtwagens of bussen genoeg ruimte geeft bij het afslaan.', NULL, NULL, '2023-03-05 07:57:04', '2023-03-14 10:54:09'),
(690, 'fsiQdGJgR5hpoLI', 'في أي من الحالتين يكون تموضعك صحيح ؟', 'In welke situatie sta je correct voorgesorteerd?', 53, 38, 'mcq', 'uploads/question/Zpgq1c1678007062.jpg', 3, 'لوحة Stop تجبرك على الوقوف ،ولكن يجب عليك التوقف بمحاذاة \r\n الخط الأبيض لكشف التقاطع والحصول على رؤية واضحة \r\nبغض النظر عن مكان وجود اللوحة قبل الخط أو بجانبه', 'Een stopbord dwingt je te stoppen, maar je moet vlak voor de witte streep stoppen om de kruising goed te kunnen bekijken en een duidelijk zicht te hebben. Het maakt niet uit waar het bord zich bevindt of dit nou voor of naast de lijn is.', NULL, NULL, '2023-03-05 08:04:22', '2023-03-14 10:53:29'),
(691, 'LXvZmM8wWsRX05K', 'تُريد الإنعطاف يميناً ؛ في أي من الحالتين تتموضع بشكل صحيح ؟', 'Je wilt rechtsaf, in welke situatie sta je correct voorgesorteerd?', 53, 38, 'mcq', 'uploads/question/pGh8Ry1678007150.jpg', 4, 'يمنع السير على خانة الفيتس ستروك \r\nاذا كان الخط الابيض متصل', 'Reden: het is verboden om op de fietsstrook te rijden als de lijn ononderbroken is zoals op foto B.', NULL, NULL, '2023-03-05 08:05:50', '2023-03-10 09:17:54'),
(692, 'trjHO0cuMFCKUw9', 'تريد الذهاب يساراً ثم يساراً ، هل تتموضع بشكل صحيح ؟', 'Je wilt links afslaan en daarna nogmaals links afslaan, is dit de correcte manier van voorsorteren', 53, 38, 'mcq', 'uploads/question/zYcwya1678007228.jpg', 5, 'هذا أقرب مسار  للذهاب يسارا ثم يسارا و هو أكثر أماناُ', 'Als je twee keer links wil afslaan dan wordt het aangeraden om zoveel mogelijk links voorsorteren.', NULL, NULL, '2023-03-05 08:07:08', '2023-03-13 23:08:43'),
(693, 'ITJNbiGQYoq5GtQ', 'تريد متابعة السير للأمام ، هل تموضعك جيد ؟', 'Je wilt rechtdoor, is dit de correcte manier van voorsorteren in dit geval?', 53, 38, 'mcq', 'uploads/question/Bcnz7B1678007350.jpg', 6, 'يجب التموضع في الخانة أقصى اليمين لأن اللوحة تخبرك انه هناك ثلاث مسارات للأمام مباشرة\r\nوانت تقود في المسار الأوسط بدون مبرر والقانون دائماً \r\nيجبرنا بالقيادة أقصى يمين الطريق اذا أمكن', 'Reden: Het bord geeft aan dat er drie rijstroken rechtdoor gaan, en je rijdt onnodig op het middelste rijstrook. Het is bij wet niet toegestaan om onnodig links te blijven rijden.', NULL, NULL, '2023-03-05 08:09:10', '2023-03-13 23:11:10'),
(694, 'DpGkYyfzqxMS8ke', 'هل يُسمح لك التوقف بهذه الحال ،لتشغيل ال جي بي اس والبحث عن موقع أو معلومات؟', 'Je wilt hier stilstaan om een adres op te zoeken via de navigatie, mag dat?', 53, 38, 'mcq', 'uploads/question/4aYimS1678007463.jpg', 7, 'الاجابة : نعم ،مسموح بهذه الحالة\r\nالسبب: هذه اللوحة تخبرك أنك تقترب\r\nمن موقف مخصص للبحث عن معلومات أو موقع', NULL, NULL, NULL, '2023-03-05 08:11:03', '2023-03-13 23:11:40'),
(695, 'tVivyavoSSnZ2Az', 'هل يُسمح لك تنزيل راكب في هذا المكان؟', 'Je wilt hier iemand uit laten stappen, mag dat?', 53, 38, 'mcq', 'uploads/question/YXqjy91678007539.jpg', 8, 'اللوحة والمكعبات على الرصيف\r\nتدل على أنه موقف باص و يسمح لك فقط تحميل وتنزيل ركاب في موقف الباص', 'Reden: bij een bushalte mag je passagiers in en -of uit laten stappen.', NULL, NULL, '2023-03-05 08:12:19', '2023-03-13 23:12:31'),
(696, 'C1HPuszqRgug38n', 'توقفت هنا للرد على اتصال هاتفي ، هل وقوفك صحيح ؟', 'Je staat hier stil om een telefoontje te beantwoorden, mag dat?', 53, 38, 'mcq', 'uploads/question/yXfY371678007606.jpg', 9, 'الرد على اتصال هاتفي يعتبر باركيرن و يُمنع الباركيرن فوق الجسر', 'Reden: het is niet toegestaan om te parkeren op bruggen.', NULL, NULL, '2023-03-05 08:13:26', '2023-03-13 23:13:16'),
(697, 'yqmG1GNL4IJQpV1', 'تُريد الإنعطاف يساراً هل تموضعك صحيح ؟', 'Je wilt naar links, sta je correct voorgesorteerd?', 53, 38, 'mcq', 'uploads/question/ziHkAG1678007674.jpg', 10, 'الشارع باتجاهين وانت تُعيق حركة القادمين من أمامك لذلك يجب الالتزام بمسارك الأيمن و الأقرب للوسط', 'Reden: de straat is in twee richtingen en zo rijd je tegen het verkeer in.', NULL, NULL, '2023-03-05 08:14:34', '2023-03-13 23:14:07'),
(698, 'TQ9iI35C4QrFoDI', 'تريد الإنعطاف يساراً هل تموضعك صحيح ؟', 'Je wilt linksaf, sta je correct voorgesorteerd?', 53, 38, 'mcq', 'uploads/question/pWuaED1678007760.jpg', 11, 'الشارع باتجاهين لذلك يجب التموضع في الوسط\r\n كي لا تعيق حركة القادمين من أمامك\r\n أو القادمين من خلفك و الذين يريدون الانعطاف يميناً', 'Reden: de straat is in twee richtingen, dus het is noodzakelijk om op deze manier te positioneren om de beweging van degenen die voor of achter je komen en die rechtsaf willen slaan niet te belemmeren.', NULL, NULL, '2023-03-05 08:16:00', '2023-03-10 09:39:29'),
(699, '3cvKban0RFWSgYc', 'على ماذا يدل هذا الرمز؟', 'Wat geeft dit symbool aan?', 56, 41, 'mcq', 'uploads/question/9IKejT1678007909.jpg', 1, 'يقوم هذا النظام بإطفاء المحرك اوتوماتيكياً في حال\r\nتوقف المركبة (على اشارة المرور مثلاً) وبمجرد الضغط على\r\nدواسة الوقود سيعمل المحرك تلقائياً وتتحرك المركبة، و هذا النظام موفر للوقود', 'Dit systeem schakelt de motor automatisch uit als het voertuig stopt (bijvoorbeeld voor een verkeerslicht), en zodra het gaspedaal wordt ingedrukt start de motor automatisch en gaat het voertuig rijden, en dit systeem bespaart brandstof.', NULL, NULL, '2023-03-05 08:18:29', '2023-03-14 18:56:33'),
(700, 'gQqZUNxMch1a84q', 'أي من الأضواء التالية يمثّل الضوء العالي (الضوء الكبير)(grootlicht) ؟', 'Op welke van de volgende afbeeldingen zie je het grootlicht symbool?', 56, 41, 'mcq', 'uploads/question/aFo2fP1678008037.jpg', 2, NULL, NULL, NULL, NULL, '2023-03-05 08:20:37', '2023-03-07 18:38:11'),
(701, 'g23GkmBWtIZBM7f', 'تُريد الإنعطاف يساراً هل تموضعك صحيح ؟', 'Je wilt linksaf, mag je zo voorsorteren?', 53, 38, 'mcq', 'uploads/question/quabVp1678008042.jpg', 12, 'الشارع باتجاه واحد حسب اللوحة ولا يوجد سائقين معاكسين لاتجاهك، \r\nلذلك اذا كنت تريد الذهاب يسارا يجب التموضع أقصى اليسار \r\nكي لا تعيق حركة القادمين من خلفك والذين يريدون الذهاب يمينا', 'Reden: Bij een eenrichtingsweg mag je uiterste links voorsorteren.', NULL, NULL, '2023-03-05 08:20:42', '2023-03-13 23:16:25'),
(702, '3ofAjYztPnz4Hb5', 'على ماذا يدل هذا الرمز ؟', 'Wat geeft dit symbool aan?', 56, 41, 'mcq', 'uploads/question/LeItWc1678008109.jpg', 3, 'يسمح بتشغيل ضوء الضباب الأمامي\r\nإذا كان مدى الرؤية أقل من 200 متر في المطر والثلج والضباب', 'Het mist-voorlicht mag worden ingeschakeld als het zicht minder dan 200 meter is bij regen, sneeuw of mist.', NULL, NULL, '2023-03-05 08:21:49', '2023-03-14 19:00:46'),
(703, 'CvlBW7UWcYhRq6F', 'هل يُسمح لك تنزيل وتصعيد راكب هنا؟', 'Je wilt hier iemand in en -of uit laten stappen, mag dat?', 53, 38, 'mcq', 'uploads/question/ZZwg1p1678008144.jpg', 13, 'بجانب الخط الأصفر \r\nالمتقطع المتواجد على الرصيف  يُسمح تنزيل وتصعيد راكب', 'Naast een geel onderbroken streep op het trottoir mag je stilstaan.', NULL, NULL, '2023-03-05 08:22:24', '2023-03-13 23:17:56'),
(704, '3eZxuGb2D6jLIVh', 'تُريد التوقف هنا بغرض عمل باركيرن ،هل يُسمح لك ذلك ؟', 'Je wilt hier parkeren, mag dat?', 53, 38, 'mcq', 'uploads/question/CXZriH1678008225.jpg', 14, 'الخط الأصفر (خط مؤقت) يدل على وجود صيانه للطريق و هو مرسوم على الطريق \r\nوليس على الرصيف و بالتالي لا يخص الوقوف والتوقف بشيء', 'Reden: deze gele lijn (tijdelijke lijn) bevindt zich op de weg, niet op het trottoir, en heeft niets te maken met parkeerverbod. Een geel streep op het trottoir verbied je om te parkeren.', NULL, NULL, '2023-03-05 08:23:45', '2023-03-14 10:47:48'),
(705, 'jX3LzKhKxrk1IRU', 'أنت تقود بهذا الشكل ، هل تموضعك صحيح ؟', 'Je rijdt op deze manier, mag dat?', 53, 38, 'mcq', 'uploads/question/fKLMhl1678008287.jpg', 15, 'يسمح السير على \r\nخانة الفيتس ستروك(بوجود رسمة فيتس) اذا كانت الخط مقطع', 'Bij een onderbroken streep mag je zo voorsorteren.', NULL, NULL, '2023-03-05 08:24:47', '2023-03-13 23:20:12'),
(706, 'FTlwIvCfunEaBhg', 'لقد أدركت بوقت متأخر أنك في المخرج الخاطئ , هل يحق لك العودة للطريق السريع؟', 'Je komt erachter dat je op de verkeerde rijstrook rijdt, mag je weer invoegen?', 53, 38, 'mcq', 'uploads/question/nc7Ruc1678008344.jpg', 16, 'لايسمح بالعودة للطريق السريع\r\nاذا غادرته وأصبحت على خانة الخروج', 'Reden: Het is niet toegestaan om vlak voor een afrit om weer invoegen. Dit kan gevaar opleveren voor het verkeer dat van achter komt.', NULL, NULL, '2023-03-05 08:25:44', '2023-03-13 23:22:42'),
(707, 'jx23r5zmPJTrKMK', 'على ماذا يدل هذا الرمز ؟', 'Wat geeft dit symbool aan?', 56, 41, 'mcq', 'uploads/question/mrXWED1678008528.jpg', 4, 'يُسمح لك  تشغيل ضوء الضباب الخلفي\r\nإذا كان مدى الرؤية أقل من 50 متر في الثلج والضباب', 'Je mag het mistachterlicht aanzetten als het zicht bij sneeuw of mist minder dan 50 meter is.', NULL, NULL, '2023-03-05 08:28:48', '2023-03-13 22:15:26'),
(708, '1KiwGTjVTHGWc0o', 'توقفت هنا لتنزيل راكب ، هل وقوفك صحيح ؟', 'Je staat hier stil om iemand uit te laten stappen, mag dat?', 53, 38, 'mcq', 'uploads/question/0pl8921678008543.jpg', 17, 'الإجابة: نعم \r\nفي خانة ( Suggestiestrook) سوخيستي ستروك(لا تحوي رسمة فيتس)\r\nيُسمح لك تنزيل وتصعيد راكب', 'Het is toegestaan om op de suggestiestrook een passagier in en uit te laten stappen.', NULL, NULL, '2023-03-05 08:29:03', '2023-03-10 09:50:05'),
(709, 'ODLKYlWX8kQGiXa', 'ماذا تعني هذه الخطوط على سطح الطريق ؟', 'Waar staat dit teken voor?', 53, 38, 'mcq', 'uploads/question/kh1qVK1678008659.jpg', 18, NULL, NULL, NULL, NULL, '2023-03-05 08:30:59', '2023-03-08 21:02:41'),
(710, 'SULB6kAEBfCzXs7', 'على ماذا يدل هذا الرمز ؟', 'Wat geeft dit symbool aan?', 56, 41, 'mcq', 'uploads/question/4wAGlO1678008722.jpg', 5, NULL, NULL, NULL, NULL, '2023-03-05 08:32:02', '2023-03-07 18:41:05'),
(711, 'Gu3YLQwLKxBQOEa', 'أنت تنوي الدخول إلى الطريق السريع من هذا المكان ، هل هذا جيد ؟', 'Je wilt vanaf deze plaats direct invoegen, mag dat', 53, 38, 'mcq', 'uploads/question/uURyou1678008750.jpg', 19, 'الاجابة : لا غير جيد\r\nالسبب : \r\nيتم الدخول إلى الطريق السريع عند وجود بلوكات أرضية.', 'Reden: je mag invoegen wanneer de lijn onderbroken wordt.', NULL, NULL, '2023-03-05 08:32:30', '2023-03-13 23:24:13'),
(712, 'HwdNcm7LZiXIZin', 'على ماذا يدل وجود اللوحة على  هذا العامود الأصفر؟', 'Wat voor bord zie je hier?', 53, 38, 'mcq', 'uploads/question/bBSP391678008839.jpg', 20, 'هذا العمود الوحيد الذي يكون بلون أصفر لتمييزه عن غيره \r\nويخبرك بأن الشارع باتجاه واحد ولا يوجد معاكسين لإتجاهك\r\nو يوجد على هذا العامود لوحة تدل على مسارك', 'Reden: Dit is de enige paal die geel is om hem te onderscheiden van andere en die aangeeft dat de straat eenrichtingsverkeer.', NULL, NULL, '2023-03-05 08:33:59', '2023-03-13 23:24:59'),
(713, 'uivZDgtniE5UJTh', 'على ماذا يدل وجود هذا الرمز ؟', 'Wat geeft dit symbool aan?', 56, 41, 'mcq', 'uploads/question/Qy3KSV1678008865.jpg', 6, NULL, NULL, NULL, NULL, '2023-03-05 08:34:25', '2023-03-07 18:42:51'),
(714, '6YFj7GXFMqJW2L0', 'تُريد الذهاب إلى محطة الوقود متى يجب عليك البدء بإعطاء إشارة ضوئية (غماز)؟', 'Je wilt naar het tankstation, wanneer geef je een richtingaanwijzer aan?', 53, 38, 'mcq', 'uploads/question/j8ziRf1678008921.jpg', 21, 'الاجابة : عند هذه اللوحة\r\nالسبب: \r\nيجب إعطاء إشارة ضوئية (غماز) قبل 300 متر\r\nمن المخرج وكما تشير اللوحة أنه تبقّى 300 متر\r\nعلى المخرج الى محطة الوقود', 'Reden: Bij het verlaten van een snelweg, mag je je knipperlichten ongeveer 300 meter voor de afrit aanzetten.', NULL, NULL, '2023-03-05 08:35:21', '2023-03-13 23:26:47'),
(715, 'plkNpDdAD1GLzj4', 'على ماذا يدل وجود هذا الزر بهذا الشكل ؟', 'Wat geeft dit symbool aan?', 56, 41, 'mcq', 'uploads/question/RHIU8j1678008937.jpg', 7, 'PASSENGER AIRBAG و تعني الوسادة الهوائية (البالون) و هي بوضعية ON أي قيد التشغيل', NULL, NULL, NULL, '2023-03-05 08:35:37', '2023-03-14 19:05:35'),
(716, '9VZgILa6dYiB6kT', 'ما هو نوع هذا الطريق ؟', 'Wat voor weg is dit?', 53, 38, 'mcq', 'uploads/question/wxWeah1678009007.jpg', 22, 'يُرمز للطريق السريع في هولندا بحرف (A) ورقم  ضمن مستطيل أحمر \r\nوحسب الصورة فأنت على الطريق السريع A28', 'De snelweg in Nederland wordt gesymboliseerd door een letter (A) en een cijfer, binnen een rode rechthoek, en volgens de afbeelding bevindt u zich op de snelweg A28', NULL, NULL, '2023-03-05 08:36:47', '2023-03-10 09:54:07'),
(717, 'DVJNos4KM9zNnWn', 'أي من الإطارات التالية يؤدي لصرف وقود أكثر ؟', 'Welke van de volgende banden verbruikt meer brandstof?', 56, 41, 'mcq', 'uploads/question/ynKCkj1678009026.jpg', 8, 'الإجابة الصحيحة الحالة :\r\nC\r\nالسبب: ضغط الإطار منخفض جدا وهذا سيتطلب\r\nجهد إضافي من المحرك لتحريك المركبة وبالتالي صرف وقود أكثر', 'Reden: De bandenspanning is te laag en dit zal extra inspanning van de motor vergen om het voertuig te verplaatsen en dus meer brandstof te verbruiken.', NULL, NULL, '2023-03-05 08:37:06', '2023-03-07 18:45:08'),
(718, 'thnDwz53uyX5VDx', 'ما هو العمق القانوني الأدنى لبروفايل ديبته للإطار(عمق فرزات الإطار)؟', 'Wat is de wettelijke minimale diepte voor een autobandprofiel?', 56, 41, 'mcq', 'uploads/question/ysHVKG1678009115.jpg', 9, 'العمق القانوني الأدنى لبروفايل جميع الإطارات هو ١.٦مم  لكن الإطار الشتوي يُنصح أن يكون عمق بروفايل الإطار ٤مم', 'De wettelijke minimale profieldiepte voor alle banden is 1,6 mm, maar voor winterbanden wordt een bandprofieldiepte van 4 m aanbevolen.', NULL, NULL, '2023-03-05 08:38:35', '2023-03-08 09:35:30'),
(719, 'mgqNG6FtGVQWmRU', 'إلى ماذا يُشير وجود هذا المثلث الأصفر على سطح الطريق ؟', 'Wat geeft de aanwezigheid van deze gele driehoek op het wegdek aan?', 53, 38, 'mcq', 'uploads/question/OAXD571678009138.jpg', 23, NULL, NULL, NULL, NULL, '2023-03-05 08:38:58', '2023-03-08 21:10:16'),
(720, 'yQCJ5c24qhfUIyA', 'هل تموضعك صحيح بهذه الحالة؟', 'Mag je hier rijden?', 53, 38, 'mcq', 'uploads/question/af8I4V1678009221.jpg', 24, 'الاجابة : نعم التموضع صحيح\r\nالسبب: \r\nخانة الطوارئ مفتوحة وبالتالي \r\nأصبحت الخانة اليمين من الطريق السريع.', 'Reden: het matrixbord geeft aan dat de vluchtstrook gebruikt mag worden als rijstrook.', NULL, NULL, '2023-03-05 08:40:21', '2023-03-13 23:31:14'),
(721, 'sDm6uCxYv4k5tvi', 'هل تموضعك صحيح اذا اردت الذهاب الى Apeldoorn؟', 'Ben je zo goed voorgesorteerd als je richting Apeldoorn wilt rijden?', 53, 38, 'mcq', 'uploads/question/cURhWr1678009299.jpg', 25, 'حسب اللوحة : كلا الخانتين (اليمين والمجاورة لها) تؤديان الى Apeldoorn و يجب التموضع دائماُ أقصى اليمين اذا امكن', 'Volgens het bord gaan beide rijstroken van rechts richting Apeldoorn.', NULL, NULL, '2023-03-05 08:41:39', '2023-03-14 10:47:19'),
(722, 'v2oF6cktpWROSH0', 'ماذا تعني هذه اللوحة ؟', 'Wat geeft dit bord aan?', 53, 38, 'mcq', 'uploads/question/nuYeO91678009374.jpg', 26, NULL, NULL, NULL, NULL, '2023-03-05 08:42:54', '2023-03-13 23:43:02'),
(723, 'xlTL0eQh2UO7v7x', 'في أي من الحالتين يُسمح لك بالقيادة؟', 'In welke van de volgende situaties mag je rijden?', 56, 41, 'mcq', 'uploads/question/Y8ZNez1678009432.jpg', 10, 'الاجابة الصحيحة الحالة\r\nB\r\n السبب: يُمنع عليك القيادة اذا كان عداد السرعة معطل كما في الحالة\r\nA', 'Reden: je mag niet rijden als de snelheidsmeter kapot is, zoals in geval A.', NULL, NULL, '2023-03-05 08:43:52', '2023-03-08 09:36:40'),
(724, 'EYFIxdxXVTNXkGY', 'في أي من الحالتين تتوقع أن تتقاطع حركتك مع حركة سائقين آخرين في هذا التقاطع ؟', 'Bij welk bord kan ander verkeer kruisen bij groenlicht?', 53, 38, 'mcq', 'uploads/question/V5RAgt1678009466.jpg', 27, 'عندما تكون الاشارة الضوئية على شكل دائرة خضراء فمن الممكن أن تكون أيضاً \r\nخضراء عند السائقين المقابلين في التقاطع ، لكن اذا كانت على شكل سهم أخضر \r\nفأنت الوحيد الذي سيتحرك في التقاطع ولن تتقاطع حركتك مع سائقين آخرين', 'Bij verkeerslichten in de vorm van een cirkel kunnen wij tegenliggers verwachten. Bij verkeerslichten met een pijl verwachten wij een tegenliggers of kruisend verkeer', NULL, NULL, '2023-03-05 08:44:26', '2023-03-14 10:44:39'),
(725, 'PwtZNx4C3U0kegr', 'انت تقود السيارة البيضاء في الإزدحام، هل يُسمح لك الوقوف على (الأكس) أمامك؟', 'Je rijdt de witte personenauto, mag je op de witte kruis stilstaan?', 53, 38, 'mcq', 'uploads/question/EURl4a1678009542.jpg', 28, 'أهمية هذا (الأكس) لإستمرار حركة المرور في التقاطع أاثناء الإزدحام', 'Het belang van de kruis op het wegdek is om het verkeer niet te belemmeren tijdens drukte.', NULL, NULL, '2023-03-05 08:45:42', '2023-03-13 23:40:38'),
(726, 'bQUIkHcnnTfSccA', 'هل أنت مجبر على تشغيل الضوء العادي  مع ضوء الضباب الأمامي؟', 'Ben je verplicht om het dimlicht aan te zetten wanneer het mistlicht aanstaat?', 56, 41, 'mcq', 'uploads/question/uF5x4K1678009567.jpg', 11, 'بإمكانك تشغيل الضوء العادي مع ضوء الضباب الأمامي\r\nلكنك غير مجبر على ذلك ويفضّل عدم تشغيل الضوء العادي\r\nمع ضوء الضباب الأمامي لأنه في بعض الحالات قد يسبب\r\nانعكاس الأشعة الضوئية وعدم وضوح الرؤية', 'Reden: je kunt met het mist-voorlicht met dimlicht aanzetten, maar je bent hiertoe niet gedwongen.', NULL, NULL, '2023-03-05 08:46:07', '2023-03-14 19:07:03'),
(727, 'Vkf26fABinJnbHR', 'ماهي سرعتك القصوى اذا رأيت هذه اللوحة ؟', 'Wat is de toegestane maximumsnelheid wanneer je dit bord ziet?', 54, 39, 'mcq', 'uploads/question/pToDKb1678009672.jpg', 1, 'هذه اللوحة توجد على الطريق السريع وتدل على\r\n\r\nتفرّع الطريق السريع الى طريقين سريعين آخرين', 'Dit bord staat op de snelweg en geeft de splitsing van de snelweg in twee andere snelwegen aan.', NULL, NULL, '2023-03-05 08:47:52', '2023-03-08 17:59:58'),
(728, '5QohKYsuA0BP2jV', 'على ماذا تدل هذه الإشارة ؟', 'Wat betekent dit symbool?', 56, 41, 'mcq', 'uploads/question/22veCj1678009672.jpg', 12, NULL, NULL, NULL, NULL, '2023-03-05 08:47:52', '2023-03-08 09:38:28'),
(729, '606qogKTHbxJlps', 'هل يُسمح لك القيادة بهذه الحالة ؟', 'Mag je op deze manier rijden?', 56, 41, 'mcq', 'uploads/question/12ZxD31678009762.jpg', 13, 'السبب: لوحة أرقام السيارة مغطاة بالطين\r\nويجب أن تكون مقروءة و واضحة', 'Reden: Het kentekenplaat van de auto zit onder de modder, deze moet leesbaar en duidelijk zijn.', NULL, NULL, '2023-03-05 08:49:22', '2023-03-14 19:08:12'),
(730, '3db4jhpl7Pcy3w7', 'ماهي السرعة القصوى عند رؤيتك لهذه اللوحة في الطريق ؟', 'Wat is de toegestane maximumsnelheid wanneer je dit bord ziet?', 54, 39, 'mcq', 'uploads/question/508yuq1678009764.jpg', 2, 'هذه اللوحة تخبرك بأن السيارات ضيوف في خط الفيتسات\r\n والسرعه القصوى لك ستكون 30 كم/سا\r\nللحفاظ على فارق سرعة قليل بينك وبين الفيتسات\r\nوحفاظاً على سلامتهم.', 'Dit bord informeert je dat de auto\'s te gast zijn op de fietsstrook en dat jouw maximumsnelheid 30 km/u zal zijn om een klein snelheidsverschil tussen jou en de fiets te behouden en om hun veiligheid te behouden.', NULL, NULL, '2023-03-05 08:49:24', '2023-03-08 18:00:21'),
(731, 'w2ur6WvL7HTJ5x5', 'ماهي السرعة القصوى على هذا الطريق ؟', 'Wat is de toegestane maximumsnelheid op deze weg?', 54, 39, 'mcq', 'uploads/question/Vtjkr31678009857.jpg', 3, 'لإن هذا الطريق Autoweg\r\nوالسرعة القصوى عليه 100 كيلو متر بالساعه', 'Deze weg is namelijk een autoweg en de maximumsnelheid is 100 km/u.', NULL, NULL, '2023-03-05 08:50:57', '2023-03-08 18:00:40'),
(732, '590M6CH48Zqi4JR', 'تسحب عربة على الطريق السريع ماهي سرعتك القصوى في هذه الحالة ؟', 'Je trekt een aanhangwagen op de snelweg, wat is in dit geval jouw maximale snelheid?', 54, 39, 'mcq', 'uploads/question/QVSdCF1678009937.jpg', 4, 'عندما تجر عربة خلفك تصبح سرعتك القصوى\r\n90 كيلو متر/ساعه  فقط', 'Als je een aanhanger trekt en het totale gewicht onder de 3500 kg is je maximumsnelheid 90 km/u.', NULL, NULL, '2023-03-05 08:52:17', '2023-03-14 10:42:59'),
(733, 'v7LG8ykp4uNxlYs', 'على أي مسار تتوقع سرعتك القصوى 130 كم/سا ؟', 'Op welke rijstrook is je maximumsnelheid 130 km/u?', 54, 39, 'mcq', 'uploads/question/LM96G11678010022.jpg', 5, 'جميع المسارات تستطيع السير بسرعة 130 كم/سا\r\nحتى خانات الدخول والخروج كونه طريق سريع', 'Je mag op alle rijstroken 130 km/u rijden, tot aan de uitvoegstrook aangezien dit een snelweg is.', NULL, NULL, '2023-03-05 08:53:42', '2023-03-12 13:25:09'),
(734, '7WdyFHUGY6lzo1G', 'متى يجب عليك إتباع تعليمات لوحات السرعة المنصوح بها هذه ؟', 'Wanneer geldt dit adviessnelheid?', 54, 39, 'mcq', 'uploads/question/jqFN9l1678010131.jpg', 6, NULL, 'De adviesborden gelden bij goed weer. Bij slecht weer wordt geadviseerd om langzamer te rijden.', NULL, NULL, '2023-03-05 08:55:31', '2023-03-12 20:38:31'),
(735, 'mK2Cj8t4cCsz0Lt', 'ماذا تتوقع سرعتك القصوى في هذا المكان ؟', 'Wat is de toegestane maximumsnelheid op deze weg?', 54, 39, 'mcq', 'uploads/question/3CmoWI1678010224.jpg', 7, 'السرعة القصوى داخل الحي السكني\r\n15كم /ساعه\r\nلجميع المركبات', 'De maximumsnelheid binnen de erf is 15 km/u voor alle voertuigen.', NULL, NULL, '2023-03-05 08:57:04', '2023-03-12 13:29:28');
INSERT INTO `questions` (`id`, `question_uuid`, `question_ar`, `question_nl`, `exam_category_id`, `exam_id`, `question_type`, `question_image`, `arrangment`, `answer_explanation_ar`, `answer_explanation_nl`, `question_en`, `answer_explanation_en`, `created_at`, `updated_at`) VALUES
(736, '8p1ndC889SpZYtV', 'مدى الرؤية لديك  70 متر في الضباب ،هل القيادة بهذه الوضعية صحيحة ؟', 'Je zichtbereik is 70 meter in de mist, mag je zo rijden?', 56, 41, 'mcq', 'uploads/question/X3cdtL1678010231.jpg', 14, 'يسمح بتشغيل ضوء ضوء الضباب الخلفي فقط اذا كان مدى الروئية أقل من 50متر في الضباب او الثلج', 'Het mistachterlicht mag alleen aanstaan als het zicht bij mist of sneeuw minder dan 50 meter is.', NULL, NULL, '2023-03-05 08:57:11', '2023-03-13 22:21:58'),
(737, 'NcOJiARsNSb0OVJ', 'ماذا تتوقع سرعتك في هذا المكان ؟', 'Wat is de toegestane maximumsnelheid op deze weg?', 54, 39, 'mcq', 'uploads/question/ICNDWU1678010308.jpg', 8, 'السرعة 15 كم/سا , انت مازلت داخل الحي السكني\r\nومفعول اللوحة يبدأ بعدها وليس قبلها', 'De snelheid is 15 km/u, je bent nog steeds binnen de woonerf.', NULL, NULL, '2023-03-05 08:58:28', '2023-03-14 19:27:56'),
(738, 'GF8gUPftT9R1G9o', 'مدى الرؤية لديك أقل من 50 متر بسبب المطر الكثيف ،هل القيادة بهذه الوضعية صحيحة ؟', 'Je zichtbereik is minder dan 50 meter door hevige regenbuien, mag je zo rijden?', 56, 41, 'mcq', 'uploads/question/CLwpH71678010349.jpg', 15, 'السبب : ضوء الضباب الخلفي يستخدم\r\nاذا كان مدى الرؤية أقل من 50 متر\r\nفي الضباب والثلج فقط ويمنع\r\nتشغيله في المطر الكثيف لأنه يسبب عمى للسائقين', 'Reden: Het mistachterlicht mag worden gebruikt als het zicht is beperkt tot minder dan 50 meter door sneeuw of mist. Bij hevige regenbuien is mistlicht achter verboden.', NULL, NULL, '2023-03-05 08:59:09', '2023-03-14 19:09:16'),
(739, 'Uem25CjIRB0UQLf', 'ماذا تتوقع سرعتك القصوى عند رؤيتك هذه اللوحة ؟', 'Wat is de toegestane maximumsnelheid wanneer je dit bord ziet?', 54, 39, 'mcq', 'uploads/question/t1YgGb1678010388.jpg', 9, 'السرعة القصوى 130 كيلو متر لأن هذه اللوحة تتواجد على الطريق السريع\r\nوتدل على وجود بوابة معدنية متحركة تفتح وتغلق في السور الفاصل بين جانبي\r\nالطريق السريع لتسهيل مرور سيارات الطوارئ بين جانبي الطريق في الحالات الطارئة', 'De maximumsnelheid is 130 km/u omdat dit bord zich op de snelweg bevindt en de aanwezigheid aangeeft van een beweegbare metalen poort die opent en sluit in het hek dat beide zijden van de snelweg scheidt, om de doorgang van hulpverleningsvoertuigen tussen de twee zijden van de weg te vergemakkelijken in geval van noodgevallen.', NULL, NULL, '2023-03-05 08:59:48', '2023-03-08 18:02:14'),
(740, 'o30WWtv6DaLlh5A', 'مدى الرؤية لديك أكثر من 250 متر ، هل القيادة بهذه الوضعية صحيحة ؟', 'Je zichtbereik is meer dan 250 meter, mag je zo rijden?', 56, 41, 'mcq', 'uploads/question/Mnh3uX1678010434.jpg', 16, 'السبب: انت تستخدم ضوء الضباب الأمامي\r\nو يسمح يتشغيل ضوء الضباب الأمامي\r\nاذا كان مدى الرؤية أقل من 200 متر في المطر والثلج والضباب', 'Reden: alleen bij zicht minder dan 200 mag je mist voorlichten gebruiken.', NULL, NULL, '2023-03-05 09:00:34', '2023-03-14 19:10:56'),
(742, 'h3hh3Kp19ULnjkT', 'ما هي أدنى نسبة مسموحة لنفاذ كمية الضوء من زجاج النوافذ الأمامية والزجاج الأمامي؟', 'Wat is de minimale toegestane hoeveelheid lichtinval door de zijruiten en voorruit?', 56, 41, 'mcq', 'uploads/question/WC4V0p1678010494.jpg', 17, NULL, 'Als je ramen blindeert moet minimaal lichtinval van meer dan 55% zijn bij je voorruit en je voorzijruiten.', NULL, NULL, '2023-03-05 09:01:34', '2023-03-13 22:27:59'),
(743, 'tVq5Usb9D9zkKXj', 'ماذا تعني هذه اللوحة ؟', 'Wat betekent dit bord?', 54, 39, 'mcq', 'uploads/question/kzjT3M1678010586.jpg', 11, 'السرعة القصوى  80 كم/ ساعه وممنوع تجاوزها', 'De maximale snelheid is 80 km/u en het is verboden deze te overschrijden.', NULL, NULL, '2023-03-05 09:03:06', '2023-03-08 18:02:31'),
(744, 'vZAjWxCyqahm9Fb', 'ما نوع هذا الإطار ؟', 'Wat voor type band is dit?', 56, 41, 'mcq', 'uploads/question/esbVzu1678010666.jpg', 18, 'السبب: يمكن تمييز الإطار الشتوي من خلال\r\nرمز الجليد المتواجد عليه\r\nبالإضافة إلى (M+S) ،حيث M اختصار لكلمة : Mud\r\n وتعني الطين و S اختصار لكلمة Snow وتعني الثلج\r\nوتبدأ فعالية هذا الإطار عند درجة حرارة 7ْ مئوية و ما دون', 'Reden: De winterband kan worden onderscheiden door het (*) symbool van ijs erop naast (MS), waarbij M een afkorting is voor het woord: Mud en S een afkorting is voor het woord Snow, wat sneeuw betekent. Deze band presteer het beste bij een temperatuur van 7°C en lager.', NULL, NULL, '2023-03-05 09:04:26', '2023-03-14 19:13:20'),
(745, 'FuJQroAtujtDMzN', 'ما هي سرعتك القصوى في هذا الطريق ؟', 'Wat is de toegestane maximumsnelheid op deze weg?', 54, 39, 'mcq', 'uploads/question/oD7GrJ1678010686.jpg', 12, 'لوحة الأفضلية موجودة بعد التقاطع أي أنت خارج المدينة\r\nوسرعتك القصوى دائماً 80 كم/ساعه\r\nإلا في حالة وجود لوحة تأمر بخلاف ذلك', 'Het voorrangswegbord bevindt zich na de kruising, wat betekent dat je buiten de bebouwede kom bent en je maximumsnelheid 80 km/u is, tenzij een bord anders aangeeft.', NULL, NULL, '2023-03-05 09:04:46', '2023-03-12 13:35:30'),
(746, 'sHPg3baYGCCwbLe', 'أثناء القيادة ظهر لديك هذا الرمز ، ماذا تفعل ؟', 'Tijdens het rijden gaat dit symbool aan, wat doe je?', 56, 41, 'mcq', 'uploads/question/sOL7Ar1678010740.jpg', 19, 'بعض الرموز اذا ظهرت بلون أصفر تدل\r\nعلى أن هناك خلل ما حسب الرمز الظاهر\r\nلديك و لا يستدعي التوقف الفوري\r\nلكن يجب عليك الذهاب لإصلاح هذا الخلل (كراج التصليح)', 'Reden: Elk symbool dat in het geel verschijnt, geeft aan dat er een defect is volgens het symbool dat wordt getoond en dat je niet onmiddellijk hoeft te stoppen, maar dat je dit defect z.s.m. moet gaan repareren.', NULL, NULL, '2023-03-05 09:05:40', '2023-03-14 19:17:01'),
(747, 'XbZ1Ju7rS8q4PJV', 'أنت تقود في هذا الطريق ماذا تتوقع السرعة القصوى للشاحنة التي تسير أمامك ؟', 'Je rijdt op deze weg, wat is de toegestane maximumsnelheid voor de vrachtwagen?', 54, 39, 'mcq', 'uploads/question/pe3PU11678010788.jpg', 13, 'السرعة القصوى للشاحنة على الطريق السريع\r\nو طريق السيارات(autoweg) هي 80 كم/ساعه', 'De maximale snelheid van de vrachtwagen op de autosnelweg en snelweg is 80 km/u.', NULL, NULL, '2023-03-05 09:06:28', '2023-03-14 19:29:47'),
(748, 'YSNUcIYzhRxus36', 'على ماذا يدل هذا الرمز؟', 'Wat betekent dit symbool?', 56, 41, 'mcq', 'uploads/question/eh7KvC1678010853.jpg', 20, NULL, NULL, NULL, NULL, '2023-03-05 09:07:33', '2023-03-08 09:49:42'),
(749, 'ICQyzAdBuhM8a0d', 'أنت تسير على الخط السريع بهذه الوضعية ماذا تتوقع سرعتك القصوى ؟', 'Je rijdt zo de snelweg op, wat is de toegestane maximumsnelheid?', 54, 39, 'mcq', 'uploads/question/3oe8iq1678010862.jpg', 14, 'حاملة الفيتس لا تعتبر عربة لذلك لايوجد أي تغيير بالسرعه', 'Een fietsendrager wordt niet gezien als een aanhangwagen daardoor blijft je snelheid op een autosnelweg max 130 km.', NULL, NULL, '2023-03-05 09:07:42', '2023-03-12 13:39:15'),
(750, 'nzGL55adx2WtWd1', 'أثناء القيادة ظهر لديك هذا الرمز ، ماذا تفعل ؟', 'Tijdens het rijden gaat dit symbool aan, wat doe je?', 56, 41, 'mcq', 'uploads/question/XP6Utf1678010942.jpg', 21, 'أي رمز يظهر بلون أحمر يعني أن\r\nالحالة خطرة ويجب التوقف مباشرة\r\nولكل قاعدة شواذ: داخل النفق اذا ظهر لديك رمز بلون أحمر\r\nحاول أن لا تتوقف اذا كان بإمكان مركبتك متابعة السير', 'Reden: elk rood symbool betekent dat de toestand gevaarlijk is en onmiddellijk moet worden gestopt. Voor elke regel is er verschil: als je in de tunnel een rood symbool hebt, probeer dan niet te stoppen als je voertuig kan blijven rijden.', NULL, NULL, '2023-03-05 09:09:02', '2023-03-14 19:18:50'),
(751, 'xlXHUELaLkj8ryH', 'في أي حالة تستطيع القيادة بسرعة  70  كم /سا؟', 'In welke van de volgende situaties mag je 70 km/u rijden?', 54, 39, 'mcq', 'uploads/question/SRfGAC1678632456.jpg', 15, 'في الحالة B\r\nانت ستصبح داخل المدينة و سرعتك القصوى 50 كم/سا\r\n\r\nأما في الحالة A\r\nأنت ستصبح خارج المدينة وسرعتك القصوى 80 كم/سا', 'In geval B bevind je je binnen de bebouwede kom met een maximale snelheid van 50 km/u, in geval A bevind je je buiten de bebouwde kom met een maximale snelheid van 80 km/u.', NULL, NULL, '2023-03-05 09:09:26', '2023-03-14 19:30:50'),
(752, 'HnE60rJ29WspcYM', 'في أي طريق من الطريقين تستطيع القيادة بسرعة 80 كم/سا ؟', 'In welke van de volgende situaties mag je 80 km/u rijden?', 54, 39, 'mcq', 'uploads/question/7d7qC21678011125.jpg', 16, 'الطريق B\r\nطريق خارج المدينة ذو السرعة القصوى 80 كم/سا\r\n\r\nوالطريق A\r\nطريق سيارات Autoweg ذو السرعة القصوى 100 كم/سا\r\nلذلك في كلا الطريقين تستطيع القيادة بسرعة 80 كم/س', 'Weg B is een weg buiten de bebouwde kom met een snelheidslimiet van 80 km/u. Weg A is een autoweg met een snelheidslimiet van 100 km/u, dus op beide wegen mag je 80 km/u rijden.', NULL, NULL, '2023-03-05 09:12:05', '2023-03-08 18:03:52'),
(753, 'cseDD54Igd6ElYn', 'في أي طريق من الطريقين يحق لك القيادة بسرعة 130 كم/سا ؟', 'In welke van de volgende situaties mag je 130 km/u rijden?', 54, 39, 'mcq', 'uploads/question/4aYkJv1678011251.jpg', 17, 'في الحالة B\r\nهذا طريق سيارت ذو سرعة قصوى 100 كم/سا\r\nبدلالة الخط الأخضر المتصل بالمنتصف\r\n\r\nاما بالنسبة للحالة A\r\nهذا طريق سريع ذو السرعة القصوى 130 كم/سا', 'In geval B is dit een autoweg met een maximumsnelheid van 100 km/u, zoals aangegeven door de groene belijning in het midden van de weg. In geval A is dit een snelweg met een maximumsnelheid van 130 km/u.', NULL, NULL, '2023-03-05 09:14:11', '2023-03-12 13:43:12'),
(754, 'AkVQIXxFyn8SoyM', 'ماهي سرعتك القصوى بعد اللوحة ؟', 'Wat is de toegestane maximumsnelheid op deze weg?', 54, 39, 'mcq', 'uploads/question/OSfMD11678011326.jpg', 18, 'أنت ستصبح داخل المدينة والسرعة القصوى هي 50 كم/سا', 'Je bevind je nu binnen de bebouwde kom en de maximumsnelheid is 50 km/u.', NULL, NULL, '2023-03-05 09:15:26', '2023-03-14 20:29:40'),
(755, '2yXADjLIGtoc9J4', 'أي من الإطارات التالية هو المثالي للقيادة ؟', 'Welke van de volgende banden is ideaal om mee te rijden?', 56, 41, 'mcq', 'uploads/question/1iinxo1678011590.jpg', 22, 'في الحالة B \r\nكامل سطح الإطار بتماس مع سطح الطريق والضغط\r\nمناسب جداً وبالتالي هذا هو الإطار المثالي للقيادة', 'Het gehele oppervlak van de band staat in contact met het wegdek en de druk is zeer geschikt, waardoor je genoeg grip hebt en niet onnodig brandstof verbruikt.', NULL, NULL, '2023-03-05 09:19:50', '2023-03-14 19:19:43'),
(756, 'xlIPRK3LLJKS0ux', 'في أي حالة تستطيع القيادة بسرعة 50  كم /سا ؟', 'In welke van de volgende situaties mag je 50 km/u rijden?', 54, 39, 'mcq', 'uploads/question/okL2YK1678011702.jpg', 19, 'في الحالة B\r\nانت ستصبح داخل المدينة وسرعتك القصوى 50 كيلو متر\r\n\r\nأما في الحالة A\r\nأنت ستصبح خارج المدينه وسرعتك القصوى 80 كيلو متر', 'In geval B bevind je je binnen de bebouwede kom met een maximale snelheid van 50 km/u. In geval A bevind je je buiten de bebouwde kom met een maximale snelheid van 80 km.', NULL, NULL, '2023-03-05 09:21:42', '2023-03-12 13:44:41'),
(757, 'wxq6OTNjCCk4NS6', 'إختر الرمز الذي يدل على ضوء المدينة  stadslicht؟', 'Welke van de volgende symbolen staat voor stadslicht?', 56, 41, 'mcq', 'uploads/question/vjaK5y1678011752.jpg', 23, NULL, NULL, NULL, NULL, '2023-03-05 09:22:32', '2023-03-08 09:53:53'),
(758, 'ghAb2yYzdEqqB5u', 'أي من اللوحتين تدل على طريق السيارات  ذو السرعة القصوى 100 كم/سا ؟', 'Welk van de twee borden geeft de autoweg aan met een maximumsnelheid van 100 km/u?', 54, 39, 'mcq', 'uploads/question/2IElmo1678011807.jpg', 20, 'اللوحة A\r\nهي لوحة طريق سيارات ذو السرعة القصوى 100 كم/سا\r\n\r\nاللوحة B\r\nهي لوحة منع دخول المركبات من نوع موتورفورتاوخ  \r\nmotorvoertuigen\r\nوالتي تسير على أكثر من عجلتين ولا تختص بالسرعة', 'Bord A is een bord voor autowegen met een maximumsnelheid van 100 km/u. Bord B is een bord die de toegang van motorvoertuigen verbiedt die op meer dan twee wielen rijden en niets te maken hebben met deze snelheid.', NULL, NULL, '2023-03-05 09:23:27', '2023-03-14 19:39:23'),
(759, 'IrWD0kevWYdFeJ3', 'أنت تقود خارج المدينة و على هذا الطريق بهذه الخطوط  ماذا تتوقع النسبة الكبرى المتوقعه  للسرعة  القصوى على هذا النوع من الطرق ؟', 'Je rijdt buiten de bebouwde kom, en je rijdt op deze weg met deze belijning, wat is vaak de toegestane maximumsnelheid op deze wegen?', 54, 39, 'mcq', 'uploads/question/mmQoWO1678011886.jpg', 21, 'في هذا النوع من الطرق خارج المدينة كما في الصورة\r\nبدون وجود خط المنتصف غالباً تكون السرعة القصوى 60 كيلو متر', 'Op dit type weg buiten de bebouwde kom zonder middenlijn en onderbroken strepen aan de zijkant zoals op de foto, is vaak een 60 km zone. Daarom kunnen wij verwachten dat dit een 60 km weg is.', NULL, NULL, '2023-03-05 09:24:46', '2023-03-12 14:18:36'),
(760, 'RqamtcxSij8RFYG', 'في أي طريق من الطريقين يحق لك القيادة بسرعة 100  كم /سا ؟', 'In welke van de volgende situaties mag je 100km/u rijden?', 54, 39, 'mcq', 'uploads/question/l3Jqc11678012066.jpg', 22, 'في كلتا الحالتين الطريق ذو السرعة القصوى 100 كيلو متر\r\nبدلالة الخطين المتصلين من الجانبين والخط الأخضر المتصل بالمنتصف\r\nأما بالنسبة للخطوط البيضاء في المنتصف فهي تعني مسموح التجاوز\r\nإذا كانت متقطعه وممنوع التجاوز إذا كانت متصله', 'In beide gevallen rijd je op een autoweg met een maximumsnelheid van 100 km. Bij bord A is inhalen verboden en Bord B is inhalen toegestaan.', NULL, NULL, '2023-03-05 09:27:46', '2023-03-12 13:56:43'),
(761, 'yT5SbwaEAjRtOG5', 'أي طريق من الطريقين هو طريق السيارات  ذو السرعة السرعة القصوى 100 كيلو متر Autoweg ؟', 'Welke van de volgende twee wegen is een autoweg met een maximumsnelheid van 100 km?', 54, 39, 'mcq', 'uploads/question/GxfWJB1678012190.jpg', 23, ' الاجابة الصحيحة الطريق بالصورة B\r\n\r\nلأن الطريق بالصورة A\r\nهو طريق خارج المدينة وسرعته القصوى هي 80 كيلو متر', 'Het juiste antwoord is afbeelding B,  de groene middenstreep geeft aan dat je op een autoweg rijdt.', NULL, NULL, '2023-03-05 09:29:50', '2023-03-12 13:59:49'),
(762, 'hNDiu14ktbuQ9d6', 'ماذا تتوقع سرعتك القصوى بعد هذه اللوحة خارج المدينة ؟', 'Wat is de toegestane maximumsnelheid op deze weg buiten de bebouwde kom?', 54, 39, 'mcq', 'uploads/question/V1jpRX1678012304.jpg', 24, 'هذه اللوحة تعني نهاية كافة المحظورات(التعليمات) السابقة على لوحات معدنية', 'Na dit bord buiten de bebouwde kom mag je 80 km per uur. Omdat buiten de bebouwde kom een maximumsnelheid geldt van 80 km per uur.', NULL, NULL, '2023-03-05 09:31:44', '2023-03-14 19:44:29'),
(763, 'efPa5lhkIMzlTpw', 'على ماذا يدل وجود هذا الرمز؟', 'Wat geeft dit symbool aan?', 56, 41, 'mcq', 'uploads/question/gizcYa1678012328.jpg', 24, NULL, NULL, NULL, NULL, '2023-03-05 09:32:08', '2023-03-08 09:55:34'),
(764, 'vFzUEnPjgPSgtQs', 'أنت تقود على طريق سريع وصادفت لوحة السرعة 50 ماذا تعني لك هذه اللوحة ؟', 'Je rijdt op een snelweg en je komt een 50 snelheidsbord tegen. Wat betekent dit bord voor jou?', 54, 39, 'mcq', 'uploads/question/FvoTpR1678012383.jpg', 25, 'السبب :\r\nأقصى سرعة هي 50 كيلو متر وممنوع تجاوزها', 'Het juiste antwoord is dat de maximale snelheid 50 km/u is en dat het verboden is deze te overschrijden.', NULL, NULL, '2023-03-05 09:33:03', '2023-03-08 18:06:48'),
(765, 'F5dmRyTRDt0emsD', 'على ماذا يدل وجود هذا الرمز؟', 'Wat geeft dit symbool aan?', 56, 41, 'mcq', 'uploads/question/e1vUGN1678012422.jpg', 25, NULL, NULL, NULL, NULL, '2023-03-05 09:33:42', '2023-03-08 09:55:46'),
(766, 'IrX60n31dFq2Gkz', 'أنت تقود على الطريق السريع واللوحات الإلكترونية تشير الى سهم بلون أخضر ماذا تتوقع ؟', 'Je rijdt op de snelweg en je ziet de elektronische borden met een groene pijl. Wat gebeurt vaak met de snelheid?', 54, 39, 'mcq', 'uploads/question/cGco8G1678012486.jpg', 26, 'عندما تكون جميع المسارات مفتوحة نتوقع أن السرعة\r\n سوف تقل و ذلك للمحافظة على استمرارية السير', 'Als alle rijstroken open zijn, verwachten we dat de snelheid zal afnemen om de vaart van het verkeer te behouden.', NULL, NULL, '2023-03-05 09:34:46', '2023-03-12 14:03:27'),
(767, 'BteAUADmDO15c3V', 'على ماذا يدل هذا الرمز؟', 'Wat geeft dit symbool aan?', 56, 41, 'mcq', 'uploads/question/1Txrt71678012508.jpg', 26, NULL, NULL, NULL, NULL, '2023-03-05 09:35:08', '2023-03-08 09:57:22'),
(768, 'U7FvFKe9o3RwcvD', 'في أي مسار من المسارات التالية تتوقع سطح طريق سيء؟', 'Op welke van de volgende rijstroken zou je een slecht wegdek kunnen verwachten?', 54, 39, 'mcq', 'uploads/question/mORNoU1678012573.jpg', 27, 'المسار الأول يكون اكثر إستخداماً من قبل الشاحنات والسيارات.', 'Rijstrook 1 omdat deze vaker wordt gebruikt door vrachtwagens', NULL, NULL, '2023-03-05 09:36:13', '2023-03-12 14:04:22'),
