(770, 'pWq78bHULFDyM4i', 'هل يؤثر عُمق بروفايل الإطار على عملية الإنزلاق المائي Aquaplaning؟', 'Heeft de diepte van het bandenprofiel invloed op aquaplaning?', 56, 41, 'mcq', 'uploads/question/c7tVfQ1678012664.jpg', 28, 'السبب :كلما قلّ عمق بروفايل الإطار سيزداد إحتمال حدوث الإنزلاق', 'Reden: Hoe lager de profieldiepte van de band, hoe groter het risico op slippen.', NULL, NULL, '2023-03-05 09:37:44', '2023-03-08 10:00:13'),
(771, 'LxHHtMDZb0oVje8', 'في أي من الحالتين تكون السرعة القصوى 90 كم/سا  فوراً؟', 'In welke van de volgende situaties is de maximale snelheid meteen 90 km/u?', 54, 39, 'mcq', 'uploads/question/8Bqn0L1678012694.jpg', 28, 'كلا اللوحتين\r\n تخبر بوجود إنزلاق وسرعة قصوى ٩٠كم/سا  \r\nلكن في اللوحة A السرعة القصوى ٩٠كم/سا   \r\nفي حال وجود رطوبة على الطريق فقط \r\nوفي حال عدم وجود رطوبة لا تطبق هذه السرعة \r\n\r\n أما اللوحة B\r\n السرعة القصوى ٩٠كم/سا  من مكان وجود اللوحة ولغاية ١.٥ كم', 'Op beide platen staat dat er sprake is van slip en een maximumsnelheid van 90 km/u, maar op plaat A is de maximum snelheid 90 km/u alleen bij nat wegdek, terwijl plaat B de maximale snelheid is 90 km/u vanaf de plaats waar de plaat zich bevindt tot 1,5 km.', NULL, NULL, '2023-03-05 09:38:14', '2023-03-12 14:05:50'),
(772, '0NyIdeB81zZawUf', 'طول مركبتك مع المقطوره 8 متر، هل يُسمح لك القيادة بهذا المسار ؟', 'De lengte van je voertuig met aanhanger is 8 meter, mag je op deze rijstrook rijden?', 55, 40, 'mcq', 'uploads/question/Rayi541678012961.jpg', 1, 'السبب : \r\nكما نعلم اذا تجاوز طول المركبة مع المقطورة 7 متر \r\nتكون ملزمه بالسير في المسارين اقصى اليمين من الطريق\r\nولكن في هذه الحالة المركبة ذاهبة الى ارنم \r\nوهذا المسار الوحيد المؤدي اليها.', 'Reden: als de lengte van het voertuig met de aanhangwagen langer is dan 7 m ben je verplicht om in de twee rijstroken uiterst rechts van de weg te rijden, maar in dit geval gaat het voertuig naar Arnhem, en dit is de enige rijstrook  die ernaartoe leidt.', NULL, NULL, '2023-03-05 09:42:41', '2023-03-13 22:37:38'),
(773, 'JMtRFwZaooJYHtP', 'هل يحق لك تجاوز المركبات من اليمين في هذه الحالة ؟', 'Is het toegestaan om in deze situatie voertuigen van rechts in te halen?', 55, 40, 'mcq', 'uploads/question/gCSjAJ1678013052.jpg', 2, 'في الازدحام يحق لك التجاوز من جهة اليمين.', 'Tijdens de file is het toegestaan om rechts in te halen.', NULL, NULL, '2023-03-05 09:44:12', '2023-03-13 22:38:07'),
(774, 'YjpJ1bfcpOahimb', 'أنت تسحب عربة ماهي سرعتك القصوى في هذه الحالة ؟', 'Je rijdt met een aanhangwagen, wat is de toegestane maximumsnelheid?', 55, 40, 'mcq', 'uploads/question/2i7tbi1678013129.jpg', 3, 'السبب : \r\nاذا كنت تسحب عربة تصبح سرعتك القصوى \r\nعلى الخط السريع وطريق السيارات 90 كيلومتر في الساعة', 'Reden: Als je een voertuig sleept, is jouw maximumsnelheid op de snelweg en autoweg 90 km/u.', NULL, NULL, '2023-03-05 09:45:29', '2023-03-12 21:29:35'),
(775, 'oMOHs7vNuk79YY2', 'أنت تقود في هذا المسار  هل هذا صحيح ؟', 'Je rijdt op de middelste rijstrook, is dat correct?', 55, 40, 'mcq', 'uploads/question/Kbc9121678013235.jpg', 4, 'بما أن خانة الطوارئ مفتوحه فهي أصبحت المسار اليمين \r\nمن الطريق والمخصصه للسير ويجب عليك الالتزام بها', 'Als de vluchtstrook open hoor je zoveel mogelijk rechts te rijden.', NULL, NULL, '2023-03-05 09:47:15', '2023-03-13 22:40:19'),
(776, 'xZ55VlGXtlikgOT', 'ماهو عدد المسارت التي سيتشكل منها الخط السريع بعد هذه اللوحة؟', 'Uit hoeveel rijstroken bestaat de snelweg na dit bord?', 55, 40, 'mcq', 'uploads/question/4MrTxW1678013322.jpg', 5, NULL, NULL, NULL, NULL, '2023-03-05 09:48:42', '2023-03-12 21:30:15'),
(777, 'x24EO6sLGALxaMT', 'ماذا تعني هذه اللوحة المخططه با الأبيض والأسود؟', 'Wat betekent dit gestreepte bord?', 55, 40, 'mcq', 'uploads/question/flm2vV1678751561.jpg', 6, NULL, NULL, NULL, NULL, '2023-03-05 09:49:53', '2023-03-13 22:52:41'),
(778, '2DJHDqyCQyT6cwd', 'تريد الذهاب إلى امستردام هل من الجيد السير في هذه الخانة؟', 'Je wilt naar Amsterdam, rijd je op de juiste rijstrook?', 55, 40, 'mcq', 'uploads/question/EYXbKU1678013503.jpg', 7, 'السبب: \r\nبما ان هناك مسارين يؤديان الى أمستردام\r\n فأنت مجبر بالقيادة في المسار اقصى اليمين', 'Reden: Aangezien er twee rijstroken naar Amsterdam leiden, bent je genoodzaakt om op de uiterst rechtse rijstrook te rijden', NULL, NULL, '2023-03-05 09:51:43', '2023-03-12 21:30:44'),
(779, 'BmeCuxAtz8nRopO', 'هل يحق لك تجاوز الشاحنة من اليمين؟', 'Mag je hier de vrachtwagen inhalen van rechts?', 55, 40, 'mcq', 'uploads/question/2DG3bq1678013572.jpg', 8, 'يحق لك التجاوز من اليمين عند وجود بلوكات ارضيه على يسارك', 'Het is toegestaan om van rechts in te halen als er blokmarkering is.', NULL, NULL, '2023-03-05 09:52:52', '2023-03-13 22:43:43'),
(780, 'YzZBihMcOgt0BNP', 'تحت أي نوع من الطرق يندرج هذا الطريق ؟', 'Onder welke type weg valt deze weg?', 55, 40, 'mcq', 'uploads/question/rU2YBv1678013665.jpg', 9, NULL, NULL, NULL, NULL, '2023-03-05 09:54:25', '2023-03-08 19:03:23'),
(781, 'hZLtcmd5hByYCAu', 'أنت تُعطي إشارة ضوئية وتنوي الدخول بين سيارات الرتل العسكري هل هذا مسموح؟', 'Je geeft een richtingssignaal aan en bent van plan in te voegen tussen de militaire colonne, mag dit?', 55, 40, 'mcq', 'uploads/question/E6cStQ1678013750.jpg', 10, 'يسمح لك السير بين سيارات الرتل العسكري فلا مانع في ذلك', 'Je mag tussen de voertuigen van het militaire colonne rijden.', NULL, NULL, '2023-03-05 09:55:50', '2023-03-13 22:45:08'),
(782, 'CElBeOGImI04K70', 'هل تستطيع تجاوز الشاحنة من اليسار؟', 'Mag je de vrachtwagen van links inhalen?', 55, 40, 'mcq', 'uploads/question/fXGYtF1678013815.jpg', 11, 'السبب: \r\nخانة الطوارئ مفتوحة إذاً هي خانة عادية كخانات الطريق الأخرى\r\n والخط المتصل يعتبر متقطع بهذه الحالة ومسموح التجاوز', 'Reden: De vluchtstrook is open, dus het is een normale rijstrook zoals de andere rijstroken, en de doorgetrokken streep  wordt in dit geval als onderbroken beschouwd en inhalen is toegestaan.', NULL, NULL, '2023-03-05 09:56:55', '2023-03-13 22:45:57'),
(783, 'wYgnrCIdZanvfzR', 'هل من الجيد السير في هذه الخانه؟', 'Rijd je hier op de juiste rijstrook?', 55, 40, 'mcq', 'uploads/question/HzyMc61678013974.jpg', 12, 'السبب: \r\nلان خانة الطوارئ مفتوحه وبالتالي \r\nاصبحت الخانه اليمين من الطريق \r\n وانت ملزم بالسير اقصى اليمين من الطريق السريع', 'Reden: Omdat de vluchtstrook open is en dit als een normale rijstrook wordt gezien. Je hoort zo veel mogelijk rechts te rijden.', NULL, NULL, '2023-03-05 09:59:34', '2023-03-13 22:47:08'),
(784, 'SOupGLITd6oV99V', 'هل يمكنك السير على خانة الطوارئ بهذه الحالة؟', 'Mag je hier op de vluchstrook rijden?', 55, 40, 'mcq', 'uploads/question/HRJZqW1678014032.jpg', 13, 'السبب: \r\nالخانه مغلقه حسب اللوحه الالكترونيه', 'Reden: de vluchtstrook is gesloten voor het verkeer volgens het elektronische bord.', NULL, NULL, '2023-03-05 10:00:32', '2023-03-13 22:47:58'),
(785, 'DOzOvtS7mWpDGC7', 'ماذا تتوقع عند رؤيتك لهذه اللوحة؟', 'Wat kun je verwachten wanneer je dit bord tegenkomt?', 55, 40, 'mcq', 'uploads/question/TD9ryu1678014178.jpg', 14, NULL, NULL, NULL, NULL, '2023-03-05 10:02:58', '2023-03-08 19:12:26'),
(786, '7lvJJ9a8zBNfIEe', 'ما هي السرعة القصوى للباصات السياحية T-bus على الخط السريع؟', 'Wat is de toegestane maximumsnelheid voor T-bussen op de snelweg?', 55, 40, 'mcq', 'uploads/question/nmEtht1678014252.jpg', 15, NULL, NULL, NULL, NULL, '2023-03-05 10:04:12', '2023-03-08 19:13:33'),
(787, 'Tl9zeH0DEzHGvfc', 'ماهي السرعة القصوى لباصات النقل الداخلي على الطريق السريع؟', 'Wat is de toegestane maximumsnelheid voor een touringcar op de autosnelweg?', 55, 40, 'mcq', 'uploads/question/FRjsOt1678014393.jpg', 16, NULL, NULL, NULL, NULL, '2023-03-05 10:06:33', '2023-03-14 10:40:06'),
(788, '7XNxxiA33CrLMOQ', 'تريد الذهاب الى Arnhem /Apeldoorn هل تقود في المسار الصحيح؟', 'Je wilt naar Arnhem/Apeldoorn, rijd je zo goed?', 55, 40, 'mcq', 'uploads/question/45g5sL1678014624.jpg', 17, 'بما أنه يوجد مسارين يؤديان إلى Arnhem /Apeldoorn و أنت تقود في المسار أقصى اليمين وبالتالي تموضعك صحيح ، بالنسبة ل Emmeloord و kampen  سيصادفك فرع في الأمام للطريق (N50) يؤدي اليهما', 'Zoals het bord aangeeft zijn er 2 rijstroken die richting Arnhem en Apeldoorn gaan. En in dit geval rij je op de rechter rijstrook richten deze steden.', NULL, NULL, '2023-03-05 10:10:24', '2023-03-14 20:54:15'),
(789, 'eHQHyLP4ZTO4uJn', 'أنت تقود على الطريق السريع وصادفت أمامك حادث جسيم مع ضحايا وأضرار ماذا تفعل؟', 'Je rijdt op de autoweg en komt een ernstig verkeersongeval tegen met gewonden en schade, wat doe je?', 55, 40, 'mcq', 'uploads/question/FACcUW1678014937.jpg', 18, ' الخطوة الاولى هي تامين نفسك \r\nوتشغيل ضوء التحذير الرباعي وتخفيف سرعتك', 'De eerste stap is om jezelf te beveiligen, je vier waarschuwingslichten in te schakelen en snelheid te verminderen.', NULL, NULL, '2023-03-05 10:15:37', '2023-03-12 21:35:04'),
(790, 'eXuu1FBNLFWjXF3', 'إلى ماذا تشير هذه اللوحه؟', 'Wat geeft dit bord aan?', 55, 40, 'mcq', 'uploads/question/vlGlqH1678015102.jpg', 19, 'تشير هذه اللوحه الى وجود بوابه معدنيه متحركه \r\nتفتح وتغلق في السور الفاصل بين جانبي الطريق السريع\r\nلسهوله انتقال سيارات الطوارئ في الحالات الطارئه', 'Dit bord geeft de aanwezigheid aan van een beweegbare metalen poort die open en dicht gaat in de muur die de twee zijden van de snelweg scheidt, voor eenvoudig transport van hulpverleningsvoertuigen in noodsituaties.', NULL, NULL, '2023-03-05 10:18:22', '2023-03-08 19:18:55'),
(791, 'wUmHPzQ782bYJre', 'هل تتوقع أن يتوقف سائق الدراجه الناريه في نهاية الإزدحام؟', 'Verwacht je dat een motorrijder stopt aan het einde van een file?', 55, 40, 'mcq', 'uploads/question/uXB7yt1678015191.jpg', 20, 'لن يتوقف سائق الدراجه الناريه بنهاية الازدحام \r\nلانه يستطيع متابعه السير بين المركبات\r\nالمزدحمة وسوف يتجاوزهم يمينا او يسارا', 'De motorrijder stopt niet aan het einde van de file omdat hij tussen de voertuigen door kan rijden en deze rechts of links inhaalt.', NULL, NULL, '2023-03-05 10:19:51', '2023-03-08 19:20:58'),
(792, 'Osno4OgGbHZmoAg', 'من أي جهة يحق للدراجة النارية تجاوز المركبات المتواجدة في أقصى يسار الخانة؟', 'Bij welke situatie mag de motor rijder links inhalen tijdens file?', 55, 40, 'mcq', 'uploads/question/kjTfoT1678015267.jpg', 21, '  في الحالة B فقط\r\nلانه من الممنوع الدخول بين السيارات والحاجز المعدني \r\nلضيق الطريق وخطورة اكتشافه من قبل السائقين\r\nوكذلك ممنوع ان يتجاوز الخط المتصل', 'Alleen in geval B, omdat het verboden is om tussen auto\'s en de metalen barrière te komen vanwege de smalheid van de weg en het gevaar zal opleveren, ook is het verboden om de ononderbroken lijn te overschrijden', NULL, NULL, '2023-03-05 10:21:07', '2023-03-13 22:57:05'),
(793, 'h5s4etHN7sOyQkV', 'أنت تقود على طريق سريع وهطلت زخه خفيفة من المطر بعد فترة جفاف ماذا تتوقع ؟', 'Je rijdt op een autoweg en er valt een lichte regenbui na een droge periode, wat kun je verwachten?', 55, 40, 'mcq', 'uploads/question/wJDXvg1678015357.jpg', 22, 'لانه سيتشكل مزيج من الماء والزيوت والغبار الموجودة على سطح الطريق\r\n وبالتالي تشكل طبقه لزجه بين سطح الطريق وسطح الاطار مؤدية للإنزلاق \r\nو فقدان التلامس بينهما \"اكوابلانغ\" وزياده مسافة الفرملة', 'Omdat het een mengsel vormt van water, olie en stof op het wegdek en zo een kleverige laag vormt tussen het wegdek en het oppervlak van de band, wat leidt tot slippen en aquaplanning, en een langere remweg.', NULL, NULL, '2023-03-05 10:22:37', '2023-03-12 21:37:34'),
(794, 'rjgZg977AwhytV6', 'ماهي أقصى سرعه على الطريق السريع أثناء المطر؟', 'Wat is de toegestane maximumsnelheid op de snelweg tijdens de regenbuien?', 55, 40, 'mcq', 'uploads/question/htCbfe1678015453.jpg', 23, NULL, NULL, NULL, NULL, '2023-03-05 10:24:13', '2023-03-08 19:25:22'),
(795, 'IHPPjxXvphKIazI', 'أنت تقود على طريق سريع وهطلت زخه خفيفة من المطر بعد فترة جفاف طويلة أين تتوقع حدوث إنزلاق بشكل أكبر؟', 'Je rijdt op een snelweg en het heeft geregend na een lange droge periode, waar verwacht je meer slipgevaar?', 55, 40, 'mcq', 'uploads/question/fWv7SE1678015541.jpg', 24, 'خانات الدخول والخروج معظمها \r\nتكون على شكل منعطفات خفيفة أو حادة', 'De meeste in- en uitritten hebben de vorm van lichte of scherpe bochten.', NULL, NULL, '2023-03-05 10:25:41', '2023-03-08 19:26:44'),
(797, 'y0eVeSKQorX05W4', 'ما الهدف من وجود الخطوط القطرية على الخط السريع؟', 'Wat is het nut van de ononderbroken lijnen op de snelweg?', 55, 40, 'mcq', 'uploads/question/vnSkat1678015631.jpg', 25, 'السبب الخطوط القطرية تتواجد غالباً عند التقاء طريقين سريعين\r\nاو عند تضيّق الطريق السريع او على خانات الدخول والخروج ،\r\nوالهدف منها تحديد المنطقة الخطرة من الطريق\r\nوذلك بمنع السير عليها لتجنب الاصطدام بين السائقين', NULL, NULL, NULL, '2023-03-05 10:27:11', '2023-03-14 09:24:03'),
(798, 'fSCxKUr0xZ81LmD', 'ما هي اللوحة المرورية التي تدل على تفرع الطريق السريع؟', 'Welke van de volgende borden geeft een splitsing aan op de snelweg?', 55, 40, 'mcq', 'uploads/question/NOiuIN1678015704.jpg', 26, NULL, NULL, NULL, NULL, '2023-03-05 10:28:24', '2023-03-08 19:29:07'),
(799, '2rk5NQ8qAmqNk4j', 'بعد أي لوحة من اللوحات التالية يتشكل الطريق من أربع مسارات؟', 'Na welk bord bestaat de weg uit 4 rijstroken?', 55, 40, 'mcq', 'uploads/question/Nowrwr1678015805.jpg', 27, NULL, NULL, NULL, NULL, '2023-03-05 10:30:05', '2023-03-12 21:39:19'),
(800, 'Egnm7Vw8vjXYV7C', 'تسحب عربة على الطريق السريع ماهي سرعتك القصوى في هذه الحالة ؟', 'Je sleept een aanhangwagen op de autosnelweg, wat is je toegestane maximumsnelheid?', 55, 40, 'mcq', 'uploads/question/kSmNwb1678015870.jpg', 28, 'عندما تجر عربة خلفك تصبح سرعتك القصوى\r\n90 كيلو متر/ساعه  فقط', 'Als je een voertuig sleept, is je maximumsnelheid 90 km/u.', NULL, NULL, '2023-03-05 10:31:10', '2023-03-13 23:00:22'),
(801, 'AMiyAIu0glgGY2e', 'ماذا تتوقع سرعتك القصوى بعد هذه اللوحة؟', 'Wat is de toegestane snelheid na dit bord?', 49, 34, 'mcq', 'uploads/question/O5ISD11678018471.jpg', 4, 'بما أن السيارات ستكون ضيف في مسار الدراجات تم تحديد السرعة القصوى للسيارات بهذه الحالة ٣٠كم/سا وذلك للحفاظ على فارق سرعة قليل بينهم و كي لا يشكل سائقي السيارت خطورة على سائقي الدراجات', 'Aangezien auto\'s te gast zullen zijn op de fietsstraat, is de maximumsnelheid voor auto\'s in dit geval vastgesteld op 30 km/u om onderling een klein snelheidsverschil te behouden en automobilisten geen gevaar zullen vormen voor fietsers.', NULL, NULL, '2023-03-05 11:14:31', '2023-03-14 11:36:27'),
(802, 'XnX63Pc8TL1H3Cr', 'من تمنع هذه اللوحة من الدخول؟', 'Voor wie is het verboden om deze weg in te rijden?', 49, 34, 'mcq', 'uploads/question/OWsSrH1678018541.jpg', 5, NULL, NULL, NULL, NULL, '2023-03-05 11:15:41', '2023-03-14 09:18:57'),
(803, 'zRYmeIkcGgfPVoq', 'في أي لوحة تستطيع متابعة السير الى الأمام؟', 'Welk bord geeft aan dat je rechtdoor kunt?', 49, 34, 'mcq', 'uploads/question/YOOkKY1678018609.jpg', 6, 'اللوحة D تمنعك من الإلتفاف والعودة فقط وبالتالي يمكنك متابعة السير للأمام أو الذهاب يميناً أو يساراً', 'Het bord D verbied je te keren, maar verbied niet om door te rijden.', NULL, NULL, '2023-03-05 11:16:49', '2023-03-14 11:35:51'),
(804, 'Db5SVO5SpxMHqnP', 'في أي لوحة يُسمح لك تجاوز الشاحنة؟', 'Welk bord geeft aan dat je vrachtwagens mag inhalen?', 49, 34, 'mcq', 'uploads/question/0J8Jyl1678018689.jpg', 7, 'اللوحة A تمنع الشاحنات فقط من التجاوز وبالتالي يمكنك تجاوز الشاحنات ، أما اللوحة B تمنع جميع المركبات المصنفة موتورفورتاوخ (أي مركبة تعمل بمحرك ثقيل كالسيارات والشاحنات والدراجات الناريه و الجرار...) من التجاوز', 'Bord A is inhaalverbod  alleen voor vrachtwagens van toepassing', NULL, NULL, '2023-03-05 11:18:09', '2023-03-14 11:37:51'),
(805, '7cfPcUvI5pAbQh7', 'أنت تقود السيارة البيضاء من يتوجب عليه الوقوف بهذه الحالة؟', 'Je rijdt de witte lesauto, wie moet in dit geval stoppen?', 57, 42, 'mcq', 'uploads/question/qwI12n1678018768.jpg', 1, NULL, 'In dit geval moeten alle bestuurders uit alle richtingen stoppen.', NULL, NULL, '2023-03-05 11:19:28', '2023-03-12 12:02:54'),
(806, 'wW7y5e2NrKf2seb', 'أي من العلامات الأرضية التالية هي المرافقة للوحة ستوب stop ؟', 'Welke van de volgende grondtekens hoort bij het stopbord?', 49, 34, 'mcq', 'uploads/question/lr4Jky1678018780.jpg', 8, NULL, NULL, NULL, NULL, '2023-03-05 11:19:40', '2023-03-09 08:02:41'),
(807, '0Fj7U7WiFTcsUiW', 'أي من اللوحات التالية تدل على سطح طريق سيء ؟', 'Welke van de volgende borden geeft een slecht wegdek aan?', 49, 34, 'mcq', 'uploads/question/ProFvD1678018842.jpg', 9, NULL, NULL, NULL, NULL, '2023-03-05 11:20:42', '2023-03-09 08:03:07'),
(808, 'shoFeYaVq9ZfVPo', 'أنت تقود السيارة البيضاء في أي من الحالتين يجب عليك التوقف؟', 'Je rijdt de witte lesauto, in welke situatie moet je stoppen?', 57, 42, 'mcq', 'uploads/question/H2JDwS1678018862.jpg', 2, NULL, NULL, NULL, NULL, '2023-03-05 11:21:02', '2023-03-12 12:06:01'),
(809, 'EPlXzdQSgVaHIOI', 'عند أي لوحة من اللوحات التالية المغطاة بالثلج ،يجب إعطاء الأفضلية للسائقين؟', 'Bij welke van de volgende borden die bedekt zijn met sneeuw moet je voorrang verlenen?', 49, 34, 'mcq', 'uploads/question/wTza1A1678018906.jpg', 10, 'السبب: اللوحة B هي لوحة أسنان القرش و هي الوحيدة\r\nالتي تكون على شكل مثلث مقلوب (رأسه للأسفل)\r\nلتمييزها عن غيرها حتى لو كانت مغطاة بالثلج , و عندها يجب اعطاء الأفضلية للسائقين من اليمين و اليسار', 'Reden: bord B is het haaientandbord en het is het enige bord dat de vorm heeft van een omgekeerde driehoek (kop naar beneden) om het van andere te onderscheiden, zelfs als het bedekt is met sneeuw.', NULL, NULL, '2023-03-05 11:21:46', '2023-03-12 10:04:23'),
(810, 'p0unYpG9n1Fhl08', 'أنت تقود السيارة البيضاء في أي من الحالتين تستطيع متابعه السير؟', 'Je rijdt de witte lesauto, wanneer hoef je niet te stoppen?', 57, 42, 'mcq', 'uploads/question/daX9yo1678018965.jpg', 3, 'Situatie A moet alleen het verkeer wat de verkeersregelaar van achteren nadert stoppen. Situatie B moet het verkeer wat de verkeersregelaar van rechts nadert stoppen.', NULL, NULL, NULL, '2023-03-05 11:22:45', '2023-03-12 12:09:47'),
(811, 'uDwypRR0FNAAro0', 'أي من اللوحات التالية تسمح بدخول البروموبيل ؟', 'Welke van de volgende borden kan je brommobiel verwachten?', 49, 34, 'mcq', 'uploads/question/j5DdcQ1678018976.jpg', 11, 'اللوحة C تمنع دخول المركبات التي لا تزيد سرعتها عن ٢٥كم/سا فقط ، أما البروموبيل تستطع السير بسرعة أكبر من ٢٥كم/سا لأن سرعتها القصوى 45كم/سا', 'Bord C verbiedt alleen de toegang van voertuigen met een snelheid van maximaal 25 km/u, terwijl de brommobiel met een snelheid van meer dan 25 km/u mag rijden.', NULL, NULL, '2023-03-05 11:22:56', '2023-03-14 11:39:54'),
(812, 'Dp6qomIWhZkke3H', 'أي من اللوحات التالية تدل على الطريق الرئيسي ؟', 'Welke van de volgende borden geeft een voorrangsweg aan?', 49, 34, 'mcq', 'uploads/question/Ft9KLX1678019087.jpg', 12, 'اللوحة A تدل على طريق الافضلية أو الطريق الرئيسي ، أما اللوحة B تدل على تقاطع رئيسي', 'Bord A geeft de voorrangsweg aan, terwijl bord B een voorrangskruispunt aangeeft.', NULL, NULL, '2023-03-05 11:24:04', '2023-03-14 11:40:41'),
(813, '2XsPTjrW1LQlJr3', 'أنت تقود السيارة البيضاء في أي من الحالتين يجب إعطاء الأفضلية للرجل الضرير؟', 'Je rijdt de witte lesauto, bij welke situatie moet je de voetganger voor laten gaan?', 57, 42, 'mcq', 'uploads/question/y8G5Ew1678019063.jpg', 4, NULL, 'Blinde of slechtzienden met een taststok moeten we altijd voor laten gaan', NULL, NULL, '2023-03-05 11:24:23', '2023-03-12 12:13:27'),
(814, 'eJglLIiDzBaPC6Y', 'أنت تقود السيارة البيضاء في أي من الحالتين يجب عليك التوقف؟', 'Je rijdt de witte lesauto, bij welke situatie moet je stoppen?', 57, 42, 'mcq', 'uploads/question/dnl7aY1678019176.jpg', 5, 'اذا ظهر أمامك أحد الأشخاص ويحمل بيده هذه اللوحة \r\nفهو يطلب منك التوقف، و أحياناً نراها في فترة الصباح \r\nعند ذهاب الأطفال إلى المدرسة لإفساح المجال لهم لعبور الطريق.', 'Als een persoon voor je verschijnt en dit bord in zijn hand houdt, vraagt hij je om te stoppen, en soms zien we het \'s ochtends als kinderen naar school gaan om ruimte te maken voor hen om over te steken.', NULL, NULL, '2023-03-05 11:26:16', '2023-03-12 12:17:42'),
(815, 'q3e3pFejcjydSK2', 'أي من اللوحات التالية تدل على السرعة المنصوح بها ؟', 'Welke van de volgende borden geeft adviessnelheid aan?', 49, 34, 'mcq', 'uploads/question/wtvYRN1678019196.jpg', 13, NULL, NULL, NULL, NULL, '2023-03-05 11:26:36', '2023-03-14 11:41:16'),
(816, 'BsAk5uDKi1Ghqs4', 'أي من اللوحات التالية تدل على معبر مشاة ؟', 'Bij welk bord kan je een voetgangersoversteek plaats verwachten?', 49, 34, 'mcq', 'uploads/question/GBGhWD1678019263.jpg', 14, NULL, NULL, NULL, NULL, '2023-03-05 11:27:43', '2023-03-14 11:42:12'),
(817, 'Jam15iSk2YS20Fx', 'انت تقود السيارة البيضاء في اي من الحالتين يجب عليك الوقوف؟', 'Je rijdt de witte lesauto, bij welke situatie moet je stoppen?', 57, 42, 'mcq', 'uploads/question/9q0EOO1678019269.jpg', 6, NULL, 'Situatie A stopt het verkeer wat de regelaar van voren nadert. Situatie B stopt het verkeer wat de regelaar van rechts nadert.', NULL, NULL, '2023-03-05 11:27:49', '2023-03-12 12:19:46'),
(818, 'U96ZMpwlQdd71L7', 'أي من اللوحات التالية تحذرك من وجود مرتفع في الطريق ؟', 'Welke van de volgende borden waarschuwt je voor een hoge helling op de weg?', 49, 34, 'mcq', 'uploads/question/UPkJ491678019334.jpg', 15, 'هاتين اللوحتين يتم قراءتهما من اليسار لليمين ، حيث  اللوحة A تحذر من وجود مرتفع في الطريق بنسبة 15٪', NULL, NULL, NULL, '2023-03-05 11:28:54', '2023-03-12 10:18:55'),
(819, 'Cuh5QZXjNkLqVeh', 'اي من الحالات التالية تمثل العصا الخاصة بالرجل الضرير؟', 'Welke stok is de blindenstok of de taststok?', 57, 42, 'mcq', 'uploads/question/FSRSr31678019351.jpg', 7, 'العصا الخاصّة بالرجل الضرير تكون بلون أبيض وتحوي حلقات بلون أحمر', 'De blindenstok of taststok is te herkennen aan de rode ringen.', NULL, NULL, '2023-03-05 11:29:11', '2023-03-12 12:22:56'),
(820, 'LAVbx1pcuCFGuuz', 'أي من اللوحات التالية تحذرك من وجود ماشية ؟', 'Welke bord waarschuwt je voor vee?', 49, 34, 'mcq', 'uploads/question/MbnIbG1678019387.jpg', 16, NULL, NULL, NULL, NULL, '2023-03-05 11:29:47', '2023-03-14 11:44:05'),
(821, '1JlaUklnrvFD9QF', 'أي من اللوحات التالية تحذرك من وجود منخفض في الطريق؟', 'Welke van de volgende borden waarschuwt je voor een daling op de weg?', 49, 34, 'mcq', 'uploads/question/7xwdxy1678019445.jpg', 17, 'هاتين اللوحتين يتم قراءتهما من اليسار لليمين ، حيث  اللوحة B  تحذر من وجود منخفض في الطريق بنسبة  7٪', NULL, NULL, NULL, '2023-03-05 11:30:45', '2023-03-14 11:44:30'),
(822, 'LSvxQbxC4nLC9mn', 'كم متر متبقي على تقاطع السكة الحديدية؟', 'Over hoeveel meter nader je de spoorwegovergang?', 57, 42, 'mcq', 'uploads/question/6oqFeX1678019449.jpg', 8, 'السبب كما نلاحظ اللوحات المعدنية على جانبي الطريق\r\n تحتوي على ثلاث خطوط حمراء مائلة\r\nحيث كل خط احمر يشير الى مسافة قدرها 80 متر', 'Elke rode lijn staat gelijk aan 80 meter. Drie rode lijnen betekend 240 meter', NULL, NULL, '2023-03-05 11:30:49', '2023-03-12 12:26:49'),
(823, 'U4X76tpwg8Tuw3x', 'ماذا تعني هذه اللوحة؟', 'Wat geeft dit bord aan?', 49, 34, 'mcq', 'uploads/question/YU9sLv1678019509.jpg', 18, NULL, NULL, NULL, NULL, '2023-03-05 11:31:49', '2023-03-09 08:08:54'),
(824, 'uPiyRepLUjBLC7N', 'ماذا تفعل بهذه الحالة ؟', 'Wat doe je in deze situatie?', 57, 42, 'mcq', 'uploads/question/WQbda31678019554.jpg', 9, 'بوجود رصيف عند موقف الترام \r\nانت غير مجبر بإعطاء الافضلية للمشاة', 'Met een trottoir bij de tramhalte ben je niet verplicht om voetgangers voorrang te geven.', NULL, NULL, '2023-03-05 11:32:34', '2023-03-08 20:12:05'),
(825, 'mLV3udxRCxqJxag', 'أي من اللوحات التالية تدل على موقف للباركير و متابعة السير بإستخدام وسائل النقل العامة ؟', 'Welke van de volgende borden geeft een parkeerplaats en reisvoorziening aan?', 49, 34, 'mcq', 'uploads/question/xAmHeJ1678019577.jpg', 19, NULL, NULL, NULL, NULL, '2023-03-05 11:32:57', '2023-03-09 08:09:28'),
(826, 'MviOLwVBh1BNJSs', 'أنت تقود السيارة البيضاء في أي من الحالتين يجب عليك الوقوف؟', 'Je rijdt de witte lesauto, bij welke situatie moet je stoppen?', 57, 42, 'mcq', 'uploads/question/Lx1I7d1678019618.jpg', 10, NULL, NULL, NULL, NULL, '2023-03-05 11:33:38', '2023-03-12 12:29:21'),
(827, 'UbNnnITAbgb0eGD', 'أي من المركبات التالية ،تسمح هذه اللوحة بدخولها ؟', 'Welke van de volgende voertuigen is toegestaan met dit bord?', 49, 34, 'mcq', 'uploads/question/bXmTt81678019631.jpg', 20, 'هذه اللوحة تمنع دخول الدراجات النارية بكافة أنواعها ، ولكنها لا تمنع دخول الفيتس و البرومفيتس والسنور فيتس', 'Dit bord verbiedt de toegang van alle soorten motorfietsen, maar niet de toegang van de fiets, bromfiets en snorfiets.', NULL, NULL, '2023-03-05 11:33:51', '2023-03-09 08:10:22'),
(828, 'Iw0LQxlzLwSK8D0', 'أي من اللوحات التالية تدل على الطول الأقصى للمركبة ؟', 'Welke van de volgende borden geeft de maximale doorrijlengte van het voertuig aan?', 49, 34, 'mcq', 'uploads/question/J6Z5yS1678019705.jpg', 21, NULL, NULL, NULL, NULL, '2023-03-05 11:35:05', '2023-03-14 11:55:09'),
(829, '1Htt1dhcXQmDrpv', 'أي من اللوحات التالية تدل على الإرتفاع الأقصى للمركبة ؟', 'Welke van de volgende broden geeft de maximale doorrijhoogte aan?', 49, 34, 'mcq', 'uploads/question/S5WFZi1678019784.jpg', 22, NULL, NULL, NULL, NULL, '2023-03-05 11:35:05', '2023-03-14 11:50:25'),
(830, 'CyJ47jbFTsAWLZq', 'من يذهب اولا ؟', 'Wie mag voor?', 57, 42, 'mcq', 'uploads/question/Aw1t8x1678019719.jpg', 11, 'السيارة الحمراء تتابع السير في طريقها ولاتقاطع السيارة البيضاء\r\nأما السيارة البيضاء تنعطف وتقاطع السيارة الحمراء \r\nوالقاعدة من ينعطف يفقد الأفضلية', 'De rode auto volgt de weg en kruist de witte auto niet, de witte auto maakt een bocht en kruist de rode auto. verkeer wat afslaat moet de doorgaan verkeer voor laten gaan.', NULL, NULL, '2023-03-05 11:35:19', '2023-03-12 12:30:45'),
(831, 'slH5p2blTOumDns', 'اي من الاشارات التالية يجب عليك اتباعها في حال تواجدهم جميعا في نفس المكان؟', 'Welke van de volgende signalen moet je volgen als ze allemaal op dezelfde plek staan?', 57, 42, 'mcq', 'uploads/question/nVDPP71678019840.jpg', 12, 'في حال تواجد شرطي المرور فهو يلغي مفعول الاشارة الضوئية \r\nواللوحات المعدنية والخطوط على الارض\r\nوتصبح ملزم باتباع تعليماته \r\nوهي الحالة الوحيده التي تستطيع بها قطع الاشارة الضوئية الحمراء', 'In het geval dat de verkeersagent aanwezig is, heft hij het effect van het lichtsignaal, de borden en de lijnen op de grond op. Je bent verplicht zijn instructies op te volgen, en het is het enige geval waarin je het rood verkeerslicht mag negeren.', NULL, NULL, '2023-03-05 11:37:20', '2023-03-12 12:34:37'),
(832, 'HwYK41ZdzOI1hZ3', 'أي من اللوحات التالية تدل على العرض الأقصى للمركبة ؟', 'Welke van de volgende borden geeft de maximale doorrijbreedte van  voertuig aan?', 49, 34, 'mcq', 'uploads/question/B3IjjR1678019853.jpg', 23, NULL, NULL, NULL, NULL, '2023-03-05 11:37:33', '2023-03-14 11:52:07'),
(833, 'LOyP6G7sXkriexB', 'أي من اللوحات التالية تحذرك من  وجود انزلاق على الطريق ؟', 'Welke van de volgende borden waarschuwt u voor slipgevaar op de weg?', 49, 34, 'mcq', 'uploads/question/VSJBv71678019911.jpg', 24, NULL, NULL, NULL, NULL, '2023-03-05 11:38:31', '2023-03-14 11:53:09'),
(834, 'AZdsLQBwPL9TBWD', 'من يذهب اولاً؟', 'Wie mag voor?', 57, 42, 'mcq', 'uploads/question/4L4zjT1678019971.jpg', 13, 'خطوط الزيبراباد غير موجوده على خانة الترام\r\nلذلك لا افضلية للمشاة بهذه الحاله', 'Het zebrapad bevindt zich niet op het tramspoor, dus voetgangers hebben in dit geval geen voorrang.', NULL, NULL, '2023-03-05 11:39:31', '2023-03-08 20:17:17'),
(835, 'XHvjIMtoV5stdHt', 'أي من اللوحات التالية تدل على الوزن الأقصى(مع الحمولة) ؟', 'Welke van de volgende borden geeft het maximale massa (met lading) aan?', 49, 34, 'mcq', 'uploads/question/9aWZqD1678020000.jpg', 25, NULL, NULL, NULL, NULL, '2023-03-05 11:40:00', '2023-03-14 11:54:42'),
(836, 'qmDpoIJKuUZntkE', 'انت تقود السيارة البيضاء ماذا تفعل بهذه الحالة؟', 'Je rijdt de witte lesauto, wat doe je tijdens deze situatie?', 57, 42, 'mcq', 'uploads/question/5rhtu71678020042.jpg', 14, 'الشرطي يطلب من جميع السائقين التوقف \r\nوالشرطي يلغي مفعول الاشارة الضوئيه', 'De verkeersregelaar vraagt alle automobilisten te stoppen en dan gelden de regels van het verkeerslicht niet.', NULL, NULL, '2023-03-05 11:40:42', '2023-03-12 12:38:11'),
(837, 'qmE67Heqlw0ZYv9', 'أي من اللوحات التالية تحذرك من وجود مطب؟', 'Welke van de volgende tekens waarschuwt je voor verkeersdrempels?', 49, 34, 'mcq', 'uploads/question/WnnvC01678020058.jpg', 26, NULL, NULL, NULL, NULL, '2023-03-05 11:40:58', '2023-03-09 08:12:50'),
(838, 'IBkzc8UGBXKAgGN', 'ماذا تفعل بهذه الحالة؟', 'Wat doe je tijdens deze situatie?', 57, 42, 'mcq', 'uploads/question/RHJG1f1678020095.jpg', 15, NULL, 'Politie auto geeft aan dat je moet stoppen. Je bent verplicht om deze instructie op te volgen.', NULL, NULL, '2023-03-05 11:41:35', '2023-03-12 12:39:39'),
(839, 'mo2GgJlnogrcbzL', 'أي من اللوحات التالية تدل على وجود طريق خاص للمشاة؟', 'Welke van de volgende borden geeft een voetpad aan?', 49, 34, 'mcq', 'uploads/question/x4yYfu1678020130.jpg', 27, NULL, NULL, NULL, NULL, '2023-03-05 11:42:10', '2023-03-09 08:13:18'),
(840, 'Pi9ehpZNjMfYWW9', 'أي من اللوحات التالية تمنع دخول المركبات التي تحمل مواد خطرة؟', 'Welke van de volgende borden verbiedt de toegang voor voertuigen die gevaarlijke stoffen vervoeren?', 49, 34, 'mcq', 'uploads/question/Jz7vb01678020204.jpg', 28, 'اللوحة A تدل على اتجاه إجباري للسائقين الذين ينقلون مواد خطرة ،أما اللوحة B تمنع دخول المركبات التي تحمل مواد خطرة', 'Bord A geeft een verplichte richting aan voor bestuurders die gevaarlijke stoffen vervoeren, terwijl bord B de toegang verbiedt voor voertuigen die gevaarlijke stoffen vervoeren.', NULL, NULL, '2023-03-05 11:43:24', '2023-03-14 11:56:47'),
(841, '8VBLTm7n8NL8DQx', 'اي من السيارات التالية هي سيارة اولوية؟', 'Welke van de volgende auto\'s is een voorrangsvoertuig?', 57, 42, 'mcq', 'uploads/question/Oxxnka1678020216.jpg', 16, 'سيارات الأولوية تكون بضوء تحذيري بلون أزرق وصوت تحذيري ذو الوتيرتين.', 'Een voorrangvoertuig herkent u aan de tweetonige hoorn en aan het blauwe zwaai, flits en knipperlichten.', NULL, NULL, '2023-03-05 11:43:36', '2023-03-12 12:43:24'),
(842, '04FBfgEcS60xv7y', 'في أي من الحالتين يقوم الشخص الضرير بطلب حق الافضلية ويحذرك أنه ينوي العبور؟', 'In welke situatie maakt een blind of slechtziende persoon met een taststok bekend dat hij wil oversteken?', 57, 42, 'mcq', 'uploads/question/S4uOX01678020344.jpg', 17, 'عندما يقوم الرجل الضرير برفع عصاه \r\nفإنه يقوم بطلب حق الافضلية ويحذرك أنه ينوي العبور', 'Wanneer een blind persoon zijn stok opheft, dan maakt hij kenbaar dat hij wil oversteken.', NULL, NULL, '2023-03-05 11:45:44', '2023-03-12 12:46:34'),
(843, 'irHrpr8dE6WRYpi', 'ماذا تعني هذه اللوحة ؟', 'Wat betekent dit bord?', 51, 36, 'mcq', 'uploads/question/VuabgN1678020359.jpg', 2, 'تخبرك هذه اللوحة أنك ملزم باتباع اتجاه السهم ولا يمكنك الذهاب يميناً ولا يساراً ويوجد سائقين معاكسين لإتجاهك', 'Dit bord vertelt je dat je de richting van de pijl moet volgen en dat je niet rechts of links kunt.', NULL, NULL, '2023-03-05 11:45:59', '2023-03-14 10:10:47'),
(844, 'gWGv5jQabVkltWa', 'انت تقود السيارة البيضاء، في اي من الحالتين تستطيع متابعه السير؟', 'Je rijdt de witte lesauto, in welk geval mag je doorrijden?', 57, 42, 'mcq', 'uploads/question/q0vHia1678020431.jpg', 18, NULL, 'Bij situatie A stopt het verkeer wat de verkeersregelaar van achter nadert', NULL, NULL, '2023-03-05 11:47:11', '2023-03-12 12:48:00'),
(845, 'vqg4kRks1tpllLu', 'أنت تقترب من تقاطع ، عند أي لوحة مرورية تتوقع سائقين من اليسار؟', 'Je nadert een kruispunt, bij welk verkeersbord kun je bestuurders van links verwachten?', 51, 36, 'mcq', 'uploads/question/1i454R1678020432.jpg', 3, 'كلا اللوحتين تخبرك بالإتجاه الإلزامي للقيادة ،ولا تخص السائقين على التقاطع أمامك', 'Beide borden geven de verplichte rijrichting aan en verwijst niet naar bestuurders die die van links of rechts komen.', NULL, NULL, '2023-03-05 11:47:12', '2023-03-09 08:26:24'),
(846, 'eusrLzo33afEx4e', 'أنت تقترب من تقاطع و تريد الإنعطاف يساراً ، هل أنت مجبر على اتباع اتجاه السهم؟', 'Je nadert een kruispunt en wilt linksaf, moet je de richting van de pijl volgen?', 51, 36, 'mcq', 'uploads/question/l9xWop1678020506.jpg', 4, 'لوحات الإتجاه ذات اللون الأصفر تخبرك بإتجاه التحويلة المؤقتة وأنت غير ملزم بإتباعها', 'Een geel verkeersbord is geen eenrichtingswegbord.', NULL, NULL, '2023-03-05 11:48:26', '2023-03-14 10:12:09'),
(847, 'Ysb6eWevPOL7ynD', 'من يذهب أولاً؟', 'Wie mag eerst?', 57, 42, 'mcq', 'uploads/question/YX2aCs1678020511.jpg', 19, NULL, 'Een voorrangsvoertuig moet u altijd voorlatengaan als ze optische en geluid signalen voeren.', NULL, NULL, '2023-03-05 11:48:31', '2023-03-12 12:50:06'),
(848, 'CyWWGzGUjM2FKi3', 'هل يحق لك تجاوز الشاحنة بهذه الحالة؟', 'Mag je in deze situatie de vrachtwagen inhalen?', 57, 42, 'mcq', 'uploads/question/rRbwUn1678020605.jpg', 20, 'أي شاحنة أو آلية تظهر أمامك وتحوي لوحة مرور، \r\nعندها يجب عليك إتباع اللوحة\r\nوفي هذه الحالة اللوحة تخبرك أنه يمكنك الانتقال يسارا\r\nرغم وجود خط متصل', 'Bij een doorgetrokken streep mag je niet inhalen, uitzondering als een verkeersbord of licht dat toestaat. In dit geval zien we een bord aan de achterkant van de vrachtwagen dat je mag inhalen.', NULL, NULL, '2023-03-05 11:50:05', '2023-03-12 12:52:27'),
(849, 'cY0m0YH30410iwh', 'في أي حالة تتوقع أن تتقاطع حركتك مع أكثر من سكة حديدية؟', 'In welk geval verwacht je dat je meer dan 1 spoor zal kruisen?', 57, 42, 'mcq', 'uploads/question/QX5NZM1678020697.jpg', 21, 'عندما تتواجد لوحة معدنية على شكل إشارة × واحدة ،\r\nهذا يعني أن حركتك ستتقاطع مع سكة حديدية واحدة\r\nواذا كانت اللوحة المعدنية تحوي إشارتين ×× \r\nهذا يعني أن حركتك ستتقاطع مع أكثر من سكة حديدية.', 'Als er een metalen bord is in de vorm van één x-teken, betekent dit dat je een treinspoor zal kruisen, en als het metalen bord twee x-tekens bevat, betekent dit dat je meer dan één treinspoor zal kruisen.', NULL, NULL, '2023-03-05 11:51:37', '2023-03-08 20:26:09'),
(850, 'trgQ2wnx1Fr8ksk', 'أنت تقود السيارة البيضاء وخلفك سيارة إسعاف مع الضوء والصوت التحذيري ماذا تفعل؟', 'Je rijdt in de witte auto en je ziet achter je een ambulance met waarschuwingslicht, wat doe je?', 57, 42, 'mcq', 'uploads/question/qSx86a1678020777.jpg', 22, NULL, 'Doordat je zoveel mogelijk links voorsorteert maak je meer ruimte voor de ambulance.', NULL, NULL, '2023-03-05 11:52:57', '2023-03-12 12:56:53');
