(852, 'Mmj6M8pPVlXBRpR', 'ماذا تعني هذه اللوحة ؟', 'Wat betekent dit bord?', 51, 36, 'mcq', 'uploads/question/hWJ4lR1678020863.jpg', 6, 'هذه اللوحة تمنع جميع المركبات المصنفة موتورفورتاوخ (أي مركبة تعمل بمحرك ثقيل كالسيارات والشاحنات والدراجات الناريه و الجرار...) من الدخول', NULL, NULL, NULL, '2023-03-05 11:54:23', '2023-03-12 12:40:29'),
(853, '9VzO95DMrGP1vHS', 'هل يحق لك رفض إجراء اختبار الكحول ؟', 'Mag je een blaastest weigeren?', 57, 42, 'mcq', 'uploads/question/ALeVXL1678020879.jpg', 23, NULL, 'Je mag geen blaastest weigeren door b.v. geloofsovertuiging of een andere reden.', NULL, NULL, '2023-03-05 11:54:39', '2023-03-14 09:03:54'),
