(855, 'SSiQpbWwAP53koP', 'انت تقود السيارة البيضاء ماذا تفعل بهذه الحالة؟', 'Je rijdt in de witte lesauto, wat doe je tijdens deze situatie?', 57, 42, 'mcq', 'uploads/question/BXjXGh1678020979.jpg', 24, 'اذا ظهرت احدى السيارات امامك\r\nكسيارة الشرطة مثلا وتظهر لك كلمة\r\nVOLGEN يجب عليك اتباعها', 'Je bent verplicht om de instructies van de politie auto te volgen.', NULL, NULL, '2023-03-05 11:56:19', '2023-03-12 12:59:48'),
(856, 'WbF6ZWrilJRLpbp', 'ماذا تعني هذه اللوحة ؟', 'Welke bewering is waar?', 51, 36, 'mcq', 'uploads/question/KFMiJ81678021017.jpg', 8, NULL, NULL, NULL, NULL, '2023-03-05 11:56:57', '2023-03-09 08:32:06'),
(857, 'ustettiABg3Jk6M', 'أنت تقود السيارة البيضاء ،على ماذا تدل هذه الإشارة من شرطي المرور؟', 'Wat geeft dit signaal van de verkeersregelaar aan?', 57, 42, 'mcq', 'uploads/question/pDBnB71678021054.jpg', 25, NULL, NULL, NULL, NULL, '2023-03-05 11:57:34', '2023-03-12 13:00:34'),
(858, 'kdWagEkHTwALHcU', 'على ماذا تدل هذه اللوحة ؟', 'Wat geeft dit bord aan?', 51, 36, 'mcq', 'uploads/question/tCkFfV1678021098.jpg', 9, NULL, NULL, NULL, NULL, '2023-03-05 11:58:18', '2023-03-09 08:32:47'),
(859, 'iCtZrIYjxfoXyli', 'إذا قمت بإستعارة سيارة أحد أصدقائك للقيام بسباق غير قانوني ،من المسؤول عن الغرامة في حال تم ضبطك من قبل السلطات؟', 'Als je de auto van een vriend leent om een illegale race te rijden, wie is dan verantwoordelijk voor de boete als je wordt betrapt door de autoriteiten?', 57, 42, 'mcq', 'uploads/question/3LJjwt1678021144.jpg', 26, NULL, NULL, NULL, NULL, '2023-03-05 11:59:04', '2023-03-08 20:31:12'),
(860, 'syri0IW8iN6f5bQ', 'أين تتواجد هذه اللوحة  ؟', 'Waar staat dit bord?', 51, 36, 'mcq', 'uploads/question/us7tye1678021175.jpg', 10, 'توجد هذه اللوحة داخل الأنفاق و يدل السهم على اتجاه مخرج الطوارئ الأقرب بالإضافة إلى عدد الأمتار المتبقية للوصول للمخرج', 'Dit bord bevindt zich in de tunnels en de pijl geeft de richting van de dichtstbijzijnde nooduitgang aan, naast het aantal meters dat nog moet worden bereikt om de uitgang te bereiken.', NULL, NULL, '2023-03-05 11:59:23', '2023-03-09 08:34:10'),
(861, 'SboxWREOEV4c78l', 'إلى ماذا يشير وميض الضوء الأبيض عند تقاطع السكة الحديدية؟', 'Wat geeft een wit flitslicht aan bij een spoorwegovergang?', 57, 42, 'mcq', 'uploads/question/27sswK1678021224.jpg', 27, 'السبب: وميض الضوء الأبيض على الإشارة الضوئية \r\nالموجودة عند تقاطع السكة الحديدية\r\nيدل على عدم وجود قطار على السكة \r\nوالطريق سالك أمامك وبإمكانك متابعة السير والعبور', 'Reden: Een knipperend wit licht op een verkeerslicht bij een spoorwegovergang geeft aan dat er geen trein op het spoor rijdt en dat je kunt doorrijden.', NULL, NULL, '2023-03-05 12:00:24', '2023-03-08 20:32:06'),
(862, '0HEVcEHuG2dUTpR', 'هل تتوقع أن تتوقف سيارة الشرطة على الإشارة الحمراء ؟', 'Verwacht je dat de politieauto met licht en geluidsingalen stopt voor een rood licht?', 57, 42, 'mcq', 'uploads/question/at9yok1678021319.jpg', 28, 'سيارة الشرطة هي سيارة اولوية بهذه الحالة \r\nلأنها تُظهر الضوء التحذيري الازرق \r\nولن تتوقف على الاشارة الضوئية الحمراء', 'De politieauto is in deze situatie een voorrangsvoertuig omdat deze een blauw waarschuwingslicht geeft en niet stopt voor een rood licht.', NULL, NULL, '2023-03-05 12:01:59', '2023-03-12 13:08:05'),
(863, 'HMnrW83PmQROzZk', 'هل يُسمح لك عمل باركيرن تحت الجسر ؟', 'Mag je onder de brug parkeren?', 58, 43, 'mcq', 'uploads/question/tPqgvX1678021545.jpg', 1, 'نعم لايوجد مايمنع ذالك ولكن المنع فوق الجسر', 'Ja, er is geen bord wat het parkeren of stilstaan verbiedt.', NULL, NULL, '2023-03-05 12:05:27', '2023-03-08 19:35:17'),
(864, 'ruxJz1k9tvuFbyg', 'أنت على طريق خارج المدينه ، هل يُسمح لك عمل باركيرن في هذا المكان؟', 'Je rijdt buiten de bebouwde kom, mag je hier parkeren?', 58, 43, 'mcq', 'uploads/question/R75aiZ1678021652.jpg', 2, '  على الطريق خارج المدينة مسموح لك عمل باركيرن\r\n و ستيلستان على العشب وعلى الرايبان\r\nالا في حال وجود لوحة تمنع ذلك', 'Buiten de bebouwde kom mag je op de berm parkeren.', NULL, NULL, '2023-03-05 12:07:32', '2023-03-12 11:11:08'),
(865, 'gvXCPSfjoC41vMr', 'هل وقوفك صحيح في هذه الحالة؟', 'Sta je hier goed?', 58, 43, 'mcq', 'uploads/question/epPnGk1678021740.jpg', 3, 'نعم، الجسر مفتوح والحاجز المعدني امامك مغلق ولا مجال لك للعبور \r\nلذلك بإمكانك الوقوف بمحاذاة خانة الفيتس ستروك حتى يغلق الجسر', 'Ja, de brug is open en de slagboom voor je is gesloten en je kunt niet oversteken, dus je kunt naast de fietsstrook blijven staan tot de brug gesloten is.', NULL, NULL, '2023-03-05 12:09:00', '2023-03-12 11:11:57'),
(866, 'PpDv75VPZAYuWN3', 'هل يُسمح لك عمل باركيرن هنا؟', 'Mag je hier parkeren?', 58, 43, 'mcq', 'uploads/question/ltUnea1678022056.jpg', 4, 'انت مازلت خارج المدينة ومسموح لك باركيرن وستيلستان على العشب\r\nوالرايبان الا في حال وجود لوحه تمنع ذلك\r\nحيث حدود المدينة تبدا بعد اللوحه', 'Je bent nog steeds buiten de bebouwde kom en je mag parkeren en stilstaan op de berm en op de rijbaan, tenzij er een bord is die dat verbiedt.', NULL, NULL, '2023-03-05 12:10:59', '2023-03-12 11:16:15'),
(867, 'zBRC6Yxjlb9Wdci', 'هل يُسمح لك الباركيرن في هذه الحالة؟', 'Mag je hier parkeren?', 58, 43, 'mcq', 'uploads/question/znLK7z1678022120.jpg', 5, '  نعم، لإن اللوحه تمنع الباركيرن على الجانب الايمن \r\nولكن بعد اللوحه ولاتشمل ماقبلها', 'Ja, het parkeerverbod geldt pas na het bord.', NULL, NULL, '2023-03-05 12:15:20', '2023-03-12 11:18:06'),
(868, 'tLJ00m1KdULXPq3', 'هل يُسمح لك عمل باركيرن في هذا المكان؟', 'Mag je hier parkeren?', 58, 43, 'mcq', 'uploads/question/NcqIez1678022228.jpg', 6, 'الخطوط الموجوده تمنع الباركيرن في هذا المكان من الطريق', 'De kruis op de weg verbiedt het parkeren op deze plek.', NULL, NULL, '2023-03-05 12:17:08', '2023-03-08 19:39:38'),
(869, '8cCYIXDHwUiqWWz', 'هل يسمح لك تنزيل أو تصعيد راكب في هذا المكان؟', 'Mag je hier iemand in en- of uit laten stappen?', 58, 43, 'mcq', 'uploads/question/WUqDJj1678022292.jpg', 7, 'لايوجد ما يمنع ذلك', 'Er staat geen bord wat het parkeren of stilstaan verbiedt.', NULL, NULL, '2023-03-05 12:18:12', '2023-03-08 19:40:57'),
(870, '1dRRy0vcH9lKr3K', 'هل يٌمكنك عمل باركيرن في هذا المكان؟', 'Mag je voor de uitgang parkeren?', 58, 43, 'mcq', 'uploads/question/ehFZXQ1678022357.jpg', 8, 'انت تقف امام مخرج ويمنع عليك عمل باركيرن  امام مخرج أو مدخل \r\nويسمح لك تنزيل وتصعيد راكب', 'Je staat voor een in- of uitrit en je mag hier niet parkeren, je mag hier wel een passagier in en -of uit laten stappen. Op voorwaarde dat je de gebruikers van de uitrit niet hindert.', NULL, NULL, '2023-03-05 12:19:17', '2023-03-12 11:20:38'),
(871, 'teO9clUV8ukeEpY', 'هل يُسمح لك عمل باركيرن هنا بإستخدام قرص التوقيت الأزرق ؟', 'Mag je hier parkeren wanneer je gebruik maakt van een blauwe parkeerschijf?', 58, 43, 'mcq', 'uploads/question/x3whDe1678022417.jpg', 9, 'تشير اللوحة الى موقف باركيرن مؤقت و يجب الوقوف في  مكان الباركيرن\r\nالذي يكون بجانبه خط ازرق و كحد اقصى ساعتين حسب اللوحه\r\nويجب عليك ضبط قرص التوقيت على رأس او نصف الساعه', 'Op een parkeerschijfzone mag je enkel parkeren op de aangegeven parkeerplekken wat wordt aangeduid met een blauwe streep. in dit geval mag je dus niet parkeren naast een stoeprand waar geen blauwe streep staat.', NULL, NULL, '2023-03-05 12:20:17', '2023-03-12 11:25:03'),
(872, 'nPz1JEnh7rCnwg7', 'هل يسمح لك التوقف لإنزال راكب في هذا المكان؟', 'Mag je hier iemand laten uitstappen?', 58, 43, 'mcq', 'uploads/question/i0IN1t1678022475.jpg', 10, 'يمنع عليك الباركيرن و الستيليستان على خانة الفيتس ستروك بوجد رسمة فيتس عليها', 'Het is verboden om stil te staan op een fietsstrook.', NULL, NULL, '2023-03-05 12:21:15', '2023-03-12 11:26:04'),
(873, 'xFKYewm1HRp21mX', 'توقفت هنا بغاية الرد على إتصال هاتفي هل تصرفك صحيح؟', 'Je staat hier stil om een telefoontje te beantwoorden, mag dit?', 58, 43, 'mcq', 'uploads/question/X71TXw1678022545.jpg', 11, 'هذا المكان خاص للحالات الطارئة كما موضح باللوحة المعدنية\r\nوالرد على إتصال هاتفي يعتبر باركيرن', 'Dit is een speciale plaats voor noodgevallen, zoals aangegeven op het bord, het beantwoorden van een telefoontje wordt beschouwd als parkeren.', NULL, NULL, '2023-03-05 12:22:25', '2023-03-08 19:45:18'),
(874, 'lyezXNRpvwiAisz', 'هل يُسمح لك تنزيل وتصعيد راكب هنا؟', 'Mag je hier iemand in en -of laten uitsappen?', 58, 43, 'mcq', 'uploads/question/6oDoP81678022616.jpg', 12, 'بجانب الخط الاصفر المتصل المتواجد على الرصيف \r\nيمنع عليك عمل باركيرن وستيلستان', 'Naast de ononderbroken gele lijn op het trottoir is het verboden om stil te staan en te parkeren.', NULL, NULL, '2023-03-05 12:23:36', '2023-03-08 19:45:55'),
(875, 'YSNvlIytgiwhH98', 'هل وقوفك صحيح في هذه الحالة؟', 'Sta je hier goed stil (geparkeerd)?', 58, 43, 'mcq', 'uploads/question/gtNLPa1678022686.jpg', 13, 'أنت تقف بالمكان المخصص للباركيرن واللوحه تمنع الباركيرن على الرايبان', 'Je staat op de parkeerplaats en het bord verbiedt het parkeren op de rijbaan.', NULL, NULL, '2023-03-05 12:24:46', '2023-03-09 10:13:26'),
(876, 'ckd9U88imhDeVcr', 'كم ساعة يُسمح لك الباركيرن بعد الساعة 18:00؟', 'Hoe lang mag je hier geparkeerd na 18:00 uur?', 58, 43, 'mcq', 'uploads/question/gL7qbv1678022783.jpg', 14, 'هذا موقف باركيرن مؤقت \r\nخاص بعربات المعاقين وذوي الاحتياجات الخاصة', 'Dit is een invalide parkeerplaats, zonder een gehandicaptenparkeerkaart mag je hier niet parkeren.', NULL, NULL, '2023-03-05 12:26:23', '2023-03-12 11:32:33'),
(877, '4tEoq1sdPB0GBSI', 'توقفت هنا بغرض قراءة رسالة واتساب، هل تصرفك صحيح بهذه الحالة؟', 'Je staat hier stil om een whatsapp bericht te lezen, mag dit?', 58, 43, 'mcq', 'uploads/question/rFHPsY1678022880.jpg', 15, 'قراءة رسالة واتساب يعتبر باركيرن حيث على طريق خارج المدينه مع وجود لوحة الافضلية (طريق رئيسي )\r\n يمنع عليك فقط عمل باركيرن على الرايبان', 'Je bevindt je op een voorrangsweg buiten de bebouwde kom, daar is het verboden om stil te staan op de rijbaan.', NULL, NULL, '2023-03-05 12:28:00', '2023-03-12 11:35:42'),
(878, 'CS4ui6ReK9N2Oyy', 'هل يُسمح لك عمل باركيرن هنا؟', 'Mag je hier parkeren?', 58, 43, 'mcq', 'uploads/question/jHUZfD1678022999.jpg', 16, 'انت الان خارج المدينة ومسموح لك عمل باركيرن\r\n وستيلستان على العشب وعلى الرايبان الا في حال وجود لوحة تمنع ذالك.', 'Buiten de bebouwde kom mag je op de rijbaan of de berm parkeren als er geen verbodsbord staat.', NULL, NULL, '2023-03-05 12:29:59', '2023-03-12 11:37:18'),
(879, '0bm6Dc3Rrd1CczC', 'هل يُسمح لك  تصعيد وتنزيل راكب هنا؟', 'Mag je hier iemand in en -of uit laten stappen?', 58, 43, 'mcq', 'uploads/question/64W6KJ1678023078.jpg', 17, ' نعم في اي مكان باركيرن اي عليه حرف P \r\n يمكنك دائماً تنزيل وتصعيد ركاب', 'Ja, waar de letter P staat mag je altijd iemand in en -of laten uitstappen.', NULL, NULL, '2023-03-05 12:31:18', '2023-03-08 19:50:12'),
(880, '5KnmOlZYxS8Z71e', 'بعد أي لوحه يحقّ لك عمل باركيرن؟', 'Bij welk bord mag je parkeren?', 58, 43, 'mcq', 'uploads/question/IxVwR91678023174.jpg', 18, 'يمنع عليك الباركيرن و الستيليستان على الطريق السريع و على طريق السيارات(الأوتوفيخ)', 'Op een autosnelweg of een autoweg is het verboden om de parkeren. Einde voorrang weg mag je parkeren op de rijbaan als er geen verkeersverbod geldt.', NULL, NULL, '2023-03-05 12:32:54', '2023-03-12 11:40:36'),
(881, 'OI5xBZkC9HFzzUk', 'عند أي خط يُسمح لك عمل باركيرين ؟', 'Bij welke streep (lijn, trottoirband) mag je parkeren?', 58, 43, 'mcq', 'uploads/question/uj2UcL1678023242.jpg', 19, 'عند الخط الاصفر المتصل المتواجد على الرصيف يمنع عليك الباركيرن و الستيليستان . أما الخط الأزرق فهو يدل على موقف باركيرن مؤقت', 'Bij een geel doorgetrokken streep op het trottoir is het verboden om te parkeren.', NULL, NULL, '2023-03-05 12:34:02', '2023-03-12 11:42:45'),
(882, 'RRMRHhT9fO67StI', 'هل يُسمح لك عمل باركيرن في الجهه اليسرى من هذا الشارع؟', 'Mag je aan de linkerzijde van deze straat parkeren?', 58, 43, 'mcq', 'uploads/question/DecvNA1678023321.jpg', 20, 'اللوحه تمنع الباركيرن والستيلستان \r\nفي الجهه اليمنى من الشارع فقط\r\nاما الجهه اليسرى فيسمح لك  الباركيرن والستيلستان \r\nوذلك لعدم وجود لوحه منع', 'Het bord geeft aan dat het parkeren en stilstaan enkel aan rechterkant van de straat is verboden. Echter mag je aan de linkerkant van de weg wel parkeren en stilstaan omdat daar geen bord staat.', NULL, NULL, '2023-03-05 12:35:21', '2023-03-09 10:36:40'),
(883, '0sYE4k3BulBoGPV', 'هل يُسمح لك بعمل باركيرن هنا؟', 'Mag je hier parkeren?', 58, 43, 'mcq', 'uploads/question/PM4cew1678023382.jpg', 21, 'هذا مكان باركيرن مخصص لتحميل او تنزيل البضائع', 'Dit is een parkeerplaats voor het laden of lossen van goederen.', NULL, NULL, '2023-03-05 12:36:22', '2023-03-08 19:53:18'),
(884, '5OqGtQTDzOFxgDG', 'أي لوحه تمنعك من عمل باركيــرن؟', 'Bij welk bord is het niet toegestaan om te parkeren?', 58, 43, 'mcq', 'uploads/question/0ysvvF1678023482.jpg', 22, ' اللوحه A\r\nتمنع الباصات والشاحنات فقط من عمل باركيــرن', 'Bord A verbiedt enkel vrachtwagens en bussen om te parkeren.', NULL, NULL, '2023-03-05 12:38:02', '2023-03-08 19:53:53'),
(885, 'Hm5sabgtYkYrdHG', 'على أي جانب من الشارع تمنعك هذه اللوحة من عمل باركيرن؟', 'Aan welke zijde mag je niet parkeren wanneer je dit bord ziet?', 58, 43, 'mcq', 'uploads/question/Wxj1MX1678023562.jpg', 23, '  كلمة Zone تعني المنطقة  , حيث هذه اللوحه فعاله في المنطقة كلها على يمين ويسار الطريق\r\n\r\nأي ممنوع الباركيرن على جانبي الطريق و لكامل المنطقه', 'Reden: Dit bord geldt voor het hele gebied rechts en links van de rijbaan. Het woord Zone betekent: Parkeren is verboden voor het hele gebied en dus aan beide kanten van de weg', NULL, NULL, '2023-03-05 12:39:22', '2023-03-09 10:43:12'),
(886, '1Qrj9yajDZqG2Dl', 'هل يُسمح الباركيرن بهذا الشكل؟', 'Mag je op deze manier geparkeerd staan?', 58, 43, 'mcq', 'uploads/question/ta1l9Q1678023636.jpg', 24, 'لامانع من اخذ مكانين للباركيرن', 'Ja, dit is omdat er niks staat aangegeven die dit verbiedt.', NULL, NULL, '2023-03-05 12:40:36', '2023-03-09 10:44:39'),
(887, 'XaXef2KBHqE0ymb', 'في أي لوحه يُسمح لك عمل باركيرن ؟', 'Welke bord toont aan dat het toegestaan is om te parkeren?', 58, 43, 'mcq', 'uploads/question/8srvBc1678023705.jpg', 25, 'اللوحة C تمنع الفيتس و السنورفيتس و البروم فيتس فقط من عمل باركيرن', 'Bord A en B is geldt een parkeerverbod. Bord C geldt een parkeerverbod alleen voor fietsen, snorfietsen en bromfietsen.', NULL, NULL, '2023-03-05 12:41:45', '2023-03-12 11:48:27'),
(888, 'FfZD8CqbyBeCfps', 'هل يُسمح لك عمل  باركيرن هنا؟', 'Mag je hier parkeren?', 58, 43, 'mcq', 'uploads/question/AN3xje1678023787.jpg', 26, ' داخل الحي السكني يُسمح لك الباركيرن \r\nفي مكان الباركيرن المخصص فقط', 'Binnen de woonerf mag je alleen op de aangewezen parkeerplaats parkeren.', NULL, NULL, '2023-03-05 12:43:07', '2023-03-12 11:49:55'),
(889, 'OVV9mLep8daQK24', 'لقد وصلت إلى منطقة الباركيرن المؤقت الساعة 15:35،على أي وقت يجب ضبط قرص التوقيت؟', 'Je komt om 15:35 uur aan op de plek van bestemming, welke tijd zet je op de blauwe parkeerschijf?', 58, 43, 'mcq', 'uploads/question/NXxUY31678023853.jpg', 27, NULL, 'Bij een parkeerschijfzone heb je ongeveer een half uur tijd in je voordeel.', NULL, NULL, '2023-03-05 12:44:13', '2023-03-12 11:51:27'),
(890, 'R4I6LCcI423C6x3', 'هل يُسمح لك تنزيل وتصعيد راكب هنا؟', 'Mag je hier iemand in en -of laten uitstappen?', 58, 43, 'mcq', 'uploads/question/TDoI1X1678023937.jpg', 28, 'بجانب الخط الاصفر المتقطع المتواجد على الرصيف \r\nيسمح لك تنزيل وتصعيد راكب', 'Bij een geel afgebroken streep op het trottoir is het toegestaan om een passagier in en -of te laten uitstappen.', NULL, NULL, '2023-03-05 12:45:37', '2023-03-12 11:53:10'),
(891, 'qD6aJbTlfuiSEKs', 'أي من اللوحات التالية تدل على طريق بإتجاه واحد ؟', 'Welk van de volgende borden geeft eenrichtingsverkeer aan?', 51, 36, 'mcq', 'uploads/question/ofJRYn1678042715.jpg', 11, 'تشير اللوحة (A) إلى أن الطريق مغلق أمام السائقين من هذا الإتجاه فقط وبالتالي هو طريق بإتجاه واحد ، بينما اللوحة (B) تشير إلى اتجاه القيادة الإلزامي و وجود سائقين معاكسين ، أما اللوحة (C) تدل على أن الطريق مغلق أمام السائقين من كلا  الإتجاهين.', 'Bord A geeft aan dat de weg vanuit deze richting is afgesloten en het dus een eenrichtingsweg is, terwijl bord B de verplichte rijrichting  aangeeft. Terwijl bord C aangeeft dat de weg vanuit beide richtingen is afgesloten.', NULL, NULL, '2023-03-05 17:58:35', '2023-03-14 10:15:34'),
(892, 'mGevxzGXiztVwYq', 'ماذا تعني هذه اللوحة ؟', 'Wat betekent dit bord?', 51, 36, 'mcq', 'uploads/question/tvRDBs1678043129.jpg', 12, NULL, NULL, NULL, NULL, '2023-03-05 18:05:29', '2023-03-09 08:36:15'),
(893, 'aDh1TFtUumy4Wr5', 'من تمنع هذه اللوحة من الدخول ؟', 'Voor wie geldt dit verbod?', 51, 36, 'mcq', 'uploads/question/OeL2oG1678043228.jpg', 13, 'هذه اللوحة تمنع دخول المركبات المصنفة موتورفورتاوخ والتي تجر عربة', 'Dit bord verbiedt de toegang van voertuigen geclassificeerd als motorvoertuigen die een aanhangwagen slepen.', NULL, NULL, '2023-03-05 18:07:08', '2023-03-14 10:18:02'),
(894, 'VKgS0qLBkTbHVrX', 'من تمنع هذه اللوحة من الدخول ؟', 'Voor wie geldt dit verbod?', 51, 36, 'mcq', 'uploads/question/COqLFT1678043314.jpg', 14, 'هذه اللوحة تمنع الدراجات النارية فقط المصنفة موتورفورتاوخ من الدخول ،و تسمح هذه اللوحة بدخول الفيتس و السنور فيتس والبروم فيتس لأن تصنيفهم موتور رايتاوخ', 'Dit bord verbiedt motoren die geclassificeerd zijn als motorvoertuig.', NULL, NULL, '2023-03-05 18:08:34', '2023-03-14 10:19:51'),
