(897, 'wyz54XKmWWe602m', 'ماذا تعني هذه اللوحة الإلكترونية؟', 'Wat betekent dit elektronische bord?', 51, 36, 'mcq', 'uploads/question/Yzj4871678043557.jpg', 17, 'تأمر هذه اللوحة الإلكترونية بمغادرة المسار الحالي إلى المسار الذي يشير إليه السهم ، لأن هذا المسار سوف يغلق قريباً', 'Het elektronische bord geeft aan om de rijbaan te verlaten en in te voegen op de rijbaan naar welke de pijl wijst, omdat deze rijbaan zal sluiten.', NULL, NULL, '2023-03-05 18:12:37', '2023-03-09 08:41:17'),
