(902, 'bsm1a7OTAPLs2E8', 'أين تتوقع أن تصادف هذه اللوحة ؟', 'Waar kun je dit bord tegenkomen?', 51, 36, 'mcq', 'uploads/question/gmXgDx1678043936.jpg', 22, 'تتواجد هذه اللوحة داخل المدينة وتحوي معلومات عن الوجهات المحلية ومعالم سياحية محلية ومرافق محلية وأرقام طرق عبر المدينة', 'Dit bord bevindt zich in de stad en bevat informatie over lokale bestemmingen, lokale bezienswaardigheden, lokale voorzieningen en wegnummers in de stad.', NULL, NULL, '2023-03-05 18:18:56', '2023-03-09 08:48:48'),
(903, 'eQlHYILPeGTPqh3', 'ماذا تعني هذه اللوحة ؟', 'Wat betekent dit bord?', 51, 36, 'mcq', 'uploads/question/NTyfPs1678044017.jpg', 23, 'هذه اللوحة الوحيدة التي تكون على شكل مثلث رأسه للأسفل لتمييزها عن غيرها وهي تعني أسنان القرش و في حال وجود سائقين في التقاطع أنت مجبر بالتوقف قبل أسنان القرش لإعطاء الأفضلية للسائقين من اليمين واليسار فقط', 'Dit is het enige teken dat de vorm heeft van een driehoek met de kop naar beneden om het van anderen te onderscheiden, en het betekent haaientanden, waarbij je  voorrang moet verlenen aan kruisende bestuurders.', NULL, NULL, '2023-03-05 18:20:17', '2023-03-14 10:26:32'),
