(909, 'Mi2Keo7PAjTRUCD', 'أي من اللوحات التالية تدل على طريق بإتجاه واحد ؟', 'Welke van de volgende borden geeft een eenrichtingsweg aan?', 59, 44, 'mcq', 'uploads/question/z4t9oz1678045692.jpg', 1, ' اللوحة A تمنع الدخول في الطريق ولكن لا تمنع الخروج ،أي الطريق بإتجاه واحد', 'Bord A verbiedt de ingang tot de weg, maar verbiedt niet de uitgang.', NULL, NULL, '2023-03-05 18:48:12', '2023-03-13 19:30:07'),
