(913, 'N8HC5m6i0MTbKY4', 'اي من اللوحات تدل على نهاية الطريق الأولوية(الطريق الرئيسي) ؟', 'Welke van de borden geeft einde voorrangsweg aan?', 59, 44, 'mcq', 'uploads/question/Kb3X7o1678045983.jpg', 5, NULL, NULL, NULL, NULL, '2023-03-05 18:53:03', '2023-03-13 21:29:04'),
(914, 'Ud5q3EXpo6XxJWf', 'هل تتوقع وجود باص على خانة الطوارئ vluchtstrook بهذه الحالة ؟', 'Verwacht je in dit geval een bus op de vluchtstrook?', 59, 44, 'mcq', 'uploads/question/4FJ3ip1678046060.jpg', 6, 'اللوحة التحذيرية المتواجدة يمين الطريق لها علامة سفلية، تخبرك أن الباص سيقود على خانة الطوارئ في حالة الازدحام فقط، ولا وجود لأي ازحام بهذه الحالة', 'Het waarschuwingsbord aan de rechterkant van de weg heeft een onderste markering, die je informeert dat de bus alleen in geval van file op de vluchtstrook zal rijden en dat er in dit geval geen file is.', NULL, NULL, '2023-03-05 18:54:20', '2023-03-12 14:46:50'),
(915, 'h9lqHFveZsppi4O', 'أي من اللوحات التالية تدل على طريق بإتجاه واحد ؟', 'Welke van de volgende borden geeft een eenrichtingsweg aan?', 59, 44, 'mcq', 'uploads/question/3NUqeY1678046191.jpg', 7, 'اللوحة B تعني طريق بإتجاه واحد للأمام ويمكنك الذهاب يميناً ويساراً ولا يوجد سائقين معاكسين لإتجاهك', 'Bord B betekent een eenrichtingsweg en bord A is verplicht rijrichting', NULL, NULL, '2023-03-05 18:56:31', '2023-03-13 21:31:15'),
(916, '3BcV8LfA409jF20', 'من تمنع هذه اللوحة من الدخول ؟ ', 'Voor wie geldt dit verbod', 59, 44, 'mcq', 'uploads/question/jxsq321678046260.jpg', 8, 'الدراجة النارية التي تسير على عجلتين فقط لا تنطبق عليها هذه اللوحة ومسموح دخولها', 'Een motorfiets die op slechts twee wielen rijdt, wordt niet genoemd in dit bord en mag naar binnen.', NULL, NULL, '2023-03-05 18:57:40', '2023-03-13 21:32:00'),
(917, 'BxB3yHtJmzN9v4I', 'ماذا تعني هذه اللوحة ؟', 'Wat betekent dit bord?', 59, 44, 'mcq', 'uploads/question/nxVL0k1678046334.jpg', 9, 'السهم اليميني المتواجد على اللوحة يخبرك أن خانة الطوارئ سوف تغلق و يجب عليك مغادرتها', 'De rechterpijl op het bord vertelt je dat de vluchtstrook sluit en dat je deze moet verlaten.', NULL, NULL, '2023-03-05 18:58:54', '2023-03-12 14:48:59'),
(918, '8hbGGg6V7X9JScs', 'هل يجب على السائقين الذين يعبرون هذه اللوحة ، عبورها من على يسارهم ؟', 'Moeten bestuurders die dit bord tegenkomen, deze van links passeren?', 59, 44, 'mcq', 'uploads/question/IppGY01678046427.jpg', 10, 'تدل هذه اللوحة على أنه إذا أردت متابعة السير للأمام فأنت مجبر على الإلتزام بالمسار الذي يشير إليه السهم وبالتالي ستكون اللوحة على يسارك', 'Dit bord geeft aan dat als je verder wilt rijden, je verplicht bent om je te houden aan de weg dat door de pijl wordt aangegeven, dus het bord bevindt zich aan je linkerkant.', NULL, NULL, '2023-03-05 19:00:27', '2023-03-13 19:33:30'),
(919, 'gCrf5RtVP3A2dug', 'في أي من الحالتين تتوقع جنوح سيارة معاكسة بإتجاهك ؟', 'In welke van de 2 gevallen kun je tegenliggers verwachten?', 59, 44, 'mcq', 'uploads/question/aoi0ts1678054099.jpg', 11, 'في الحالة ب  أنت تقود أقصى اليمين والمنعطف بالنسبة لك لجهة اليسار أي انزلاقك خارج المنعطف لليمين ،أما المنعطف بالنسبة للسائقين القادمين من أمامك فهو إلى جهة اليمين وبالتالي انزلاقهم سيكون خارج المنعطف لليسار أي بإتجاهك أنت', 'In geval B rijdt je uiterst rechts en is de afslag voor jou naar links, d.w.z. je schuift buiten de afslag naar rechts. Wat betreft de afslag voor de tegenliggende bestuurders, deze is naar rechts, en daarom zal hun slip buiten de bocht naar links zijn, d.w.z. naar jou toe.', NULL, NULL, '2023-03-05 21:08:19', '2023-03-14 09:00:12'),
(920, 'XkBV8cVaimUzFJ1', 'طول مركبتك خمسة أمتار . هل يسمح لك الدخول في هذا الطريق ؟', 'De lengte van jouw voertuig is 5 meter, mag je de weg inrijden wanneer je dit bord treft?', 59, 44, 'mcq', 'uploads/question/3aEpcH1678747756.jpg', 12, 'هذه اللوحة تمنع المركبات التي يتجاوز عرضها ٤,١ متر من الدخول ، ولا تخص طول المركبة بشيء', 'Dit bord geeft de maximale breedte aan voor voertuigen die deze weg in mogen rijden.', NULL, NULL, '2023-03-05 21:09:31', '2023-03-13 21:49:16'),
(921, 'y2WAMkqS6MouGA6', 'أي من اللوحات تدل على أنك داخل المدينة ؟', 'Welk bord geeft aan dat je je binnen de bebouwde kom bevindt?', 59, 44, 'mcq', 'uploads/question/QtwnDd1678054265.jpg', 13, 'اللوحه A تدل على السرعه القصوى 50 كيلو متر في الساعه والتي يمكن ان تكون داخل وخارج المدينه  , ام اللوحه B فانها تدل على اسم المدينه وهذا يعني انك داخل المدينه .', 'A geeft een maximumsnelheid aan en B geeft aan dat je een bebouwde kom in rijdt.', NULL, NULL, '2023-03-05 21:11:05', '2023-03-14 09:00:45'),
(922, 'DyNYiYGxUx3VFH2', 'أي من اللوحات تدل على طريق السيارات autoweg ؟', 'Welke van de volgende borden geeft aan dat je je op een autoweg bevindt?', 59, 44, 'mcq', 'uploads/question/X7XNkE1678054342.jpg', 14, NULL, NULL, NULL, NULL, '2023-03-05 21:12:22', '2023-03-13 19:35:47'),
(923, 'TMdAiukTdkNxRoj', 'ماذا تعني هذه اللوحة ؟', 'Wat betekent dit bord?', 59, 44, 'mcq', 'uploads/question/GTFWKi1678054418.jpg', 15, NULL, NULL, NULL, NULL, '2023-03-05 21:13:38', '2023-03-12 14:53:46'),
(924, 'dzOelPD51FEK9Tn', 'أي من اللوحات المرورية تحذر من وجود حافة نهر ؟', 'Welke van de verkeersborden waarschuwt je voor een rivieroever?', 59, 44, 'mcq', 'uploads/question/wqGEwG1678054498.jpg', 16, 'اللوحة B تحذر من وجود حافة نهر ، أما اللوحة A تحذر من وجود جسر قد يكون مفتوح', 'Bord B waarschuwt voor een rivieroever en bord A waarschuwt voor de mogelijkheid van een open brug.', NULL, NULL, '2023-03-05 21:14:58', '2023-03-13 19:40:33'),
(925, 'MGQzW5LymCLqwG1', 'أي من اللوحات التالية تمنع المشاة من الدخول ؟', 'Welke van de volgende borden geeft een voetgangersverbod aan', 59, 44, 'mcq', 'uploads/question/0UBI7f1678054572.jpg', 17, NULL, NULL, NULL, NULL, '2023-03-05 21:16:12', '2023-03-14 08:54:24'),
(926, 'Qq1Dt7bXtdBz2o9', 'أي من اللوحات التالية تدل على أن الطريق مغلق من الجانبين لجميع المركبات ؟', 'Welk bord geeft een geslotenverklaring  aan voor beide richtingen?', 59, 44, 'mcq', 'uploads/question/tgkExK1678054634.jpg', 18, 'اللوحة ب تعني أن الطريق مغلق أمام المركبات من الجهتين أي لا يوجد طريق ، أما اللوحة أ تعني أن الطريق مغلق فقط من هذا الإتجاه', 'Bord B betekent dat de weg van beide kanten is afgesloten voor voertuigen, wat betekent dat er geen weg is, terwijl bord  A betekent dat de weg alleen vanuit deze richting de verbod geldt.', NULL, NULL, '2023-03-05 21:17:14', '2023-03-13 21:42:59'),
(927, 'DFNAbEWrDN6xcJH', 'عند أي لوحة يجب أعطاء السائقين من الإتجاه المعاكس الأفضلية؟', 'Bij welk bord moet je voorrang verlenen aan tegenkomende verkeer?', 59, 44, 'mcq', 'uploads/question/xft1si1678054904.jpg', 19, NULL, NULL, NULL, NULL, '2023-03-05 21:21:44', '2023-03-13 21:44:22'),
(928, 'h07b47BRAtOPGmb', 'على بعد كم متر ستتقاطع حركتك مع سكة قطار أو جسر متحرك؟', 'Bij hoeveel meter verwacht je een spoorovergang of een beweegbare brug?', 59, 44, 'mcq', 'uploads/question/Fs6Wyu1678054976.jpg', 20, 'كل خط احمر يدل على 80 مترا خطين احمرين يدلان على 160 مترا ثلاثه خطوط حمراء تدل على 240 مترا', 'Elke rode lijn geeft 80 meter aan, twee rode lijnen geven 160 meter aan, drie rode lijnen geven 240 meter aan.', NULL, NULL, '2023-03-05 21:22:56', '2023-03-13 21:46:25'),
(929, 'JDdXVwndaceLDCh', 'أي من اللوحات التالية تحذرك من تقاطع حركتك مع سكة قطار؟', 'Welke van de volgende borden waarschuwt je dat je een spoorweg zal kruisen?', 59, 44, 'mcq', 'uploads/question/oghny51678055055.jpg', 21, 'اللوحة B تحذرك من تقاطع حركتك مع سكة قطار غير محمية بحاجز ، أما اللوحة A تحذرك من تقاطع حركتك مع سكة قطار محمية بحاجز', 'Bord A waarschuwt voor een overweg met slagbomen. Bord B waarschuwt een spooroverweg zonder slagbomen.', NULL, NULL, '2023-03-05 21:24:15', '2023-03-13 21:48:22'),
(930, 'V2wV4mbxsnXnJkn', 'عند أي من اللوحات التالية  يجب عليك إفساح المجال للسائقين القادمين من أمامك؟', 'Bij welke van de volgende borden moet je ruimte maken voor tegenliggende bestuurders.', 59, 44, 'mcq', 'uploads/question/gu4Dxc1678055141.jpg', 22, 'هذه اللوحات تتواجد في الطرق الريفية الضيقة  لتنظيم الأفضلية بين السائقين وذلك من خلال وجود منطقة فسح مجال يمين أو يسار الطريق ،ففي اللوحة ب منطقة فسح المجال يمين الطريق و يجب عليك فسح المجال و إعطاء الأفضلية للسائقين القادمين من أمامك عند هذه اللوحة', 'Deze borden bevinden zich op smalle landelijke wegen om de voorrang tussen bestuurders te regelen door de aanwezigheid van een open plek aan de rechter- of linkerkant van de weg. Op bord B bevindt de open plek zich aan de rechterkant van de weg en moet je voorrang verlenen en verleen je  voorrang aan tegenliggende bestuurders.', NULL, NULL, '2023-03-05 21:25:41', '2023-03-12 14:59:41'),
(931, 'dndPO6wczaAsGlg', 'أي من اللوحات التالية تدل على وجود سكتين حديديتين أو أكثر  ؟', 'Welke van de volgende verkeersborden duidt op de aanwezigheid van meer dan één spoor.', 59, 44, 'mcq', 'uploads/question/i6DNmT1678055463.jpg', 23, NULL, NULL, NULL, NULL, '2023-03-05 21:31:03', '2023-03-14 08:55:21'),
(932, 'bRbApciPXSPvsy1', 'هل يُسمح لك التجاوز يوم الإثنين عند الساعة ٩:٠٠ صباحاً ، بهذه الحالة ؟', 'Mag je hier maandag om 9.00 uur inhalen?', 59, 44, 'mcq', 'uploads/question/h0vE4s1678055529.jpg', 24, 'هذه اللوحة تمنع الشاحنات فقط من التجاوز ضمن الأوقات المحددة ولا تخص باقي السائقين بشيء', 'Inhaalverbod geldt voor vrachtwagens, auto\'s mogen hier inhalen.', NULL, NULL, '2023-03-05 21:32:09', '2023-03-13 21:51:15'),
(933, 'UIHUArXAWlKGCBI', 'في أي من الحالتين يسمح لك التجاوز هنا ؟', 'In welke van de volgende situaties is het toegestaan om in te halen?', 59, 44, 'mcq', 'uploads/question/WSOUg41678055611.jpg', 25, 'اللوحة B تمنع التجاوز ولكن مفعولها يبدأ بعد ٥٠٠ متر من مكان وجود اللوحة ،أما اللوحة A تمنع التجاوز من مكان وجود اللوحة ولغاية ٥٠٠ متر', 'Het inhaalverbod bij bord B geldt na 500 meter pas. Bij bord A is inhaalverbod direct van kracht tot een afstand van 500 meter.', NULL, NULL, '2023-03-05 21:33:31', '2023-03-13 21:53:34'),
(934, 'aChlaqRVlFyh9g2', 'أي من اللوحات التالية تمنع دخول الأحصنة؟', 'Welke van de volgende borden verbiedt paarden?', 59, 44, 'mcq', 'uploads/question/nWzey21678055676.jpg', 26, 'اللوحة B تدل على نهاية الطريق المخصص للأحصنة لكن لا تمنع دخولهم ، أما اللوحة A فهي تمنع دخول الأحصنة', NULL, NULL, NULL, '2023-03-05 21:34:36', '2023-03-13 21:55:14'),
(935, 'fyfuL9tsLskYUEP', 'طول مركبتك خمسة أمتار . هل يسمح لك الدخول في هذا الطريق ؟', 'De lengte van jouw voertuig is vijf meter. Mag je deze weg op?', 59, 44, 'mcq', 'uploads/question/yLImzT1678055747.jpg', 27, 'هذه اللوحة تخص ارتفاع المركبة ولا علاقة لها بالطول', 'Dit bord geeft de maximale doorrijhoogte aan.', NULL, NULL, '2023-03-05 21:35:47', '2023-03-13 21:56:05'),
