(997, '9Lhex9Tb5tBIJTY', 'ماهي السرعة القصوى على الطريق السريع؟', 'Wat is de toegestane maximumsnelheid op de autosnelweg?', 54, 39, 'mcq', 'uploads/question/BeZF5Z1678300647.jpg', 10, 'هذا السؤال هو نوع من الأسئلة المتداولة في دائرة cbr حيث السؤال لا يخص الصورة المرافقه له ، و السؤال هنا عن السرعة القصوى على الطريق السريع ولم يحدد لك بهذه الحاله او بهذه الصورة', 'Op een autosnelweg is de toegestane maximumsnelheid 130 km. De vraag hier is over de maximumsnelheid en niet over deze situatie.', NULL, NULL, '2023-03-08 17:37:27', '2023-03-12 13:50:35'),
(998, 'f04EmiUAr0eO8J0', 'إختر الإجابة الصحيحة ؟', 'Welke stelling is juist?', 64, 49, 'mcq', 'uploads/question/vg9jk01689759151.jpg', 1, NULL, NULL, NULL, NULL, '2023-03-12 11:49:26', '2023-07-19 06:32:31'),
(999, 'HcDg1tzSq2EwLSt', 'هل يسمح لك الدخول بهذا الطريق ؟', 'Is het toegestaan om deze weg in te rijden?', 64, 49, 'mcq', 'uploads/question/m8l14a1689759162.jpg', 2, 'هذه اللوحة تمنع جميع المركبات المصنفة موتورفورتاوخ من الدخول باستثناء حركة المرور المحلية أي الأشخاص المقيمين في هذه المنطقة', 'Alleen bestemmingsverkeer mag gebruik maken van deze weg.', NULL, NULL, '2023-03-12 11:51:20', '2023-07-19 06:32:42'),
(1000, 'YFVlPrydowk8XOJ', 'ما هي سرعتك القصوى بهذه الحالة ؟', 'Wat is de toegestane maximumsnelheid in deze situatie?', 64, 49, 'mcq', 'uploads/question/pgtJX41678626163.jpg', 3, 'أنت داخل المدينة والسرعة القصوى هي ٥٠ كم/سا', 'Je bevindt je binnen de bebouwde kom, dus 50 km/u.', NULL, NULL, '2023-03-12 12:02:43', '2023-03-13 13:11:56'),
(1001, 'cwtjRkGUL19d3Nf', 'توقفت هنا للرد على اتصال هاتفي ، هل يسمح لك ذلك ؟', 'Je staat hier stil om een telefoontje te beantwoorden, is dit toegestaan?', 64, 49, 'mcq', 'uploads/question/vSrr1d1678626322.jpg', 4, ' لا يوجد ما يمنع ذلك ، أما اللوحة في تحذرك من وجود تقاطع خطر', 'Er staat geen parkeerverbodsbord, het bord waarschuwt je voor de aanwezigheid van een gevaarlijk kruispunt.', NULL, NULL, '2023-03-12 12:05:22', '2023-03-13 20:04:55'),
(1002, '9DRYAHvpDe2UVzp', 'السيارة التي أمام تصدر شرار من العادم ، هل يحق لك تحذيره باستخدام الضوء العالي أو الزمور ؟', 'De auto voor je stoot vonken uit de uitlaat, is het toegestaan om hem te waarschuwen door groot licht of de claxon te gebruiken?', 64, 49, 'mcq', 'uploads/question/bW1vNH1678627587.jpg', 5, NULL, NULL, NULL, NULL, '2023-03-12 12:06:53', '2023-03-13 13:14:53'),
