(1005, 'Zr7Zffenej0yr07', 'هل يسمح لك الباركيرن بهذه الحالة ؟', 'Is het toegestaan om hier te parkeren in deze situatie?', 64, 49, 'mcq', 'uploads/question/0OEvjq1678626807.jpg', 8, 'تشير اللوحة إلى ان هذا الطريق باتجاه واحد حيث يسمح لك الباركيرن يسار الطريق لعدم وجود لوحة منع ولكن يمنع عليك   الاصطفاف عكس اتجاه السير في طريق ذو اتجاه واحد', 'Het bord geeft aan dat deze weg eenrichtingsverkeer is, aangezien het is toegestaan om aan de linkerzijde van de weg te parkeren omdat er geen verbodsbord is, maar het is verboden om in de tegenovergestelde richting van het verkeer te parkeren op een eenrichtingsweg.', NULL, NULL, '2023-03-12 12:13:27', '2023-03-13 20:04:10'),
(1006, '9l59UGMMW8IswAX', 'صادفت شخص لديه نزف بالوريد ،هل يسمح لك مساعدته بالضغط على الجرح بقطعة قماش(T-shirt )؟', 'Je komt iemand tegen die een slagaderlijk bloeding heeft, mag je hem helpen door met een stuk stof (T-shirt) op de wond te drukken?', 64, 49, 'mcq', 'uploads/question/oihVyC1678825452.png', 10, ' نزف الوريد يعتبر من الحالات الخطيرة فمن الممكن أن يفقد الشخص حياته قبل وصول الطوارئ ، ويسمح عندها تقديم المساعدة وايقاف النزيف بالضغط على الجرح بقطعة قماش-t-shirt', 'Aderbloeding wordt als een van de ernstige gevallen beschouwd, omdat het mogelijk is dat een persoon zijn leven verliest voordat de noodhulp arriveert, dus is het toegestaan om hulp te bieden en het bloeden te stoppen door met een doek (shirt) op de wond te drukken.', NULL, NULL, '2023-03-14 19:24:12', '2023-03-14 19:24:37'),
