(1061, 'SHgHeb5ZBZ8NSke', 'أنت تقود مركبه مع مقطوره الطول الكلي لهما 7.5 مترهل يسمح لك تجاوز السيارة الزرقاء بسرعه 90كم /ساعه؟', 'Je rijdt met een aanhangwagen, samen met je auto is de lengte 7,5 meter in totaal. Mag je de blauwe auto inhalen met 90 km/u?', 69, 54, 'mcq', 'uploads/question/O0RdMn1677927762.jpg', 1, 'عندما يتجاوز طول السيارة مع المقطورة سبعه امتار تصبح ملزمه\r\n بالسير على اول خانتين فقط من الجهه اليمين للخط السريع.', 'Wanneer de lengte van het voertuig met de aanhanger meer dan zeven meter bedraagt, mag je alleen de twee rechter rijstroken gebruiken.', NULL, NULL, '2023-07-25 09:08:21', '2023-07-25 09:08:21'),
(1062, 'BWDOD4pJOewT689', 'هل يُسمح لك القياده بهذا الشكل؟', 'Mag je op deze manier rijden?', 69, 54, 'mcq', 'uploads/question/cmCLrS1677927875.jpg', 2, 'السبب: يجب وضع قاعده لتثبيت الحموله بشكل جيد', 'Reden: Er moet een onderstel worden geplaatst om de lading goed te bevestigen.', NULL, NULL, '2023-07-25 09:08:21', '2023-07-25 09:08:21'),
(1063, 'AsAxBL2dgwbzIbj', 'الحمولة بارزه متر من الأمام , هل يُسمح لك القياده بهذا الشكل؟', 'De lading steekt 1 meter uit aan de voorzijde, mag je op deze manier rijden?', 69, 54, 'mcq', 'uploads/question/OQ9IWE1677928116.jpg', 3, 'السبب: \r\nلان الحموله اكثر من قطعه فوق السيارة \r\nوبتالي ممنوع ان تبرز من مقدمة السيارة', 'De deelbare lading mag niet uitsteken aan de voorzijde.', NULL, NULL, '2023-07-25 09:08:21', '2023-07-25 09:08:21'),
(1064, '6LaoKfu7lu2rKXI', 'ما هو الحدّ الأقصى لوزن المركبة مع العربة وحمولتها ، مع رخصة القيادة فئة B ؟', 'Wat is de maximummassa wat je mag vervoeren met rijbewijs B (auto + aanhanger + lading)', 69, 54, 'mcq', 'uploads/question/kOv2HD1677928256.jpg', 4, NULL, NULL, NULL, NULL, '2023-07-25 09:08:21', '2023-07-25 09:08:21'),
(1065, 'v7W4Bq4Nj36UN8X', 'الحمولة بارزة متر من خلف السيارة , هل يُسمح لك القياده بهذا الشكل؟', 'De lading steekt 1 meter uit aan de achterzijde, mag je op deze manier rijden?', 69, 54, 'mcq', 'uploads/question/f7kUUZ1677928369.jpg', 5, 'اذا كانت الحموله اكثر من قطعه مسموح ان تبرز متر واحد فقط من الخلف كحد أقصى', 'Als de lading uit meer dan één stuk bestaat, mag deze slechts één meter aan de achterkant uitsteken.', NULL, NULL, '2023-07-25 09:08:21', '2023-07-25 09:08:21'),
(1066, '7Exnafr6QGI1iPt', 'الحمولة بارزه متر من الأمام و متر من الخلف هل يُسمح لك القيادة بهذا الشكل؟', 'De lading steekt zowel aan de voorzijde als de achterzijde 1 meter uit, mag je op deze manier rijden?', 69, 54, 'mcq', 'uploads/question/2OBQYp1677928490.jpg', 6, 'بما ان الحموله قطعه واحده فمسموح \r\nان تبرز متر امام مقدمة السيارة ومتر من الخلف  كحد أقصى', 'Aangezien de lading uit één stuk bestaat, mag deze één meter aan de voorkant van de auto uitsteken en één meter aan de achterkant.', NULL, NULL, '2023-07-25 09:08:21', '2023-07-25 09:08:21'),
(1067, 'QOzs1iTjlNmfQvw', 'الحمولة بارزه 25 سم من كل جانب هل يُسمح لك القياده؟', 'De lading steekt aan beide zijde 25 cm uit, mag dit?', 69, 54, 'mcq', 'uploads/question/EB3Jn11677928586.jpg', 7, 'بما ان الحموله قطعه واحده فمسموح \r\nان تبرز 20سم فقط من كل جانب كحد أقصى', 'De lading mag maximaal 20 cm uitsteken aan beide kanten.', NULL, NULL, '2023-07-25 09:08:21', '2023-07-25 09:08:21'),
(1068, '7w2hxhQ9fM89utz', 'هل يُسمح لك القياده بهذا الشكل؟', 'Mag je op deze manier rijden?', 69, 54, 'mcq', 'uploads/question/COabfl1677928698.jpg', 8, 'السبب: \r\nلم تقم بوضع الحموله بشكل امن خاصه ان الحموله بارزه\r\n امام و خلف المقطوره وغير مثبته وفي حال الضغط على الفرامل \r\nستندفع الى الامام مشكله خطرا عليك وعلى السائقين.', 'Reden: je hebt de lading niet correct geplaatst, vooral omdat de lading voor de aanhangwagen uitsteekt en niet goed is bevestigd. Als je op de rem trapt, zal de lading zich naar voren verplaatsen wat een gevaar vormt voor jou en de weggebruikers.', NULL, NULL, '2023-07-25 09:08:21', '2023-07-25 09:08:21'),
(1069, '4DhuxVJO095EeG8', 'في أي من الحالتين يُسمح لك القياده؟', 'In welk geval mag je rijden?', 69, 54, 'mcq', 'uploads/question/q4kP3c1677929035.jpg', 9, 'السبب: \r\nلان حمالة الفيتسات في الحاله A لاتحوي أضواء ولا لوحة ارقام', 'De fiets-drager moet altijd beschikken over verlichting en een witte kentekenplaat.', NULL, NULL, '2023-07-25 09:08:21', '2023-07-25 09:08:21'),
(1070, 'TWZneiKD2aahztS', 'لقد قمت بتثبيت الحموله بشكل جيد هل يُسمح لك القياده بهذا الشكل؟', 'Je hebt de lading correct bevestigd, mag je op deze manier rijden?', 69, 54, 'mcq', 'uploads/question/IXlDum1677929148.jpg', 10, 'السبب: \r\nبالنسبه للحمولات البارزه امام المقطوره يجب  الايتجاوز بروزها منطقة الكوبيل \r\nوهي منطقه ربط المقطوره مع السيارة بالاضافه الى تثبيتها بشكل جيد.', 'Wat betreft uitstekende ladingen aan de voorkant van de aanhangwagen, deze mogen niet verder uitsteken dan de trekhaak, het gebied waar de aanhangwagen aan de auto is gekoppeld.', NULL, NULL, '2023-07-25 09:08:21', '2023-07-25 09:08:21'),
(1071, 'R3GVjOVq6Kcy9Uz', 'الحموله بارزه 4.5 متر خلف المقطورة وقمت بوضع لوحة تحذيرية هل يُسمح لك القيادة على هذا الشكل؟', 'De lading steekt 4,5 meter uit de aanhangwagen met een markeringsbord, mag je op deze manier rijden?', 69, 54, 'mcq', 'uploads/question/XGa6kj1677929237.jpg', 11, 'الحد الأقصى لبروز الحموله خلف المقطورة هو خمس أمتار بدءا من محور الدولاب الخلفي للمقطورة', 'Het uitsteken van de lading mag niet meer dan vijf meter bedragen, uitgaande van de as van het achterwiel van de aanhangwagen.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1072, 'Z6fUyzbKsT8Rrwq', 'الحمولة بارزة 1.5 متر خلف العربة هل يُسمح لك القيادة على هذا الشكل؟', 'De lading steekt 1,5 meter uit aan de achterzijde van de aanhangwagen, mag je op deze manier rijden?', 69, 54, 'mcq', 'uploads/question/5mAjTk1677929332.jpg', 12, 'يسمح ببروز الحموله أكثر من متر خلف العربه لكن عندها يجب وضع لوحه تحذيريه', 'De lading mag meer dan een meter uitsteken aan de achterzijde van de aanhangwagen, maar dan moet er wel een markeringsbord worden geplaatst.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1073, 'qRWAYmx5xc1tWQ0', 'تجر مقطورة وزنها مع حمولتها 850 كغ والحمولة بارزة اكثر من متر هل يُسمح لك القيادة بهذا الشكل؟', 'Je trekt een aanhangwagen en het gewicht (aanhanger+lading) wegen samen 850 kilo en de lading steekt 1 meter uit aan de achterzijde, mag je zo rijden?', 69, 54, 'mcq', 'uploads/question/QNz4wt1677929727.jpg', 13, 'عندما يتجاوز وزن المقطوره مع حمولتها ال 750كيلو غرام \r\nتأخذ لوحه ارقام صفراء غير مطابقة للوحه ارقام السيارة.', 'Wanneer het gewicht van de aanhanger met lading zwaarder is dan 750 kilo, moet er een gele kentekenplaat geplaatst worden die niet overeenkomt met de kentekenplaat van de auto.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1074, 'tTGsw6K41SY1n7G', 'الحمولة بارزه 80 سم خلف العربة هل يسمح لك القيادة على هذا الشكل؟', 'De lading steekt 80 cm uit aan de achterzijde van de aanhangwagen, mag je op deze manier rijden?', 69, 54, 'mcq', 'uploads/question/jjWZ4l1677929448.jpg', 14, 'يسمح بروز الحموله متر خلف العربه بدون لوحه تحذيريه \r\nوالحموله موضوعه ومثبته بشكل جيد', 'De lading mag zonder markeringsbord maximaal één meter uitsteken aan de achterzijde van de aanhangwagen.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1075, 'A8MhdaYbtxTqK2Q', 'الحموله بارزه اكثر من متر خلف المقطوره في اي من الوضعيتين تكون لوحه التحذير صحيحة؟', 'De lading steekt meer dan 1 meter uit, in welk geval is het markeringsbord op de juiste manier bevestigd?', 69, 54, 'mcq', 'uploads/question/RGsLQv1677929813.jpg', 15, 'لان لوحه التحذير يجب ان توضع بطريقه تسمح برؤيتها \r\nمن قبل السائقين المتواجدين خلفك وليس بجانبك', 'Het markeringsbord moet zichtbaar zijn voor het verkeer achter je.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1076, 'KLkuK5GBlRjc4tq', 'الحموله بارزه 1.5 متر خلف المقطورة هل تستطيع القياده بهذا الشكل؟', 'De lading steekt 1,5 meter uit aan de achterzijde van de aanhangwagen, mag je op deze manier rijden?', 69, 54, 'mcq', 'uploads/question/k6QMFa1677929944.jpg', 16, 'يجب وضع اللوحه التحذيرية الخاصه بالحمولات\r\n \"مخططه ابيض واحمر \" وليس قطعه قماش', 'Het markeringsbord moet wit en rood gestreept zijn, een rood doek is niet voldoende.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1077, 'yrHYxboz2oBCQuM', 'هل يحق لك جر عربة في النهار, إذا كان غماز العربه معطل ؟', 'Mag je overdag een aanhangwagen gebruiken wanneer één van de richtingaanwijzers het niet doet?', 69, 54, 'mcq', 'uploads/question/h6FDdD1677930038.jpg', 17, 'يمنع عليك جر عربة اذا كان الغماز أو أحد الأضواء معطل سواء في الليل أو النهار', 'Het is zowel \'s nachts als overdag verboden.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1078, 'SXf8PVJMP3jXRYG', 'هل وضع الدراجة الهوائية بهذا الشكل يستهلك وقود أكثر؟', 'Als je op deze manier fietsen vervoert, verbruik je dan meer brandstof?', 69, 54, 'mcq', 'uploads/question/5B8ngF1677930112.jpg', 18, 'أي حمولة فوق السيارة أو داخلها و حتى جر العربة يتطلب جهد اضافي من المحرك و بالتالي صرف وقود أكثر', 'Elk extra gewicht op of in de auto maakt de auto zwaarder, waardoor de auto meer brandstof verbruikt.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1079, 'O3LsYKEl8syH4UQ', 'هل يُسمح لك نقل الحموله بهذه الوضعيه؟', 'Mag je de lading op deze manier vervoeren?', 69, 54, 'mcq', 'uploads/question/kSal081677930200.jpg', 19, 'لايسمح لانها اكثر من قطعه واحده وبالتالي ممنوع أن تبرز من جانبي السيارة.', 'Het is niet toegestaan omdat de lading uit meer dan één stuk bestaat. De deelbare lading mag niet uitsteken aan de zijkanten.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1080, 'Pqst8CXcCozDcKr', 'هل تقود خلف شاحنه ام قاطرة ومقطوره؟', 'Rijd je achter een vrachtwagen of vrachtauto?', 69, 54, 'mcq', 'uploads/question/xC4DSi1677930334.jpg', 20, 'الشاحنة تكون بلوحة مخططة بالأصفر والأحمر', 'De vrachtauto is te herkennen aan het geel met rood gestreepte markeringsbord aan de achterzijde.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1081, 'vjtAOgtTVM0YyJH', 'ماهو الحد الاقصى لعرض الحمولة على العربة ؟', 'Wat is de maximale breedte van de lading op een aanhangwagen?', 69, 54, 'mcq', 'uploads/question/VzKZQo1677930560.jpg', 21, NULL, 'De maximale breedte van de lading op een aanhangwagen mag nooit meer dan 3 meter zijn.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1082, 'LIRrWaxYY3WSumx', 'ماهو اقصى طول للسيارة مع العربه؟', 'Wat is de maximale lengte van een auto met aanhangwagen?', 69, 54, 'mcq', 'uploads/question/addaVX1677930681.jpg', 22, NULL, NULL, NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1083, 'lusRBOndiqqjxnv', 'طول مركبتك مع العربه لايتجاوز 7 أمتار هل يحق لك الدخول بهذا الشارع؟', 'De lengte van je voertuig met de aanhangwagen is niet meer dan 7 meter, mag je deze weg in?', 69, 54, 'mcq', 'uploads/question/22kZfs1677930813.jpg', 23, 'هذه اللوحة تمنع أي مركبة مصنفة موتورفورتاوخ وتجر عربة  من الدخول.', 'Dit bord verbiedt motorvoertuigen met een aanhangwagen.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1084, 'uD4ENOVQU7egAsp', 'تقود سيارة مع عربة الطول الكلي لهما 9 متر،هل يحق لك التجاوز بهذه الحالة؟', 'Je rijdt een auto met een aanhanger waarvan de totale lengte 9 meter is, mag je hier inhalen?', 69, 54, 'mcq', 'uploads/question/zoqMIf1677930944.jpg', 24, 'اللوحة المعدنية تمنع الشاحنات فقط \r\nمن التجاوز بهذا الطريق وهي لا تخصك بشيء', 'Het bord verbiedt alleen vrachtwagens om in te halen op deze weg, dit geldt niet voor jou.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1085, 'yn0DYMnQVnISWm8', 'اذا كان ارتفاع الحمولة مع السيارة 3 امتار هل تحتاج الى لوحه تحذيرية ؟', 'Als de hoogte van de lading met de auto 3 meter is, heb je dan een markeringsbord nodig?', 69, 54, 'mcq', 'uploads/question/daVaBB1677931037.jpg', 25, 'بالنسبة للحمولات فوق السيارة ،ليست بحاجة للوحة تحذيرية، \r\nويجب ألا يتجاوز ارتفاع الحمولة مع السيارة 4م ابتداءاً من سطح الأرض', 'Voor ladingen boven de auto is een markeringsbord niet nodig, en de hoogte van de lading vanaf de grond mag niet hoger zijn dan 4 meter.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1086, 'oT5puwGAnl4Pfnd', 'أي من المقطورات التالية تكون ذات لوحة أرقام غير مطابقة للوحة أرقام السيارة ؟', 'Welke van de volgende aanhangwagens heeft een kenteken dat niet overeenkomt met het kenteken van de auto?', 69, 54, 'mcq', 'uploads/question/UE9Hv11677931135.jpg', 26, 'السبب : \r\nالمقطورات التي يكون وزنها مع حمولتها أكثر من ٧٥٠ كغ تحمل لوحة \r\nأرقام بلون أصفر غير مطابقة للوحة أرقام السيارة ولها كرت ميكانيك خاص بها .', 'Reden: Aanhangwagens van meer dan 750 kg hebben een eigen kentekenplaat.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1087, 'a2uAidWo1pFXW8x', 'تقود مركبه مع مقطوره هل تستطيع تجاوز السيارة الحمراء بسرعه 100كم /ساعه ؟', 'Je rijdt een auto met aanhangwagen, mag je de rode auto met 100 km/uur inhalen?', 69, 54, 'mcq', 'uploads/question/f3PZQP1677931265.jpg', 27, ' عند جر مقطورة على الخط السريع او طريق السيارات \r\nتكون سرعتك القصوى 90 كم / ساعه فقط.', 'Bij het trekken van een aanhangwagen op de autoweg of snelweg geldt de maximumsnelheid van 90 km/u.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
(1088, 'UR2qChj6m9yqfyQ', 'هل يسمح لك بعمل باركيرن بهذا الشكل؟', 'Mag je op deze manier parkeren?', 69, 54, 'mcq', 'uploads/question/1xjxIM1677931360.jpg', 28, 'يسمح لك بعمل باركيرن للسيارة مع المقطورة في خانتي اصطفاف\r\nولكن لا يسمح ببروز الحمولة إلى خانة الاصطفاف الثالثة لأنها تشكل خطورة', 'Met aanhangwagen mag je maximaal gebruik maken van 2 parkeervakken.', NULL, NULL, '2023-07-25 09:08:22', '2023-07-25 09:08:22'),
