(1108, 'EC5PWRbaxlHv3HF', 'ماهي نسبة الكحول المسموحة في دم السائق الخبير بالبروميلي؟', 'Wat is het toegestane percentage alcohol in het bloed van een ervaren bestuurder in promille?', 74, 58, 'mcq', 'uploads/question/je3y881673033222.jpg', 3, NULL, NULL, NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1109, 'Y5Iag0ADatlBQQk', 'في أي من الحالتين تكون السرعة القصوى 90 فوراً؟', 'In welk geval is de maximale snelheid meteen 90 km/u?', 74, 58, 'mcq', 'uploads/question/zYbddk1673276495.jpg', 4, 'كلا اللوحتين تخبر بوجود إنزلاق وسرعة قصوى ٩٠كم/سا  ، لكن في اللوحة A السرعة القصوى ٩٠ في حال وجود رطوبة على الطريق فقط وفي حال عدم وجود رطوبة لا تطبق هذه السرعة ، أما اللوحة B السرعة القصوى ٩٠ من مكان وجود اللوحة ولغاية ١.٥ كم', 'Op beide borden staat dat er sprake is van slip en een maximumsnelheid van 90 km/u, maar op bord A is de maximumsnelheid 90 km/u alleen bij vocht op de weg en bij afwezigheid van vocht geldt deze snelheid niet. Bord B geeft de maximale snelheid van 90 km/u vanaf de plaats waar het bord zich bevindt tot 1,5 km.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1110, 'vVn4eGAII4S8s8M', 'ماذا تفعل بهذه الحاله؟', 'Wat doe je in deze situatie?', 74, 58, 'mcq', 'uploads/question/kappx71673033366.jpg', 5, NULL, NULL, NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1111, 'SQkoQgcGMVU4V47', 'الرجل الضرير رفع العصا  ، ماذا تفعل بهذه الحالة؟', 'De slechtziende man heft zijn taststok op, wat doe je in dit geval?', 74, 58, 'mcq', 'uploads/question/pkWyES1673033544.jpg', 6, 'إعطاء طريق وأفضليه للضرير حتى لو لم يقم برفع العصا.', 'Op de weg geef je voorrang  aan slechtzienden, zelfs als hij zijn taststok niet opheft.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1112, 'dKX4dg8NeFXHtQC', 'أي من الحالتين تتوقع وجود سائقين قادمين من يمينك؟', 'In welke van de twee situaties kun je bestuurders van rechts verwachten?', 74, 58, 'mcq', 'uploads/question/nN09Ug1673033643.jpg', 7, 'كلا اللوحتين تُخاطبانك انت فقط(السيارة البيضاء)ولاتخص السائقين من يمينك ويسارك ،ففي الحالة A\r\n\r\nأنت مُجبر على الإنعطاف يميناً\r\n\r\nأما في الحالة B\r\n\r\nيُمكنك الذهاب يميناً ويساراً', 'Beide borden zijn alleen voor jou bestemd en zijn niet voor de kruisende bestuurders. In geval A ben je gedwongen rechtsaf te slaan, in geval B kun je naar rechts of naar links.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1113, 'bvIAO5hoFfxJyr7', 'أنت تقود السيارة البيضاء ،هل يُسمح لك الإنعطاف يساراً؟', 'Mag je hier linksaf?', 74, 58, 'mcq', 'uploads/question/G81TUo1673033734.jpg', 8, 'السبب: حسب لوحة الإتجاه هذه يُمكنك متابعة السير للأمام ويمكنك الإنعطاف يساراً', 'Reden: Volgens dit richtingsbord kun je rechtdoor blijven rijden en kun je linksaf slaan.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1114, '3G94GUTWUh78qh0', 'على ماذا تدُل هذه اللوحة الإلكترونية ؟', 'Wat geeft dit elektronische bord aan?', 74, 58, 'mcq', 'uploads/question/tgfpPB1673033815.jpg', 9, 'هذه اللوحة الإلكترونية تُعطي حالة الطريق السريع ،حيثُ يشير الخط الأحمر على وجود إزدحام على الطريق السريع\r\n\r\nA10.', 'Dit elektronische bord geeft de staat van de snelweg aan, waarbij de rode lijn aangeeft dat er file is op de A10.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1115, '6IHQ1b0PedcvsPa', 'أنت تَقود السيارة البيضاء ، هل تتوقع وجود سائقين قادمين من يسارك؟', 'Je rijdt de witte auto, kun je bestuurders van links verwachten?', 74, 58, 'mcq', 'uploads/question/G3pIBf1673033908.jpg', 10, 'السبب:جميع السائقين بهذه الحالة مجبرين على إتباع إتجاه السهم وأنت مُجبرعلى الإنعطاف يساراً\r\n\r\nلذلك لاتتوقع وجود سائقين من اليسار يقُودون بعكس إتجاه السهم.', 'Alle automobilisten worden moeten de richting van de pijl te volgen, en voor jou wijst de pijl naar links, dus verwacht niet dat automobilisten van links tegen de richting van de pijl in rijden.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1116, 'TyH3ZcX4vQRak6U', 'هل يُسمح لك بالإنتقال إلى المسارالذي على يمينك؟', 'Mag je invoegen op de rechterrijstrook?', 74, 58, 'mcq', 'uploads/question/17MKRE1673033986.jpg', 11, ' السبب: الخانة التي على يمينك مخصصة للباصات والشاحنات فقط.', 'Reden: de rijstrook van rechts is alleen voor bussen en vrachtwagens bestemd.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1117, 'gYewfCNSVVUdG6E', 'في أي من الحالتين تتوقع وجود فيتس قادم من يمينك؟', 'In welke situatie zou je fietsers van rechts kunnen verwachten?', 74, 58, 'mcq', 'uploads/question/eEXRUK1673034079.jpg', 12, 'السبب: في الحالة A:\r\n\r\nجميع السائقين مُجبرين على إتباع إتجاه السهم بإستثناء الفيتس والسنور فيتس ،\r\n\r\nاما في الحالة B:\r\n\r\nفقط الفيتس والسنورفيتس مُجبرين على إتباع السهم.', 'In situatie A zijn alle bestuurders verplicht om de richting van de pijl te volgen behalve de fiets en snorfiets. \r\nIn situatie B zijn alleen de fiets en snorfiets verplicht om de pijl te volgen.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1118, '7Jpj6cxvKgK5iad', 'أي من الزوايا التالية تعتبر زاوية ميتة بالنسبة لسائق الدراجة النارية ؟', 'Welke van de volgende hoeken is een dode hoek voor een motorrijder?', 74, 58, 'mcq', 'uploads/question/zLBcFE1673034170.jpg', 13, NULL, NULL, NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1119, 'WdtYRfBVw0oF4q7', 'لقد تعرضت لحادث مروري ،إختر الإجابة الصحيحة؟', 'Je was betrokken bij een verkeersongeval, kies het juiste antwoord.', 74, 58, 'mcq', 'uploads/question/sVmZhI1673034254.jpg', 14, NULL, NULL, NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1120, 'UBSfgfdyJ2VFkyD', 'ما الذي يسرع عملية طرد الكحول من جسمك؟', 'Wat versnelt het proces van het verdrijven van alcohol uit het lichaam?', 74, 58, 'mcq', 'uploads/question/XV9cSy1673034332.jpg', 15, NULL, NULL, NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1121, 'xqFzw3hE3MLL6Qd', 'على بُعد كم متر من موقف الباص يحق لك عمل باركير؟', 'Op hoeveel meter afstand van de bushalte mag je parkeren?', 74, 58, 'mcq', 'uploads/question/kICAUv1673034406.jpg', 16, ' يُمكن معرفة حدود موقف الباص من خلال بلوكات بيضاء أو خط أبيض متصل،\r\n\r\nوفي حال عدم وجودهما فإن حدود موقف الباص هي 12 متر قبل لوحة موقف الباص و 12 متر بعدها .', 'De grenzen van de bushalte kunnen worden geïdentificeerd door middel van witte blokken of een doorlopende witte lijn, en als deze niet aanwezig zijn, zijn de grenzen van de bushalte 12 meter voor het bord met de bushalte en 12 meter erna.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1122, 'IhdjFD3JmstqB7q', 'تريد جرّ عربة بسيارتك ،في أي من الحالتين تقوم بتثبيت الكابل المسمى باللغة الهولندية hulpkoppeling بشكل صحيح؟', 'Je wilt een auto meeslepen, in welk geval monteer je de hulpkoppeling kabel op de juiste manier?', 74, 58, 'mcq', 'uploads/question/CnfSES1673034494.jpg', 17, 'الاجابة الصحيحة :\r\n\r\nB\r\n\r\nالسبب : عندما تريد جرّ عربة ليس لها نظام فرملة ذاتي\r\nمع السيارة فإنك تقوم بربط العربة مع السيارة عن طريق\r\nوضع التجويف الذي في مقدمة العربة في ساحب السيارة\r\nالمعقوف وبذلك يكون تم الربط بشكل جيد ولكن في حال\r\nانفصال العربة عن السيارة ستشكل خطورة كبيرة ،\r\nلذلك تم وضع كابل خاص يسمى باللغة الهولندية\r\nhulpkoppeling\r\nوظيفته إبقاء العربه معلقة بالسيارة في حال انفصالها\r\nويجب تمريره من خلال الجزء المعدني الأبيض أيضا المثبت\r\nفي الساحب المعقوف الخاص بالسيارة وليس في الساحب فقط.', 'Reden:  wanneer je een voertuig wil slepen dat geen zelf remmend systeem heeft met de auto wilt slepen, koppel je het voertuig aan de auto door de groef aan de voorzijde van het voertuig in de aangehaakte autotrekker te plaatsen, en zo is die goed geïnstalleerd.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1123, 'hJk2H7PGiPpRwaB', 'هل تتوقع وجود أطفال إذا رأيت هذه اللوحة؟', 'Kun je kinderen verwachten op de weg wanneer je dit bord ziet?', 74, 58, 'mcq', 'uploads/question/u5uT7g1673034645.jpg', 18, 'السبب:في منطقة السرعة 30 نتوقع وجود أطفال او مشاة.', 'Reden: In de 30 km/u snelheidszone verwachten we de aanwezigheid van kinderen of voetgangers.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1124, 'JOnvLEL5t2upVZ0', 'هل يحق لك إستخدام الزمور ليلاً لتجنب خطر ما؟', 'Heb je het recht om \'s nachts de claxon te gebruiken om enig gevaar te vermijden?', 74, 58, 'mcq', 'uploads/question/jvIU821673034731.jpg', 19, 'السبب: يحق لك إستخدام الزمور ليلاً ونهاراً لتجنب خطر ما.', 'Je hebt het recht om de claxon overdag en ‘s nachts te gebruiken om enig gevaar te vermijden.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1125, 'DUYTNvdagWBJTml', 'ماذا تعني هذه اللوحة؟', 'Wat betekent dit bord?', 74, 58, 'mcq', 'uploads/question/yqScrs1673034911.jpg', 20, NULL, NULL, NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1126, 'hkMOlgrCGlpzaes', 'هل إستخدام جهاز الملاحة (GPS) يؤدي لتوفير الوقود والحفاظ على البيئة؟', 'Leidt het gebruik van het navigatieapparaat tot brandstofbesparing en milieubescherming?', 74, 58, 'mcq', 'uploads/question/ksKgaR1673034989.jpg', 21, 'إنّ ضبط جهاز الملاحة قبل البدء بالقيادة يساعد في إختيار الطريق الأقصر  والأسرع(زمن أقل)\r\nويزودك بمعرفة مسبقة عن حالة الطريق في حال وجود ازدحام أو طريق مغلق بسبب أعمال الصيانة\r\nاو حادث ، كل هذا يؤدي الى توفير الوقود والحفاظ على البيئة.', 'Het instellen van het navigatieapparaat voordat je gaat rijden helpt bij het kiezen van de kortste en snelste route en geeft je voorkennis over de toestand van de wegen in het geval van een file of een wegafsluiting door onderhoudswerkzaamheden of een ongeval. Dit leidt tot brandstofbesparing en milieubehoud.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1127, 'amLSHjsNsYUaegO', 'على ماذا تدل هذه اللوحة؟', 'Wat geeft dit bord aan?', 74, 58, 'mcq', 'uploads/question/phU0zF1673035099.jpg', 22, NULL, NULL, NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1128, 'dDrn7br86HEPmhx', 'هل تتوقع قدوم شاحنة  من أمامك؟', 'Kun je een vrachtwagen voor je op de weg verwachten?', 74, 58, 'mcq', 'uploads/question/3y27Ct1673274579.jpg', 23, 'السبب: حسب ما تُخبر به اللوحة أنّه إتجاه إجباري للشاحنات فقط ولايوجد شاحنات من أمامك.', 'Dit is een verplichte richting voor vrachtwagens en er rijden geen vrachtwagens voor je.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1129, '5S9hoeXlLKPZ1rW', 'في أي من الحالات التالية تستطيع الإلتفاف والعودة ؟', 'Bij welke van de volgende situaties mag je keren?', 74, 58, 'mcq', 'uploads/question/NZJTht1673274665.jpg', 24, 'على الطريق السريع وطريق السيارات لا يمكنك الإلتفاف والعودة أمّا على طريق خارج المدينة مسموح ذلك.', 'Op de snelweg en autoweg is het niet toegestaan om te keren, op een weg buiten de bebouwde kom is dit wel toegestaan.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1130, 'rT0qa7yAHiBLGbs', 'في أي من الصورتين تكون وضعية الجر أكثر أمانا ؟', 'In welke van de twee situaties is het meeslepen veiliger?', 74, 58, 'mcq', 'uploads/question/qIQYRr1673274833.jpg', 25, 'الجواب  A\r\n\r\n. وضعية الجر و الحبل مشدود أكثر أمنا من وضعية الجر و الحبل مرخي .', 'De tractiepositie met het touw gespannen is veiliger dan de tractiepositie met het touw los.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1131, '3iG5LBkLMyNWzPb', 'أي من الحالتين تكون القياده أكثر أماناً؟', 'In welke van de twee gevallen is autorijden veiliger?', 74, 58, 'mcq', 'uploads/question/TwTP3H1673274938.jpg', 26, NULL, NULL, NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1132, '1jVtUrgHcE7KwpH', 'على ماذا يدل ظهور هذا الرمز في لوحة القيادة لديك؟', 'Wat geeft dit symbool aan?', 74, 58, 'mcq', 'uploads/question/11cUXC1673275019.jpg', 27, NULL, NULL, NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1133, 'HGKQlpgCQOd9mqx', 'على ماذا يدل ظهور هذا الرمز في لوحة القيادة لديك؟', 'Wat geeft dit symbool aan?', 74, 58, 'mcq', 'uploads/question/K0aU141673275106.jpg', 28, NULL, NULL, NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1134, 'kogc6SO00XPiWEW', 'أنت على الخط السريع و مستوى الوقود قليل  في خزان السيارة وقد فاتك المخرج إلى محطة الوقود, هل يسمح لك بالرجوع إلى الخلف للدخول في محطة الوقود؟', 'Je bevindt je op de snelweg en het brandstofniveau van de auto is laag , je hebt de afslag naar het tankstation gemist. Mag je terug keren?', 75, 58, 'mcq', 'uploads/question/X4H2wu1677669669.png', 1, 'يُمنع الإلتفاف والعودة والرجوع للخلف على الخط السريع', 'Draaien, keren en achteruitrijden op de snelweg is verboden.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1135, 'ycAtZOw1WggyraO', 'أنت تقود السيارة البيضاء في أي من الحالتين يجب عليك التوقف؟', 'Je rijdt de witte auto, in welke situatie moet je stoppen?', 75, 58, 'mcq', 'uploads/question/qOoOZo1677669948.png', 2, 'في الحالة (A) شرطي المرور يطلب من جميع السائقين التوقف ، أما في الحالة (B) شرطي المرور يقوم بمد ذراعيه و يطلب من القادمين من أمامه وخلفه التوقف', 'In geval (A) vraagt de verkeersregelaar alle automobilisten om te stoppen, terwijl in geval (B) de verkeersregelaar zijn armen uitsteekt en vraagt het verkeer wat hem van voor en achter nadert om te stoppen.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1136, 'TmI2gPT0gIAMiaI', 'أنت تقود السيارة البيضاء و خلفك سيارة إسعاف مع الضوء والصوت التحذيري ماذا تفعل؟', 'Je rijdt hier in de witte auto en achter je een rijdt een ambulance met optische en geluidssignalen, wat doe je?', 75, 58, 'mcq', 'uploads/question/IenNnb1677670006.png', 3, 'سياره الاسعاف تمر عادتا ( في حالات الطوارئ ) ما بين , الخانه ما قبل الاخيره الى اليسار, والخانة الاخيره الى اليسار.', NULL, NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1137, 'qAYvhiKLvn1kdI2', 'رتب الأفضلية بهذه الحالة؟', 'Wat is de juiste volgorde van voor laten gaan?', 75, 58, 'drag_drop', 'uploads/question/nCveeJ1677670144.png', 4, 'الرتل العسكري يتوقف عند أسنان القرش لإعطاء الأفضلية للسائقين من اليمين واليسار ،ولدينا سائقان على الطريق الرئيسي ومن ينعطف يفقد الافضلية أمام من يريد متابعة السير للأمام', 'De militaire colonne stopt bij de haaientanden om de voorrang te verlenen aan kruisende bestuurders. We hebben twee bestuurders op de voorrangsweg, en wie afslaat verleent voorrang voor degenen die rechtdoor willen.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1138, 'tIDnX05ChNHSRwJ', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 75, 58, 'drag_drop', 'uploads/question/2mrZMy1677670298.png', 5, 'الافضلية لك لانه لديك اللوحة المرورية المربعة الزرقاء و التي تعني  الافضلية لك عند التضيقات . و الطرف المقابل يملك لوحة مرورية مدورة تعني اعطاء الافضلية للغير عند التضيقات', 'Jij krijgt voorrang want je hebt het blauwe vierkante verkeersbord, wat betekent dat je voorrang hebt op een versmalde weg . En de andere kant heeft een rond verkeersbord, wat betekent dat je voorrang verleent aan anderen op een versmalde weg.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1139, 'zuWo1zmYjv3MWvl', 'تقود مركبه مع مقطوره هل يُسمح لك تجاوز السيارة الحمراء ؟', 'Je rijdt de witte auto met aanhanger, mag je de rode auto inhalen?', 75, 58, 'mcq', 'uploads/question/GiSURS1677670447.png', 6, 'القانون لا يمنعك من التجاوز عندما تجر مقطورة ، ولكن يجبرك بالإلتزام بالمسارين أقصى اليمين في حال تجاوز الطول سبة أمتار و يمنعك من تجاوز حدود السرعة الخاصة بحالتك هذه.', 'De wet verbied je niet om in te halen wanneer je een aanhangwagen trekt, maar je moet de  twee uiterst rechtse rijstroken gebruiken als de lengte meer dan 7 meter bedraagt.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1140, 'u9JPwVOdFL0pdlz', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 75, 58, 'drag_drop', 'uploads/question/qFluqc1677670557.png', 7, 'التقاطع متساوي و رتل الجنازة لم يقطع التقاطع اذا يعتبر سائق عادي وبما أن الترام متساوي مع السائقين فالأفضلية له ويذهب أولاً ،ثم ستذهب السيارة البيضاء لأنها قادمة من يمين رتل الجنازة و أخيراً الرتل', 'De kruising is gelijk en de rouwstoet is de kruising niet overgestoken, dus wordt deze als een normale bestuurder beschouwd, en aangezien de tram gelijk is aan de bestuurders heeft hij de voorrang en gaat hij eerst, daarna gaat de witte auto omdat deze rechts van de rouwstoet aankomt en tenslotte de rouwstoet.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1141, 'FDPA56w8ueteg32', 'اذا كانت الوسادة الهوائية لا تعمل ، ما هي الطريقة الصحيحة لوضع الكرسي الخاص بالأطفال ؟', 'Wat is dan de juiste manier om de kinderstoel te plaatsen wanneer de airbag niet is ingeschakeld?', 75, 58, 'mcq', 'uploads/question/7PBcG51677670760.png', 8, 'يجب وضع الطفل كما في الحالة (ب) عند ما تكون الوسادة الهوائية لا تعمل وذلك لحماية الطفل وخاصة في حالات الحوادث والضغط على الفرامل بشكل مفاجئ', 'Wanneer de airbag niet is ingeschakeld moet het kind worden geplaatst zoals in situatie (b) om het kind te beschermen, vooral bij ongevallen en plotselinge remsituaties.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1142, 't6LV1IbGXpvHQUO', 'ماذا تتوقع إذا تجاوزت الشاحنة؟', 'Wat kun je hier verwachten wanneer je de vrachtwagen inhaalt?', 75, 58, 'mcq', 'uploads/question/88iTSA1677671684.png', 9, 'الشاحنة تحميك الآن من الرياح، فإذا قمت بتجاوزها فسوف تدفع بك الرياح الشديدة يساراحيث جراب الرياح يشير إلى اتجاه الرياح يسارا.', 'De vrachtwagen beschermt je nu tegen de wind, als ls je hem passeert zal sterke wind je naar links duwen omdat  de windrichting naar links aangeeft.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1143, 'dffdZlNG72mXmsM', 'ماذا تفعل بهذه الحالة؟', 'Wat doe je in deze situatie?', 75, 58, 'mcq', 'uploads/question/JzUMb31677671755.png', 10, 'لا أفضلية للمشاة هنا ، لكنه قرر عبور الشارع قبلك ،لذلك توقف و دعه يذهب (الأفضلية لا تؤخد بالإجبار)', 'De voetganger heeft normaal gesproken geen voorrang, maar als voetgangers toch oversteken dan laten wij ze voor gaan omdat er direct een gevaar is. Voorrang moet je krijgen en niet nemen.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1144, 'LLg85PWn9QCQB68', 'من يذهب أولا؟', 'Wat is de juiste volgorde van voor laten gaan?', 75, 58, 'drag_drop', 'uploads/question/R3AfJL1677671881.png', 11, 'السبب أن خطوط ممر المشاة غير موجودة على مسار الترام لذلك لن يتوقف الترام لإعطاء الأفضلية للمشاة', 'De reden is dat de voetgangersoversteekplaats niet aanwezig is ​​op het tramspoor, dus de tram zal niet stoppen om voorrang te geven aan de voetganger.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1145, 'xc3HsDVC2jFutbB', 'اكتب في الفراغ أدناه كم متر تبعد عنك سكة القطار؟', 'Over hoeveel meter kan je een spoorwegovergang verwachten?', 75, 58, 'text_input', 'uploads/question/qrQp101677672005.png', 12, 'الإجابة 240 مترا.حسب اللوحة التي تشير إلى ثلاثة خطوط حمراء و كل خط أحمر يدل على ثمانين مترا وثلاث خطوط حمراء تدل على240 مترا.', 'Het antwoord is 240 meter, het bord heeft drie rode lijnen, en elke rode lijn geeft 80 meter aan.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1146, 'fs9SpjUKWhpXrXn', 'هل يُسمح لك تنزيل وتصعيد راكب هنا؟', 'Mag je hier iemand in- en uit laten stappen?', 75, 58, 'mcq', 'uploads/question/AprmkG1677672108.png', 13, 'الاجابة : نعم بسبب وجود الخط الأصفر المتقطع يُسمح تنزيل وتصعيد راكب', NULL, NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1147, 'nX51Mwojig93hA8', 'تسحب عربة على الطريق السريع ماهي سرعتك القصوى في هذه الحالة ؟', 'Je trekt een aanhanger op de snelweg, wat de toegestane maximumsnelheid?', 75, 58, 'mcq', 'uploads/question/zXQBhk1677672182.png', 14, 'عندما تجر عربة خلفك تصبح سرعتك القصوى\r\n90 كيلو متر/ساعه  فقط', 'Als je een aanhanger trekt, is je maximumsnelheid slechts 90 km/u.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1148, 'FDpT8UZIJWfqVJ3', 'في أي حالة تستطيع القيادة بسرعة  70  كم /سا؟', 'In welke van de volgende situaties mag je 70 km/u rijden?', 75, 58, 'mcq', 'uploads/question/bif3e81677672280.png', 15, 'في الحالة\r\nB\r\nانت ستصبح داخل المدينة و سرعتك القصوى 50 كيلو متر\r\nأما في الحالة\r\nA\r\nأنت ستصبح خارج المدينة وسرعتك القصوى 80 كيلو متر', 'In situatie B bevind jij je binnen de bebouwde kom met een maximale snelheid van 50 km. In situatie A bevind jij je buiten de bebouwde kom met een maximale snelheid van 80 km.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1149, 'uT4z4FTysg07P1A', 'ما هو الطول المحدد للأطفال دون سن الثامنة عشر كي يجلسو بمقاعد مخصصة لهم ؟', 'Wat is het lengtelimiet voor kinderen onder de achttien jaar om op een kinderstoel te zitten?', 75, 58, 'mcq', 'uploads/question/m69wTw1677672406.png', 16, 'الجواب : أقل من 135 سم\r\nالسبب: اذا كان طول الطفل أقل من 135 سم يجب وضعه بكرسي مخصص\r\nوهذا لا ينطبق على الأشخاص البالغين وطولهم أقل من 135 سم', 'Als het kind kleiner is dan 135 cm, moet het kind in een kinderstoel worden geplaatst, en dit geldt niet voor volwassenen met een lengte kleiner dan 135 cm.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1150, '6pWa8KqF5GwCpTs', 'عند أي خط يسمح لك تنزيل ركاب ؟', 'Bij welke lijn mag je passagiers afzetten?', 75, 58, 'mcq', 'uploads/question/OGIMPk1677672497.png', 17, 'السبب: عند الخط الاصفر المتصل ممنوع الوقوف والتوقف', 'Het is verboden te parkeren en te stoppen bij de doorgetrokken gele lijn.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1151, '5PPA1NoAkz2cPCK', 'أي من اللوحات التالية تدل على وجود فسحة توقف للبحث عن معلومات؟', 'Welke van de volgende borden geeft een informatiepunt aan?', 75, 58, 'mcq', 'uploads/question/dddpEq1677672577.png', 18, NULL, NULL, NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1152, 'Fd74ztjMdHJux78', 'أنت تقود السيارة البيضاء ،هل يُسمح لك الإنعطاف يساراً؟', 'Mag je hier linksaf?', 75, 58, 'mcq', 'uploads/question/E98puP1677686369.png', 19, NULL, NULL, NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1153, 'ZFFBtn269TI6IYU', 'أنت تقود داخل النفق وفجأة ظهر لك مؤشر زيت المحرك باللون الأحمر ماذا تفعل ؟', 'Je rijdt door de tunnel en plotseling knippert de motorolie-indicator rood, wat doe je?', 75, 58, 'mcq', 'uploads/question/skPLlB1677686497.png', 20, '    والسبب: يعتبر الوقوف داخل النفق من اخطر الحالات التي من الممكن ان تصادف السائقين\r\nلذلك حاول دائما ان تخرج من النفق  وتتوقف بعده فورا اذا كانت سيارتك بإمكانها متابعة السير\r\nحتى لو بدأ الدخان يتصاعد من تحت غطاء المحرك او ظهر رمز بلون أحمر', 'Parkeren in de tunnel wordt beschouwd als een van de gevaarlijkste situaties die automobilisten kunnen tegenkomen. Probeer daarom altijd de tunnel uit te komen en direct daarna te stoppen als jouw auto door kan rijden.Ook als er rook onder de motorkap vandaan komt of er een rood symbool verschijnt', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1154, 'qf9yJRYLvKAXzp2', 'الرجل الضرير رفع العصا  ، ماذا تفعل بهذه الحالة؟', 'De slechtziende man heft zijn taststok op, wat doe je in deze situatie?', 75, 58, 'mcq', 'uploads/question/jvgaQg1677686601.png', 21, 'عندما يرفع الرجل الضرير عصاه فهو يحذرك أنه ينوي العبور', 'Wanneer een slechtziend persoon zijn taststok opheft, waarschuwt hij je dat hij van plan is om over te steken.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03'),
(1155, 'qL9DocMc2AdrRqX', 'أي من الحالتين تتوقع وجود سائقين قادمين من يمينك؟', 'In welke van de twee situaties kun je bestuurders van rechts verwachten?', 75, 58, 'mcq', 'uploads/question/Y75JMl1677686689.png', 22, 'كلا اللوحتين تُخاطبانك انت فقط(السيارة البيضاء)ولاتخص السائقين من يمينك ويسارك ،ففي الحالةA\r\nأنت مُجبر على الإنعطاف يميناً\r\nأما في الحالة B\r\nيُمكنك الذهاب يميناً ويساراً\r\nأيضا في كل لوحة دائرية زرقاء تحوي سهم إتجاه نتوقع قادمين من الأمام.', 'Beide borden zijn alleen voor jou bestemd en zijn niet bestemd voor kruisende bestuurders. In situatie A moet je  rechtsaf slaan. In situatie B kun je links en rechts gaan, ook kun je tegenliggers verwachten.', NULL, NULL, '2023-12-27 09:38:03', '2023-12-27 09:38:03');
