(1156, 'lJUsUkactgy0Xfm', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 75, 58, 'drag_drop', 'uploads/question/OReCvE1677686802.png', 23, 'الفارس يعتبر سائق سواء كان راكب على حصانه أو يسير بجانبه والسائق الذي يخرج من طريق ترابي يعطي الأفضلية للسائقين من اليمين واليسار', 'De ruiter wordt beschouwd als een bestuurder, of hij nu op zijn paard rijdt of naast hem loopt, en de bestuurder die een onverharde weg verlaat verleent voorrang aan kruisende bestuurders.', NULL, NULL, '2023-12-27 09:38:04', '2023-12-27 09:38:04'),
(1157, 'GRERQNiwYhxTbXd', 'ماذا تفعل في هذه الحالة؟', 'Wat doe je in deze situatie?', 75, 58, 'mcq', 'uploads/question/1qywa01678825112.jpg', 24, 'أمامك منعطف.وفي حالات الثلج، يجب أن تكون حذرا.من تشكل الجليد على السطح الإسفلتي لذلك من الأفضل عدم استخدام الفرام.ورفع القدم عن دواسة الوقود فقط.', 'Er is een bocht voor je, en bij sneeuw moet je oppassen tegen ijsvorming op het asfalt het is dus beter om de remmen niet te gebruiken en alleen het gas loslaten.', NULL, NULL, '2023-12-27 09:38:04', '2023-12-27 09:38:04'),
(1158, 'N9OBYYWjzFcxIvk', 'مستوى الرؤية   بسبب الضباب 40 مترهل يسمح لك بتشغيل ضوء الضباب الخلفي ؟', 'Het zicht is door de mist 40 meter, mag je het mistachterlicht aanzetten?', 75, 58, 'mcq', 'uploads/question/mbJnJT1677687208.png', 25, 'الجواب . نعم\r\n\r\nالسبب : ضوء الضباب الخلفي يستخدم\r\nاذا كان مدى الرؤية أقل من 50 متر\r\nفي الضباب والثلج فقط ويمنع\r\nتشغيله في المطر الكثيف', 'Het mistachterlicht wordt alleen gebruikt als het zichtbereik minder is dan 50 meter in mist en sneeuw en het is verboden om het in te schakelen bij hevige regen.', NULL, NULL, '2023-12-27 09:38:04', '2023-12-27 09:38:04'),
(1159, 'pPzKw4u8ptRFndg', 'الحمولة بارزة متر و نصف خلف العربة ،هل يجوز القيادة بهذا الشكل ؟', 'De lading steekt anderhalve meter achter de aanhangwagen uit, is het toegestaan om zo te rijden?', 75, 58, 'mcq', 'uploads/question/4dSYMN1677686995.png', 26, 'الجواب لا .\r\n\r\nلأنه عند بروز الحمولة أكثر من متر خلف العربة يجب وضع لوحة تحذيرية( لوحة مخططة بشكل قطري أحمر و أبيض ) في نهاية الحمولة  . و لا يجوز وضع قطعة قماش أو أي شيئ أخر بغرض التحذير .', 'Wanneer de lading meer dan een meter achter de hanger uitsteekt moet er een markeringsbord (een rood-wit diagonaal gestreept bord) aan het einde van de lading worden geplaatst. Het is niet toegestaan om een stuk stof of iets anders te plaatsen ter waarschuwing.', NULL, NULL, '2023-12-27 09:38:04', '2023-12-27 09:38:04'),
(1160, 'x41zgACYbf4x1cn', 'في أي من هذه اللوحات المرورية، يجب عليك اتباع السرعة القصوى 90 كيلومترا في الساعة فوراً ؟', 'Bij welke van de bovenstaande verkeersborden moet je direct de maximumsnelheid van 90 km/u volgen?', 75, 58, 'mcq', 'uploads/question/aS2wgL1677687065.png', 27, 'اللوحة (B)تعني اتباع السرعة ٩٠فورا ومفعولها يبدأ بعد اللوحة ، أما اللوحة (C)تعني اتباع السرعة ٩٠ فوراً من مكان وجود اللوحة ولغاية ٥٠٠ متر بعدها', 'Bord (B) betekent dat de snelheid 90 km/u onmiddellijk na het bord wordt toegepast. Bord (C) betekent dat de snelheid 90 km/u onmiddellijk wordt gevolgd vanaf de locatie van het bord tot 500 meter erna.', NULL, NULL, '2023-12-27 09:38:04', '2023-12-27 09:38:04'),
(1161, 'z7FmHvEDUa7dJAw', 'رتب الأفضلية؟', 'Wat is de juiste volgorde van voor laten gaan?', 75, 58, 'drag_drop', 'uploads/question/OggNC31677687296.png', 28, NULL, NULL, NULL, NULL, '2023-12-27 09:38:04', '2023-12-27 09:38:04'),
